var book = {
	"name": "ၥ စဎွၩ",
	"numChapters": 22,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭစဎွၩဒၫဝံၭအၥၭၡါယူၭ, လ့ၩနုၬယူၭလၧမုနံၩ လဖၪအကျၩယူၭ, ၦဒုၭလုၬအဝ့ၫလၧဆၧကီၩ့ဆၧၥိၭ",
			"2": "<sup>2</sup> လါနၫ့တၭး လၧၩ့ထၪ့အ့ၬ.- အခိးမွဲဘဲၫနီၪတၭ, အခ့ၫ အၡၩစံၭအဝ့ၫ, မွဲၦအၪ့ဎၬန့ၦမုၪနၩ့လၧအၥၭဘၪ့လ ဂၩလၧယကဆါအဂးတၭ, မွဲအဆၧၫ့ထုၪ့လၧစဎွၩအ မ့ၬယၫတၭ, ကဲၪထၪ့အထံၩအၥိၭ ဒဲမံၫလၧအၥၭနၫ ၡါအလီၩ့ဆံၭ. တၭယကဆါစဎွၩ မိလၧၩ့ထၪ့လီၫ.",
			"3": "<sup>3</sup> အခိးမွဲအဝ့ၫၥံၪအၪ့ဎၬဝ့ၫ ၦမုၪနၩ့အခံးအဂၩ့ဂ့ၩလၧ အံၫစရ့လၭအခးနဲၩ့ ထီးအလူၬအဖၧၩ့တၭ, ဒၪန့ဝ့ၫ လၧၦရှုန့ၫဖိၪနးအၭဘၡၭတၭ, ဂဲၫၥိၫ့ဝ့ၫလၧစဎွၩအ",
			"4": "<sup>4</sup> အီၪလီၫ.- ၦမုၪနၩ့နီၪအခံးအဂၩ့ဂ့ၩမၬတၭ, ယိထဲၩ့ခွါထဲၩ့စဎွၩနီၪ, မၩအခ့ၫအၡၩအဆၧတၭး စဎွၩၥ့ၪယၫဝ့ၫဒၪအ့ၬ.",
			"5": "<sup>5</sup> နးဟၭဂံၭအဖိၪခွၫစအၭဒနဲယၫ အီၪက့ၪထၪ့ထီၫ အၥၭတၭ,စံၭဝ့ၫဒၪ, ယမိကဲၪထၪ့စဎွၩလီၫ. တၭတဲၩ့ ဝဲၩလဲၪ့ၥုၭလဖၪ, ဒဲၦထူၬကၥ့ၪလဖၪ, ဒဲၦၡၩလၧအမိ",
			"6": "<sup>6</sup> စဲၪ့လၧအမ့ၬယၫယဲဆံၫလီၫ.- တၭအဝ့ၫဒၪမၩဆၧလ မံၩ့လါလါနီၪ အဖါပဒၩ့လၧအစံၭဝ့ၫ, မွဲဘၪနီၫနမၩ ဆၧဘဲၫနီၪလဲၪ, နးဆိၭအ့ၬ. တၭအခံးအဂၩ့နီၪဂ့ၩ မၬဆ့လီၫ. တၭအဝ့ၫအီၪဖျဲၪ လၧစအၭဘစလၧၫ့အ",
			"7": "<sup>7</sup> လးခဲၫ့နီၪလီၫ.- တၭအဝ့ၫဒၪချဲၩ့ဆၧ လၧနးဇ့ၫရုၫအဲ အၫအဖိၪခွၫစယိအၭ, ဒဲၦလုဆၧစအဘဲအၥၫတၭ,အ",
			"8": "<sup>8</sup> ဝ့ၫၥံၪဖိၬစအၭဒနဲယၫအခဲၫ့တၭ မၩဆၧၩ့ဝ့ၫလီၫ.- အ့ၪ မွဲၦလုဆၧစဇၫဒီၭ, ဒဲစယဟီအဒၫအဖိၪခွၫစဘံၫ့နအဲ အၫ,ဒဲမီၪစနၫၥၫ့, ဒဲစၡံမအဲၫ,ဒဲစရံအဲၫ, ဒဲစဒၫဝံၭအၡၩ",
			"9": "<sup>9</sup> အဆီၪ့ၥံၪနီၪအီၪလၧစအၭဒနဲယၫအၥိၭအ့ၬ.- တၭစ အၭဒနဲယၫမၩၥံၫၥိၪဒဲချီဖၫၥံၪ, ဒဲချီဖိၪအဘီၪ့လဖၪ လၧလိးဇိဟလ့ၭ အနဲၩ့လၧအအီၪဝ့ၫ ထီးအံၪ့ရိၫဂ့ လၭတၭ, ကိၭန့အထၧၫ့ဖုဝဲ စဎွၩအဖိၪခွၫၥံၪ ထီးအ လူၬ,ဒဲၦၡၩယုဒၫဖိၪ စဎွၩအခ့ၫအၡၩၥံၪထီးအလူၬ",
			"10": "<sup>10</sup> လီၫ.- အ့ၪမွဲမီၪစနၫၥၫ့, ဒဲစဘံၫ့နအဲအၫ, ဒဲၦအဆီၪ့လ ဖၪ, ဒဲအထၧၫ့ဖုဝဲစစီလမၧၫ့နီၪကိၭဝ့ၫအ့ၬ.",
			"11": "<sup>11</sup> စနၫၥၫ့ချဲၩ့ဆၧလၧစစီလမၧၫ့ အမိနးဘၭၥၡံဘၫ တၭ,စံၭဝ့ၫဒၪ, လၧနးဟၭဂံၭအဖိၪခွၫ စအၭဒနဲယၫ, ကဲၪစဎွၩတၭ, ပကဆါစဒၫဝံၭလၥ့ၪယၫဘၪနီၪ, မွဲန",
			"12": "<sup>12</sup> လနါဂၧၫ့ဘၪဧၪ.- တၭဘိၩ့နဲၪ့ယီၩဂဲၫဘီၪ, ဒုၭကိၪ့လါ ယၧၩလၧနၧၩ, ဘဲၫၥိၭနမိမၩဖီၩ့မၩဖျ့ၭနၥၭမၧၫ့, ဒဲန",
			"13": "<sup>13</sup> ဖိၪခွၫစစီလမၧၫ့အၥၭမၧၫ့နီၪဆံၭ.- လ့ၩဘီၪ, လ့ၩနုၬ လၧစဎွၩဒၫဝံၭအအီၪတၭ, စံၭအဝ့ၫ,ယကဆါစဎွၩဧ့, နဆိၪလၩ့နၥၭလၧနဎီးမုၪတၭစံၭ, နဖိၪခွၫစစီလမၧၫ့မိ ကဲၪစဎွၩလၧယလးခဲၫ့တၡါတၭ, မိဆၧၫ့နၩ့လၧယလး ဆီၩ့ဆီနီၪလမွဲဘၪဧၪ. တၭစအၭဒနဲယၫ ကဲၪစဎွၩ",
			"14": "<sup>14</sup> နီၪမွဲဘၪလဲၪ.- ယိခွါ, နချဲၩ့ဆၧလၧစဎွၩအဘိၩ့ဘၭ တၭ,ယမိဂဲၫဆ့လၧနလးခဲၫ့တၭ, မၩဂုးထၪ့ခၧၫ့ထၪ့န ဆၧချဲၩ့လီၫ.",
			"15": "<sup>15</sup> နးဘၭၥၡံဘၫ လ့ၩနုၬလၧစဎွၩအအီၪလၧဒူၭဖၧၩ့ တၭ, စဎွၩအၥၭၡါဖၭဒိၪယူၭလီၫ. တၭၦရှုန့ၫဖိၪနး",
			"16": "<sup>16</sup> အၭဘၡၭနီၪမၩစဎွၩအခ့ၫအၡၩအဆၧလီၫ.- တၭနး ဘၭၥၡံဘၫ ၡီၫ့လၩ့အခိၪ, ဒဲထွံၩလၩ့ လၧစဎွၩအမ့ၬ ယၫတၭ,စဎွၩစံၭဝ့ၫဒၪ, မွဲနဆိၫ့န့ဘၪ ဆၧနီၪလမံၩ့",
			"17": "<sup>17</sup> လဲၪ.- ၦမုၪနီၪစံၭဝ့ၫ, ယကဆါဧ့, နဆိၪလၩ့နၥၭလၧန ဎီးမုၪလၧယဟိဝၩနယွၩအမ့ၬယၫတၭ, နစံၭ,နဖိၪခွၫ စစီလမၧၫ့မိကဲၪစဎွၩ လၧယလးခဲၫ့တၡါတၭ, မိဆၧၫ့",
			"18": "<sup>18</sup> နၩ့လၧယလးဆီၩ့ဆီလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ယိခွါ, စအၭဒနဲယၫကဲၪစဎွၩတၭ, ဘိၩ့နဲၪ့ယီၩယကဆါစဎွၩ",
			"19": "<sup>19</sup> ဧ့,နၥ့ၪယၫအ့ၬ.- တၭအဝ့ၫဒၪမၩၥံၫယူၭချီဖၫၥံၪ, ချီဖိၪ အဘီၪ့ၥံၪ, ဒဲၥိၪၥံၪအၪအၪလ့ၬတၭ, ကိၭန့ယူၭစဎွၩအ ဖိၪခွၫထီးအလူၬ, ဒဲၦလုဆၧစအဘဲအၥၫ, ဒဲၦၥုၭမုအ ခိၪစယိအၭလီၫ. အ့ၪမွဲနခ့ၫနၡၩစစီလမၧၫ့နီၪ ကိၭဝ့ၫ",
			"20": "<sup>20</sup> ဒၪအ့ၬ.- တၭနဝ့ၫဒၪယီၩယကဆါ,စဎွၩဧ့, အံၫစရ့လၭ ထီးအလူၬအမ့ၬၥၪၥံၪအီၪဝ့ၫ လၧနလီၩ့, လၧယက ဆါစဎွၩအလးခဲၫ့နီၪ, မွဲပလၫမိဆၧၫ့နၩ့ လၧအလး ဆီၩ့ဆီလဂၩလဲၪနီၪ, ဘဲၫၥိၭနမိလီၩဘၪအဝ့ၫၥံၪလီၫ.",
			"21": "<sup>21</sup> နအ့ၪလမၩဘၪဘဲၫနီၪတၭ, ထီးယကဆါစဎွၩ မိမံၫ လၧအဖါၥံၪအၥိၭတၭ, ဆၧမိမၩအၥၭလၧဆၧမိအီၪ က့ၪယၧၩဒဲယဖိၪခွၫစစီလမၧၫ့ လၧၦပိၩ့ထၪ့ဆၧလီၫ.",
			"22": "<sup>22</sup> တၭယိခွါ, အဝ့ၫဒၪချဲၩ့ဝ့ၫလၧစဎွၩအဘိၩ့ဘၭနီၪ,",
			"23": "<sup>23</sup> မီၪစနၫၥၫ့ဂဲၫနုၬဝ့ၫဆ့လီၫ.- တၭၦဒုၭနဲၪစဎွၩတၭ,စံၭ ဝ့ၫဒၪ,ယိခွါ, မီၪစနၫၥၫ့လီၫ. တၭအဝ့ၫဒၪဂဲၫနုၬဝ့ၫလၧ စဎွၩအအီၪနီၪ, ထွံၩလၩ့အၥၭလၧစဎွၩအမ့ၬယၫ,အ",
			"24": "<sup>24</sup> မ့ၬထီၩ့လၩ့လၧဂၪ့ခိၪလီၫ.- တၭစနၫၥၫ့စံၭဝ့ၫဒၪ,ယ ကဆါစဎွၩဧ့, မွဲနစံၭလၧစအၭဒနဲယၫမိကဲၪစဎွၩလၧ",
			"25": "<sup>25</sup> ယလးခဲၫ့တၭ, မိဆၧၫ့နၩ့လၧယလးဆီၩ့ဆီဆ့ဧၪ.-အ ဂဲးဘဲၫယီၩ အဝ့ၫဒၪလ့ၩလၩ့လနံၩယီၩတၭ, မၩၥံၫ ယူၭချီဖၫၥံၪ,ဒဲချီဖိၪလၧ အဘီၪ့လဖၪအၪအၪလ့ၬတၭ, ကိၭန့စဎွၩအဖိၪခွၫထီးအလူၬ, ၦၥုၭမုအခိၪလဖၪ,ဒဲၦ လုဆၧစအဘဲအၥၫတၭ, ယိခွါ, အဝ့ၫၥံၪနီၪအၪ့ဆၧ,ဒဲ အီၩဆၧလၧအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, မွဲစအၭဒနဲယၫ",
			"26": "<sup>26</sup> မၧၫ့ဝ့ၫဆံၭ.- အ့ၪမွဲဆၧလၧယၧၩယီၩ, ယဝ့ၫဒၪနခ့ၫန ၡၩ,ဒဲၦလုဆၧစဇၫဒီၭ, ဒဲစယဟီအဒၫအဖိၪခွၫစဘံၫ့",
			"27": "<sup>27</sup> နအဲအၫဒဲနခ့ၫနၡၩ စစီလမၧၫ့နီၪကိၭဝ့ၫအ့ၬ.- မွဲပလၫ မိဆၧၫ့နၩ့လၧယကဆါအလးဆီၩ့ဆီ လၧအလးခဲၫ့လ ဂၩလဲၪနီၪနလဒုၭၥ့ၪယၫဘၪနခ့ၫနၡၩတၭ, ဆၧလမံၩ့ ယီၩမွဲအဘၪဆၧမၩဝ့ၫ လၧယကဆါစဎွၩဆ့ဧၪ.",
			"28": "<sup>28</sup> တၭစဎွၩဒၫဝံၭစံၭဆၧၫ့ဆၧတၭး စံၭ, ကိၭန့ယၧၩလၧ နးဘၭၥၡံဘၫဆံၭ. တၭအဝ့ၫဒၪဂဲၫနုၬဝ့ၫလၧစဎွၩအ အီၪတၭဆၧၫ့ထုၪ့လၧစဎွၩအမ့ၬယၫလီၫ.",
			"29": "<sup>29</sup> စဎွၩဆိၪလၩ့အၥၭတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩလၧအ ဎွ့ၩန့ထဲၩ့ယၥၭ လၧကယဲဆၧၡၪ့ဆၧနၭ အဖၧၩ့နီၪမၧၫ့",
			"30": "<sup>30</sup> ဝ့ၫ,- ဘဲၫယဆိၪလၩ့ယၥၭဒၪလ့ၬလၧနၧၩလၧယဟိဝၩ အံၫစရ့လၭအယွၩအမ့ၬယၫအၥိၭတၭ, စံၭ, နဖိၪခွၫ စစီလမၧၫ့မိကဲၪထၪ့စဎွၩ လၧယလးခဲၫ့တၡါတၭ,မိ ဆၧၫ့နၩ့လၧယလးဆီၩ့ဆီလၧယလးနီၪ, လၧမုဆၫလ",
			"31": "<sup>31</sup> နံၩယီၩဒၪလ့ၬ ယမိမၩတၡါဘဲၫနီၪအၥိၭလီၫ.- ထီး နီၪလဖၧၫ့ နးဘၭၥၡံဘၫၡီၫ့လၩ့အခိၪ ချႃၬလၩ့အမ့ၬ လၧဂၪ့ခိၪတၭ, ထွံၩလၩ့လၧစဎွၩအမ့ၬယၫတၭစံၭဝ့ၫ ဒၪ,မွဲယကဆါစဎွၩဒၫဝံၭ မၧၫ့ဝ့ၫအဆိၩဆိၩအကၠၪ ကၠၪဆံၭ.",
			"32": "<sup>32</sup> တၭစဎွၩဒၪဝံၭစံၭဝ့ၫဒၪ, ကိၭန့ယၧၩလၧၦလုဆၧ စဇၫဒီၭ,ဒဲမီၪစနၫၥၫ့, ဒဲစယဟီအဒၫအဖိၪခွၫစဘံၫ့န အဲအၫဆံၭ. တၭအဝ့ၫၥံၪဂဲၫနုၬဝ့ၫ လၧစဎွၩအမ့ၬယၫ",
			"33": "<sup>33</sup> လီၫ.- စဎွၩစံၭဆ့အဝ့ၫၥံၪ, မၩန့နၥံၪအကဆါအခ့ၫအ ၡၩလၧနၥံၪအၥိၭတၭ, ဒုၭထူၬယဖိၪခွၫစစီလမၧၫ့လၧ ယကၥ့ၪယီၩ့ဒၪယဝ့ၫတၭ, ၥိၫ့လၩ့အဝ့ၫ လၧဂဲဟၫ့",
			"34": "<sup>34</sup> ဆံၭ.- တၭမွဲၦလုဆၧစဇၫဒီၭ, ဒဲမီၪစနၫၥၫ့ဂုၪအဝ့ၫလၧ စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪထီးနီၪဆံၭ. နၥံၪဝ့ၫအူၪ",
			"35": "<sup>35</sup> ထၪ့ခွ့ၩတၭစံၭ,မွဲစဎွၩစစီလမၧၫ့မၧၫ့ဝ့ၫဆံၭ.- ထီးနီၪ လဖၧၫ့နၥံၪမိဘၪဂဲၫထၪ့လၧအလးခဲၫ့ ဘဲၫၥိၭအမိဂဲၫ ဆၧၫ့နၩ့လၧယလးဆီၩ့ဆီအဖၧၩ့း အဂဲးဘဲၫယီၩအဝ့ၫဒၪ မိဘၪကဲၪထၪ့စဎွၩလၧယလးလီၫး ယအီၪက့ၪထၪ့ယူၭ အဝ့ၫဘဲၫၥိၭအမိကဲၪထၪ့ၦပၧၩ့ဆၧ လၧအံၫစရ့လၭဒဲ",
			"36": "<sup>36</sup> လၧယုဒၫအဖၫ့ခိၪလီၫ.- တၭစယဟီအဒၫ အဖိၪခွၫ စဘံၫ့နအဲအၫစံၭဆၧၫ့ စဎွၩတၭ, စံၭဝ့ၫဒၪ, အၩမံၩ့, ယဟိဝၩ ယကဆါစဎွၩအယွၩနီၪ, မွဲအစံၭဘဲၫနီၪအ",
			"37": "<sup>37</sup> ၥိၭဆံၭ.- ဘဲၫယဟိဝၩအီၪယူၭဝ့ၫ လၧယကဆါစဎွၩ အၥိၭနီၪ, မွဲအအီၪလၧစစီလမၧၫ့ဘဲၫနီၪအၥိၭ, ဒဲမွဲအ မၩအလးဆီၩ့ဆီဒိၪနဲၪ့ ယကဆါစဎွၩဒၫဝံၭအလး ဆီၩ့ဆီနီၪဆံၭ.",
			"38": "<sup>38</sup> အခိးမွဲၦလုဆၧစဇၫဒီၭဒဲမီၪစနၫၥၫ့, ဒဲစယဟီအဒၫ အဖိၪခွၫစဘံၫ့နအဲအၫ, ဒဲၦခ့ၫရ့ၭဖိၪၥံၪ, ဒဲၦပံလ့ၭဖိၪ ၥံၪလ့ၩလၩ့ဝ့ၫတၭ, ဒုၭထူၬစစီလမၧၫ့လၧစဎွၩဒၫဝံၭအ",
			"39": "<sup>39</sup> ကၥ့ၪယီၩ့တၭ, ဂဲၫၥိၫ့အဝ့ၫလၧဂဲဟၫ့လီၫ.- ၦလုဆၧ စဇၫဒီၭမၩန့ဆၧနိၩ့လခီၫအီၪလၧၥိၪ လၧတဲၩဆံၫ့ဎံၪ အဖၧၩ့တၭ, ဂုၪစစီလမၧၫ့လီၫ. ၦအူၪထၪ့ခွ့ၩနီၪ,ၦခ",
			"40": "<sup>40</sup> မျၧးထီးအလူၬစံၭဝ့ၫဒၪ, မွဲစစီလမၧၫ့မၧၫ့ဝ့ၫဆံၭ.- ၦ ခမျၧးထီးအလူၬဂဲၫဖိၬထၪ့အခဲၫ့တၭ, ၦခမျၧးအူၪခဲၫ တၭ,ၥၭထိၬလၧဆၧၥၭထိၬဖၭဒိၪတၭ, ဂၪ့ခိၪဝၭဖျၩ့ လၧအၥီၫအကၠီၩ့လီၫ.",
			"41": "<sup>41</sup> စအၭဒနဲယၫ, ဒဲကယဲၦလၧအဒိၭကိၭအၥၭထီးအ လူၬလၧအအီၪလၧအဝ့ၫနီၪအၥိၭနါဂၧၫ့ဝ့ၫတၭ, အဝ့ၫ ၥံၪနီၪအၪ့လၧၩ့ဆၧအ့ၬး တၭစယိအၭနါဂၧၫ့ခွ့ၩအၥီၫ တၭ,စံၭဝ့ၫဒၪ, ဒိၩ့တုၩ့ထၪ့တုၩ့လၩ့အၥီၫနီၪး မွဲဆၧနီၪ လမံၩ့လဲၪ.",
			"42": "<sup>42</sup> အဝ့ၫဒၪချဲၩ့ဆၧအဘိၩ့ဘၭနီၪ, ယိခွါ,ၦလုဆၧစအ ဘဲအၥၫအဖိၪခွၫ စစၪ့နၥၧၫ့ဂဲၫဝ့ၫတၭ, စအၭဒနဲယၫ စံၭအဝ့ၫ,ဂဲၫနုၬဘီၪ. အဂဲးဘဲၫယီၩနမွဲၦအဆီၪ့အၥၭ",
			"43": "<sup>43</sup> ဒူၩဒဲဂဲၫဆိၬဆၧပရၧၫ့အဂ့ၩလီၫ.- စစၪ့နၥၧၫ့စံၭဆၧၫ့ ဆၧတၭ,စံၭစအၭဒနဲယၫ, မွဲမၬပကဆါစဎွၩဒၫဝံၭအီၪ",
			"44": "<sup>44</sup> က့ၪယူၭစစီလမၧၫ့လၧစဎွၩလီၫ.- တၭစဎွၩအၪ့မၧၫ့ လၩ့ၦလုဆၧစဇၫဒီၭ, ဒဲမီၪစနၫၥၫ့, ဒဲစယဟီအဒၫအ ဖိၪခွၫစဘံၫ့နအဲအၫ, ဒဲၦခ့ၭရ့ၭဖိၪၥံၪ, ဒဲၦပံလ့ၭဖိၪၥံၪ လၧအၥိၭတၭ, အဝ့ၫၥံၪနီၪဒုၭထူၬဝ့ၫ လၧစဎွၩအကၥ့ၪ",
			"45": "<sup>45</sup> ယီၩ့နီၪး- တၭၦလုဆၧစဇၫဒီၭ, ဒဲမီၪစနၫၥၫ့နီၪဂုၪဝ့ၫ လၧစဎွၩလၧဂဲဟၫ့အဖၧၩ့တၭ, ဂဲၫထဲၩ့ထၪ့ထီးနီၪလၧ အၥုၪ့ထိၬအၥၭထိၬတၭ, ဒိၩ့ဝၭတြုၤထၪ့လီၫ. အနီၪ",
			"46": "<sup>46</sup> မွဲဆၧၥီၫလၧနၥံၪနါဂၧၫ့လီၫ.- တၭစစီလမၧၫ့ဆၧၫ့နၩ့",
			"47": "<sup>47</sup> လၧဘၩ့မုးအလးဆီၩ့ဆီဆ့လီၫ.- တၭစဎွၩအခ့ၫအ ၡၩဂဲၫစံၭထၪ့အၪ့အူၭ ပကဆါစဎွၩဒၫဝံၭတၭ, စံၭဝ့ၫ ဒၪ,မွဲယွၩမၩစစီလမၧၫ့အမံၩ့ ဂ့ၩနဲၪ့နမံၩ့တၭ, မၩအ လးဆီၩ့ဆီဒိၪနဲၪ့နလးဆီၩ့ဆီဆံၭ. တၭစဎွၩဘၩဆၧ",
			"48": "<sup>48</sup> လၧအလးမံၫဖၧၩ့လီၫ.- တၭစဎွၩစံၭဆ့ဘဲၫယီၩ, ယ ဟိဝၩအံၫစရ့လၭအယွၩ လၧအအီၪက့ၪၦလဂၩဆၧၫ့ နၩ့လၧယလးဆီၩ့ဆီလၧမုဆၫလနံၩယီၩ, ယမ့ၬၥၪဒၪ ဘၪအဝ့ၫနီၪ, မွဲအဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဆံၭ.",
			"49": "<sup>49</sup> ၦလၧအဒိၭကိၭအၥၭ လၧအအီၪဝ့ၫလၧစအၭဒနဲ ယၫအၥိၭထီးအလူၬနီၪ, ၥၭမဲၪဝ့ၫတၭ, ဂဲထုၪ့တၭ,စဲၪ့ ထၪ့ခွံၬလဂၩ လၧအဖၧၩ့ၥၭဒၪဝ့ၫ, လဂၩလၧအဖၧၩ့",
			"50": "<sup>50</sup> ၥၭဒၪဝ့ၫလီၫ.- တၭစအၭဒနဲယၫၥၭမဲၪဆၧလၧစစီလ မၧၫ့အကၠီၩ့နီၪ, ဂဲထုၪ့လ့ၩဖီၪ့ထၬဆၧလုအလးအနိၩ့",
			"51": "<sup>51</sup> လဖၪလီၫ.- ၦဒုၭနဲၪစစီလမၧၫ့တၭ, စံၭဝ့ၫဒၪ,ယိခွါ, စအၭဒနဲယၫၥၭမဲၪ စဎွၩစီလမၧၫ့နီၪ, အဂဲးဘဲၫယီၩ, ယိခွါ,ဖီၪ့ထၬဆၧလုလးအနိၩ့လဖၪတၭ, စံၭဝ့ၫဒၪ, မွဲစဎွၩစီလမၧၫ့ ဆိၪလၩ့အၥၭလၧယၧၩ လၧမုဆၫ လနံၩယီၩလၧအလမၩၥံၫဘၪ အခ့ၫအၡၩလၧနၭနီၪ",
			"52": "<sup>52</sup> ဆံၭ.- တၭစစီလမၧၫ့စံၭဝ့ၫဒၪ, အ့ၪကဲၪထၪ့ၦအဂ့ၩအ ဘၪတၭ,န့ၫအခိၪၥူၫလဘီၩ့ လၩ့ထ့ၬဘၪလၧဂၪ့ခိၪအ့ၬ. အ့ၪမွဲဆၧအၧၩ့အ့ၪအီၪလၧအဖၧၩ့တၭ, မိဘၪၥံၫလီၫ.",
			"53": "<sup>53</sup> စဎွၩစီလမၧၫ့ အၪ့မၧၫ့လၩ့ဆၧတၭ, ၦဂဲၫထဲၩ့ဆိၬဝ့ၫ လၧဆၧလုအလးတၭ, အဝ့ၫဒၪဂဲၫဝ့ၫတၭ, ထွံၩလၩ့အ ၥၭလၧစဎွၩစီလမၧၫ့အမ့ၬယၫတၭ, စစီလမၧၫ့စံၭအ ဝ့ၫ,လ့ၩလၧနဂံၪ့ဆံၭ."
		},
		"2": {
			"1": "<sup>1</sup> စဒၫဝံၭအမုနံၩလၧအမိၥံၫနီၪ လၩ့ဘူၭဝ့ၫတၭ,အဝ့ၫ",
			"2": "<sup>2</sup> မၪလူၬအဖိၪခွၫစစီလမၧၫ့နီၪစံၭဝ့ၫဒၪ,- ယမိဖိၬၦဂၪ့ ခိၪဖိၪထီးအလူၬအဖၧၩ့ၥၭတၭ, အီၪက့ၪဆီၪ့နၥၭတၭ",
			"3": "<sup>3</sup> အီၪက့ၪနၥၭ ဘဲၫၦခွၫအၥိၭဆံၭ.- တၭယိယဟိဝၩ နယွၩအဆၧ, ဘဲၫၥိၭနမိဖိၬအဖၧၩ့ၥၭလဖၪ,ဒဲထီးန့အ ဆၧၥီၪ့ဆၧၥၫ့, ဒဲအဆၧမၪလူၬလဖၪ, ဒဲအဆၧစ့ၩရၫ့ လဖၪ,ဒဲအဆၧထိးအၥၭလဖၪ, ဘဲၫဆၧကွ့ၭအၥၭလၧ အဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့, ဘဲၫၥိၭနမိဘီၪထၪ့ယီၫထၪ့လၧ ကယဲဆၧလၧနမၩနဝ့ၫ, ဒဲထီးဒၪအလးလၧနကၠၪနၥၭ",
			"4": "<sup>4</sup> လၧအအီၪနီၪဆံၭ.- ဘဲၫၥိၭယဟိဝၩမိဒုၭအီၪဂုးအီၪ ခၧၫ့အဆၧချဲၩ့ လၧအချဲၩ့ဆၧလၧယဂဲးယကၠီၪ့တၭ, စံၭဝ့ၫဒၪ,နဖိၪနလံၩ အ့ၪထီးလၩ့အၥၭလၧ အဝ့ၫၥံၪအ ဖၧၩ့ၥၭ ဘဲၫၥိၭအမိလ့ၩဆၧလၧယမ့ၬယၫ လၧဆၧမွဲ ဆၧတီၩအဖၧၩ့ လၧအၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧအၥၭ ၡီၩ့ထီးအလူၬတၭ, (စံၭဝ့ၫဒၪ.) ၦဘၪဆဲၫ့လၧနၧၩလၧ",
			"5": "<sup>5</sup> အံၫစရ့လၭအလးဆီၩ့ဆီနီၪမိလၩ့ထူၬဘၪအ့ၬ.- တၭ နးဇ့ၫရုၫအဲအၫ အဖိၪခွၫစယိအၭ, မၩယၧၩဘဲၫအံၩ ဘဲၫအိၩနီၪ,နၥ့ၪယၫဆ့လီၫ. အဝ့ၫမၩဘၪအံၫစရ့လၭ အၥုၭမုခမျၧးအခိၪနံၫဂၩ, စနၧၫအဖိၪခွၫစအၭဘနၧၫ ဒဲစယ့ၥၧၫ့အဖိၪခွၫ စအၫမစၫနီၪ, မၩၥံၫဝ့ၫတၭ, ဒုၭ လၩ့ဆၧဒုၭၥုၭအဆၧၥွံၪ လၧဆၧဘၪလိၬအိၭလိၬအ ဖၧၩ့,ဒဲအီၪက့ၪဆၧဒုၭၥုၭအဆၧၥွံၪ လၧအခၧၩ့ယးအ လီၩ့လၧအအီၪဝ့ၫလၧအယးဒံၩ့, ဒဲလၧအခၪ့ဖံၭဖၧၩ့",
			"6": "<sup>6</sup> လၧအအီၪဝ့ၫလၧအခၪ့လီၩ့နီၪလီၫ.- အခိးမွဲမၩဆၧ ဘဲၫနဆၧကိၪ့ၥ့ၪအၥိၭနီၪတၭ, ဒုၭလ့ၩလၩ့အခိၪဘွၩ",
			"7": "<sup>7</sup> လၧၥွၪခိၪဖၧၩ့,လၧဆၧမုၬဆၧလၩအဖၧၩ့လဂ့ၩ,- အ့ၪ မွဲမၩခိးမၩတၩၦဂံလအၭဖိၪ စဘၫဇံလ့ၫအဖိၪခွၫလ ဖၪတၭ,ဒုၭအီၪအဝ့ၫၥံၪ လၧၦလၧအအၪ့ဆၧလၧနစပွဲ ထံၭလဖၪအကျၩဆံၭ. အဂဲးဘဲၫယီၩလၧယစဲၪ့ဖျိၭလၧ နထၧၫ့ဖုဝဲစအၭဘစလၧၫ့အမ့ၬယၫနီၪ အဝ့ၫၥံၪဂဲၫဝ့ၫ",
			"8": "<sup>8</sup> လၧယအီၪဘဲၫနီၪလီၫ.- တၭယိခွါ, ၦဘံၪ့ယမံၫ့ဖိၪစဂံ ရၫအဖိၪခွၫ စၡံမအဲၫဘၪဆဲၫ့ လၧစဟုရံၫ့လဂၩလၧ အဆိၪအၧၩ့ယၧၩလၧဆၧဆိၪအၧၩ့ လၧမုလနံၩလၧယ လ့ၩလၧမၫဟနၫအံၫ့အဖၧၩ့နီၪလီၫ. အ့ၪမွဲဂဲၫအၪ့ဂၬ ယၧၩလၧယီၫဒၫ့တၭ, ယဆိၪလၩ့ယၥၭလၧအဝ့ၫလၧ ယဟိဝၩအမ့ၬယၫစံၭ, ယမိမၩၥံၫနၧၩ လၧနၭအ့ၬ.",
			"9": "<sup>9</sup> တၭဘိၩ့နဲၪ့ယီၩ အီၪက့ၪအဝ့ၫလၧဆၧဒဲၩဘၭလအီၪ ဘၪလဂ့ၩ. အဂဲးဘဲၫယီၩနကိၪ့ဆၧၥ့ၪနဲၪ့တၭ, နမိမၩ နဝ့ၫဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ, နၥ့ၪယၫလီၫ. ဒုၭလ့ၩ လၩ့အခိၪဘွၩလၧဖျႃဖၧၩ့ လၧဆၧၥွံၪအဖၧၩ့နီၪဆံၭ.",
			"10": "<sup>10</sup> စဒၫဝံၭမံၫဝ့ၫလၧအဖါလဖၪအၥိၭတၭ, ၦခုၪ့လၩ့",
			"11": "<sup>11</sup> ဘၧၩ့ခွံၬဝ့ၫလၧစဒၫဝံၭအဒိၩ့ဖၧၩ့နီၪလီၫ.- တၭမုနံၩ လဖၪလၧစဒၫဝံၭကဲၪစဎွၩ လၧအံၫစရ့လၭအဖၫ့ခိၪနီၪ မွဲအနံၪ့လံဆံၫလီၫ. ကဲၪစဎွၩနွ့ၫနံၪ့ လၧဟံဘြၧၫ့အ ဖၧၩ့,ဒဲကဲၪစဎွၩၥၧၫ့ဆံၫၥၧၫ့နံၪ့ လၧယရုစလံၫ့အဖၧၩ့ လီၫ.",
			"12": "<sup>12</sup> စစီလမၧၫ့ဆၧၫ့နၩ့ဝ့ၫလၧ အဖါစဒၫဝံၭအလးဆီၩ့ ဆီနီၪတၭ, အဘၩ့အမုးဂုးထၪ့ခၧၫ့ထၪ့ဖၭဒိၪလီၫ.",
			"13": "<sup>13</sup> နးဟၭဂံၭအဖိၪခွၫစအၭဒနဲယၫ ဂဲၫဝ့ၫလၧစစီလမၧၫ့ အမိနးဘၭၥၡံဘၫအအီၪလီၫ. တၭအဝ့ၫဒၪစံၭ, နဂဲၫမုၬ",
			"14": "<sup>14</sup> မုၬဆ့ဧၪ.တၭအဝ့ၫနီၪစံၭဆၧၫ့ဝ့ၫဒၪ, မုၬမုၬလီၫ.- တၭ စံၭဒံၭဝ့ၫ, ယချဲၩ့ဆၧလၧနၧၩအလးအီၪလီၫ. အဝ့ၫဒၪ",
			"15": "<sup>15</sup> စံၭဝ့ၫ,ချဲၩ့ထၪ့ဘီၪ.- တၭစံၭဝ့ၫဒၪ နၥ့ၪယၫလၧဘၩ့မုး မွဲယဆၧလီၫ. တၭအံၫစရ့လၭ ထီးအလူၬအီၪက့ၪအ မ့ၬလၧယလီၩ့ဘဲၫၥိၭယမိကဲၪစဎွၩလီၫ. တၭဘၩ့မုး ကၠၪအၥၭတၭ, ကဲၪထၪ့ဝ့ၫလၧယထၧၫ့ဖုဝဲအဆၧလီၫ. အဂဲးဘဲၫယီၩ ကဲၪထၪ့အဝ့ၫအဆၧလၧယဟိဝၩလီၫ.",
			"16": "<sup>16</sup> တၭဘိၩ့နဲၪ့ယီၩယမိအၪ့ကံၩ့ဆၧလမံၩ့လၧနၧၩ, ကၠၪ",
			"17": "<sup>17</sup> ခွံၬနမ့ၬလဂ့ၩ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ချဲၩ့ထၪ့ဘီၪ.- တၭ အဝ့ၫဒၪစံၭ, ချဲၩ့လါလၧစဎွၩစီလမၧၫ့, (အဂဲးဘဲၫယီၩ မိကၠၪကဒၩခွံၬအမ့ၬ လၧနအီၪအ့ၬ.) ဘဲၫၥိၭအမိဖ့ၪ လၫ့ယၧၩၦရှုန့ၫဖိၪ နးအၭဘၡၭလၧယမၫဆံၭ.",
			"18": "<sup>18</sup> တၭနးဘၭၥၡံဘၫစံၭဝ့ၫဒၪ, ဘၪယူၭ, ယမိချဲၩ့ဆၧ လၧစဎွၩလၧနဂးလီၫ.",
			"19": "<sup>19</sup> အခိးမွဲနးဘၭၥၡံဘၫလ့ၩလၧစဎွၩစီလမၧၫ့အအီၪ ဘဲၫၥိၭအမိချဲၩ့ဆၧလၧစအၭဒနဲယၫအဂးတၭ, စဎွၩ ဂဲထုၪ့ထၪ့အၪ့ဂၬဝ့ၫတၭ, ၡီၫ့လၩ့အခိၪတၭ, ဆၧၫ့နၩ့ လၧအလးဆီၩ့ဆီတၭ, အၪ့မၧၫ့ၦအီၪက့ၪအဆၧၫ့နၩ့ အလးလၧစဎွၩအမိအဂးတၭ, အဝ့ၫဒၪဆၧၫ့နၩ့လၧအ",
			"20": "<sup>20</sup> စူၪထွ့ၪလခီၫလီၫ.- တၭစံၭ, ယအၪ့ကံၩ့ဆၧအၪ့ကံၩ့ အဆံၭလမံၩ့လၧနၧၩတၭ, ထီးကၠၪခွံၬနမ့ၬလဂ့ၩး တၭ စဎွၩစံၭ, အၪ့ကံၩ့ကဒၪဘီၪ, ယမိဧ့, အဂဲးဘဲၫယီၩ",
			"21": "<sup>21</sup> ယကၠၪခွံၬယမ့ၬအ့ၬ.- အဝ့ၫဒၪစံၭဝ့ၫ, ဖ့ၪလၫ့ၦရှုန့ၫ ဖိၪနးအၭဘၡၭ လၧနထၧၫ့ဖုဝဲ စအၭဒနဲယၫ လၧအ",
			"22": "<sup>22</sup> မၫဆံၭ.- စဎွၩစီလမၧၫ့စံၭဆၧၫ့ဆၧတၭ စံၭအမိ,နအၪ့ ကံၩ့ၦရှုန့ၫဖိၪနးအၭဘၡၭ လၧစအၭဒနဲယၫအဂးနီၪ, မွဲဘၪလဲၪ. အၪ့ကံၩ့ဆ့ဘၩ့မုး လၧအဂးဆံၭ. အဂဲး ဘဲၫယီၩအဝ့ၫဒၪနီၪမွဲယဝဲလီၫ. တၭအၪ့ကံၩ့လၧအ ဂး,ဒဲလၧၦလုဆၧစအဘဲအၥၫအဂး, ဒဲလၧနးဇ့ၫရုၫအဲ",
			"23": "<sup>23</sup> အၫအဖိၪခွၫစယိအၭအဂးဘီၪ.- ထီးနီၪလဖၧၫ့စဎွၩ စီလမၧၫ့ ဆိၪလၩ့အၥၭ လၧယဟိဝၩအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ဆၧချဲၩ့လထံၪယီၩ, စအၭဒနဲယၫအ့ၪလချဲၩ့ ထၫ့ဒုၪဒၩဘၪအၥၭမၧၫ့ဒၪဝ့ၫတၭ, မွဲယွၩမၩယၧၩဘဲၫ",
			"24": "<sup>24</sup> နီၪ,အၪနဲၪ့အနီၪဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩယဟိဝၩမၧၫ့ ဝ့ၫလၧအဒုၭအီၪဂုးအီၪခၧၫ့ယၧၩ, ဒဲအီၪက့ၪထၪ့ယၧၩ လၧယဖါစဒၫဝံၭအလးဆီၩ့ဆီအဖၫ့ခိၪတၭ, မၩယၧၩ လၧဂံၪ့လဖျိၪ့ဘဲၫအစံၭဝဲၩဝ့ၫအၥိၭနီၪ, စအၭဒနဲယၫ",
			"25": "<sup>25</sup> မိဘၪဆၧမၩၥံၫဝ့ၫ လၧမုဆၫလနံၩယီၩလီၫ.- စဎွၩ စီလမၧၫ့အၪ့မၧၫ့လၩ့ စယဟီအဒၫအဖိၪခွၫစဘံၫ့နအဲ အၫနီၪ, အဝ့ၫဖ့ၬခွံၬဝ့ၫတၭ, ၥံၫဝ့ၫလီၫ.",
			"26": "<sup>26</sup> တၭစဎွၩစံၭၦလုဆၧစအဘဲအၥၫနီၪ, စဲၪ့ထၪ့ခွံၬ လ့ၩစိၩလၧအၫ့နၥီၭ, လၧနဂၪ့ခိၪအဝၩ့ဒၪနဝ့ၫဆံၭ. အ ဂဲးဘဲၫယီၩနကြၨၭၥံၫလါနၫ့တၭ, ယမၩၥံၫနၧၩလၧမုဆၫ လနံၩယီၩအ့ၬ, အဂဲးဘဲၫယီၩ နဆိၬယဟိဝၩယွၩအ တလၫလၧယဖါစဒၫဝံၭအမ့ၬယၫတၭ, ဒဲလၧနဘၪဆၧ နၭဆၧၡၪ့လၧကယဲဆၧနၭဆၧၡၪ့ လၧအဘၪယဖါအ",
			"27": "<sup>27</sup> ဖၧၩ့အကၠီၩ့နီၪဆ့လီၫ.- အခိးမွဲစစီလမၧၫ့နၫ့ထၪ့ခွံၬ စအဘဲအၥၫ လၧၦလုဆၧအလး လၧယဟိဝၩအမ့ၬ ယၫ,ဘဲၫၥိၭအမိမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ ယဟိဝၩအလူ အထၫလၧအချဲၩ့ဆၧလၧစအံလဲၫ အၡၩဂံၪ့ဖိၪအဂဲး အကၠီၪ့လၧၡဲလိၫအဖၧၩ့နီၪလီၫ.",
			"28": "<sup>28</sup> တၭဆၧပရၧၫ့နီၪ ထီၩ့ဝ့ၫလၧစယိအၭအအီၪလီၫ. အဂဲးဘဲၫယီၩ စယိအၭလကၠၪထဲၩ့ဖိၬဘၪ စအၭဘစ လၧၫ့အခဲၫ့လါနၫ့တၭ, ကၠၪအၥၭဖိၬစအၭဒနဲယၫအ ခဲၫ့နီၪလီၫ. တၭစယိအၭစဲၪ့ဝ့ၫ လၧယဟိဝၩအတဲၩ ဆံၫ့ဎံၪဖၧၩ့တၭ, ဖီၪ့ထၬဆၧလုလးအနိၩ့လဖၪလီၫ.",
			"29": "<sup>29</sup> ၦလီၩဘၪစစီလမၧၫ့ လၧစယိအၭစဲၪ့ယူၭ လၧယဟိ ဝၩအတဲၩဆံၫ့ဎံၪဖၧၩ့တၭ, ယိခွါ,အီၪဝ့ၫလၧဆၧလု လးအနဲၩ့လီၫ. စစီလမၧၫ့ အၪ့မၧၫ့လၩ့စယဟီအဒၫ အဖိၪခွၫစဘံၫ့နအဲအၫတၭ, စံၭဝ့ၫဒၪ,လ့ၩဖ့ၬခွံၬအဝ့ၫ",
			"30": "<sup>30</sup> ဆံၭ.- စဘံၫ့နအဲအၫဂဲၫဝ့ၫလၧ ယဟိဝၩအတဲၩဆံၫ့ဎံၪ ဖၧၩ့တၭ,စံၭအဝ့ၫ, စဎွၩစံၭဆၧဘဲၫယီၩ, ဂဲၫထၪ့လၧ ခီၫ့ယီၩဘီၪ, တၭအဝ့ၫဒၪစံၭဝ့ၫ,ယလ့ၩထၪ့အ့ၬ. ယမိ ၥံၫထီးယီၩလီၫ. တၭစဘံၫ့နအဲအၫဆိၬဆၧချဲၩ့နီၪလၧ စဎွၩအအီၪတၭ, စံၭဝ့ၫဒၪ, စယိအၭစံၭဝ့ၫဘဲၫယီၩ,",
			"31": "<sup>31</sup> တၭစံၭဆၧၫ့ယၧၩဘဲၫယီၩလီၫ.- တၭစဎွၩစံၭဝ့ၫ,မၩ အဝ့ၫဘဲၫအစံၭဝ့ၫအၥိၭနီၪ, ဖ့ၬခွံၬဝ့ၫတၭ, ခုၪ့လၩ့ ဘၧၩ့ခွံၬအဝ့ၫး ဘဲၫၥိၭနမိၥုၭခွံၬဆၧၥွံၪ လၧအဆၧဒဲၩ ဘၭလအီၪဘၪလၧစယိအၭဒုၭလၩ့ဝ့ၫနီၪ, လၧယၧၩ,",
			"32": "<sup>32</sup> ဒဲလၧယဖါအၡၩဂံၪ့ဖိၪနီၪဆံၭ.- တၭယဟိဝၩမိဒုၭ ဂဲၫထဲၩ့အၥွံၪလၧအခိၪဒၪဝ့ၫ, ၦလၧအဖ့ၬခွံၬၦနံၫဂၩ လၧအတီၩနဲၪ့ဒဲဂ့ၩနဲၪ့အနၫ့ဆါဒၪဝ့ၫတၭ, မၩၥံၫဝ့ၫ လၧနၭ (ယဖါစဒၫဝံၭၥ့ၪယၫအ့ၬ.) အံၫစရ့လၭအၡၩ ၥုၭမုအခိၪစနၧၫအဖိၪခွၫ စအၭဘနၧၫ,ဒဲယုဒၫအခ့ၫအ",
			"33": "<sup>33</sup> ၡၩၥုၭမုအခိၪစယ့ၥၧၫအဖိၪခွၫစအၫမစၫလီၫ.- အခိး မွဲအဝ့ၫၥံၪအၥွံၪမိဂဲၫထဲၩ့ဘၪစယိအၭအခိၪ, ဒဲမိဘၪ အချံၫအၥၪအခိၪ လၩ့ဆိၩလၩ့ကၠၪလီၫ. အ့ၪမွဲလၧစ ဒၫဝံၭအဂး, ဒဲလၧအချံၫအၥၪအဂး, ဒဲလၧအၡၩဂံၪ့ဖိၪ အဂး,ဒဲလၧအလးဆီၩ့ဆီအဖၫ့ခိၪနီၪ, ဆၧဘၪလိၬ အိၭလိၬမိအီၪ အဆိၩဆိၩအကၠၪကၠၪ လၧယဟိဝၩ",
			"34": "<sup>34</sup> လီၫ.- စယဟီအဒၫအဖိၪခွၫ စဘံၫ့နအဲအၫလ့ၩထၪ့ တၭ,ဖီၪ့ထၬမၩၥံၫဝ့ၫတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအ",
			"35": "<sup>35</sup> ဂံၪ့ဒၪဝ့ၫအဖၧၩ့ လၧမံၩ့လၬကျၩနီၪလီၫ.- စဎွၩအီၪ က့ၪလၩ့စယဟီအဒၫ အဖိၪခွၫ စဘံၫ့နအဲအၫလၧအ လးလၧၦၥုၭမုခမျၧးအဖၫ့ခိၪတၭ, စဎွၩအီၪက့ၪၦလု ဆၧစဇၫဒီၭလၧစအဘဲအၥၫအလးနီၪလီၫ.",
			"36": "<sup>36</sup> စဎွၩအၪ့မၧၫ့လၩ့ဆၧကိၭန့စၡံမအဲၫတၭ, စံၭအဝ့ၫ, ၥုၪ့နဂံၪ့လၧယရုစလံၫ့အဖၧၩ့တၭ, အီၪထီးနီၪဆံၭ.",
			"37": "<sup>37</sup> စဲၪ့ထၪ့ထီးနီၪနးစီၪ့လဂ့ၩ,- တၭမုလနံၩလၧနစဲၪ့ထၪ့, ဒဲခၫ့ဂၬထံၫချိၬကံဒၧၫ့တၭ, ဆၧမိမၩအၥၭ လၧနမိၥ့ၪ ယၫလၩ့ထံးလၩ့ဆ့ၭလၧနမိဘၪၥံၫတၡါလီၫ. နၥွံၪမိ",
			"38": "<sup>38</sup> အီၪလၧနခိၪဒၪနဝ့ၫ အလီၩ့လီၫ.- တၭစၡံမအဲၫစံၭစ ဎွၩ,ဆၧချဲၩ့နီၪဂ့ၩယူၭ, ဘဲၫယကဆါစဎွၩ စံၭဝ့ၫအ ၥိၭနီၪနခ့ၫနၡၩ မိမၩဘဲၫနီၪအၥိၭလီၫ. တၭစၡံမအဲၫ",
			"39": "<sup>39</sup> အီၪလၧယရုစလံၫ့အဖၧၩ့ အၪနံၩအၪၥၫ့လီၫ.- တၭ လၧၥၧၫ့နံၪ့အထုၬနီၪဆၧမၩအၥၭ လၧစၡံမအဲၫအဎီး အၡၩနံၫဂၩစဲၪ့ထၪ့ခွံၬ လ့ၩလၧဂၫၥၭအစဎွၩ စမၫအ ခၫအဖိၪခွၫ စအၫခံၭ အအီၪတၭ, ၦဒုၭနဲၪစၡံမအဲၫ တၭ,စံၭဝ့ၫဒၪ, ယိခွါ,နဎီးနၡၩနီၪအီၪဝ့ၫလၧဂၫၥၭ",
			"40": "<sup>40</sup> အဖၧၩ့လီၫ.- စၡံမအဲၫဂဲထုၪ့တၭ, မၩထၪ့ကၥ့ၪယီၩ့ဒဲ အပီၩ့တၭ, လ့ၩဝ့ၫလၧဂၫၥၭလၧစအၫခံၭအအီၪဘဲၫၥိၭ အမိအၪ့ဎၬန့ထဲၩ့အဎီးအၡၩလီၫ. တၭစၡံမအဲၫလ့ၩ ဆၧတၭ, ဂဲၫထဲၩ့ဆိၬခွံၬအဎီးအၡၩလၧဂၫၥၭအဖၧၩ့",
			"41": "<sup>41</sup> လီၫ.- ၦလီၩဘၪစစီလမၧၫ့ လၧစၡံမအဲၫစဲၪ့ထၪ့လၧယ ရုစလံၫ့လ့ၩထီၩ့လၧဂၫၥၭတၭ, ဂဲၫထဲၩ့ထဲၩ့ယူၭလီၫ.",
			"42": "<sup>42</sup> စဎွၩအၪ့မၧၫ့လၩ့ဆၧကိၭန့စၡံမအဲၫတၭ, စံၭအဝ့ၫ, ယဒုၭဆိၪလၩ့နၥၭ လၧယဟိဝၩအမ့ၬယၫ, ဒဲယထိး ယၥၭလၧနၧၩတၭ, စံၭ, မုလနံၩလၧနစဲၪ့ထၪ့ခွံၬတၭ, လ့ၩဆၧထီးအံၩ ထီးအိၩနီၪ, နမိၥ့ၪယၫလၩ့ထံးလၩ့ ဆ့ၭလၧနမိဘၪၥံၫတၡါနီၪ, မွဲအ့ၬဧၪ.",
			"43": "<sup>43</sup> တၭနစံၭယၧၩ, ဆၧချဲၩ့လၧယနါဂၧၫ့နီၪဂ့ၩယူၭ.",
			"44": "<sup>44</sup> တၭနလထီးန့ဘၪဆၧဆိၪလၩ့အၥၭ ဘၪဆဲၫ့လၧယဟိ ဝၩနီၪ,ဒဲဆၧမၪလူၬ လၧယမၪလူၬနၧၩနီၪ မွဲဘၪလဲၪ. တၭစဎွၩစံၭ စၡံမအဲၫနၥ့ၪယၫလၧနၥၭခံဖၧၩ့ ကယဲ ဆၧအၧၩ့လၧနမၩယဖါစဒၫဝံၭနီၪ, အခိးမွဲယဟိဝၩမိ ဒုၭဂဲၫထဲၩ့ထဲၩ့ နဆၧအၧၩ့လၧနခိၪ ဒၪနဝ့ၫအဖၫ့ခိၪ",
			"45": "<sup>45</sup> လီၫ.- စဎွၩစီလမၧၫ့မိဘၪဆၧဆိၪဂ့ၩဝ့ၫတၭ, စဒၫဝံၭ အလးဆီၩ့ဆီမိအီၪဂုးအီၪခၧၫ့ လၧယဟိဝၩအမ့ၬယၫ",
			"46": "<sup>46</sup> လၩ့ဆိၩလၩ့ကၠၪလီၫ.- စဎွၩမၪလူၬ စယဟီအဒၫအ ဖိၪခွၫစဘံၫ့နအဲအၫတၭ, အဝ့ၫဒၪစဲၪ့ထၪ့တၭ, ဖ့ၬခွံၬ အဝ့ၫတၭ,ၥံၫဝ့ၫလီၫ. တၭဘၩ့မုးနီၪဂုးခၧၫ့ဝ့ၫလၧစစီ လမၧၫ့အစူၪဖၧၩ့လီၫ."
		},
		"3": {
			"1": "<sup>1</sup> စစီလမၧၫ့ထၧၫ့ထံၩထၧၫ့ၥိၭ လၧအံဇံၭအစဎွၩဖၫ ရိၫတၭ,မၩန့ဖၫရိၫအဖိၪမုၪနီၪ, ဂဲၫဆိၬဝ့ၫလၧစဒၫဝံၭ အဒိၩ့ဖၧၩ့ထီးအမၩဂီၩ့ အဂံၪ့ဒၪဝ့ၫ,ဒဲယဟိဝၩအဂံၪ့",
			"2": "<sup>2</sup> ဒဲဒိၩ့ခိၪဒၧၩ့ဝၬဖီၩ့ယရုစလံၫ့လီၫ.- တၭၦခမျၧးလုထၪ့ ဆၧလၧအလး ထၪ့ထီၫလဖၪအဖၫ့ခိၪလီၫ. အဂဲးဘဲၫ ယီၩဆၧလမၩဒံၭဘၪဂံၪ့လၧယဟိဝၩ အမံၩ့အဂးထီး",
			"3": "<sup>3</sup> လၩ့လၧမုနံၩလဖၪနီၪလီၫ.- စစီလမၧၫ့ အဲၪယဟိဝၩ တၭ,လ့ၩဆၧလၧ အဖါစဒၫဝံၭ အဆၧမၪလူၬအဖၧၩ့, မွဲလါနၫ့အဝ့ၫလုထၪ့ဆၧ, ဒဲဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧ ဆၧအလးထၪ့ထီၫလဖၪအဖၫ့ခိၪလီၫ.",
			"4": "<sup>4</sup> တၭစဎွၩလ့ၩလၧဂံဘအၧၫ့အဖၧၩ့ ဘဲၫၥိၭအမိလု ထၪ့ဆၧထီးနီၪလီၫ. အဂဲးဘဲၫယီၩဆၧအလးထၪ့ထီၫ ဖၭဒိၪအီၪဝ့ၫထီးနီၪလစီၪ့လီၫ. စစီလမၧၫ့လုထၪ့ဆၧ",
			"5": "<sup>5</sup> လုမ့ၪလထီၫ့လၧဆၧလုလးအဖၫ့ခိၪနီၪလီၫ.- ယဟိ ဝၩနဲၪဖျီၪထၪ့အၥၭလၧစစီလမၧၫ့ အမ့ၬယၫလၧဆၧမံၫ မးအဖၧၩ့လၧမုနၩလၧဂံဘအၧၫ့အဖၧၩ့လီၫ. တၭယွၩ စံၭဝ့ၫဒၪ, ယမိဖ့ၪလၫ့နၧၩနီၫလဲၪ, နီၫလဲၪနီၪ, အၪ့ကံၩ့",
			"6": "<sup>6</sup> ဆံၭ.- တၭစစီလမၧၫ့စံၭဝ့ၫဒၪ, နမၩခိးမၩတၩယဖါန ခ့ၫနၡၩစဒၫဝံၭဒိၪဒိၪလ့ၬ, ဘဲၫအလ့ၩဆၧလၧနမ့ၬယၫ လၧဆၧမွဲဆၧတီၩအဖၧၩ့, ဒဲလၧဆၧတီၩဆၧလီၩ့အ ဖၧၩ့,ဒဲလၧအၥၭလီၩ့အဖၧၩ့ လၧနၧၩအၥိၭနီၪတၭ, န ထီးန့ဆၧအခိးအတၩဖၭဒိၪယီၩ လၧအဂးတၭ, နဖ့ၪ လၫ့အဝ့ၫလၧအဖိၪခွၫလၧအဆၧၫ့နၩ့ လၧအလးဆီၩ့ ဆီအဖၫ့ခိၪ ဘဲၫလၧမုဆၫလနံၩယီၩ အၥိၭနီၪလီၫ.",
			"7": "<sup>7</sup> ဘိၩ့နဲၪ့ယီၩယဟိဝၩယယွၩဧ့, နအီၪက့ၪလၩ့နခ့ၫန ၡၩစဎွၩလၧယဖါ စဒၫဝံၭအလးတၭ, ယမွဲဖိၪၥၪအ",
			"8": "<sup>8</sup> ဆံၭတၭ, ယလ့ၩထၪ့ဂဲၫနုၬနီၪယၥ့ၪယၫအ့ၬ.- တၭန ခ့ၫနၡၩအီၪဝ့ၫလၧနၡၩခမျၧးလၧနရွံန့ဝ့ၫအကျၩ, ၦ ခမျၧးဖၭဒိၪလၧၦလဝံလနၬဘၪဝ့ၫ, ဒဲအီၪဎွ့ၩအံၩဎွ့ၩ အိၩထီးဆၧဝံထၪ့နၬထၪ့လၥ့ၪဘၪ လၧအအီၪအၪအ",
			"9": "<sup>9</sup> ကၠီၩ့နီၪလီၫ.- အခိးမွဲဘဲၫနီၪတၭ, ဖ့ၪလၫ့နခ့ၫနၡၩအ ၥုၪ့ဆၭအၥၭဆၭဘဲၫၥိၭ အမိစ့ၩရၫ့နၡၩခမျၧးဘဲၫၥိၭ ယမိအၪ့နၩ့ဖၭဆၧဂ့ၩ ဒဲဆၧအၧၩ့အဆၧၫ့နီၪဆံၭ. အ ဂဲးဘဲၫယီၩမွဲပလၫစ့ၩရၫ့ နၡၩခမျၧးဖၭဒိၪယီၩမိၥ့ၪလ ဂၩလဲၪ.",
			"10": "<sup>10</sup> တၭအဆၧချဲၩ့လၧစစီလမၧၫ့ အၪ့ကံၩ့ဆၧလမံၩ့ နီၪဂ့ၩဝ့ၫလၧယဟိဝၩအမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> ယွၩစံၭအဝ့ၫ, မွဲနအၪ့ကံၩ့ဆၧလမံၩ့ယီၩတၭ,လ အၪ့ကံၩ့ဘၪအၪနံၩအၪၥၫ့လၧနဂး, ဒဲလအၪ့ကံၩ့ဘၪ ဆၧထူၭဆၧလၧၫ့လၧနဂး, ဒဲလအၪ့ကံၩ့ဘၪနဒုၪနဒၩ လဖၪအၥၭမၧၫ့တၭ, အ့ၪမွဲနအၪ့ကံၩ့ နၥုၪ့ဆၭ နၥၭ ဆၭလၧနနၫ့ဆါအဂး, ဘဲၫၥိၭနမိယိၥ့ၪယၫဆၧစ့ၩရၫ့",
			"12": "<sup>12</sup> တၭ,- ယိခွါ,ယမၩယူၭ ဆၧဘဲၫနဆၧချဲၩ့အၥိၭနီၪကၭ အ့ၬး ယိခွါ, ယဖ့ၪလၫ့ယူၭနၧၩလၧနၥၭအကိၪ့ဆၧၥ့ၪ, ဒဲနၥုၪ့ဆၭနၥၭဆၭး ထီးၦဘဲၫနၧၩအၥိၭ လအီၪဘၪ လၧနမ့ၬယၫ, ဒဲလၧနလးခဲၫ့နီၪၦမိအီၪထၪ့ဘဲၫနၧၩအ",
			"13": "<sup>13</sup> ၥိၭနးဂၩဆ့အ့ၬ.- တၭယဖ့ၪလၫ့နၧၩဆ့လၧဆၧလၧန လအၪ့ကံၩ့ဘၪ, ဆၧထူၭဆၧလၧၫ့ ဒဲဆၧလၩဆၧဖၩ့, ဘဲၫၥိၭၦလၧစဎွၩလဖၪအကျၩနီၪ, မီၪ့ဎီၩ့လၧနၧၩလ",
			"14": "<sup>14</sup> ဆိၩဒၪနဝ့ၫမိအီၪနးဂၩအ့ၬ.- တၭနအ့ၪဖိၬယဖၧၩ့ၥၭ လဖၪ,ဒဲထီးန့ယၥနိၫလဖၪ, ဒဲယဆၧမၪလူၬ,ဘဲၫနဖါ စဒၫဝံၭလ့ၩဆၧအၥိၭနီၪတၭ, ယမိဒုၭအီၪကိၩ့အီၪခိၭ",
			"15": "<sup>15</sup> နၧၩအၪနံၩအၪၥၫ့လီၫ.- စစီလမၧၫ့နၪ့ထၪ့တၭ, ယိခွါ, ဆၧမံၫမးလီၫ. မွဲအဂဲၫဝ့ၫ လၧယရုစလံၫ့တၭ, ဆၧၫ့ ထုၪ့လၧယဟိဝၩအဆၧအုၩ့လၩ့ အတလၫအမ့ၬယၫ တၭ,လုထၪ့ဆၧလုမ့ၪ, ဒဲဆၧလုမၩဘၪလိၬအိၭလိၬ ဒဲမၩဆၧအၪ့ဆၧအီၩ, လၧအခ့ၫအၡၩ ထီးအလူၬအ ဂးလီၫ.",
			"16": "<sup>16</sup> တၭၦမဲၩဎွဲၩမုၪနံၫဂၩ ဂဲၫဝ့ၫလၧစဎွၩ အအီၪတၭ,",
			"17": "<sup>17</sup> ဆၧၫ့ထုၪ့လၧအမ့ၬယၫလီၫ.- တၭၦမုၪလဂၩစံၭဝ့ၫဒၪ, ယကဆါဧ့, ယဝ့ၫဒၪဒဲၦမုၪလဂၩယီၩ, ပအီၪလၧဂံၪ့လ ဖျိၪ့ဎးအဖၧၩ့တၭ, ယအီၪဖျဲၪန့ယဖိၪခွၫလဂၩအီၪလၧ",
			"18": "<sup>18</sup> အဝ့ၫအၥိၭလၧဂံၪ့ဖၧၩ့လီၫ.- တၭယအီၪဖျဲၪန့ဆၧအ လးခဲၫ့ၥၧၫ့နံၩလနံၩနီၪ ဆၧမၩအၥၭလၧ ၦမုၪလဂၩ ယီၩအီၪဖျဲၪန့ဆၧဆ့တၭ, ပအီၪလစီၪ့ဎးတၭး ၦမွံၩအီၪ လၧပၥိၭနးဂၩအ့ၬ. အီၪန့ၫပဝ့ၫဒၪနံၫဂၩ လၧဂံၪ့ဖၧၩ့",
			"19": "<sup>19</sup> လီၫ.- တၭၦမုၪလဂၩယီၩ အဖိၪၥံၫဝ့ၫလၧမုနၩလခီၫ",
			"20": "<sup>20</sup> လီၫ. အဂဲးဘဲၫယီၩဒိၭချံးၥံၫဘၪဝ့ၫလီၫ.- အဝ့ၫဒၪဂဲ ထုၪ့ထၪ့လၧဖိၭဖၫ့မုတၭ, မၩန့ယဖိၪခွၫလၧယဖၩထံၭ လၧနးဎီးမုၪမံၫမၪဝ့ၫအဘိၩ့ဘၭတၭ, အီၪက့ၪအဖိၪၥံၫ",
			"21": "<sup>21</sup> လဂၩလၧယၥၭနၫၡါအဖၧၩ့လီၫ.- ဆၧဖၩ့ထၪ့နီၪယ ဂဲထုၪ့ဘဲၫၥိၭယမိဒုၭအၪ့နူယဖိၪတၭ, ယိခွါ,ၥံၫယူၭ ဝ့ၫယူၭ. တၭလၧဂီၩလခီၫနီၪ ယယိထံၫယိဆၭတၭ,",
			"22": "<sup>22</sup> ယိခွါ,မွဲယဖိၪခွၫလၧယအီၪဖျဲၪန့အဝ့ၫအ့ၬ.- ၦမုၪအ ဂူၫဂၩလဂၩစံၭဝ့ၫဒၪ, မွဲအ့ၬ, အ့ၪမွဲလၧအမၧၫ့ဝ့ၫလ ဂၩမွဲယဖိၪခွၫတၭ, ဆၧအၥံၫလဂၩနီၪ မွဲနဖိၪခွၫလီၫ. တၭအဝ့ၫလဂၩနီၪစံၭဝ့ၫ, မွဲအ့ၬ,ဆၧအၥံၫနီၪမွဲနဖိၪခွၫ တၭ,လၧအမၧၫ့ဝ့ၫလဂၩနီၪ မွဲယဖိၪခွၫလီၫ. တၭအ ဝ့ၫၥံၪချဲၩ့လၧစဎွၩအမ့ၬယၫဘဲၫနီၪၥိၭလီၫ.",
			"23": "<sup>23</sup> စဎွၩစံၭအဝ့ၫဒၪ, အဝ့ၫလဂၩစံၭဝ့ၫ, လၧအမၧၫ့ဝ့ၫ နီၪမွဲယဖိၪခွၫတၭ, နဝ့ၫနဖိၪခွၫမွဲအၥံၫလီၫ တၭအဝ့ၫ လဂၩစံၭဝ့ၫ,မွဲအ့ၬ. နဖိၪခွၫမွဲအၥံၫတၭ, ယဖိၪခွၫမွဲအ",
			"24": "<sup>24</sup> မၧၫ့လဂၩနီၪလီၫ.- တၭစဎွၩစံၭဝ့ၫဒၪ, ဂဲၫဆိၬန့ယၧၩ လၧနၭနးဘံၪ့ဘီၪ. တၭၦဂဲၫဆိၬနၭလဘံၪ့ လၧစဎွၩ",
			"25": "<sup>25</sup> အမ့ၬယၫလီၫ.- စဎွၩစံၭဝ့ၫဒၪ, ဖ့ၬဖၭဖိၪၥၪလၧအမၧၫ့ ဝ့ၫနီၪနံၫခီၫတၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪလဂၩလခီၫ လဂၩလ",
			"26": "<sup>26</sup> ခီၫဆံၭ.- ထီးနီၪလဖၧၫ့ၦမုၪလၧအဖိၪ မၧၫ့ဝ့ၫလဂၩနီၪ ချဲၩ့ဆၧလၧစဎွၩ, (အဂဲးဘဲၫယီၩအၥၭအီၪအဖိၪခွၫ,) ယကဆါဧ့, ဖ့ၪလၫ့အဝ့ၫလၧဖိၪၥၪအမၧၫ့နီၪတၭ,ထီး မၩၥံၫအဝ့ၫလၩလါလဂ့ၩ. အ့ၪမွဲအဝ့ၫလဂၩနီၪစံၭ အဝ့ၫဒၪ,ယဝ့ၫမွဲဂ့ၩ, နဝ့ၫမွဲဂ့ၩ မွဲအထီးအီၪလဂ့ၩ,",
			"27": "<sup>27</sup> ဖ့ၬဖၭအဝ့ၫဆံၭ.- ထီးနီၪလဖၧၫ့ စဎွၩစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ဖ့ၪလၫ့အဝ့ၫလၧဖိၪၥၪ လၧအမၧၫ့ဝ့ၫဆံၭ. ထီးမၩၥံၫအဝ့ၫလၩလါလဂ့ၩ, အဝ့ၫဒၪနီၪမွဲအမိလီၫ.",
			"28": "<sup>28</sup> အံၫစရ့လၭထီးအလူၬနါဂၧၫ့ ဆၧစ့ၩရၫ့လၧစဎွၩ စ့ၩရၫ့ဝ့ၫတၭ,ၥၭမဲၪစဎွၩလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪဒၪ ဘၪဝ့ၫလၧယွၩအဆၧကိၪ့ၥ့ၪ အီၪလၧအဝ့ၫ, ဘဲၫၥိၭအ မိစ့ၩရၫ့ဆၧလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> တၭစဎွၩစီလမၧၫ့ ကဲၪစဎွၩလၧအံၫစရ့လၭထီး",
			"2": "<sup>2</sup> အလူၬအဖၫ့ခိၪလီၫ.- ၦဒိၪဖၭဒိၪလၧအအီၪလၧအၥိၭမွဲ အယီၩး ၦလုဆၧစဇၫဒီၭ, အဖိၪခွၫစအၭဇရဲၫအၫ,",
			"3": "<sup>3</sup> စၡဲၡၫအဖိၪခွၫၥံၪ, စအံၫလဟိရ့ၭ, ဒဲစအဟဲအၫမွဲၦ ကွ့ၭလံၬလဖၪး စအဟဲလၧၭအဖိၪခွၫစယဟီၡဖၭမွဲၦ",
			"4": "<sup>4</sup> ကွ့ၭနဲၪ့ဆၧး ဒဲစယဟီအဒၫအဖိၪခွၫစဘံၫ့နအဲအၫမွဲၦ ၥုၭမုခမျၧးအခိၪး ဒဲၦလုဆၧနီၪမွဲစဇၫဒီၭ ဒဲစအဘဲ",
			"5": "<sup>5</sup> အၥၫၥံၪ,- ဒဲစနၫၥၫ့အဖိၪခွၫစအၭဇရဲအၫ မွဲၦဒိၪၥံၪ အခိၪးဒဲစနၫၥၫ့အဖိၪခွၫစဇၫဘၧၭ, လၧၦဒိၪၥံၪအကျၩ",
			"6": "<sup>6</sup> အဒိၪထုၬ, ဒဲစဎွၩအထံၩအၥိၭ,- ဒဲၦပၧၩ့ဂံၪ့နီၪစအ ဟဲၡၧၫး ဒဲၦပၧၩ့အခီၫ့နီၪစအၭဘဒၫအဖိၪခွၫ စအၭဒ နဲရၫ့လီၫ.",
			"7": "<sup>7</sup> တၭၦလၧအတဲၩ့ဝဲၩဆၧအၪ့ဆၧအီၩ လၧစဎွၩဒဲအ ဂံၪ့အဂးနီၪ, စစီလမၧၫ့အီၪလၧၦဒိၪလဆံၫနံၫဂၩလၧ",
			"8": "<sup>8</sup> အံၫစရ့လၭထီးအလူၬအဖၫ့ခိၪတၭ,- အဝ့ၫၥံၪတဲၩ့ဝဲၩ ဆၧအၪ့ဆၧအီၩ, လဂၩလၧအလၩ လဂၩလၧအလၩ ဆုၬဆုၬလနံၪ့အထးဖၧၩ့နီၪလီၫ. အဝ့ၫၥံၪအမံၩ့မွဲဘဲၫ",
			"9": "<sup>9</sup> ယီၩ.- စဟၧၫအဖိၪခွၫလၧခိၪလီၩ့အံဖြံၫ့အဖၧၩ့ စဒ့ ကၫအဖိၪခွၫ လၧမၫကၭအဖၧၩ့, ဒဲဘ့ၭၥၡံမ့ၭ, ဒဲအံၫ",
			"10": "<sup>10</sup> လၧၫ့ဘ့ၭၥဟၫနၫ့း- စဟံစ့ၭအဖိၪခွၫ လၧအၫရုၫဘိၭ အဖၧၩ့, စိကိၫဒဲခးဟ့ဖၧၫ ထီးအလူၬနီၪဘၪဆဲၫ့လၧ အဝ့ၫဒၪဆ့း စအဘံၫ့နဒၭအဖိၪခွၫလၧခးဒီၫထီးအလူၬ",
			"11": "<sup>11</sup> အဖၧၩ့း- အဝ့ၫနီၪန့အမၫလၧစစီလမၧၫ့အဖိၪမုၪနးတၫ ဖၭး စအဟဲလၧၭ အဖိၪခွၫစဘၫအနၫ, အဝ့ၫဒၪန့ဘၪ",
			"12": "<sup>12</sup> ဝ့ၫတၫအနၭဒဲမဂံၭဒိၫ,- ဒဲဘ့ၭၥၡံအၫ့ထီးအလူၬ,လၧ အအီၪလၧဇၫတနၫအနဲၩ့ လၧယ့ၭစရ့လၭ အဖၫ့လၬ လၧဘ့ၭၥၡံအၫ့ဖိး လၧအၫဘလၭမဟိလၫ, ထီၩ့လၧ",
			"13": "<sup>13</sup> ယီၭနအၫ့အမ့ၬယၫ- စဂံဘအၧၫအဖိၪခွၫလၧရၫမီၭဂံ လအၭအဖၧၩ့း အဝ့ၫဒၪန့ဘၪစမနၭစ့ၫအဖိၪခွၫစယၫ အၫအဝၩ့လဖၪလၧဂံလအၭအဖၧၩ့, မွဲအန့ဘၪဆ့ခး အၫဂီၭလၧဘၫၡၫ့အဖၧၩ့ ဒိၩ့ဖၭဒိၪဎူၫဆံၫ အီၪလၧအ",
			"14": "<sup>14</sup> ခိၪဒၧၩ့ဒဲနိၪဘီၩ့ထီးဘၩ့ၥံၪ,- စအံဒိၫအဖိၪခွၫစအဟံ",
			"15": "<sup>15</sup> နဒၭန့ဘၪမၫဟနၫအံၫ့,- စအဟံမအၭန့ဘၪနၭၥလဲၫး",
			"16": "<sup>16</sup> အဝ့ၫဒၪန့မၫလၧစစီလမၧၫ့ အဖိၪမုၪနးဘၭစမၭ,- စ ယုၡဲၫအဖိၪခွၫစဘၫအနၫအီၪ လၧအၭၡၧၫဒဲအၫလီၭအ",
			"17": "<sup>17</sup> ဖၧၩ့း- စပၫရုအၫအဖိၪခွၫ စယဟီၡဖၭ လၧအံၭစခၫ",
			"18": "<sup>18</sup> အဖၧၩ့,- စအံလၫအဖိၪခွၫစၡံမအဲၫလၧ ဘံၪ့ယမံၫ့အ",
			"19": "<sup>19</sup> ဖၧၩ့,- စယုရဲၫအဖိၪခွၫစဂံဘၧၫ လၧခးဂံလအၭ,ဘၪ ဆဲၫ့လၧဇဲဟၫ့ ၦအၫမိၫဖိၪ အစဎွၩ, ဒဲဘၫၡၫ့အစဎွၩ စအီၭတၭ, ၦဒိၪလၧခးဖၧၩ့နီၪ မွဲန့ၫအဝ့ၫဒၪလဂၩလီၫ.",
			"20": "<sup>20</sup> ယုဒၫဒဲအံၫစရ့လၭနီၪ အၪဝ့ၫဘဲၫမ့ၭၥံၪလၧမၫဆမံၭ နဲၩ့အၥိၭနီၪအၪ့ဆၧဒဲအီၩဆၧတၭ, မၩမုၬမၩလၩအ",
			"21": "<sup>21</sup> ၥၭလီၫ.- တၭစစီလမၧၫ့ကဲၪစဎွၩ လၧဘၩ့မုးထီးအ လူၬအဖၫ့ခိၪ လၧအအီၪဝ့ၫ လၧထံၫမိၡါဖိးလၧၦဖလံ ၡၫဖိၪအခး, ဒဲဖိးလၧအံဇံၭအခးနဲၩ့လီၫ. တၭၦလဖၪ နီၪဂဲၫဆိၬဆၧဖ့ၪလၫ့လဖၪတၭ, မၩစစီလမၧၫ့အဆၧ လဆိၩဒၪအဝ့ၫဒၪအၥၭလီၫ.",
			"22": "<sup>22</sup> တၭစစီလမၧၫ့အဆၧအၪ့ လၧမုလနံၩအဂးနီၪ,မွဲ ကိၪမုၬလွံပွံၪ အကီၫၥၧၫ့ဆံၫ, ဎနၬနံၫယၩလံဆံၫၭ, ဒဲ",
			"23": "<sup>23</sup> ကိၪအမုၬအကီၫဎူၫဆံၫ, ဎနၬလံယၩဎိၭဆံၫၭ,- ချီဖၫ အဘီၪ့ဆံၫဒုၩ ဒဲချီဖၫလၧအဒီၪ့အကျၩနံၫဆံၫ, ဒဲၥိၪ လယၩ,ဒဲစဎဲၩ, ဒဲခံၫဘၩ့,ဒဲဆၧဎီၩ, ဒဲထိၪဖိၪလံၪဖိၪ",
			"24": "<sup>24</sup> အဘီၪ့လီၫ.- အဂဲးဘဲၫယီၩမွဲအပၧၩ့ဆၧလၧခးလၧအ အီၪဝ့ၫလၧထံၫမိၡါအယီၩလခီၫ ထၧၫ့ဘံၪ့ယၫလၧတံ ပစၫဖိးလၧအၭဇၫလၧကယဲစဎွၩ အီၪလၧထံၫမိၡါအ ယီၩလခီၫအဖၫ့ခိၪလီၫ. တၭဆၧဘၪလိၬအိၭလိၬအီၪ ဝ့ၫလၧအခးနဲၩ့ထံၭ လစီၪ့လါလါ ဝၬဖီၩ့အဝ့ၫလီၫ.",
			"25": "<sup>25</sup> တၭလၧစစီလမၧၫ့အမုနံၩ ထီးအလူၬနီၪ ယုဒၫဒဲအံၫစ ရ့လၭအီၪဂုးခၧၫ့နီၪ, ၦအီၪဝ့ၫလၧအစဘံၭမု, ဒဲၦအီၪ ဝ့ၫလၧအချိၪ့ဒိၩ့အဖၫ့လၬဆုၬဆုၬ လၧဒၫ့ဖိးလၧဘံ အၧၫၡံဘၫလီၫ.",
			"26": "<sup>26</sup> တၭစစီလမၧၫ့အီၪဝ့ၫ လၧတၩ့ခူၬအဒူၭၥံၪလံလၬ လၧအလဲၪ့ၥုၭကၥ့ၪအဂး ဒဲၦနၫ့ကၥ့ၪနံၫလၬလထီၫ့",
			"27": "<sup>27</sup> လီၫ.- တၭၦဒိၪဖၭဒိၪလဖၪနီၪ တဲၩ့ဝဲၩဆၧအၪ့ဆၧအီၩ လၧစဎွၩစီလမၧၫ့အဂး, ဒဲလၧကယဲၦလၧအဂဲၫဝ့ၫလၧ စစီလမၧၫ့အစပွဲထံၭအဂးလီၫ. လဂၩလၧအလၩဒၪ ဝ့ၫအဖၧၩ့နီၪတၭ, ဆၧလၧအလလၧၫ့ဘၪနီၪအီၪနးမံၩ့",
			"28": "<sup>28</sup> အ့ၬ.- တၭၦဂဲၫဆိၬဘုၪမုယီၩ, ဒဲလီခၫ့ၥံၪလၧကၥ့ၪ,ဒဲ ဆၧအခၪ့ဖျဲၪလဖၪအဂးလၧအလးထီးနီၪ, လဂၩဘဲၫ အဆၧစ့ၩရၫ့အီၪဝ့ၫအၥိၭနီၪဆုၬဆုၬလီၫ.",
			"29": "<sup>29</sup> ယွၩဖ့ၪလၫ့စစီလမၧၫ့လၧအဆၧကိၪ့ၥ့ၪ, ဒဲအၥုၪ့ဆၭ အၥၭဆၭဒိၪလ့ၬတၭ, အၥၭဖၭလဲဘဲၫမ့ၭၥံၪဂၫ့ၥံၪလၧ",
			"30": "<sup>30</sup> မၫဆမံၭနဲၩ့အၥိၭနီၪလီၫ.- တၭစစီလမၧၫ့အဆၧကိၪ့ ၥ့ၪဒိၪနဲၪ့ၦမုထၪ့ဖိၪအဆၧကိၪ့ၥ့ၪ, ဒဲအံဇံၭအဆၧကိၪ့",
			"31": "<sup>31</sup> ၥ့ၪထီးအလူၬနီၪလီၫ.- တၭအကိၪ့ဆၧၥ့ၪ ဂ့ၩနဲၪ့ၦ ထီးအလူၬ, ဂ့ၩနဲၪ့ၦအ့စရၫဖိၪစအ့ၥၫ့, ဒဲစဟ့မၫ,ဒဲစ ခၫလကီလၭ,ဒဲစဒၫဒၫ, စမၫဟီလၭအဖိၪခွၫလဖၪနီၪ ဒံၭလီၫ.တၭအမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ လၧကယဲၦဆၨၩ",
			"32": "<sup>32</sup> ဝၬဖီၩ့ဝ့ၫထီးအလူၬအကျၩလီၫ.- တၭအဝ့ၫဒၪချဲၩ့ဒီၩ့ လၩ့ဆၧအထံၪၥၧၫ့ထီၫ့, ဒဲအဆၧၥံၫကျံၩနီၪအီၪဝ့ၫလ",
			"33": "<sup>33</sup> ထီၫ့ယဲဆၫ့လီၫ.- ချဲၩ့ဝ့ၫလၧၥံၪ့အဂဲးအကၠီၪ့လၧၥံၫ့ၡိၫ အ့ရ့ၭအီၪဝ့ၫလၧလ့ၭဘနၧၫ့ဖိးလၧ ၥံၪ့ကဖျၫ့အ့စိၭလၧ အမဲၪထၪ့လၧဆၧခိၪဒၧၩ့အလီၩ့လီၫ. ချဲၩ့ဝ့ၫလၧဆၧ ဖိၪဆၧဎါအဂဲးအကၠီၪ့, ဒဲလၧထိၪၥံၪ လံၪၥံၪအဂဲးအ ကၠီၪ့,ဒဲလၧဆၧစွၩၥံၪအဂဲးအကၠီၪ့, ဒဲလၧဒ့ၪၥံၪယၪ",
			"34": "<sup>34</sup> ၥံၪအဂဲးအကၠီၪ့လီၫ.- လၧကယဲဂၪ့ခိၪအစဎွၩအအီၪ လၧအနါဂၧၫ့ယူၭအဆၧကိၪ့ၥ့ၪအဂဲးအကၠီၪ့နီၪ, ၦၡၩ လၧၦဆၨၩထီးအလူၬအကျၩ ဂဲၫဘဲၫအမိနါဂၧၫ့စစီလ မၧၫ့အဆၧကိၪ့ၥ့ၪကိၪ့ဘၪအၥိၭနီၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> တၭတဲအၫအစဎွၩဟဲရၫ့ အၪ့မၧၫ့လၩ့အခ့ၫအၡၩ လၧစစီလမၧၫ့အအီၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအနါဂၧၫ့ လၧၦဂုၪယူၭဝ့ၫလၧစဎွၩလၧအဖါ အလးနီၪလီၫ.အ ဂဲးဘဲၫယီၩစဟဲရၫ့မွဲၦလၧအအဲၪ စဒၫဝံၭနီၪကိၭမုနံၩ",
			"2": "<sup>2</sup> ကိၭမုနၩဒ့ၭလီၫ.- စစီလမၧၫ့အၪ့မၧၫ့လၩ့ဆၧလၧစဟဲ",
			"3": "<sup>3</sup> ရၫ့တၭစံၭဝ့ၫဒၪ,- နၥ့ၪယၫလၧယဖါစဒၫဝံၭမၩဂံၪ့လၧ ယဟိဝၩအဝ့ၫဒၪအယွၩ အမံၩ့အဂးလၥ့ၪဘၪလၧဆၧ ဒုၭၥုၭအီၪဝၬဖီၩ့ဝ့ၫအကၠီၩ့, ထီးလၧယဟိဝၩအီၪက့ၪ",
			"4": "<sup>4</sup> လၩ့အဝ့ၫၥံၪလၧအခၪ့ယၫၥၭအဖၫ့လၬလီၫ.- ဘိၩ့နဲၪ့ ယီၩယဟိဝၩဒုၭအီၪပွံၭ ဆၧဝၬဖီၩ့ယၧၩတၭ, ဆၧအ ဒုၪဒၩအီၪအ့ၬ, တၭဆၧအၧၩ့, လမံၩ့မံၩ့နီၪ အီၪထၪ့",
			"5": "<sup>5</sup> အ့ၬ.- တၭယိခွါ, ယစံၭလၧယမိမၩဂံၪ့လၧယဟိဝၩ ယယွၩအမံၩ့အဂး, ဘဲၫယဟိဝၩချဲၩ့ဆၧလၧယဖါစဒၫ ဝံၭအၥိၭတၭ, စံၭဝ့ၫဒၪ, နဖိၪခွၫလၧယမိအီၪက့ၪလၧန လးဆီၩ့ဆီလၧနလးလဂၩနီၪ, အဝ့ၫဒၪမိဘၪမၩဂံၪ့လၧ",
			"6": "<sup>6</sup> ယမံၩ့အဂးလီၫ.- တၭဘိၩ့နဲၪ့ယီၩမၪလူၬဆၧလၧၦမိ ခူၬၥံၪ့ၡိၫအ့ရ့ၭလၧလ့ၭဘနၧၫ့အလီၩ့ လၧယဂးဆံၭ. တၭယခ့ၫယၡၩမိအီၪ လၧနခ့ၫနၡၩအၥိၭတၭ, ယမိ ဖ့ၪလၫ့နၧၩလၧနခ့ၫနၡၩအလံၩ့အလဲၫ, ဘဲၫကယဲဆၧ လၧနမိစံၭဆၧအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ နၥ့ၪယၫ လၧၦတဲၩၥံၪ့ၥ့ၪ ဘဲၫၦစဲဒၧၫ့ဖိၪအၥိၭ အီၪလၧပကျၩ အ့ၬ.",
			"7": "<sup>7</sup> ထီးစဟဲရၫ့နါဂၧၫ့စစီလမၧၫ့အဆၧချဲၩ့တၭ, ဆၧ မၩအၥၭလၧအၥၭထိၬဒိၪဒိၪလ့ၬတၭ, စံၭဝ့ၫဒၪ,ယဟိဝၩ လၧအဖ့ၪလၫ့စဒၫဝံၭလၧအဖိၪခွၫ လၧအကိၪ့ဆၧၥ့ၪ လၧၦခမျၧးဖၭဒိၪယီၩ အဖၫ့ခိၪနီၪ, မွဲအဘၪ ဆၧစံၭ",
			"8": "<sup>8</sup> ထၪ့အၪ့အူၭလၧမုဆၫလနံၩယီၩဆံၭ. စဟဲရၫ့အၪ့မၧၫ့ လၩ့ဆၧလၧစစီလမၧၫ့အအီၪတၭ, စံၭဝ့ၫဒၪ,ယနါဂၧၫ့ ဆၧလဖၪအဂဲးအကၠီၪ့တၭ, ဆၧမိမၩဘၪအၥၭကယဲ ဆၧလၧအဘၪနၥၭလၧၥံၪ့ၡိၫအ့ရ့ၭ, ဒဲၥံၪ့ၡိၫနီၪထီးအ",
			"9": "<sup>9</sup> လူၬလီၫ.- ယခ့ၫယၡၩမိဘၪဂဲၫဆိၬဝ့ၫလၧလ့ၭဘနၧၫ့ ထီၩ့လၧမၫဆမံၭတၭ, ယမိၥိၫ့အဝ့ၫၥံၪ လၧမၫဆမံၭ ဖၧၩ့လၧဖီၩ့ဖၧၩ့ဖိးလၧအလး လၧနမိအၪ့မၧၫ့လၩ့ဆၧ လၧအအီၪတၭ, ယမိအၪ့မၧၫ့အစိၭထၪ့ ထီးနီၪတၭ, နမိမၩန့ဝ့ၫတၭ, နမိဖ့ၪလၫ့ဆၧအၪ့ လၧယၡၩဂံၪ့ဖိၪ တၭ,နမိမၩဆၧလၧအဘၪယၥၭလီၫ.",
			"10": "<sup>10</sup> တၭစဟဲရၫ့ဖ့ၪလၫ့စစီလမၧၫ့ လၧၥံၫ့ၡိၫအ့ရ့ၭၥံၪ,",
			"11": "<sup>11</sup> ဒဲၥံၪ့ၡိၫၥံၪ, ကယဲဆၧလၧအဘၪအၥၭလီၫ.- တၭစစီ လမၧၫ့ဖ့ၪလၫ့စဟဲရၫ့ လၧဘုၪကၠိၩ့အကီၫနံၫလၬလၧ အၡၩဂံၪ့ဖိၪအဂး, ဒဲၥိၪဎံၪအကီၫနံၫဆံၫလီၫ. တၭစစီ လမၧၫ့ဖ့ၪလၫ့ဝ့ၫလၧစဟဲရၫ့လနံၪ့ဘၪလနံၪ့ ဘဲၫနီၪၥိၭ",
			"12": "<sup>12</sup> လီၫ.- ယဟိဝၩဖ့ၪလၫ့စစီလမၧၫ့ လၧဆၧကိၪ့ၥ့ၪဘဲၫ အစံၭဝဲၩဝ့ၫအၥိၭနီၪတၭ, စဟဲရၫ့ဒဲစစီလမၧၫ့အီၪဘၪ လိၬအိၭလိၬအၥၭတၭ, အုၩ့လၩ့လိၬအၥၭနံၫဂၩလူၬ လီၫ.",
			"13": "<sup>13</sup> စစီလမၧၫ့အၪ့မၧၫ့ ၦမၩဆၧလၧအဖ့ၪလၫ့အခီၫ့ အလးတၭ,ဆၧလၧအမၩဝ့ၫနီၪ မွဲၦၡၩၥၧၫ့လၬလီၫ.",
			"14": "<sup>14</sup> တၭအၪ့မၧၫ့လၩ့ဝ့ၫလၧလ့ၭဘနၧၫ့, လၩလဘံၪ့ၦၡၩလ လၬ,ဘဲၫအဆၧၫ့အီၪဝ့ၫလဆၫ့ လဆၫ့အၥိၭနီၪလီၫ. အီၪဝ့ၫလၧလ့ၭဘနၧၫ့အလီၩ့လၩလဘံၪ့တၭ, အီၪဝ့ၫ လၧဂံၪ့လၩနံၫဘံၪ့လီၫ. စအၭဒနဲရၫ့အီၪဝ့ၫလၧၦမၩ",
			"15": "<sup>15</sup> ဆၧလၧအဖ့ၪလၫ့အခီၫ့အဖၫ့ခိၪလီၫ.- စစီလမၧၫ့အီၪ လၧၦၡၩအွံၪဆၧယိၭဆၧနွ့ၫလၬ, ဒဲၦလၧအတဲၩၥံၪ့",
			"16": "<sup>16</sup> လၧခိၪလီၩ့ခိၪအီၪဝ့ၫဎိၭလၬလီၫ.- တၭလၧစစီလမၧၫ့ အီၪလၧၦဒိၪဖၭဒိၪလၧအအီၪဝ့ၫလၧ ဆၧမၩအဖၫ့ခိၪ အမ့ၬယၫနီၪ, ၦအီၪၥၧၫ့ထီၫ့ၥၧၫ့ယၩ လၧအပၧၩ့ၦခ",
			"17": "<sup>17</sup> မျၧးလၧအမၩဆၧလီၫ.- စဎွၩမၪလူၬဆၧတၭ,ၦဂဲၫဆိၬ လိးဖၭဒိၪ, ဒဲလိးလၧအလူဒိၪဎွ့ၩဒိၪ, လိးစိၭဖျၩအၥၭ လဖၪနီၪဘဲၫၥိၭအမိအီၪက့ၪလၩ့ဂံၪ့ အခၪ့ထံၭနီၪလီၫ.",
			"18": "<sup>18</sup> စစီလမၧၫ့အၡၩမၩဆၧၥ့ၪ, ဒဲစဟဲရၫ့အၡၩမၩဆၧၥ့ၪ လဖၪနီၪ, ဒဲမၩဎၩ့လိးၥံၪစိၭဖျၩဝ့ၫလီၫ. အဝ့ၫၥံၪတဲၩ့ ဝဲၩၥံၪ့ၥံၪဒဲလိးၥံၪ ဘဲၫၥိၭအမိမၩဂံၪ့ဘဲၫနီၪလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> တၭလၧၦအံၫစရ့လၭဖိၪစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအ လးခဲၫ့အနံၪ့လံယၩဎိၭဆံၫလနံၪ့နီၪ, လၧစစီလမၧၫ့ ကဲၪစဎွၩလၧအံၫစရ့လၭ အဖၫ့ခိၪလံနံၪ့လနံၪ့လၧ လၩဇံဖၭအဖၧၩ့ လၧအမွဲလၩနံၫဘံၪ့လဘံၪ့နီၪဆၧ မၩအၥၭလၧစစီလမၧၫ့ မၩထၪ့ၥၫ့ ယဟိဝၩ အဂံၪ့ လီၫ.",
			"2": "<sup>2</sup> တၭဂံၪ့လၧစစီလမၧၫ့မၩဝ့ၫ လၧယဟိဝၩအဂးနီၪ အဖၭထီၫမွဲအဖျါဎူၫဆံၫ, ဒဲအဒၪ့ဎၩ့အဖျါနံၫဆံၫ,ဒဲအ",
			"3": "<sup>3</sup> ဆီၩ့ဆီထၪ့အဖျါၥၧၫ့ဆံၫလီၫ.- တၭအလးလၧနီးအ မ့ၬယၫ, ထိၬချိၫ့နီၪ အဖၭထီၫအဖျါနံၫဆံၫ ဘဲၫဂံၪ့အ ဒၪ့ဎၩ့အၥိၭး လၧဂံၪ့အမ့ၬယၫနီၪ အဒၪ့ဎၩ့ ဆံၫဖျါ",
			"4": "<sup>4</sup> လီၫ.- တၭမၩတရၫ့ လံၩလဖၪ အဲၪ့လၧအချိၫ့လခီၫ",
			"5": "<sup>5</sup> တၭ,လဲလၧအဖၧၩ့လခီၫလၧဂံၪ့အဂးလီၫ.- တၭမၩ ဒူၭဖၧၩ့ဘုၭထၬလၧဂံၪ့အဒီၪ့ဝၬဖီၩ့ဝ့ၫ, ဝၬဖီၩ့နီးနီၪ, ဒဲ လၧချဲၩ့ဆၧအလးနီၪလီၫ. တၭမၩဒူၭဖၧၩ့ ဝၬဖီၩ့ဝ့ၫ",
			"6": "<sup>6</sup> လီၫ.- ဒူၭအဖၫ့လၬထုၬလစီၪ့နီၪ အဒၪ့ဎၩ့မွဲယဲဖျါတၭ, ဒူၭအကျၩလစီၪ့နီၪအဒၪ့ဎၩ့ ဎူၫဖျါတၭ,ဒူၭၥၧၫ့ဆၫ့လ ဆၫ့နီၪအဒၪ့ဎၩ့မွဲနွ့ၫဖျါလီၫ. အဂဲးဘဲၫယီၩ လၧဂံၪ့ အချိၫ့နီၪမၩဝ့ၫအခၪ့အအဲၪ့လဖၪ ဝၬဖီၩ့ဝ့ၫ,ဘဲၫၥိၭ ဎွံၩ့လဖၪအထီးဘၪ ဆၧမၩထၬဝ့ၫလၧဂံၪ့ဒီၪ့ဖၧၩ့လ",
			"7": "<sup>7</sup> ဂ့ၩလီၫ.- တၭထီးအမၩဂံၪ့နီၪ, ၦမၩဝ့ၫလၧလိးတဲၩ့ ဝဲၩအၥၭ, လၧၦလချႃၭဂဲၫဆိၬဒံၭဘၪ ထီးနီၪတၭး ထီးအမၩဂံၪ့နီၪ, စၭခုၫမွဲဂ့ၩ, ကွၩမွဲဂ့ၩ,ထီးဒၪအဎၧၩ့ အဎီထၭမွဲဂ့ၩ, မွဲအထီးဂၧၫ့ထၪ့ဘၪ လၧဂံၪ့ဖၧၩ့လ",
			"8": "<sup>8</sup> ဂ့ၩ.- ဒူၭအၥၭကျၩအတရၫ့နီၪ အီၪဝ့ၫလၧအဂံၪ့အပၪ လၧစူၪထွ့ၪလခီၫတၭး ၦလ့ၩထၪ့လၧအၥၭကျၩနီၪ လၧဎၫ့ဝံၬအၥၭ, ဒဲစဲၪ့ထၪ့လၧအၥၭကျၩနီၪနုၬလၧၥၧၫ့",
			"9": "<sup>9</sup> ဆၫ့လဆၫ့နီၪလီၫ.- မၩဂံၪ့နီၪ,မၩဂီၩ့ဝ့ၫတၭး မၩဂံၪ့ခိၪ",
			"10": "<sup>10</sup> အဂၩ့ဖၩၥံၪဒဲၥံၪ့ပၪၥံၪ မွဲၥံၪ့ၡိၫအ့ရ့ၭလီၫ.- မၩဒူၭဖၧၩ့ လၧဂံၪ့ထၧၫ့ဖျိၪ့ယၫအနဲၩ့ထံၭ, အဆီၩ့ဆီထၪ့ယဲဖျါ တၭ,ဒိၭနဲၩ့အၥၭလၧဂံၪ့နီၪအီၪလၧၥံၪ့ၡိၫအ့ရ့ၭလီၫ.",
			"11": "<sup>11</sup> ယဟိဝၩအလူလၩ့ဘၪ စစီလမၧၫ့တၭ,စံၭဝ့ၫဒၪး",
			"12": "<sup>12</sup> ဆၧလၧဂံၪ့လၧနမၩယီၩ နအ့ၪလ့ၩလၧယဆၧၥီၪ့ဆၧ ၥၫ့အဖၧၩ့,ဒဲမၩယဆၧစ့ၩရၫ့, ဒဲထီးန့ယဆၧမၪလူၬ ထီးအလူၬဘဲၫၥိၭနမိလ့ၩဆၧလၧအဖၧၩ့တၭ, ယမိဒုၭ ကဲၪထၪ့ယဆၧချဲၩ့လၧနဂးလၧ ယချဲၩ့ဆၧလၧနဖါစဒၫ",
			"13": "<sup>13</sup> ဝံၭနီၪလီၫ.- ယမိအီၪလၧအံၫစရ့လၭဖိၪအကျၩတၭ, ယစဲၪ့ဒၪယၡၩခမျၧးအံၫစရ့လၭအ့ၬ.",
			"14": "<sup>14</sup> စစီလမၧၫ့မၩဂံၪ့တၭမၩဂီၩ့ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> တၭအဝ့ၫမၩဂံၪ့အဒီၪ့လၧအဖၧၩ့လခီၫ ၥံၪ့ပၪလၧ ၥံၪ့ၡိၫအ့ရ့ၭလၧဂံၪ့အဒၩလၩ့ဖိးလၧဂံၪ့ခိၪအဒၩနီၪ, မၩ ဘံၭဝ့ၫအဖၧၩ့လခီၫလၧၥံၪ့တၭ, ဒၩလၩ့ဂံၪ့အဒၩလၧၥံၪ့",
			"16": "<sup>16</sup> ပၪၡိၫအတၪ့လီၫ.- တၭလၧဂံၪ့အဒီၪ့ၥံၪမၩထၪ့ဝ့ၫအ ဖျါနံၫဆံၫ, အဒၩမွဲဂ့ၩ, အဒီၪ့ၥံၪမွဲဂ့ၩလၧၥံၪ့ပၪၡိၫအ့ ရ့ၭလီၫ.မၩထၪ့ဝ့ၫလၧအဖၧၩ့လခီၫ အဂးဒၪလ့ၬ,လၧ ချဲၩ့ဆၧအလးအဂး, လၧလးဆံၫ့ဎံၪထုၬအဂးဆ့လီၫ.",
			"17": "<sup>17</sup> တၭလၧဂံၪ့အမ့ၬယၫ, နီးနီၪအီၪဝ့ၫအဖျါလံဆံၫလီၫ.",
			"18": "<sup>18</sup> တၭဂံၪ့အၥံၪ့ၡိၫအ့ရ့ၭလၧအဖၧၩ့လခီၫနီၪ, ဒ့ၭကံၪအ ၥၭလၧထံၫလုၩၥၪ,ဒဲဖီၫလီၫ. မွဲၥံၪ့ၡိၫအ့ရ့ၭထီးအလူၬ",
			"19": "<sup>19</sup> လိးအီၪဖျီၪနးစီၪ့အ့ၬ.- တၭချဲၩ့ဆၧအလးနီၪမၩဝ့ၫလၧ ဂံၪ့အဖၧၩ့, ဘဲၫၥိၭအမိအီၪက့ၪ ယဟိဝၩအဆၧအုၩ့",
			"20": "<sup>20</sup> လၩ့အတလၫထီးနီၪလီၫ.- တၭချဲၩ့ဆၧအလးလၧအ မ့ၬယၫနီၪအဖၭထီၫမွဲအဖျါနံၫဆံၫ, ဒဲအဒၪ့ဎၩ့အဖျါ နံၫဆံၫ,ဒဲအဆီၩ့ဆီထၪ့အဖျါနံၫဆံၫလီၫ. ဖၩ့ဝ့ၫလၧ ထီၫ့ဆံၫ့တၭ, ကျၭထၬဆၧလုအလး လၧၥံၪ့ၡိၫအ့ရ့ၭ",
			"21": "<sup>21</sup> လီၫ.- တၭစစီလမၧၫ့ဖၩ့ဂံၪ့အဖၧၩ့လခီၫ လၧထီၫ့ဆံၫ့ တၭ,မၩဆၧအဒီၪ့လၧၥွ့ၫထီၫ့ လၧချဲၩ့ဆၧအလးအ",
			"22": "<sup>22</sup> မ့ၬယၫလီၫ. တၭဖၩ့ဝ့ၫလၧထီၫ့လီၫ.- အဝ့ၫဒၪဖၩ့ဂံၪ့ ထၧၫ့ဖျိၪ့ယၫ လၧထီၫ့ထီးအမၩဂီၩ့ဂံၪ့ ထၧၫ့ဖျိၪ့ယၫ လီၫ.တၭဖၩ့ဆၧလုအလးလၧအအီၪဝ့ၫ လၧချဲၩ့ဆၧ အလးအနဲၩ့ထံၭလၧထီၫ့ ထၧၫ့ဖျိၪ့ယၫဆ့လီၫ.",
			"23": "<sup>23</sup> တၭလၧချဲၩ့ဆၧအလးဖၧၩ့ တဲၩ့ခ့ၫရူၬလဖၪလၧၥံၪ့",
			"24": "<sup>24</sup> အလဲအိၫ့နံၫဒုၩ, အထၪ့ထီၫမွဲဆံၫဖျါလီၫ.- တၭခ့ၫရူၬ အဒံၭလခီၫယဲဖျါ, ဒဲခ့ၫရူၬအဒံၭလခီၫဒၪယဲဖျါ,လၧ အဒံၭလခီၫအထုၬ ဖိးလၧအဒံၭ လခီၫဒၪအထုၬနီၪ မွဲ",
			"25": "<sup>25</sup> ဆံၫဖျါလီၫ.- တၭခ့ၫရူၬလဒုၩဒၪနီၪမွဲဆံၫဖျါလီၫ. ခ့ၫ ရူၬနံၫဒုၩလူၬနီၪ မွဲအဖျါဎွ့ၩဎီၩ့, ဒဲအခံးအဂၩ့န့ၫဎီၩ့",
			"26": "<sup>26</sup> လိၬအၥၭဆ့လီၫ.- ခ့ၫရူၬလဒုၩနီၪအထၪ့ထီၫမွဲဆံၫဖျါ, ဒဲခ့ၫရူၬလဒုၩဒၪဆ့, မီၪ့ဎီၩ့လိၬအၥၭနံၫဒုၩလူၬလီၫ.",
			"27": "<sup>27</sup> ခ့ၫရူၬလဖၪနီၪအီၪက့ၪဝ့ၫလၧဂံၪ့ လၧယၫအဖၧၩ့လခီၫ တၭ,အဝ့ၫၥံၪဒုၭယၩ့ထၪ့ ခ့ၫရူၬလဖၪအဒံၭတၭ, လ ဒုၩအဒံၭဘုၭစိၩလၧဆၧဒီၪ့တၭ, ခ့ၫရူၬလဒုၩဒၪအဒံၭ ဘုၭစိၩလၧဆၧဒီၪ့ဂူၫဂၩတၭ, အဝ့ၫၥံၪအဒံၭထိၭဘုၭ",
			"28": "<sup>28</sup> လိၬအၥၭလၧအဂံၪ့အၥၭကျၩနီၪလီၫ.- အဝ့ၫၥံၪဖၩ့ခ့ၫ ရူၬလဖၪလၧထီၫ့လီၫ.",
			"29": "<sup>29</sup> တၭဒ့ၭကံၪဂံၪ့အဒီၪ့ဝၬဖီၩ့ထီးအလူၬ လၧခ့ၫရူၬအ ဂၩ့,ဒဲၥံၪ့စီၩ့မလီၫ့, ဒဲဖီၫၥံၪအဂၩ့လဖၪ, လၧအဖၧၩ့ဒဲ",
			"30": "<sup>30</sup> လၧအချိၫ့လီၫ.- တၭဂံၪ့အဒၩလၩ့နီၪ ဖၩ့ဝ့ၫလၧထီၫ့ လၧအချိၫ့ဒဲလၧအဖၧၩ့လီၫ.",
			"31": "<sup>31</sup> တၭဆၧလ့ၩနုၬလၧချဲၩ့ဆၧအလးအဂးနီၪ တဲၩ့တ ရၫ့လၧၥံၪ့အလဲအိၫ့လီၫ. လၧတရၫ့အဖိၫဆိၬဒဲတရၫ့ အထုၪ့နီၪမွဲယဲခီၫလီၫ.",
			"32": "<sup>32</sup> တရၫ့နံၫဘံၪ့နီၪဆ့မွဲၥံၪ့အလဲအိၫ့တၭ, ဒ့ၭကံၪဝ့ၫလၧ ခ့ၫရူၬၥံၪဒဲစီၩ့မလီၫ့ဒဲဖီၫလဖၪလၧအလီၩ့, ဒဲဖၩ့ဝ့ၫလၧ ထီၫ့တၭ,ဖၩ့ခ့ၫရူၬ, ဒဲစီၩ့မလီၫ့လၧထီၫ့နီၪလီၫ.",
			"33": "<sup>33</sup> ဘဲၫနီၪၥိၭဆ့လၧ နီးအတရၫ့အထုၪ့လဖၪအဂးမၩ ဝ့ၫလၧၥံၪ့အလဲအိၫ့တၭ, အီၪဝ့ၫလံပိၩ့လပိၩ့လီၫ.တ",
			"34": "<sup>34</sup> ရၫ့နံၫဘံၪ့နီၪမွဲၥံၪ့ၡိၫလီၫ.- တရၫ့လဘံၪ့အလၪနံၫခီၫ ခါချံၭအၥၭ,ဒဲတရၫ့လဘံၪ့ဒၪအလၪနံၫခီၫခါချံၭအၥၭ",
			"35": "<sup>35</sup> လီၫ.- တၭဒ့ၭကံၪခ့ၫရူၬဒဲၥံၪ့စီၩ့မလီၫ့, ဒဲဖီၫလၧအ လီၩ့,တၭဖၩ့ဝ့ၫလၧထီၫ့ဘုၭထၬလိၬအၥၭ လၧဆၧဒ့ၭကံၪ ဝ့ၫလီၫ.",
			"36": "<sup>36</sup> တၭမၩဆၧဝၩ့ထၬ လၧအဖၧၩ့လဆၫ့လၧလိးစိၭဖျၩ ဝ့ၫၥၧၫ့ဂဲး, ဒဲၥံၪ့ၡိၫအ့ရ့ၭအထုၪ့လဂဲးလီၫ.",
			"37": "<sup>37</sup> တၭလၧလံနံၪ့လနံၪ့ လၧလၩဇံဖၭအဖၧၩ့နီၪၦအီၪ",
			"38": "<sup>38</sup> က့ၪလၩ့ယဟိဝၩအဂံၪ့အခၪ့ထံၭလီၫ.- အနံၪ့လဆံၫ လနံၪ့လၧလၩဘၧလၭအဖၧၩ့နီၪ, (အဝ့ၫနီၪမွဲလၩဎိၭ ဘံၪ့လဘံၪ့) ၦမၩဂံၪ့ဂီၩ့ဝ့ၫတၭ, ဘဲၫကယဲဆၧချဲၩ့အ ၥိၭ,ဒဲဘဲၫကယဲဆၧစ့ၩရၫ့ ထီးအလူၬ အၥိၭနီၪလီၫ. တၭမၩထၪ့ဂံၪ့နီၪ နွ့ၫနံၪ့အထးဖၧၩ့လီၫ."
		},
		"7": {
			"1": "<sup>1</sup> စစီလမၧၫ့မၩထၪ့အဂံၪ့ဒၪဝ့ၫ လဆံၫၥၧၫ့နံၪ့တၭ, မၩဂီၩ့အဂံၪ့လီၫ.",
			"2": "<sup>2</sup> တၭမၩဆ့ဂံၪ့လဖျိၪ့ လၧလ့ၭဘနၧၫ့အမံၩ့လၬကျၩ အၥံၪ့လီၫ. အထီၫမွဲအဖျါလယၩ, ဒဲအဒၪ့ဎၩ့အဖျါ ယဲဆံၫ,ဒဲအဆီၩ့ဆီထၪ့အဖျါၥၧၫ့ဆံၫလီၫ. အီၪဝ့ၫလၧ ၥံၪ့ၡိၫအ့ရ့ၭ အထုၪ့လံဂဲး, ဒဲဂၩ့ဖၩၥံၪ့ၡိၫအ့ရ့ၭအီၪဝ့ၫ",
			"3": "<sup>3</sup> လၧထုၪ့အဖၫ့ခိၪလီၫ.- တၭအခိၪအီၪဝ့ၫလၧၥံၪ့ၡိၫအ့ ရ့ၭလၧထုၪ့ၥံၪလံဆံၫယဲထုၪ့အဖၫ့ခိၪတၭ, ထုၪ့လဖၪ",
			"4": "<sup>4</sup> လဂဲးလဂဲးနီၪအီၪဝ့ၫလဆံၫယဲထုၪ့လီၫ.- လၧဆၧဖၩ့ မိနုၬအဂး တရၫ့လံၩအီၪဝ့ၫၥၧၫ့ဂဲး လဆိၬဘၪလဆိၬ",
			"5": "<sup>5</sup> အီၪဎၩ့လိၬအၥၭလါခီၫလါခီၫနီၪလီၫ.- ကယဲတရၫ့ ထီးအလူၬ, ဒဲကယဲတရၫ့လံၩအထုၪ့နီၪဎၩ့လိၬၥၭလီၫ. ဆၧဖၩ့နုၬဝ့ၫလဆိၬဘၪလဆိၬ ဆၧၫ့ယၫလိၬအၥၭလါ",
			"6": "<sup>6</sup> ခီၫလါခီၫနီၪအီၪၥၧၫ့ဂဲးလီၫ.- တၭအဝ့ၫဒၪမၩထိၬချိၫ့ လၧဆၧအထုၪ့လဖၪအဖၭထီၫ မွဲအဖျါယဲဆံၫတၭ,အ ဒၪ့ဎၩ့အဖျါၥၧၫ့ဆံၫလီၫ. တၭအထိၬချိၫ့အီၪဝ့ၫလၧအ မ့ၬယၫတၭ, ထုၪ့လဖၪ ဒဲကျူၩတၪ့လဖၪအီၪဝ့ၫလၧ",
			"7": "<sup>7</sup> အဝ့ၫၥံၪအမ့ၬယၫလီၫ.- တၭအဝ့ၫဒၪမၩထိၬချိၫ့လစီၪ့ လၧလးဆီၩ့ဆီအဂး, ထီးအမိစ့ၩရၫ့ဆၧအလး,ဆၧ စ့ၩရၫ့အထိၬချိၫ့လီၫ. တၭၥိၭဝ့ၫအခိၪ လၧၥံၪ့ၡိၫအ့",
			"8": "<sup>8</sup> ရ့ၭလၧအဒၩလခီၫဖိးလၧဝါလခီၫလီၫ.- တၭအဂံၪ့လၧ အအီၪဝ့ၫလၧအဖၧၩ့လဖျိၪ့နီၪ အီၪလၧဝၩ့ အဂူၫဂၩ လစီၪ့လၧအထိၬချိၫ့အမ့ၬယၫလခီၫ လၧဆၧမၩဝ့ၫဘဲၫ နီၪၥိၭလီၫ. တၭစစီလမၧၫ့မၩဂံၪ့လဖျိၪ့ဆ့ လၧဖၫရိၫ အဖိၪမုၪလၧအမၩန့ဝ့ၫလၧအမၫအဂး လၩ့ဂၬထိၬချိၫ့ ယီၩလီၫ.",
			"9": "<sup>9</sup> အဝ့ၫၥံၪနီၪမွဲလိးလၧအဎွ့ၩဒိၪလဖၪ, ဘဲၫလိးစိၭ ဖျၩအၥၭအဆၧထိၪအၥိၭနီၪ ဘၪဆၧတဲၩ့ဝဲၩဝ့ၫလၧ လွ့ၬလၧအချိၫ့ဒဲလၧအဖၧၩ့, လၧအခၪ့ထံၭဖိးလၧအခံၫ, ဒဲအီၪလၧခီၫ့လၧဝၩ့ဖၭဒိၪလၧခီၫ့ မွဲဘဲၫနီၪအၥိၭလီၫ.",
			"10": "<sup>10</sup> တၭအခၪ့ထံၭနီၪအီၪဝ့ၫလၧလိးအဎွ့ၩဒိၪ, လိးဖၭဒိၪ,",
			"11": "<sup>11</sup> လိးဆံၫဖျါ, ဒဲလိးဎိၭဖျါလီၫ.- တၭလၧထၭလခီၫနီၪ အီၪဝ့ၫလၧလိးအဎွ့ၩဒိၪ ဘဲၫလိးစိၭဖျၩအၥၭအဆၧ",
			"12": "<sup>12</sup> ထိၪအၥိၭနီၪ, ဒဲၥံၪ့ၡိၫအ့ရ့ၭလီၫ.- တၭဆၧအဝၩ့ဖၭ ဒိၪအီၪဝၬဖီၩ့ဝ့ၫနီၪ အီၪဝ့ၫလၧလိးစိၭဖျၩအၥၭၥၧၫ့ဂဲး ဒဲဂၩ့ဖၩၥံၪ့ၡိၫအ့ရ့ၭလဂဲး လၧယဟိဝၩအဂံၪ့အဝၩ့ လၧယၫအဂးမွဲဂ့ၩ, ဒဲလၧဂံၪ့အထိၬချိၫ့အဂးမွဲဂ့ၩလီၫ.",
			"13": "<sup>13</sup> တၭစဎွၩစီလမၧၫ့ အၪ့မၧၫ့ၦလ့ၩဆၧလၧတဲအၫနီၪ,",
			"14": "<sup>14</sup> ဂဲၫထဲၩ့ကိၭန့စဟဲရၫ့လီၫ.- အဝ့ၫဒၪမွဲၦမုၪမဲၫလဂၩအ ဖိၪခွၫဘၪဆဲၫ့လၧနၭၥလဲၫအဒီၪ့တၭ, အဖါမွဲၦတဲအၫ ဖိၪ,ၦစူၪၥ့ၪလၧထီးဘၩ့း အနၫ့ဆါဎွ့ၩဝ့ၫလၧဆၧကိၪ့ ၥ့ၪ,ဒဲအၥုၪ့ဆၭအၥၭဆၭတၭ, ကယဲဆၧမၩလၧထီး ဘၩ့နီၪၥ့ၪယၫဝ့ၫထီးအလူၬလီၫ.",
			"15": "<sup>15</sup> အဝ့ၫဒၪဂဲၫဝ့ၫလၧစဎွၩစီလမၧၫ့အအီၪတၭ, မၩ အဆၧမၩထီးအလူၬလီၫ. တၭၥိၫ့ထုၪ့ထီးဘၩ့နံၫထုၪ့ လီၫ.ထုၪ့အထၪ့ထီၫလထုၪ့လထုၪ့နီၪ မွဲလဆံၫဎိၭဖျါ, ဒဲဖျံၩအဖၭထီၫလဆံၫနံၫဖျါ ခဲးဝၬအဝ့ၫၥံၪလထုၪ့လ",
			"16": "<sup>16</sup> ထုၪ့လီၫ.- တၭမၩဝ့ၫအခိၪစီၪ့ထီးဘၩ့အဆံၫ့နံၫဖျိၪ့, ဘဲၫၥိၭအမိအီၪက့ၪဝ့ၫ လၧထုၪ့လဖၪအခိၪလီၫ. ဆၧ အခိၪစီၪ့လဖျိၪ့အထၪ့ထီၫမွဲယဲဖျါ, ဒဲဆၧအခိၪစီၪ့လ",
			"17": "<sup>17</sup> ဖျိၪ့ဒၪအထၪ့ထီၫမွဲယဲဖျါလီၫ.- တၭဆ့ၭကံၪဒီၩ့ၡၬၥံၪ, ဒဲမၩၥွ့ၫချၩ့ၥံၪလၧဆၧအခိၪစီၪ့ လၧအအီၪဝ့ၫလၧထုၪ့ လဖၪအဖၫ့ခိၪအဂး, လၧခိၪစီၪ့လဖျိၪ့အဂးနွ့ၫဒုၩ,လၧ",
			"18": "<sup>18</sup> ခိၪစီၪ့လဖျိၪ့ဒၪအဂးနွ့ၫဒုၩလီၫ.- မၩဝ့ၫအထုၪ့လဖၪ တၭ,ဆၧအဂဲးနံၫဂဲးအီၪဝၬဖီၩ့ဝ့ၫ, လၧဆၧဆ့ၭကံၪဒီၩ့ ၡၬအဆၧမၩလဘံၪ့အဖၫ့ခိၪ ဘဲၫၥိၭအမိချႃၬဘံၭဆၧ အခိၪစီၪ့လၧအအီၪဝ့ၫ လၧအခံၫထိၭလၧၥလဲၩအၥၪ နီၪလီၫ. တၭမၩဝ့ၫအခိၪစီၪ့အဂူၫဂၩ လဖျိၪ့အဂးဘဲၫ နီၪၥိၭလီၫ.",
			"19": "<sup>19</sup> တၭဆၧအခိၪစီၪ့လဖၪ လၧအအီၪဝ့ၫလၧထုၪ့အခံၫ ထိၭနီၪ,မၩကံၪဖီၫယၫ လၧထိၬချိၫ့ဖၧၩ့လံဖျါလီၫ.",
			"20": "<sup>20</sup> တၭဆၧအခိၪစီၪ့လဖၪ လၧနံၫထုၪ့အဖၫ့ခိၪနီၪအီၪဝ့ၫ လၧထၭလခီၫဆ့အီၪဆဲၫဎၩ့ ဒဲအဖျိၪ့လၧအအီၪဝ့ၫလၧ ဆၧဆ့ၭကံၪဒီၩ့ၡၬအနဲၩ့ထံၭလီၫ. ၥလဲၩၥၪနီၪအီၪဝ့ၫ နံၫယၩလၧနံၫဂဲးအဖၧၩ့ ဝၬဖီၩ့ဆၧအခိၪစီၪ့အလဖျိၪ့ အလီၩ့လီၫ.",
			"21": "<sup>21</sup> တၭဘီၩ့ထၪ့ထုၪ့လဖၪနီၪ လၧနီးအထိၬချိၫ့ဖၧၩ့လီၫ. တၭဘီၩ့ထၪ့ထုၪ့လၧစူၪထွ့ၪလခီၫတၭ, ဖျိၬဝ့ၫအမံၩ့ လၧယၫခံၫ့တၭ, ဘီၩ့ထၪ့ထုၪ့လၧစူၪစ့ၪလခီၫတၭ,ဖျိၬ",
			"22": "<sup>22</sup> ဝ့ၫအမံၩ့လၧဘိအၭလီၫ.- တၭမၩကံၪဖီၫယၫလၧထုၪ့ လဖၪ အခံၫထိၭလီၩ့တၭး ထုၪ့လဖၪအဆၧမၩဂီၩ့ ဝ့ၫလီၫ.",
			"23": "<sup>23</sup> အဝ့ၫဒၪၥိၫ့ကမၫထီးဘၩ့လဖျိၪ့, အခိၪဖဲၩ့လခီၫဖိး လၧဝါလခီၫနီၪ, အဖျါလဆံၫလီၫ. အီၪဝ့ၫဝၩ့ဒၩ့တၭ, အလၩ့အိၪ့ယဲဖျါတၭ, ဖျံၩဖၭထီၫအဖျါ ၥၧၫ့ဆံၫနီၪ",
			"24": "<sup>24</sup> ခဲးဝၬဖီၩ့ဝ့ၫလီၫ.- တၭလၧအခိၪဖဲၩ့ ဝၬဖီၩ့အဝ့ၫလၧ ထံၫလုၩၥၪဝၬဖီၩ့ဝ့ၫ, လဖျါဆံၫဖျိၪ့, လဖျါဆံၫဖျိၪ့ဝၬဖီၩ့ ကမၫထၧၫ့ဖျိၪ့ယၫလီၫ. လၧကမၫဘၪၥိၫ့အၥၭတၭ,",
			"25": "<sup>25</sup> ထံၫလုၩၥၪလဖၪနီၪ ဘၪၥိၫ့အၥၭလၧနံၫဂဲးလီၫ.- တၭ အီၪဝ့ၫလၧချီဖၫလဆံၫနံၫဒုၩအဖၫ့ခိၪလီၫ. ၥၧၫ့ဒုၩယိ ဆၧလၧမုဖၩ, ဒဲၥၧၫ့ဒုၩယိဆၧလၧမုနုၬ, ဒဲၥၧၫ့ဒုၩယိ ဆၧလၧမုခံၫ့, ဒဲၥၧၫ့ဒုၩ, ယိဆၧလၧမုထၪ့လခီၫလီၫ. တၭကမၫနီၪအီၪဝ့ၫ လၧအဝ့ၫၥံၪအဖၫ့ခိၪတၭ, အဝ့ၫ ၥံၪထီးအလူၬအခဲၫ့အီၪထဲၩ့လၧအဖၧၩ့လခီၫလီၫ.",
			"26": "<sup>26</sup> ကမၫနီၪအတၪ့အီၪစူၪယၫလခီၫတၭ, အခိၪဖဲၩ့မၩ အၥၭဘဲၫလိၫ့အခိၪဖဲၩ့အၥိၭနီၪ မၩကံၪဝ့ၫလၧဖီၫယၫ အဖီၫလဖၪတၭ, ထီဝ့ၫဘၭၥၫနံၫထီၫ့လီၫ.",
			"27": "<sup>27</sup> တၭမၩဝ့ၫအခၪ့ထီးဘၩ့ဆံၫဖျိၪ့လီၫ. တၭခၪ့လဖျိၪ့ နီၪအဖၭထီၫလံဖျါ, အဒၪ့ဎၩ့လံဖျါ, ဒဲအဆီၩ့ဆီထၪ့မွဲ",
			"28": "<sup>28</sup> ၥၧၫ့ဖျါလီၫ.- တၭခၪ့လဖၪၦမၩဝ့ၫနီၪမွဲဘဲၫယီၩ, အီၪ လၧအခိၪချၩ့တၭ, ခိၪချၩ့နီၪအီၪဝ့ၫလၧခၪ့အဆၧၫ့အ",
			"29": "<sup>29</sup> ဘိၩ့ဆၧၩ့နီၪလီၫ.- တၭလၧခိၪချၩ့အလီၩ့ လၧအအီၪ ဝ့ၫလၧအခၪ့အဆၧၫ့အဘိၩ့ဆၧၩ့နီၪ ဆၬလၥၧၫ့ၥံၪ,ချီ ဖၫၥံၪ, ခ့ၫရူၬၥံၪအီၪဝ့ၫတၭ, လၧဆၬလၥၧၫ့ဒဲချီဖၫအ ဖၫ့ခိၪဒဲလၧအဖၫ့လၬနီၪ ခၪ့အဆၧၫ့အီၪဝ့ၫလၧဖီၫလၩ့",
			"30": "<sup>30</sup> ဆဲၩလဖၪလီၫ.- တၭကယဲဆၧအခၪ့အီၪဝ့ၫလၧလဲၪ့ ပၪထီးဘၩ့လံဘံၪ့, ဒဲအရံၬထီးဘၩ့တၭအနိၪ့လံနိၪ့နီၪ အီၪဝ့ၫလၧဆၧဒိၭထၪ့ထၬလီၫ. လၧအံၪ့ဒိၫ့နီၪအဖၫ့ လၬဆၧဒိၭထၪ့ၥိၫ့အၥၭအီၪဝ့ၫလၧ အနဲၩ့ထံၭကိၭစီၪ့",
			"31": "<sup>31</sup> ဒ့ၭလီၫ.- တၭလၧအံၪ့ဒိၫ့အခိၪထိၭ အချၩ့နီၪအလဲ အီၪဝ့ၫလဖျါလီၫ. အခိၪထိၭအီၪခွၩ့ဒၩ့ ဘဲၫဆၧမၩအ ခၪ့အၥိၭ,အီၪဝ့ၫလဖျါထၫ, မွဲဆၧဝၩ့ဒၩ့အ့ၬ, မွဲဆၧလံ နိၫ့နီၪလၧၫ့ဎွ့ၩလၧဆၧစိၭဖျၩဝ့ၫလဖၪလီၫ.",
			"32": "<sup>32</sup> တၭလၧအခၪ့ခွၩ့အဖၫ့လၬနီၪ လဲၪ့ပၪလံဘံၪ့အီၪဝ့ၫ, လဲၪ့အရံၬဘုၭထၬလၧဆၧအခၪ့တၭ, လဲၪ့ပၪနီၪအလဲ မွဲလဖျါဒဲလထၫလီၫ.",
			"33": "<sup>33</sup> တၭလဲၫ့ပၪအခံးအဂၩ့နီၪ မၩအၥၭဘဲၫလဲၫ့ၥုၭအ ပၪအခံးအဂၩ့အၥိၭနီၪလီၫ. အလဲၫ့ရံၬ, ဒဲအလဲၫ့ပၪ အနီး,ဒဲအချၩ့ဒဲအဎံၫ့လဖၪနီၪ မွဲဆၧၥိၫ့အၥၭထီးအ",
			"34": "<sup>34</sup> လူၬလီၫ.- ဆၧဒိၭထၪ့ထၬလံဒုၩအီၪဝ့ၫလၧဆၧအခၪ့ လဖျိၪ့အနိၪ့လံနိၪ့အဂးတၭ, ဆၧဒိၭထၪ့ထၬလဖၪနီၪ",
			"35": "<sup>35</sup> ဘၪဆဲၫ့လၧဆၧအခၪ့လီၫ.- လၧဆၧအခၪ့အဖၫ့ခိၪနီၪ ဆၧခွၩ့အထၪ့ထီၫလထၫအီၪဝ့ၫတၭ, ဆၧလၧအခၪ့အ ခိၪ,ဒဲအဆၧအဆၧၫ့, ဒဲအဆၧခိၪချၩ့နီၪမွဲဆၧလမံၩ့ဎး",
			"36": "<sup>36</sup> လီၫ.- တၭလၧဆၧအဆၧၫ့အလီၩ့နီၪ, ဒဲလၧဆၧအခိၪ ချၩ့အလီၩ့နီၪကွ့ၭဝ့ၫလၧခ့ၫရူၬၥံၪ, ဆၬလၥၧၫ့ၥံၪ, ဒဲ ၥံၪ့စီၩ့မလီၫ့ဘဲၫအလးအီၪပျီၩဝ့ၫအၥိၭနီၪ ဝၬဖီၩ့ဝ့ၫဒၪ လီၫ.",
			"37": "<sup>37</sup> ဘဲၫနီၪအၥိၭမၩဝ့ၫလၧအခၪ့ဆံၫဖျိၪ့လီၫ. အီၪလၧ ဆၧၥိၫ့ဝ့ၫလမံၩ့ဎး, အထိၪထီၫဎီၩ့, အခံးအဂၩ့န့ၫဎီၩ့",
			"38": "<sup>38</sup> လီၫ.- တၭအဝ့ၫဒၪ မၩအံၪ့ဒိၫ့ထီးဘၩ့ ဆံၫဖျိၪ့လီၫ. အံၪ့ဒိၫ့လဖျိၪ့ထီဝ့ၫ ဘၭၥၫလံဆံၫ, အံၪ့ဒိၫ့လဖျိၪ့လ ဖျိၪ့နီၪအီၪဝ့ၫလံဖျါ, လၧခၪ့ဆံၫဖျိၪ့လဖျိၪ့လဖျိၪ့အဖၫ့ ခိၪနီၪ အံၪ့ဒိၫ့အီၪဝ့ၫလဖျိၪ့ကိၭဖျိၪ့ဒ့ၭဆုၬဆုၬလီၫ.",
			"39": "<sup>39</sup> အီၪက့ၪလၩ့ဆၧအခၪ့ယဲဖျိၪ့ လၧဂံၪ့အစူၪထွ့ၪလခီၫ, ဒဲယဲဖျိၪ့လၧဂံၪ့အစူၪစ့ၪလခီၫတၭ, အီၪက့ၪကမၫနီၪ လၧဂံၪ့အစူၪထွ့ၪလခီၫ လၧမုထၪ့ဆဲၫဎၩ့ လၧမုခံၫ့လ",
			"40": "<sup>40</sup> ခီၫနီၪလီၫ.- တၭစဟဲရၫ့မၩအံၪ့ဒိၫ့လဖၪ, ဒဲဆွးၥံၪ, ဒဲ လိၫ့ၥံၪနီၪလီၫ.",
			"41": "<sup>41</sup> တၭစဟဲရၫ့ မၩဂီၩ့ဆၧမၩထီးလူၬ လၧအမၩလၧ စဎွၩစီလမၧၫ့အဂး လၧယဟိဝၩအဂံၪ့အဂး, ထုၪ့ဖၭ ဒိၪနံၫထုၪ့နီၪ, ဒဲဆၧအဖျိၪ့ဒိၪ့ လၧဆၧအခိၪစီၪ့အဂး လၧအအီၪဝ့ၫလၧထုၪ့ဖၭဒိၪနံၫထုၪ့အခံၫထိၭ, ဒဲဆၧ ဆ့ၭကံၪဒီၩ့ၡၬနံၫဘံၪ့ ဘဲၫၥိၭအမိချႃၬဘံၭဆၧအခိၪ စီၪ့အဖျိၪ့ဒိၪ့နံၫဖျိၪ့ လၧအအီၪဝ့ၫလၧထုၪ့ဖၭဒိၪအဖၫ့",
			"42": "<sup>42</sup> ခိၪနီၪး- ဒဲၥလဲၩၥၪလံယၩ လၧဆၧဆ့ၭကံၪဒီၩ့ၡၬနံၫ ဘံၪ့အဂး, ၥလဲၩၥၪနံၫဂဲး လၧဆၧဆ့ၭကံၪဒီၩ့ၡၬလ ဘံၪ့အဂး, ဘဲၫၥိၭအမိချႃၬဘံၭဆၧအခိၪစီၪ့အဖျိၪ့ဒိၪ့ နံၫဖျိၪ့အီၪဝ့ၫလၧထုၪ့ဖၭဒိၪလဖၪ အဖၫ့ခိၪနီၪလီၫ.",
			"43": "<sup>43</sup> တၭဆၧအခၪ့ဆံၫဖျိၪ့, ဒဲအံၪ့ဒိၫ့ဆံၫဖျိၪ့လၧအအီၪဝ့ၫ",
			"44": "<sup>44</sup> လၧခၪ့လဖၪအဖၫ့ခိၪ,- ဒဲကမၫလဖျိၪ့, ဒဲချီဖၫလဆံၫ",
			"45": "<sup>45</sup> နံၫဒုၩအီၪဝ့ၫလၧကမၫအဖၫ့လၬ,- ဒဲဖၧၩ့ၥံၪ,ဒဲဆွးၥံၪ, ဒဲလိၫ့ၥံၪလီၫ. တၭကယဲဆၧအဎၧၩ့အဎီ လၧစဟဲရၫ့ မၩဝ့ၫလၧစဎွၩစီလမၧၫ့အဂး, လၧယဟိဝၩ အဂံၪ့အ",
			"46": "<sup>46</sup> ဂးနီၪမွဲထီးဘၩ့ဆံၫ့ ထီးအလူၬလီၫ.- လၧယီၫဒၫ့အ ဆၧပျၩ့ဖၧၩ့, လၧစၧကီၭဒဲဇၫၥၫ့အဘိၩ့ဆၧၩ့ လၧဖံၬ",
			"47": "<sup>47</sup> ယဲၩအကျၩနီၪ,စဎွၩၥိၫ့ဝ့ၫလီၫ.- တၭဆၧဖိၪဆၧလံၩ နီၪမွဲအအီၪအၪအၪလ့ၬတၭ, စစီလမၧၫ့လခံၫ့ဘၪဝ့ၫ တၭးၥိၫ့ဝ့ၫလီၫ. ထီးဘၩ့အလယၧးနီၪ မွဲအအီၪဆံၭ အၪလဲၪၦၥ့ၪယၫနးဂၩအ့ၬ.",
			"48": "<sup>48</sup> ကယဲယဟိဝၩအဂံၪ့အဎၧၩ့အဎီ ထီးအလူၬနီၪစစီ လမၧၫ့မၩကဲၪထၪ့ဝ့ၫဒၪ, ဆၧလုအလးနီၪလၧထီၫ့,ဒဲစ ပွဲနီၪလၧထီၫ့, လၧဆၧမ့ၬယၫအကိၪအီၪဝ့ၫလၧအဖၫ့",
			"49": "<sup>49</sup> ခိၪ,- ဒဲမ့ၪဒိၩ့ၥံၪလၧထီၫ့ဆံၫ့ယဲဖျိၪ့ အီၪလၧစူၪထွ့ၪ, ဒဲ ယဲဖျိၪ့အီၪလၧစူၪစ့ၪ, လၧချဲၩ့ဆၧအလး အမ့ၬယၫ, လၧဖီၫၥံၪ,ဒဲမ့ၪဒိၩ့ဖိၪၥံၪ, ဒဲဆၧထံၬထၬမ့ၪၥံၪ. ဎမၩဝ့ၫ",
			"50": "<sup>50</sup> လၧၭထီၫ့,- ဒဲထွ့ၫအဖျိၪ့ၥံၪ, ဒဲဆၧထံၬခွံၬမ့ၪဘိၪၥံၪ,ဒဲ လိၫ့ၥံၪ,ဒဲနိၪထိၩ့ၥံၪ, ဒဲဖၧၩ့ၥံၪလၧထီၫ့ဆံၫ့, ဒဲပၭတၫ ထီၫ့ၥံၪလၧဂံၪ့လၧယၫအတရၫ့အဂး, ဆၧအလးဆံၫ့ ဎံၪထုၬ. ဒဲလၧဂံၪ့အတရၫ့အဂး, ဘဲၫၦစံၭဆၧအၥိၭနီး နီၪလီၫ.",
			"51": "<sup>51</sup> ဘဲၫနီၪၥိၭစဎွၩစီလမၧၫ့ မၩဂီၩ့ဆၧမၩထီးအလူၬ လၧယဟိဝၩအဂံၪ့အဂးလီၫ. တၭစစီလမၧၫ့ဂဲၫဆိၬန့ ဆၧလဖၪလၧအဖါစဒၫဝံၭမၩဘိၪ့ဝ့ၫလီၫ. ကျိၪၥံၪစ့ၩ ၥံၪ,ထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲဆၧအဎၧၩ့အဎီနီၪအီၪက့ၪဝ့ၫလၧ ဆၧလူဒိၪဎွ့ၩဒိၪအကျၩ လၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ စစီလမၧၫ့ ဒုၭအီၪကိၩ့အီၪကီၪ့အံၫ စရ့လၭအၥုၪ့က့ၭၥၭၡါလဖၪ, ဒဲအဒီၪ့ၥံၪအခိၪလဖၪ, ၦအံၫစရ့လၭဖိၪ အဖါၥံၪအခိၪလဖၪ လၧစဎွၩစီလ မၧၫ့အအီၪလၧယရုစလံၫ့အဖၧၩ့, ဘဲၫၥိၭအမိဂဲၫဆိၬ ထၪ့ခွံၬယဟိဝၩအဆၧအုၩ့လၩ့ အတလၫလၧစဒၫဝံၭ အဒိၩ့ဖၧၩ့နီၪ, လၧအမွဲဇံအိၫ့လီၫ.",
			"2": "<sup>2</sup> တၭအံၫစရ့လၭအၡၩထီးအလူၬ အီၪကိၩ့အီၪကီၪ့ လၧစဎွၩစီလမၧၫ့အအီၪ လၧဆၧမၩဘိၪ့အဖၧၩ့, လၧ လၩအ့ၥနံၫ့အဖၧၩ့, လၧအမွဲဝ့ၫ လၩနွ့ၫဘံၪ့လဘံၪ့",
			"3": "<sup>3</sup> လီၫ.- အံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါ ထီးအလူၬဂဲၫဝ့ၫ",
			"4": "<sup>4</sup> တၭ,ၦလုဆၧမၩန့ထၪ့တလၫလီၫ.- တၭအဝ့ၫၥံၪဂဲၫ ဆိၬထၪ့ယဟိဝၩအတလၫ, ဒဲဆၧအီၪကီၪ့အတဲၩဆံၫ့ ဎံၪ,ဒဲဆၧဖိၪဆၧလံၩဆံၫ့ဎံၪထီးအလူၬ လၧအအီၪဝ့ၫ လၧတဲၩဆံၫ့ဎံၪအဖၧၩ့, ဆၧလဖၪနီၪၦလုဆၧၥံၪ,ဒဲၦ",
			"5": "<sup>5</sup> လံဝဲၫဖိၪၥံၪဂဲၫဆိၬဝ့ၫလီၫ.- စဎွၩစီလမၧၫ့ ဒဲအံၫစရ့ လၭအဆၧအီၪကီၪ့ထီးအလူၬ လၧအအီၪကီၪ့လၧအ အီၪနီၪ, အီၪဝ့ၫလၧအၥိၭလၧတလၫ အမ့ၬယၫတၭ, လုထၪ့ၥိၪလဖၪ, ဒဲချီဖၫၥံၪအၪလ့ၬ, မွဲအအီၪအၪဒုၩ တၭ,အီၪဎွ့ၩအံၩဎွ့ၩအိၩၦစံၭဝ့ၫအ့ၬး တၭဝံထၪ့နၬ",
			"6": "<sup>6</sup> ထၪ့ဝ့ၫၥ့ၪဝါအ့ၬ.- တၭၦလုဆၧဂဲၫဆိၬ ယဟိဝၩအ ဆၧအုၩ့လၩ့ အတလၫထီၩ့လၧဂံၪ့ အချဲၩ့ဆၧအလး ဖၧၩ့,အလးဆံၫ့ဎံၪထုၬ လၧခ့ၫရူၬလဖၪအဒံၭအဖၫ့",
			"7": "<sup>7</sup> လၬလီၫ.- အဂဲးဘဲၫယီၩခ့ၫရူၬၥံၪယၩ့ထၪ့ အဒံၭနံၫခီၫ လၧတလၫအဖၫ့ခိၪတၭ, ခ့ၫရူၬၥံၪချႃၬဘံၭတလၫနီၪ",
			"8": "<sup>8</sup> ဒဲအနိၪယိၭဘီၩ့လၧအဖၫ့ခိၪလီၫ.- တၭအဝ့ၫၥံၪထုၭ ထၪ့နိၪယိၭဘီၩ့, ထီးနိၪယိၭဘီၩ့အခံၫထိၭၥံၪအီၪဖျီၪ ဝ့ၫလၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့ လၧချဲၩ့ဆၧအလးအ မ့ၬယၫတၭ, လအီၪဖျီၪဘၪလၧခီၫ့တၭ, အီၪဝ့ၫထီးနီၪ",
			"9": "<sup>9</sup> ခီၫ့မုဆၫလနံၩယီၩလီၫ.- တၭဆၧအီၪဝ့ၫလၧတလၫ ဖၧၩ့နးမံၩ့အ့ၬ, အီၪန့ၫလိးပၪနံၫဘံၪ့ လၧစမိစ့ၭ အီၪ က့ၪထီးနီၪလၧဟိရ့ၭ, ထီးယဟိဝၩအုၩ့လၩ့ဆၧလၧ ၦအံၫစရ့လၭဖိၪ, ထီးအဝ့ၫၥံၪဂဲၫစဲၪ့ထၪ့ခွံၬ လၧခးအံ ဇံၭအဖၧၩ့နီၪလီၫ.",
			"10": "<sup>10</sup> ဆၧမၩအၥၭထီးၦလုဆၧ ဂဲၫထဲၩ့ထၪ့လၧဆၧအ လးဆံၫ့ဎံၪနီၪတၭ, ဆၧအုၪ့နီၪ ဎွ့ၩယဟိဝၩအဂံၪ့ဖၧၩ့",
			"11": "<sup>11</sup> လီၫ.- တၭလၧဆၧအုၪ့အကၠီၩ့ ၦလုဆၧလဖၪနီၪဆၧၫ့ ထုၪ့မၩဆၧလၥ့ၪဘၪလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩအ လၩအဖၩ့ဎွ့ၩယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့စစီလမၧၫ့စံၭဝ့ၫဒၪ, ယဟိဝၩစံၭလၧ",
			"13": "<sup>13</sup> အမိအီၪလၧဆၧခံၭတၪ့အဖၧၩ့လီၫ.- ယမၩတၡါယူၭ ဂံၪ့လဖျိၪ့ ဘဲၫၥိၭနမိအီၪလၧအဖၧၩ့, ဆၧအလးခၧၫ့ ဘဲၫၥိၭနမိအီၪလၧအဖၧၩ့ လၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"14": "<sup>14</sup> တၭစဎွၩကၠၪစိၩအမ့ၬတၭ ဆိၪဂ့ၩအံၫစရ့လၭအ ဆၧအီၪကီၪ့ထီးအလူၬ, (တၭအံၫစရ့လၭ အဆၧအီၪ",
			"15": "<sup>15</sup> ကီၪ့ဆၧၫ့ထုၪ့ကိၭဂၩဒ့ၭ,)- တၭအဝ့ၫဒၪစံၭ, ယဟိဝၩ အံၫစရ့လၭအယွၩလၧ အချဲၩ့လၧအနိၭလၧယဖါစဒၫ ဝံၭတၭ, မၩဎွ့ၩထၪ့ဝ့ၫလၧအစူၪလဂၩ, မွဲအဘၪဆၧ",
			"16": "<sup>16</sup> စံၭထၪ့အၪ့အူၭဆံၭ,- တၭစံၭဝ့ၫဒၪ, ခီၫဒၪလၧမုလနံၩ လၧယဂဲၫဆိၬထၪ့ခွံၬ ယၡၩခမျၧး အံၫစရ့လၭလၧအံ ဇံၭအဖၧၩ့နီၪ လၧကယဲအံၫစရ့လၭအဒီၪ့ ထီးအလူၬ အကျၩ ယရွံန့ဘၪဒိၩ့ လၧၦမိမၩဂံၪ့ ဘဲၫၥိၭယမံၩ့မိ အီၪလၧအဖၧၩ့နးဖျိၪ့အ့ၬ. အ့ၪမွဲယရွံန့စဒၫဝံၭဘဲၫၥိၭ အမိအီၪလၧယၡၩခမျၧး အံၫစရ့လၭအဖၫ့ခိၪလီၫ.",
			"17": "<sup>17</sup> တၭအီၪဝ့ၫလၧယဖါစဒၫဝံၭအၥၭ လၧအမိမၩဂံၪ့နး ဖျိၪ့လၧယဟိဝၩအံၫစရ့လၭအယွၩ အမံၩ့အဂးလီၫ.",
			"18": "<sup>18</sup> တၭယဟိဝၩစံၭယဖါစဒၫဝံၭ, မွဲဆၧအီၪလၧနၥၭဖၧၩ့ လၧနမိမၩဂံၪ့ လၧယမံၩ့အဂးတၭ, မွဲနမၩဆၧအဂ့ၩ",
			"19": "<sup>19</sup> လီၫ.- မွဲလါနၫ့နမၩဘၪဂံၪ့နီၪအ့ၬ. အ့ၪမွဲနဖိၪခွၫလၧ အမိဂဲၫထၪ့လၧနယးဒံၩ့ဖၧၩ့လဂၩနီၪ, အဝ့ၫဒၪမိမၩ",
			"20": "<sup>20</sup> ဂံၪ့လဖျိၪ့နီၪလၧယမံၩ့အဂးလီၫ.- ယဟိဝၩမၩလၧၫ့ ထၪ့ဎွ့ၩထၪ့အလူလၧအချဲၩ့ဝ့ၫတၭ, ယဂဲထုၪ့လၧယ ဖါစဒၫဝံၭအလးတၭ, ဆၧၫ့နၩ့လၧအံၫစရ့လၭအလး ဆီၩ့ဆီအဖၫ့ခိၪ ဘဲၫယဟိဝၩ စံၭဝဲၩဆၧအၥိၭတၭ, မၩဂံၪ့လၧယဟိဝၩ အံၫစရ့လၭအယွၩ အမံၩ့အဂး",
			"21": "<sup>21</sup> လီၫ.- တၭယအီၪက့ၪယူၭဆၧအလး ထီးနီၪလၧတလၫ အဂးလၧယဟိဝၩအဆၧအုၩ့လၩ့ အီၪလၧအဖၧၩ့လၧ အအုၩ့လၩ့လၧပဖါၥံၪ ထီးအဂဲၫဆိၬထၪ့ခွံၬအဝ့ၫၥံၪ လၧခးအံဇံၭအဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> တၭစစီလမၧၫ့ဆၧၫ့ထုၪ့ လၧယဟိဝၩအဆၧလုလး အမ့ၬယၫလၧအံၫစရ့လၭ အဆၧအီၪကီၪ့ထီးအလူၬ",
			"23": "<sup>23</sup> အအီၪတၭ, ယူၬထၪ့အစူၪလၧမူၭခိၪ,- စံၭဝ့ၫဒၪ,ယ ဟိဝၩအံၫစရ့လၭအယွၩဧ့, လၧမူၭခိၪထၭမွဲဂ့ၩ, လၧ ဂၪ့ခိၪချိၫ့မွဲဂ့ၩ ယွၩဘဲၫနၧၩအၥိၭအီၪနးဂၩအ့ၬး ယွၩ လၧအထီးန့ဆၧအုၩ့လၩ့, ဒဲဆၧအခိးအတၩလၧနခ့ၫ နၡၩလဖၪလၧအလ့ၩဆၧလၧ နမ့ၬယၫလၧအၥၭထၧၫ့",
			"24": "<sup>24</sup> ဖျိၪ့ယၫး- လၧအထီးန့ဆၧလၧနခ့ၫနၡၩ ယဖါစဒၫဝံၭ လၧဆၧလၧနစံၭဝဲၩလီၫ. တၭနချဲၩ့ဆၧလၧနနိၭတၭ, နမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧ နစူၪဘဲၫလၧမုဆၫလနံၩယီၩ",
			"25": "<sup>25</sup> အၥိၭလီၫ.- အခိးမွဲဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩအံၫစရ့လၭ အယွၩဧ့, ထီးန့ဆၧလၧနခ့ၫနၡၩ ယဖါစဒၫဝံၭလၧဆၧ လၧနချဲၩ့ဝဲၩလၧအဝ့ၫဆံၭ. နစံၭ, ၦဘၪဆဲၫ့လၧနၧၩ မိဆၧၫ့နၩ့လၧအံၫစရ့လၭအလး ဆီၩ့ဆီလဂၩလၩ့ထူၬ ဘၪလၧယမ့ၬယၫအ့ၬ, န့ၫအယီၩလမံၩ့, မွဲနဖိၪနလံၩ ထီးန့အဖၧၩ့ၥၭဘဲၫၥိၭအမိလ့ၩဆၧလၧ ယမ့ၬယၫဘဲၫ နလ့ၩယူၭနဝ့ၫလၧ ယမ့ၬယၫအၥိၭနီၪဆံၭ.",
			"26": "<sup>26</sup> တၭဘိၩ့နဲၪ့ယီၩ, အံၫစရ့လၭအယွၩဧ့,မွဲနမၩတီၩ လါနလူလၧနချဲၩ့ဆၧလၧ နခ့ၫနၡၩယဖါစဒၫဝံၭဆံၭ.",
			"27": "<sup>27</sup> မွဲလါနၫ့ဘိၩယွၩ မိအီၪတၡါလၧဂၪ့ခိၪချိၫ့ဆ့ဧၪ,ယိခွါ, မူၭခိၪဒဲမူၭခိၪအထီၫထုၬနီၪ နအီၪလထီဘၪတၭး ဂံၪ့ လၧယမၩလဖျိၪ့ယီၩ မွဲအဆံၭနဲၪ့အနီၪဆံၭအၪလဲၪ.",
			"28": "<sup>28</sup> တၭကၠၪစိၩနမ့ၬလၧနခ့ၫနၡၩ အဆၧဘၩဆိၪဖၪ,ဒဲ အအၪ့ကံၩ့အၪ့ယၫဆၧဆံၭ, ယဟိဝၩယယွၩဧ့, ထီး န့ဆၧကိၭၡၭထၪ့, ဒဲဆၧဘၩဆိၪဖၪ လၧနခ့ၫနၡၩဘၩ",
			"29": "<sup>29</sup> ဆိၪဖၪလၧနမ့ၬယၫလၧ မုဆၫလနံၩယီၩ,- ဘဲၫၥိၭန မ့ၬၥၪၥံၪမိအီၪဝၩ့ဝဲအၥၭတီၩလၧ ဂံၪ့လဖျိၪ့ယီၩလၧမု ဆၫဒဲလၧမုနၩလၧဆၧအလးလၧ နစံၭလၧအဂဲး,ယမံၩ့ မိအီၪထီးနီၪ, ဘဲၫၥိၭနမိခိၭနၪဆၧဘၩဆိၪဖၪလၧနခ့ၫ",
			"30": "<sup>30</sup> နၡၩဘၩဆိၪဖၪတီၩလၧအလးယီၩဆံၭ.- ထီးအဘၩ ဆိၪဖၪဆၧလၧဆၧအလးယီၩတၭ, ခိၭနၪနခ့ၫနၡၩ,ဒဲ နၡၩခမျၧးအံၫစရ့လၭအအၪ့ယၫဆၧတၭ, ခိၭနၪဆၧ လၧမူၭခိၪ,နအီၪအလး, ထီးနနါဂၧၫ့ဆၧတၭ, ဖျါခွံၬ ဆၧဆံၭ.",
			"31": "<sup>31</sup> ၦလဂၩအ့ၪမၩမၪၦၡၩလဂၩ လၧအနဲၩ့ထံၭတၭ, အၪ့မၧၫ့ဝ့ၫလၧအဆိၪလၩ့အၥၭ လၧအဝ့ၫတၭ, ဆၧ ဆိၪလၩ့အၥၭနီၪ အ့ၪဂဲၫဝ့ၫလၧနဆၧလုလးအမ့ၬယၫ",
			"32": "<sup>32</sup> လၧဂံၪ့လဖျိၪ့ယီၩအဖၧၩ့တၭ,- ထီးနီၪလဖၧၫ့ခိၭနၪန ဝ့ၫလၧမူၭခိၪအဖၧၩ့တၭ, မၩဆၧတၭစ့ၩရၫ့နခ့ၫနၡၩ, ဘဲၫၥိၭနမိဖ့ၪလၫ့ဆၧဒဲၩဘၭ လၧၦလတီၩလလီၩ့ဘၪ, ဘဲၫၥိၭနမိဖ့ၪလၫ့အဖၧၩ့ၥၭ လၧအခိၪဒၪဝ့ၫ အဖၫ့ခိၪ တၭ,ဘဲၫၥိၭနမိအီၪက့ၪတီၩအီၪက့ၪလီၩ့ ၦအတီၩအ လီၩ့,ဘဲၫၥိၭနမိဖ့ၪလၫ့ဝ့ၫ ဘဲၫအဆၧတီၩဆၧလီၩ့အ ၥိၭနီၪဆံၭ.",
			"33": "<sup>33</sup> ထီးနၡၩခမျၧးအံၫစရ့လၭ ဘၪဆၧဖ့ၬခွံၬဝ့ၫလၧအ ဒုၪအဒၩအမ့ၬယၫ လၧအမၩမၪဘၪနၧၩအကၠီၩ့တၭ, ကၠၪထဲၩ့အၥၭလၧနအီၪ, ဒဲစံၭထၪ့အၪ့အူၭနမံၩ့ဒဲဘၩ ဆိၪဖၪဆၧ,ဒဲအၪ့ကံၩ့အၪ့ယၫဆၧလၧနၧၩ လၧဂံၪ့ယီၩ",
			"34": "<sup>34</sup> အဖၧၩ့တၭ,- ထီးနီၪလဖၧၫ့ခိၭနၪနဝ့ၫလၧမူၭခိၪတၭ, ဖျါခွံၬနၡၩခမျၧးအံၫစရ့လၭ အဆၧဒဲၩဘၭတၭ, ဒုၭ ဂဲၫထဲၩ့ဝ့ၫလၧခးလၧ နဖ့ၪလၫ့အဖါလဖၪနီၪဆံၭ.",
			"35": "<sup>35</sup> ထီးမူၭခိၪကၭဘံၭထၬအၥၭနီၪ, လၧအဝ့ၫၥံၪမၩမၪ ဘၪနၧၩအကၠီၩ့ဆၧလဂဲၫဆၧၩ့ဘၪတၭ, ထီးနမၩၡၪ့မၩ နၭဝ့ၫတၭး အ့ၪဘၩဆိၪဖၪဆၧတီၩအလးယီၩ, ဒဲအုၩ့ လၩ့နမံၩ့တၭ, ကၠၪခွံၬအၥၭလၧအဆၧဒဲၩဘၭအအီၪ",
			"36": "<sup>36</sup> တၭး- ထီးနီၪလဖၧၫ့ခိၭနၪနဝ့ၫလၧမူၭခိၪတၭ, ဖျါခွံၬ နခ့ၫနၡၩ,ဒဲနၡၩခမျၧးအံၫစရ့လၭ အဆၧဒဲၩဘၭ, ဘဲၫ ၥိၭနမိၥီၪ့လိၪအဝ့ၫၥံၪလၧ ဖၧၩ့ၥၭအဂ့ၩ လၧအကြၨၭ ဖိၬဝ့ၫတၭ, ဒုၭဂဲၫလၩ့ဆၧဆၧၩ့ လၧခးဖၧၩ့ လၧနဖ့ၪ လၫ့ယူၭနၡၩခမျၧး လၧဆၧန့ၥၫအဂးနီၪဆံၭ.",
			"37": "<sup>37</sup> ဆၧၥၭဝံလၩ့ဒိၩ အ့ၪအီၪလၧခးဖၧၩ့, ဆၧၥံၫခမျၧး, လံၩအူၪမၩဂၭဂီၩ့ဆၧ, ဘုၪအဆၧဆၫထွ့အၪဘၩအ့ၪ အီၪ,ထွ့ဎစံအ့ၪအီၪ, ဒဲအဝ့ၫၥံၪအဒုၪအဒၩအ့ၪဝၩ့ထၬ ဝ့ၫလၧအဝ့ၫၥံၪအဒိၩ့လဖၪအခးဖၧၩ့, ဒဲထီးဒၪဆၧဆၫ",
			"38": "<sup>38</sup> လမံၩ့မံၩ့အ့ၪအီၪတၭ,- ကယဲဆၧဘၩဆိၪဖၪ, ကယဲ ဆၧအၪ့ကံၩ့အၪ့ယၫလၧၦလဂၩဂၩမွဲဂ့ၩ, လၧနခ့ၫန ၡၩခမျၧးအံၫစရ့လၭ ထီးအလူၬမွဲဂ့ၩ, မၩဝ့ၫလၧအၥ့ၪ ယၫအၥၭဒၪဝ့ၫ အဆၧထးလဂၩဘၪလဂၩနီၪ, ဒဲယူၬ",
			"39": "<sup>39</sup> ထၪ့အစူၪတီၩလၧဂံၪ့ယီၩတၭ,- ထီးနီၪလဖၧၫ့ခိၭနၪ နဝ့ၫလၧနအီၪအလးလၧမူၭခိၪတၭ, ဖျါခွံၬ, ဒဲမၩဆၧ, ဒဲဖ့ၪလၫ့ၦၡၩလၧနၥံၪၥ့ၪယၫအၥၭ လဂၩလါလါဘဲၫ အဖၧၩ့ၥၭအၥိၭနီၪ, (အဂဲးဘဲၫယီၩ နၥ့ၪယၫၦၡၩၥံၪ",
			"40": "<sup>40</sup> အၥၭထီးအလူၬ, မွဲန့ၫနၧၩလဂၩဎးလီၫ.)- ဘဲၫၥိၭ အဝ့ၫၥံၪမိၥၭမဲၪနၧၩ ကယဲမုနံၩမုနၩ လၧအမၧၫ့ဝ့ၫလၧ ခးဖၧၩ့လၧနဖ့ၪလၫ့ပဖါၥံၪနီၪဆံၭ.",
			"41": "<sup>41</sup> တၭၦလခီၫဘၩ့မုးဖိၪဆ့ လၧအလမွဲဘၪနၡၩခမျၧး အံၫစရ့လၭဖိၪတၭ, ဂဲၫဝ့ၫလၧထံၫယဲၩ့ခးယဲၩ့လၧနမံၩ့",
			"42": "<sup>42</sup> အကၠီၩ့နီၪ,- (အဂဲးဘဲၫယီၩ ၦမိနါဂၧၫ့လၧနမံၩ့ဒိၪဒဲ နစူၪဆီၪ့, ဒဲနစူၪဒူၪ ယၩ့ထၪ့အၥၭ အဂဲးအကၠီၪ့လီၫ.)",
			"43": "<sup>43</sup> ထီးအဂဲၫဘၩဆိၪဖၪဆၧတီၩ လၧအဂံၪ့ယီၩတၭ.- ခိၭ နၪနဝ့ၫလၧနအီၪအလးလၧမူၭခိၪတၭ, မၩဆၧဘဲၫကယဲ ဆၧလၧၦလခီၫဘၩ့မုးဖိၪ ကိၭထၪ့လၧနၧၩ လမံၩ့လါ လါအၥိၭ, ဘဲၫၥိၭၦခမျၧးလၧဂၪ့ခိၪချိၫ့ ထီးအလူၬမိၥ့ၪ ယၫနမံၩ့, ဒဲၥၭမဲၪနၧၩဘဲၫနၡၩခမျၧးအံၫစရ့လၭအၥိၭ နီၪတၭ,ဘဲၫၥိၭအမိၥ့ၪယၫ လၧဂံၪ့လဖျိၪ့ယီၩ လၧယ မၩအဝ့ၫဘၪဆၧကိၭဝ့ၫလၧနမံၩ့နီၪဆံၭ.",
			"44": "<sup>44</sup> နၡၩခမျၧးအ့ၪလ့ၩထၪ့ဒုၭဆၧလၧ အဒုၪအဒၩတၭ, ထီးဒၪနအၪ့မၧၫ့လၩ့ဝ့ၫနီၪ, အ့ၪဘၩဆိၪဖၪယဟိဝၩ တီၩလၧဒိၩ့လဖျိၪ့လၧနရွံန့ယူၭဝ့ၫနီၪ, ဒဲဂံၪ့လၧယမၩ",
			"45": "<sup>45</sup> လၧနမံၩ့အဂးတၭ,- ထီးနီၪလဖၧၫ့ ခိၭနၪနဝ့ၫအဆၧ ဘၩဆိၪဖၪ, ဒဲအဆၧအၪ့ကံၩ့အၪ့ယၫလၧမူၭခိၪတၭ, စ့ၩရၫ့ဆၧလၧအဂးနီၪဆံၭ.",
			"46": "<sup>46</sup> အ့ၪမၩမၪဘၪနၧၩတၭ, (အဂဲးဘဲၫယီၩ ၦလၧအလ မၩမၪဘၪဆၧအီၪအ့ၬ,) ဒဲနၥၭထၪ့အဝ့ၫနီၪ, နဖ့ၪလၫ့ ခွံၬအဝ့ၫၥံၪလၧအဒုၪအဒၩတၭ, အဝ့ၫၥံၪဆိၬထၪ့ခွံၬ ဝ့ၫဒုၭကဲၪဎီး လၧအဒုၪအဒၩအခးဖၧၩ့ လၧအယဲၩ့မွဲ",
			"47": "<sup>47</sup> ဂ့ၩ,လၧအဘူၭမွဲဂ့ၩတၭ,- အဝ့ၫၥံၪအ့ၪနၪ့ထၪ့ထဲၩ့ အၥၭလၧခးဖၧၩ့ ထီးဆၧဆိၬအၪ့မၧၫ့ဎီးဝ့ၫတၭ, နီၫ့ ယါလၩ့ထဲၩ့အၥၭတၭ, အၪ့ကံၩ့အၪ့ယၫနၧၩ လၧၦ အခးဖၧၩ့ လၧအဆိၬအၪ့မၧၫ့ ဎီးဝ့ၫနီၪ, စံၭဝ့ၫ, ပမၩ မၪယူၭဆၧယူၭတၭ, ပမၩယူၭဆၧအၧၩ့ယူၭ, ပမၩ",
			"48": "<sup>48</sup> ယူၭဆၧဒဲၩဘၭယူၭ.- တၭအ့ၪဂဲၫထဲၩ့ထဲၩ့ လၧနအီၪ လၧအၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲလၧအၥၭၡီၩ့ထီးအလူၬလၧ အဒုၪအဒၩအခးဖၧၩ့ လၧအဆိၬအၪ့မၧၫ့ဎီးဝ့ၫတၭ, အ့ၪဘၩဆိၪဖၪဆၧတီၩ လၧအဝ့ၫၥံၪအခး လၧနဖ့ၪလၫ့ အဝ့ၫၥံၪအဖါလဖၪ, လၧဒိၩ့လၧနရွံန့ယူၭဝ့ၫ, ဒဲလၧ",
			"49": "<sup>49</sup> ဂံၪ့လၧယမၩလၧနမံၩ့အဂး,- ထီးနီၪလဖၧၫ့ခိၭနၪနဝ့ၫ အဝ့ၫၥံၪအဆၧဘၩဆိၪဖၪ, ဒဲအဆၧအၪ့ကံၩ့အၪ့ယၫ လၧနအီၪအလးလၧမူၭခိၪတၭ, စ့ၩရၫ့ဆၧလၧအဂး",
			"50": "<sup>50</sup> တၭ,- မၩဖီၩ့မၩဖျ့ၭနၡၩခမျၧး လၧအမၩမၪဘၪနၧၩ တၭ,ဖျါခွံၬကယဲအဆၧမၪ လၧအမၩမၪဘၪနၧၩ ထီး အလူၬတၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪလၧဆၧယၫ့ၥၭ လၧၦလၧ အဆိၬအၪ့မၧၫ့ဎီးဝ့ၫလဖၪအမ့ၬယၫ, ဘဲၫၥိၭအဝ့ၫၥံၪ",
			"51": "<sup>51</sup> မိယၫ့ၥၭဘၪဝ့ၫနီၪဆံၭ.- အဂဲးဘဲၫယီၩ မွဲဝ့ၫလၧနၡၩ ခမျၧးဒဲနဆၧန့ၥၫ လၧနဂဲၫဆိၬထၪ့ခွံၬ လၧအံဇံၭအ",
			"52": "<sup>52</sup> ဖၧၩ့,လၧဖံၫ့ချၪထၭအၥၭကျၩလီၫ.- ဘဲၫၥိၭနမ့ၬၥၪၥံၪ မိအီၪဝၩ့ဝဲလၧနခ့ၫနၡၩ လၧအအၪ့ကံၩ့အၪ့ယၫဆၧအ ဂး, ဒဲလၧနခ့ၫနၡၩခမျၧး အံၫစရ့လၭအအၪ့ကံၩ့အၪ့ ယၫဆၧအဂး, ဘဲၫၥိၭနမိခိၭနၪအလူ လၧကယဲဆၧ လၧအဝ့ၫၥံၪအၪ့ကံၩ့န့ ဆၧလၧနၧၩလီၫ.",
			"53": "<sup>53</sup> အဂဲးဘဲၫယီၩ နမၩလၩ့မုလၩ့ဖၭဝ့ၫလၧကယဲၦခ မျၧးလၧဂၪ့ခိၪချိၫ့ဘဲၫၥိၭအမိကဲၪထၪ့နဆၧန့ၥၫ, ဘဲၫန ချဲၩ့ဆၧလၧနခ့ၫနၡၩစမိစ့ၭအစူၪဖၧၩ့ ထီးနဂဲၫဆိၬထၪ့ ခွံၬပဖါလဖၪလၧအံဇံၭအဖၧၩ့နီၪ, ယဟိဝၩယွၩဧ့.",
			"54": "<sup>54</sup> တၭထီးစစီလမၧၫ့ဘၩဆိၪဖၪနီၪ, ဒဲအၪ့ကံၩ့အၪ့ယၫ ဆၧထီးအလူၬလၧယဟိဝၩဂီၩ့တၭ, ဆၧမၩအၥၭလၧ အဂဲထုၪ့လၧယဟိဝၩအဆၧလုလးအမ့ၬယၫ ထီးအ ချံၭလၩ့အခၪ့အီၪလၧအစူၪယူၬထၪ့အၥၭ လၧမူၭခိၪး",
			"55": "<sup>55</sup> ဆၧၫ့ထုၪ့ဝ့ၫတၭ, ဆိၪဂ့ၩအံၫစရ့လၭအဆၧအီၪကီၪ့",
			"56": "<sup>56</sup> ထီးအလူၬလၧအလူဖၭဒိၪတၭ, စံၭဝ့ၫဒၪ,- ယဟိဝၩ လၧအဖ့ၪလၫ့ဆၧအီၪပွံၭ လၧအၡၩခမျၧးအံၫစရ့လၭ ဘဲၫကယဲဆၧလၧအချဲၩ့ယူၭအၥိၭနီၪ, မွဲအဘၪဆၧစံၭ ထၪ့အၪ့အူၭဆံၭ. လၧကယဲဆၧချဲၩ့ လၧအချဲၩ့ဆၧ လၧအခ့ၫအၡၩ စမိစ့ၭအစူၪဖၧၩ့ ထီးအလူၬအကျၩ",
			"57": "<sup>57</sup> နီၪ,လၩ့ထ့ၬဘၪနးထံၪအ့ၬ.- တၭမွဲယဟိဝၩပယွၩ အီၪလါလၧပၥိၭ ဘဲၫအအီၪလၧပဖါၥံၪအၥိၭနီၪဆံၭ. မွဲအထီးလ့ၩဒၪပၧၩ, မွဲအထီးစဲၪ့ထၪ့ခွံၬလၧပအီၪလ",
			"58": "<sup>58</sup> ဂ့ၩ,- မွဲအဘိၭကၠၪပၥၭ လၧအအီၪဘဲၫၥိၭ ပမိဖိၬအ ဖၧၩ့ၥၭထီးအလူၬ, ဒဲထီးန့အဆၧမၪလူၬလဖၪ, ဒဲအၥ နိၫလဖၪ, ဒဲအဆၧစ့ၩရၫ့ လၧအမၪလူၬပဖါလဖၪနီၪ",
			"59": "<sup>59</sup> ဆံၭ.- တၭယဆၧချဲၩ့လဖၪယီၩ လၧယအၪ့ကံၩ့အၪ့ ယၫဆၧလၧအဝ့ၫလၧယဟိဝၩအမ့ၬယၫနီၪ, မွဲအအီၪ ဘူၭလၧယဟိဝၩပယွၩ လၧမုဆၫဒဲလၧမုနၩဘဲၫၥိၭအ မိစ့ၩရၫ့ ဆၧလၧအခ့ၫအၡၩအဂး, ဒဲလၧအၡၩခမျၧး ထီးအလူၬအဂး, လနံၩအဆၧဘဲၫလနံၩ အဆၧဒၪဝ့ၫ",
			"60": "<sup>60</sup> အၥိၭနီၪဆံၭ.- ဘဲၫၥိၭၦခမျၧးလၧဂၪ့ခိၪချိၫ့ထီးအလူၬ မိၥ့ၪယၫလၧယဟိဝၩမွဲယွၩ, ဒဲလၧအဂူၫဂၩအီၪနးဂၩ",
			"61": "<sup>61</sup> အ့ၬ.- တၭမွဲနၥံၪအၥၭလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧယဟိဝၩ ပယွၩအမ့ၬယၫ, ဘဲၫၥိၭနၥံၪမိလ့ၩဆၧလၧအဆၧၥီၪ့ ဆၧၥၫ့အဖၧၩ့, ဒဲထီးန့အဆၧမၪလူၬလဖၪ, ဘဲၫလၧမု ဆၫလနံၩယီၩအၥိၭနီၪဆံၭ.",
			"62": "<sup>62</sup> တၭစဎွၩဒဲအံၫစရ့လၭထီးအလူၬ အီၪလၧအဝ့ၫဒၪ အၥိၭနီၪလုထၪ့ဆၧလၧ ယဟိဝၩအမ့ၬယၫလီၫ.",
			"63": "<sup>63</sup> တၭစစီလမၧၫ့လုထၪ့ဆၧလု မၩဘၪလိၬအိၭလိၬလၧ အလုထၪ့ဝ့ၫလၧယဟိဝၩ, ချီဖၫနံၫလၬနံၫထီၫ့, ဒဲၥိၪ လကုၬနံၫလၬလီၫ. တၭစဎွၩဒဲအံၫစရ့လၭဖိၪထီးအ",
			"64": "<sup>64</sup> လူၬနီၪမၩဘိၪ့ဖလါ ယဟိဝၩအဂံၪ့လီၫ.- တၭဆၧလၧ မုလနံၩဎးနီၪ စဎွၩအီၪက့ၪဆံၫ့ဎံၪဝၩ့ လၧအၥၭကျၩ လၧအအီၪဝ့ၫလၧယဟိဝၩအဂံၪ့ အမ့ၬယၫလီၫ.အဂဲး ဘဲၫယီၩလုထၪ့ဆၧလုမ့ၪ ဒဲဆၧမၩဘိၪ့ကိၪ, ဒဲဆၧလု မၩဘၪလိၬအိၭလိၬအၥိၪထီးနီၪလီၫ. အဂဲးဘဲၫယီၩ ဆၧလုအလးထီးဝီၩလၧအအီၪဝ့ၫ လၧယဟိဝၩအမ့ၬ ယၫနီၪ, ဘဲၫၥိၭအမိဒိၭန့ဆၧလုမ့ၪ ဒဲဆၧမၩဘိၪ့ကိၪ, ဒဲဆၧလုမၩဘၪလိၬအိၭလိၬအၥိၪနီၪ ဆံၭလၨၪဝ့ၫဒၪ လီၫ.",
			"65": "<sup>65</sup> အထီထီးနီၪ စစီလမၧၫ့ မၩဆၧဘိၪ့တၭ, အံၫစရ့ လၭထီးအလူၬအီၪလၧအၥိၭ, ဆၧအီၪကီၪ့ဖၭဒိၪလၧ ဆၧဂဲၫနုၬလၧဟါမၭဖိးလၧ အံဇံၭအထံၫချိၬ, လၧယ ဟိဝၩပယွၩအမ့ၬယၫ နွ့ၫနံၩဒဲနွ့ၫနံၩ, လဆံၫလံနံၩ",
			"66": "<sup>66</sup> လီၫ.- ဎိၭနံၩလနံၩနီၪဖျါခွံၬၦခမျၧးတၭ, အဝ့ၫၥံၪစံၭ ထၪ့အၪ့အူၭစဎွၩတၭ, လ့ၩဝ့ၫလၧအဝ့ၫၥံၪအတဲၩဖၧၩ့ လၧအၥုၪ့ထိၬအၥၭထိၬ, ဒဲလၧအၥုၪ့ဎွံၫအၥၭယီၫလၧ ကယဲဆၧအဂ့ၩ လၧယဟိဝၩမၩဝ့ၫ, လၧအခ့ၫအၡၩ စဒၫဝံၭအဂး, ဒဲအၡၩခမျၧးအံၫစရ့လၭ အဂးနီၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ထီးစစီလမၧၫ့မၩယဟိဝၩအဂံၪ့ဂီၩ့, ဒဲစဎွၩအ ဂံၪ့, ဒဲကယဲစစီလမၧၫ့ဆိၫ့ဆၧလၧအဘၪအၥၭ လၧအ",
			"2": "<sup>2</sup> မိမၩဝ့ၫတၭ,- ဆၧမၩအၥၭလၧယဟိဝၩနဲၪဖျီၪထၪ့အ ၥၭလၧစစီလမၧၫ့ အမ့ၬယၫနံၫဘျၩ့လဘျၩ့ ဘဲၫအအီၪ ဖျီၪလၧအမ့ၬယၫ လၧဂံဘအၧၫ့အဖၧၩ့ အၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> တၭယဟိဝၩစံၭအဝ့ၫ, ယနါဂၧၫ့ယူၭနဘၩဆိၪဖၪ ဆၧ, ဒဲနအၪ့ကံၩ့အၪ့ယၫဆၧလၧ နမၩလၧယမ့ၬယၫး ယမၩဆံၫ့ဎံၪယူၭဂံၪ့လဖျိၪ့ယီၩ လၧနမၩအဝ့ၫဘဲၫၥိၭ ယမိအီၪက့ၪယမံၩ့ထီးနီၪ လၩ့ဆိၩလၩ့ကၠၪတၭ,ယမ့ၬ ၥၪၥံၪ, ဒဲယၥၭမိအီၪထီးနီၪ ကိၭမုနံၩမုနၩဒ့ၭလီၫ.",
			"4": "<sup>4</sup> တၭနအ့ၪလ့ၩဆၧလၧယမ့ၬယၫ, ဘဲၫနဖါစဒၫဝံၭလ့ၩ ဆၧအၥိၭ လၧနၥၭထၧၫ့ဖျိၪ့ယၫ ဒဲလၧယဆၧတီၩဆၧ လီၩ့အဖၧၩ့ဘဲၫၥိၭနမိမၩကယဲဆၧလၧ ယမၪလူၬနၧၩ, ဒဲနမိထီးန့ယဆၧၥီၪ့ဆၧၥၫ့, ဒဲယဆၧစ့ၩရၫ့ လဖၪနီၪ",
			"5": "<sup>5</sup> တၭ,ယမိဒုၭအီၪဂုးအီၪခၧၫ့ နဘၩ့နမုးအလးဆီၩ့ဆီ လၧအံၫစရ့လၭအဖၫ့ခိၪ အဆိၩအကၠၪ,ဘဲၫယချဲၩ့ဝဲၩ ဆၧလၧနဖါစဒၫဝံၭအၥိၭနီၪတၭ, ယစံၭ, ၦလၧအဘၪ ဆဲၫ့လၧနၧၩ လၧအံၫစရ့လၭ အလးဆီၩ့ဆီ အဖၫ့ခိၪ",
			"6": "<sup>6</sup> လၩ့ထူၬဘၪအ့ၬ.- အ့ၪမွဲနၥံၪမွဲဂ့ၩ, နၥံၪအဖိၪအလံၩ မွဲဂ့ၩ, အ့ၪကၠၪခွံၬလၧအဖိၬယခဲၫ့တၡါတၭ, လထီးန့ ဘၪယဆၧမၪလူၬ ဒဲယဆၧၥီၪ့ဆၧၥၫ့, လၧယအီၪက့ၪ လၩ့လၧနၥံၪအမ့ၬယၫတၭ, လ့ၩမၩယွၩဂူၫဂၩလဖၪ",
			"7": "<sup>7</sup> အဆၧ,ဒဲဘၩထၪ့ဝ့ၫတၭ,- ထီးနီၪလဖၧၫ့ယမိဒၪ့ထ့ၬ ခွံၬအံၫစရ့လၭလၧအခး လၧယဖ့ၪလၫ့ဝ့ၫ, ဒဲဂံၪ့လၧ ယမၩဆံၫ့ဎံၪလၧယမံၩ့အဂးလဖျိၪ့ယီၩ, ယမိခွံၬၡိၭ လၧယမ့ၬယၫတၭ, အံၫစရ့လၭမိကဲၪထၪ့ဆၧချဲၩ့ဒီၩ့ အလး, ဒဲဆၧဒုၪဒွ့ၪအလး လၧၦခမျၧးထီးအလူၬအ",
			"8": "<sup>8</sup> ကျၩလီၫ.- တၭဂံၪ့လၧအထီၫယီၩ ကယဲၦလၧအလဲး လီၩ့ဝ့ၫလဂၩလါလါ မိအီၪက့ၪအၥၭ ထီၫမံၫထီၫမၪ, ဒဲဒုၪဒွ့ၪဆၧတၭ, မိစံၭ,ယဟိဝၩမၩဘဲၫယီၩၥိၭလၧ",
			"9": "<sup>9</sup> ခးယီၩ,ဒဲဂံၪ့ယီၩမွဲဘၪလဲၪ.- တၭၦမိစံၭဆၧၫ့ဝ့ၫ,မွဲ အဝ့ၫၥံၪလ့ၩဒၪယဟိဝၩ အဝ့ၫၥံၪအယွၩလၧအဂဲၫဆိၬ ထၪ့ခွံၬအဖါၥံၪလၧခးအံဇံၭအဖၧၩ့တၭ, မၩန့အယွၩ အဂူၫဂၩတၭ, ဘၩထၪ့ဝ့ၫ, ဒဲမၩအဆၧအကၠီၩ့လီၫ.မွဲ ဘဲၫနီၪတၭ ယဟိဝၩဒုၭဂဲၫဘၪအဝ့ၫၥံၪ လၧကယဲဆၧ အၧၩ့ယီၩထီးအလူၬလီၫ.",
			"10": "<sup>10</sup> တၭလၧအနံၪ့နံၫဆံၫအထုၬနီၪ ထီးစစီလမၧၫ့မၩ ယူၭယဟိဝၩအဂံၪ့, ဒဲစဎွၩအဂံၪ့ဒၪဝ့ၫနံၫဖျိၪ့တၭ,",
			"11": "<sup>11</sup> (တဲအၫအစဎွၩဟဲရၫ့ ဖ့ၪလၫ့ဝဲၩယူၭစစီလမၧၫ့လၧၥံၪ့ ၡိၫအ့ရၭ,ဒဲၥံၪ့ၡိၫ, ဒဲထီၫ့ဘဲၫကယဲဆၧဘၪအၥၭအၥိၭ နီၪလီၫ.) ဆၧမၩအၥၭလၧစဎွၩစီလမၧၫ့ ဖ့ၪလၫ့စဟဲ",
			"12": "<sup>12</sup> ရၫ့လၧဒိၩ့နံၫဆံၫလၧခးဂၫလလံၫအဖၧၩ့နီၪလီၫ.- တၭ စဟဲရၫ့ဂဲၫထၪ့လၧတဲအၫအဖၧၩ့ ဘဲၫၥိၭအမိယိဒိၩ့ၥံၪ",
			"13": "<sup>13</sup> လၧစစီလမၧၫ့ဖ့ၪလၫ့အဝ့ၫတၭ, ဘၪအၥၭအ့ၬ.- တၭ စံၭဝ့ၫဒၪ, ဒိၩ့လဖၪယီၩလၧနဖ့ၪလၫ့ယၧၩ မွဲဆၧနီၪ လမံၩ့လဲၪ. ယထၧၫ့ဖုဝဲဧ့, တၭဖျိၬဝ့ၫအမံၩ့လၧကၫ",
			"14": "<sup>14</sup> ဘူလၭထီးမုဆၫလနံၩယီၩလီၫ.- တၭစဟဲရၫ့ဖ့ၪယု ယူၭစဎွၩလၧထီၫ့အကံကၫလယၩနံၫဆံၫလီၫ.",
			"15": "<sup>15</sup> တၭစစီလမၧၫ့အၪ့မၧၫ့ ၦဖ့ၪလၫ့အခီၫ့နီၪအဂဲးဘဲၫ ယီၩ,ဘဲၫၥိၭအမိမၩယဟိဝၩအဂံၪ့, ဒဲအဂံၪ့ဒၪဝ့ၫ,ဒဲဒိၩ့ မံလိၫ,ဒဲယရုစလံၫ့အခိၪဒၧၩ့, ဒဲဟၫဇီၫ,ဒဲမဂံဒိၫ,ဒဲဂံ",
			"16": "<sup>16</sup> ဇၧၫလီၫ.- အံဇံၭအစဎွၩဖၫရိၫလ့ၩထၪ့ယူၭ, မၩန့ဂံ ဇၧၫတၭ,ဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪတၭ, မၩၥံၫၦကၫနအၫ့ ဖိၪလၧအအီၪဝ့ၫလၧဒိၩ့ဖၧၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧဆၧဖ့ၪ လၫ့အဂးလၧအဖိၪမုၪစစီလမၧၫ့အမၫလီၫ.",
			"17": "<sup>17</sup> တၭစစီလမၧၫ့မၩထၪ့ဂံဇၧၫ, ဒဲဘ့ၭၥဟိရၫ့လၧလၬ.",
			"18": "<sup>18</sup> ဒဲဘၫအလၭ,ဒဲဘၫဒမီၫလၧမံၩ့လၬကျၩ, လၧခးဖၧၩ့,",
			"19": "<sup>19</sup> ဒဲကယဲဒိၩ့အီၪက့ၪကီၪ့ ဆၧလၧအအီၪ လၧစစီလမၧၫ့ အစူၪဖၧၩ့, ဒဲဒိၩ့ၥံၪလၧအလဲၪ့ၥုၭလဖၪအဂး, ဒဲဒိၩ့ ၥံၪလၧအၡၩထူၬကၥ့ၪအဂး, ဆၧလၧစစီလမၧၫ့ဆိၫ့ မၩဝ့ၫလၧယရုစလံၫ့အဖၧၩ့, ဒဲလၧလ့ၭဘနၧၫ့အလီၩ့, ဒဲလၧအခးဖၧၩ့ထၧၫ့ဘံၪ့ယၫလၧအပၧၩ့ဝ့ၫလီၫ.",
			"20": "<sup>20</sup> တၭကယဲၦလၧအအီၪလၩ့ထး လၧၦအၫမိၫဖိၪၥံၪ, ၦဟံၥၭဖိၪၥံၪ, ၦပံရ့ၭဖိၪၥံၪ, ၦဟံဝဲၫဖိၪၥံၪ,ဒဲၦယ့ဘုၫ ဖိၪၥံၪလၧအလဘၪဆဲၫ့ဘၪ လၧအံၫစရ့လၭဖိၪနီၪ,",
			"21": "<sup>21</sup> အဝ့ၫၥံၪအဖိၪအလံၩ လၧအအီၪလၩ့ထး လၧခးဖၧၩ့ လၧၦအံၫစရ့လၭဖိၪ မၩဂၭဂီၩ့ဝ့ၫ ထီးအလူၬ အဆံၫ့ လၥ့ၪဘၪနီၪ, စစီလမၧၫ့အၪ့မၧၫ့အဖ့ၪလၫ့အခီၫ့ လၧ",
			"22": "<sup>22</sup> အမၩဎီးအဆၧမၩထီးမုဆၫလနံၩယီၩလီၫ.- အ့ၪမွဲ ၦအံၫစရ့လၭဖိၪနီၪ စစီလမၧၫ့အၪ့မၧၫ့အကဲၪဎီးအ့ၬ. အ့ၪမွဲအဝ့ၫၥံၪနီၪမွဲၦၥုၭဖိၪလဖၪ, ဒဲအခ့ၫအၡၩလဖၪ, ဒဲအၦဒိၪလဖၪ, ဒဲအၦၥုၭခိၪၥံၪ, ဒဲအလဲၪ့ၥုၭအခိၪၥံၪ,",
			"23": "<sup>23</sup> ဒဲအၡၩထူၬကၥ့ၪလဖၪလီၫ.- တၭၦဒိၪဖၭဒိၪလၧအ အီၪဝ့ၫလၧစစီလမၧၫ့အဆၧမၩအဖၫ့ခိၪနီၪ, မွဲၦယဲ ယၩယဲဆံၫလၧအပၧၩ့ ၦလၧအမၩဆၧလီၫ.",
			"24": "<sup>24</sup> အ့ၪမွဲဖၫရိၫအဖိၪမုၪဂဲၫထၪ့ခွံၬ လၧစဒၫဝံၭအဒိၩ့ ဖၧၩ့ထီၩ့လၧအဂံၪ့ လၧစစီလမၧၫ့မၩဝ့ၫလၧအဂးလီၫ. ထီးနီၪလဖၧၫ့ဆၧမၩကဲၪထၪ့မံလိၫဆ့လီၫ.",
			"25": "<sup>25</sup> တၭစစီလမၧၫ့ လုထၪ့ဆၧလုမ့ၪ, ဒဲဆၧလုမၩဘၪ လိၬအိၭလိၬလၧဆၧလုလးအဖၫ့ခိၪ လၧအမၩဝ့ၫလၧယ ဟိဝၩအဂးလနံၪ့ၥၧၫ့ဘျၩ့တၭ, ဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧ ဆၧလုလးအဖၫ့ခိၪ လၧအအီၪဝ့ၫလၧယဟိဝၩအမ့ၬ ယၫလီၫ. တၭအဝ့ၫမၩဂံၪ့ဂီၩ့ဝ့ၫလီၫ.",
			"26": "<sup>26</sup> တၭစဎွၩစီလမၧၫ့မၩထၪ့ကဘၩ့လဖၪ လၧအံဇ အၧၫ့ဂံဘၧၫအဖၧၩ့လၧအအီၪဝ့ၫထီးအ့လီၭ လၧမၫဆ",
			"27": "<sup>27</sup> မံၭဝီၩအနဲၩ့ထံၭလၧခးအံဒၧၫ့အဖၧၩ့လီၫ.- တၭစဟဲရၫ့ အၪ့မၧၫ့လၩ့အခ့ၫအၡၩ, ၦကဘၩ့ဖိၪလၧအၥ့ၪယၫမၫ ဆမံၭၥံၪအီၪလၧကဘၩ့ဖၧၩ့ လၧစစီလမၧၫ့အခ့ၫအ",
			"28": "<sup>28</sup> ၡၩအၥိၭလီၫ.- တၭအဝ့ၫၥံၪလ့ၩထီၩ့လၧအိဖၧၫတၭ, ဂဲၫထဲၩ့ဆိၬန့ထီၫ့အကံကၫလံယၩနံၫဆံၫတၭ, ဂဲၫဆိၬ ဝ့ၫလၧစဎွၩစီလမၧၫ့အအီၪလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ထီးၡံဘၫအနးဎွၩမုၪနါဂၧၫ့ စစီလမၧၫ့အပရၧၫ့ လၧယဟိဝၩအမံၩ့အဂဲးအကၠီၪ့တၭ, ဂဲၫဝ့ၫဘဲၫၥိၭအမိ",
			"2": "<sup>2</sup> မၩခွါဝ့ၫလၧဆၧချဲၩ့ဒီၩ့လီၫ.- တၭဂဲၫထီၩ့ဝ့ၫလၧယ ရုစလံၫ့အီၪဝ့ၫလၧအၡၩဖိၬ အခဲၫ့အၪအၪလ့ၬ, ဒဲကလ အူၭ လၧအဆိၬဆၧနၧၫ့မၧၫ့, ဒဲထီၫ့ၥံၪလွ့ၫၥံၪ အၪအၪ လ့ၬ, ဒဲမနံၬလဖၪတၭ, ဂဲၫထီၩ့လၧစစီလမၧၫ့ အအီၪ တၭ,ချဲၩ့ဆၧလၧအဝ့ၫ လၧကယဲဆၧလၧအအီၪဝ့ၫလၧ",
			"3": "<sup>3</sup> အၥၭခံဖၧၩ့အဂဲးအကၠီၪ့လီၫ.- စစီလမၧၫ့ဒုၭနဲၪဝ့ၫလၧ ဆၧဘၪဆဲၫ့လၧအဆၧချဲၩ့ ထီးအလူၬတၭး ဆၧအီၪ ဘံၭလၧစဎွၩလၧအလလီၩဘၪဝ့ၫနီၪ အီၪနးမံၩ့အ့ၬ.",
			"4": "<sup>4</sup> တၭၡံဘၫအနးဎွၩမုၪနီၪ ဒၪဘၪကယဲ စစီလမၧၫ့အ",
			"5": "<sup>5</sup> ဆၧကိၪ့ၥ့ၪ, ဒဲဂံၪ့လၧအမၩဝ့ၫနီၪ,- ဒဲဆၧအၪ့လၧအစ ပွဲခိၪ,ဒဲအခ့ၫအၡၩဆၧၫ့နၩ့ဝ့ၫ, ဒဲအၡၩမၩအဆၧဆၧၫ့ ထုၪ့ဝ့ၫ,ဒဲအဝ့ၫၥံၪအကီၩ့အၥိၭ, ဒဲအၡၩဆိၬအထွ့ၫ, ဒဲဎၫ့ၥံၪလၧအလ့ၩထၪ့ဝ့ၫလၧ ယဟိဝၩအဂံၪ့ဖၧၩ့တၭ",
			"6": "<sup>6</sup> အၥၭအီၪလၧၩ့လၧအဖၧၩ့အ့ၬ.- တၭစံၭစဎွၩ, ဆၧချဲၩ့ လၧယနါဂၧၫ့လၧယခးဒၪယဝ့ၫအဖၧၩ့, လၧနဆၧချဲၩ့ အဂဲးအကၠီၪ့, ဒဲလၧနကိၪ့ဆၧၥ့ၪအဂဲးအကၠီၪ့နီၪမွဲဆၧ",
			"7": "<sup>7</sup> အတီၩလီၫ.- မွဲလါနၫ့ယလချႃၭဂဲၫဒံၭဘၪ, ဒဲယမ့ၬလ ချႃၭဒၪဒံၭဘၪတၭ, ယနဲၩယဝ့ၫအ့ၬ. တၭယိခွါ,ဆၧ လီၩဘၪယၧၩလၧဆၧနီၪဖိၭဖၫ့ဒံၭအ့ၬ. နဆၧကိၪ့ၥ့ၪ, ဒဲဆၧဘီၪဆၧယီၫနီၪ အၪနဲၪ့ဒံၭအပရၧၫ့လၧယနါဂၧၫ့",
			"8": "<sup>8</sup> ဘၪနီၪလီၫ.- နၡၩၥံၪဘၪဆိၪဂ့ၩဝ့ၫလီၫ. ၦလၧအဆၧၫ့ ထုၪ့လၧနမ့ၬယၫလထံၪဎး, ဒဲလၧအနါဂၧၫ့နဆၧကိၪ့",
			"9": "<sup>9</sup> ၥ့ၪ,နခ့ၫနၡၩလဖၪယီၩဘၪဆိၪဂ့ၩဝ့ၫလီၫ.- ယဟိဝၩ နယွၩလၧအဘၪအၥၭလၧနၧၩ ဘဲၫၥိၭအမိဖ့ၪနဆၧၫ့နၩ့ လၧအံၫစရ့လၭ အလးဆီၩ့ဆီအဖၫ့ခိၪနီၪ, မွဲအဘၪ ဆၧစံၭထၪ့အၪ့အူၭဆံၭ. ယဟိဝၩအဲၪအံၫစရ့လၭအ ဆိၩဆိၩအကၠၪကၠၪအကၠီၩ့တၭ, အီၪက့ၪနၧၩလၧစဎွၩ,",
			"10": "<sup>10</sup> ဘဲၫၥိၭနမိစ့ၩရၫ့ဆၧ, ဒဲမၩဆၧတီၩဆၧလီၩ့လီၫ.- တၭ အဝ့ၫဖ့ၪလၫ့စဎွၩ လၧထီၫ့အကံကၫလယၩနံၫဆံၫ,ဒဲ ဆၧနၧၫ့မၧၫ့အၪအၪလ့ၬ ဒဲမနံၬလဖၪလီၫ. ဆၧနၧၫ့မၧၫ့ အၪအၪလ့ၬဎွ့ၩဎီၩ့ လၧၡံဘၫအနးဎွၩမုၪ ဖ့ၪလၫ့စစီ လမၧၫ့နီၪဂဲၫလၧၩ့ဝ့ၫအ့ၬ.",
			"11": "<sup>11</sup> တၭစဟဲရၫ့အကဘၩ့ လၧအဂဲၫထဲၩ့ဆိၬထီၫ့ၥံၪ လွ့ၫၥံၪလၧအိဖၧၫအလးနီၪ ဂဲၫဆိၬဆ့ၥံၪ့အၪလမၧၭအၪ",
			"12": "<sup>12</sup> အၪလ့ၬဒဲမနံၬလဖၪ လၧအိဖၧၫလီၫ.- စဎွၩတဲၩ့ထုၪ့ လဖၪလၧၥံၪ့အၪလမၧၭ လၧယဟိဝၩအဂံၪ့အဂး,ဒဲလၧ စဎွၩအဂံၪ့အဂး, ဒဲတဲၩ့ဆ့ၥၫ့ထီးဒဲနါဒံၩ့လၧၦၥံၫကျံၩ ဆၧဖိၪအဂးလီၫ. ၥံၪ့အၪလမၧၭဘဲၫနီၪအၥိၭဂဲၫလၧၩ့ အ့ၬးတၭဆၧလဒၪလၧၩ့ဘၪ ထီးမုဆၫလနံၩယီၩလီၫ.",
			"13": "<sup>13</sup> တၭစဎွၩစီလမၧၫ့ ဖ့ၪလၫ့ၡံဘၫအနးဎွၩမုၪလၧက ယဲအဆၧဆိၫ့န့ဘၪ, ထီးဒၪအအၪ့ကံၩ့ဝ့ၫ လမံၩ့လါ လါလၧစစီလမၧၫ့ဖ့ၪလၫ့လၧအဝ့ၫ လၧအဘၪဆဲၫ့လၧ ဆၧဖ့ၪလၫ့အၪဘဲၫစဎွၩအၥိၭ အဖၫ့ခိၪဒံၭလီၫ. ၦမုၪ နီၪကၠၪထဲၩ့အၥၭတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအခးဒၪဝ့ၫ,အ ဝ့ၫဒၪဒဲအခ့ၫအၡၩလဖၪလီၫ.",
			"14": "<sup>14</sup> တၭထီၫ့ၥံၪလွ့ၫၥံၪလၧအဂဲၫ လၧစစီလမၧၫ့အအီၪ လၧလနံၪ့အထးဖၧၩ့နီၪ အခံၫ့အီၪဎူၫယၩဎူၫဆံၫ ဎူၫ",
			"15": "<sup>15</sup> ကံကၫလီၫ.- လၧနီၪအမ့ၬယၫန့ဘၪဆၧလၧၦဖနံၬဖိၪ ၥံၪ,ဒဲလၧၦမၩဖနံၬလၧဆၧနၧၫ့မၧၫ့ဖိၪ, ဒဲလၧအရ့ဘၠၫ အစဎွၩထီးအလူၬ, ဒဲလၧထံၫၥံၪခးၥံၪ အၦဒိၪဖၭဒိၪ",
			"16": "<sup>16</sup> လဖၪနီၪလီၫ.- တၭစဎွၩစီလမၧၫ့ တဲၩ့ထၩ့ဖံၭဖၭဒိၪ နံၫယၩလၧထီၫ့ခိလီၪ့လီၫ. ထီၫ့အၡက့လၬ ဎူၫယၩ",
			"17": "<sup>17</sup> လူၬဝ့ၫလၧထၩ့ဖံၭလဘံၪ့အဂးလီၫ.- တၭတဲၩ့ထၩ့ဖံၭ ဖိၪၥၧၫ့ယၩ လၧထီၫ့ခိလီၪ့, ထီၫ့အၡက့လၬၥၧၫ့ယၩ လူၬဝ့ၫလၧထၩ့ဖံၭလဘံၪ့အဂးလီၫ. တၭစဎွၩအီၪက့ၪ အဝ့ၫၥံၪလၧလ့ၭဘနၧၫ့အမံၩ့လၬကျၩ အဂံၪ့ဖၧၩ့ လီၫ.",
			"18": "<sup>18</sup> တၭစဎွၩတဲၩ့လးဆီၩ့ဆီဖၭဒိၪ လၧကဆၫ့မဲၪတၭ,",
			"19": "<sup>19</sup> ဖၩ့ဝ့ၫလၧထီၫ့ဆံၫ့လီၫ.- တၭလးဆီၩ့ဆီနီၪအီၪဝ့ၫလၧ အဎၫ့ဎူၫၥွၫတၭ, လးဆီၩ့ဆီအဖၫ့ခိၪနီၪကဲၪ့ခွၩ့ခွၩ့လၧ အချိၫ့တၭ, ဆၧဒိၭနဲၩ့အလးအီၪဝ့ၫထီးဆၧၫ့နၩ့အလး အနဲၩ့ထံၭလါခီၫလါခီၫတၭ, ဆၬလၥၧၫ့နံၫဒုၩဆၧၫ့",
			"20": "<sup>20</sup> ထုၪ့အီၪဝ့ၫထီးဆၧဒိၭနဲၩ့အလးအနဲၩ့ထံၭလီၫ.- တၭ ဆၬလၥၧၫ့လဆံၫနံၫဒုၩ ဆၧၫ့ထုၪ့ထီးနီၪလၧဎၫ့ဎူၫၥွၫ အလီၩ့လၧလခီၫ, ဒဲလၧအနီၪလခီၫလီၫ. ဆၧတဲၩ့ဝ့ၫဘဲၫ နီၪအၥိၭလၧဘၩ့မုးအဂူၫဂၩအဖၧၩ့ အီၪဝ့ၫနးစီၪ့အ့ၬ.",
			"21": "<sup>21</sup> တၭကယဲစဎွၩအထွ့ၫအီၩဆၧနီၪ မွဲထီၫ့ထီးအလူၬ လီၫ. တၭကယဲထွ့ၫအီၪဝ့ၫ လၧလ့ၭဘနၧၫ့အမံၩ့လၬ ကျၩအဂံၪ့ဖၧၩ့နီၪမွဲထီၫ့ဆံၫ့လီၫ. တဲၩ့ဝ့ၫလၧစ့ၩနးဖျိၪ့ အ့ၬ.လၧစစီလမၧၫ့ အမုနံၩလဖၪနီၪ, ဆၧအီၪက့ၪစ့ၩ လၧဆၧနးမံၩ့အ့ၬ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ စဎွၩအီၪလၧအကဘၩ့တၫၡံၭလၧ မၫဆမံၭအဖၧၩ့နီၪ, ဒဲအီၪလၧစဟဲရၫ့အကဘၩ့လဖၪဆ့ လီၫ.ၥၧၫ့နံၪ့လဖၧၫ့နီၪ ကဘၩ့တၫၡံၭဂဲၫထုၭထီၫ့ၥံၪလွ့ၫ ၥံၪ,ကျိၪၥံၪစ့ၩၥံၪ, ကဆၫ့မဲၪ,ဒဲကယုၩဖၩၥံၪ,ဒဲထိၪၡၬ ၥံၪလီၫ.",
			"23": "<sup>23</sup> တၭစဎွၩစီလမၧၫ့ဒိၪနဲၪ့ကယဲစဎွၩ လၧဂၪ့ခိၪချိၫ့ လၧအစူၪလးအခၪ့ခိၪအကၠီၩ့, ဒဲလၧအဆၧကိၪ့ၥ့ၪကိၪ့",
			"24": "<sup>24</sup> ဘၪအကၠီၩ့နီၪဆ့လီၫ.- တၭဂၪ့ခိၪဖိၪထီးအလူၬအၪ့ဎၬ စစီလမၧၫ့အမ့ၬ ဘဲၫၥိၭအမိနါဂၧၫ့ အဆၧကိၪ့ၥ့ၪကိၪ့ ဘၪလၧယွၩအီၪက့ၪလၩ့ဝ့ၫလၧအၥၭခံဖၧၩ့နီၪလီၫ.",
			"25": "<sup>25</sup> တၭၦလဂၩဒဲလဂၩဂဲၫဆိၬအလၬ ဆီၪ့ဆုၬဆုၬ,ထွ့ၫ စ့ၩ,ဒဲထွ့ၫထီၫ့, ဒဲဆၧအကီၩ့အၥိၭ, ဒဲဆၧဒုၭၥုၭအစူၪ ဝဲၩ,ဒဲဆၧနၧၫ့မၧၫ့, ဒဲကၥ့ၪ, ဒဲကၥ့ၪလၫၥံၪလနံၪ့ဘၪ လနံၪ့လီၫ.",
			"26": "<sup>26</sup> တၭစစီလမၧၫ့အီၪက့ၪကီၪ့လဲၪ့ၥုၭ, ဒဲၦကၥ့ၪၥုၭဖိၪ တၭ, အီၪဝ့ၫလၧလဲၫ့ၥုၭလထီၫ့လံယၩး ဒဲၦကၥ့ၪၥုၭဖိၪ လလၬနံၫထီၫ့တၭ, အီၪက့ၪဝ့ၫလၧလဲၪ့ၥုၭလဖၪအဒိၩ့ ဖၧၩ့, ဒဲအီၪလၧစဎွၩအၥိၭ လၧယရုစလံၫ့အဖၧၩ့လီၫ.",
			"27": "<sup>27</sup> စဎွၩအီၪက့ၪစ့ၩလၧယရုစလံၫ့အဖၧၩ့, ဘဲၫလိးၥံၪလဲၫ့ ၥံၪအၥိၭ, ဒဲအီၪက့ၪၥံၪ့ၡိၫအ့ရ့ၭအၪအၪလ့ၬ ဘဲၫၥံၪ့",
			"28": "<sup>28</sup> ကူၪၥံၪလၧဆၧပျၩ့ဖၧၩ့အၥိၭနီၪလီၫ.- တၭဆၧဂဲၫဆိၬ ကၥ့ၪလၧခးအံဇံၭအဖၧၩ့ လၧစစီလမၧၫ့ အဂးလီၫ.",
			"29": "<sup>29</sup> တၭစဎွၩအၡၩဖနံၬဖိၪဒိၭန့ဝ့ၫလၧအဎွ့ၩလီၫ.- ၦလ့ၩ ဆၧတၭ, ဂဲၫထဲၩ့ဆိၬလဲၪ့ၥုၭလခိၪ လၧအံဇံၭအဖၧၩ့ လၧၡက့လၭဎူၫယၩ, ဒဲကၥ့ၪလဒုၩလၧလယၩယဲဆံၫ လီၫ. ဘဲၫနီၪအၥိၭဂဲၫထဲၩ့န့ဝ့ၫလၧအဝ့ၫၥံၪအစူၪလၧၦ ဟံၥၭဖိၪအစဎွၩ ထီးအလူၬအဂး, ဒဲလၧစံရအၫအ စဎွၩၥံၪအဂးလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> တၭစဎွၩစီလမၧၫ့ အဲၪၦလခီၫဘၩ့မုးဖိၪအဖိၪမုၪ အၪဂၩလီၫ. လၧဖၫရိၫအဖိၪမုၪအမ့ၬယၫနီၪၦမိအၭ အမုၪၥံၪ,ၦအၫမၧၫ့အမုၪၥံၪ, ၦအံဒၧၫ့အမုၪၥံၪ,ၦဇံဒိၫ့",
			"2": "<sup>2</sup> အမုၪၥံၪ,ၦဟံၥၭအမုၪၥံၪ,- လၧၦဆၨၩလဖၪအကျၩ လၧယဟိဝၩစံၭ ၦအံၫစရ့လၭဖိၪ လၧအဂဲးနီၪ,နၥံၪ လ့ၩနုၬဘၪလၧအအီၪအ့ၬ. အဝ့ၫၥံၪနီၪဂဲၫနုၬဘၪလၧ နၥံၪအအီၪဆ့အ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမိဘိၭကၠၪ ခွံၬတၡါနၥံၪအၥၭ ဒဲဒုၭဖိၬအဝ့ၫၥံၪအယွၩလဖၪနီၪအ ခဲၫ့ဆ့လီၫ. စစီလမၧၫ့အဲၪဝ့ၫတၭ, ၥုၭဘူၭအၥၭလၧအ",
			"3": "<sup>3</sup> ဝ့ၫၥံၪလီၫ.- အဝ့ၫဒၪအီၪဝ့ၫလၧအမၫနွ့ၫယၩ, စဎွၩအ ဖိၪမုၪၥံၪ, ဒဲအၥံၪမၫၥၧၫ့ယၩတၭ, အမၫလဖၪနီၪဘိၭ",
			"4": "<sup>4</sup> ကၠၪခွံၬအၥၭလီၫ.- တၭစစီလမၧၫ့အၥၭၡါအထီနီၪ ဆၧမၩအၥၭလၧအမၫလဖၪ ဘိၭကၠၪခွံၬထဲၩ့အၥၭလၧ အဖိၬယွၩအဂူၫဂၩလဖၪ အခဲၫ့တၭး အၥၭအီၪထၧၫ့ ဖျိၪ့ယၫလၧယဟိဝၩအယွၩ, ဘဲၫအဖါစဒၫဝံၭအၥၭ အၥိၭနီၪအ့ၬ.",
			"5": "<sup>5</sup> တၭစစီလမၧၫ့လ့ၩဖိၬ ၦဇဲဒၧၫ့ဖိၪအယွၩအၭၡတြီၭ အခဲၫ့, ဒဲအၫမၧၫ့ဖိၪ အဆၧၥၭလိၪမိလ့ၭအခဲၫ့လီၫ.",
			"6": "<sup>6</sup> တၭစစီလမၧၫ့ မၩဆၧအၧၩ့ လၧယဟိဝၩ အမ့ၬယၫ တၭ,ဖိၬယဟိဝၩအခဲၫ့ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩဘဲၫအဖါစဒၫ",
			"7": "<sup>7</sup> ဝံၭအၥိၭနီၪအ့ၬ.- ထီးနီၪလဖၧၫ့ စစီလမၧၫ့မၩဆၧ လၧအလးထၪ့ထီၫလၧမိအၭအဆၧၥၭလိၪ, ခ့ၫမီၭအ ဂးလၧခိၪလီၩ့လၧယရုစလံၫ့အမ့ၬယၫအလီၩ့, ဒဲလၧ",
			"8": "<sup>8</sup> ၦအၫမၧၫ့ဖိၪအဆၧၥၭလိၪ, မိလ့ၭအဂးလီၫ.- တၭမၩ ဝ့ၫဘဲၫနီၪအၥိၭလၧကယဲအၡၩလခီၫ ဘၩ့မုးဖိၪအမၫ အဂး,လၧအဝ့ၫၥံၪဆူၭခဲၩဆၧနၧၫ့မၧၫ့, ဒဲလုထၪ့ဆၧ လၧအဝ့ၫၥံၪအယွၩလဖၪလီၫ.",
			"9": "<sup>9</sup> တၭယဟိဝၩအၥၭထၪ့ဘၪစစီလမၧၫ့နီၪ, အဂဲးဘဲၫ ယီၩအၥၭကၠၪခွံၬယူၭအၥၭ လၧယဟိဝၩအံၫစရ့လၭ အယွၩအီၪလၧအနဲၪဖျီၪထၪ့အၥၭ လၧအဝ့ၫဒၪနံၫဖၧၫ့",
			"10": "<sup>10</sup> ယူၭ,-ဒဲမၪလူၬဝ့ၫလၧဆၧလမံၩ့နီၪ အဂဲးအကၠီၪ့ ဘဲၫ ၥိၭအထီးဖိၬယွၩအဂူၫဂၩ အခဲၫ့လဂ့ၩလီၫ. မွဲလါနၫ့ ဘိၩအဝ့ၫဒၪထီးန့ ဆၧလၧယဟိဝၩ မၪလူၬဝ့ၫအ့ၬ.",
			"11": "<sup>11</sup> အခိးမွဲယဟိဝၩစံၭစစီလမၧၫ့, မွဲနမၩဆၧယီၩတၭ, နလထီးန့ဘၪယဆၧအုၩ့လၩ့, ဒဲယဆၧၥီၪ့ဆၧၥၫ့လၧ ယမၪလူၬနၧၩတၭ, ယမိထုၭထၪ့ခွံၬတၡါဘၩ့မုးနီၪ",
			"12": "<sup>12</sup> လၧနအီၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧနခ့ၫနၡၩလဂၩလီၫ.- မွဲ လါနၫ့ဘိၩ လၧနမုနံၩလဖၪအဖၧၩ့ လၧနဖါစဒၫဝံၭအ ကၠီၩ့နီၪယမၩအ့ၬ. ယမိထုၭထၪ့ခွံၬဝ့ၫလၧနဖိၪခွၫအ",
			"13": "<sup>13</sup> စူၪဖၧၩ့လီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ယထုၭထၪ့ခွံၬဘၩ့ မုးထီးအလူၬဆ့အ့ၬ. ယမိဖ့ၪလၫ့ၦလဒီၪ့လၧနဖိၪခွၫ လၧယခ့ၫယၡၩစဒၫဝံၭအကၠီၩ့, ဒဲလၧယရုစလံၫ့အ ကၠီၩ့လၧယရွံန့ယူၭဝ့ၫလီၫ.",
			"14": "<sup>14</sup> တၭယဟိဝၩ ထိၪဂဲၩဆၧအဒုၪအဒၩလၧအထၫ့ဒၩ စစီလမၧၫ့, ၦအံဒၧၫ့ဖိၪစဟၫဒၭလီၫ. အဝ့ၫဒၪနီၪမွဲၦ လၧစဎွၩအချံၫအၥၪအကျၩ လၧအံဒၧၫ့အဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> လၧစဒၫဝံၭအီၪဝ့ၫလၧအံဒၧၫ့အဖၧၩ့, ဒဲစယိအၭ,ၦ ၥုၭမုခမျၧးအခိၪလ့ၩထၪ့ခုၪ့လၩ့ဘၧၩ့ခွံၬ ၦဘၪဆၧမၩ ၥံၫဝ့ၫလဖၪ လၧဆၧဖ့ၬခွံၬ ၦခွၫထီးအလူၬလၧအံဒၧၫ့",
			"16": "<sup>16</sup> အဖၧၩ့အလးခဲၫ့နီၪ,- (အဂဲးဘဲၫယီၩ စယိအၭအီၪ ထီးနီၪဒဲအံၫစရ့လၭထီးအလူၬ လၩဎူၫဘံၪ့ထီးအဒၪ့",
			"17": "<sup>17</sup> ထ့ၬခွံၬကယဲၦခွၫလၧအံဒၧၫ့အဖၧၩ့နီၪဂီၩ့,)- ဆၧမၩ အၥၭလၧစဟၫဒၭစဲၪ့ထၪ့ခွံၬ, အဝ့ၫဒၪဒဲအဖါအခ့ၫအ ၡၩၦအံဒၧၫ့ဖိၪလနၩ့နၩ့, ဘဲၫၥိၭအမိလ့ၩလၩ့ လၧအံ",
			"18": "<sup>18</sup> ဇံၭအဖၧၩ့တၭး စဟၫဒၭနီၪမွဲဖိၪၥၪဆံၭဒံၭလီၫ.- အ ဝ့ၫၥံၪဂဲထုၪ့လၧမံဒအၫ့အဖၧၩ့တၭ, ဂဲၫဝ့ၫလၧပၫရၫ့အ ဖၧၩ့တၭ, မၩန့ၦၡၩလၧပၫရၫ့အဖၧၩ့ ဂဲၫထီၩ့လၧအံ ဇံၭအဖၧၩ့, လၧအံဇံၭအစဎွၩဖၫရိၫအအီၪလၧအဖ့ၪ လၫ့အဝ့ၫလၧဂံၪ့လဖျိၪ့တၭ, မၪလူၬလၧအမိန့ဆၧအၪ့,",
			"19": "<sup>19</sup> ဒဲဖ့ၪလၫ့အဝ့ၫလၧဂၪ့ခိၪလီၫ.- တၭစဟၫဒၭဒၪန့ဆၧ အခိးအတၩ လၧဖၫရိၫအမ့ၬယၫဒိၪမၬလီၫ. တၭအ ဝ့ၫဖ့ၪလၫ့လၧအမၫအဂးအမၫ ဒၪဝ့ၫအထၧၫ့ဖုဝဲမုၪနး",
			"20": "<sup>20</sup> ဎွၩမုၪတၫပန့ၭ အထၧၫ့ဖုဝဲမုၪလီၫ.- နးတၫပန့ၭအ ထၧၫ့ဖုဝဲမုၪနီၪ အီၪဖျဲၪန့ဝ့ၫလၧအဖိၪခွၫ စဂ့ၫနုၫဘၭ တၭ,နးတၫပန့ၭဒုၭလၩ့ၡၪဝ့ၫလၧ အနူလၧဖၫရိၫအ ဂံၪ့ဖၧၩ့တၭ, စဂ့ၫနုၫဘၭနီၪအီၪဝ့ၫလၧဖၫရိၫအဂံၪ့ဖိၪ အကျၩ, လၧဖၫရိၫအဖိၪခွၫၥံၪအကျၩလီၫ.",
			"21": "<sup>21</sup> တၭစဟၫဒၭအီၪလၧအံဇံၭအဖၧၩ့နီၪ, နါဂၧၫ့လၧ စဒၫဝံၭမံၫဝ့ၫလၧအဖါၥံၪအၥိၭ, ဒဲလၧၦၥုၭမုခမျၧးအ ခိၪစယိအၭၥံၫယူၭနီၪလီၫ. တၭစဟၫဒၭစံၭဖၫရိၫ,ဖျါ",
			"22": "<sup>22</sup> ခွံၬယၧၩဘဲၫၥိၭယမိထဲၩ့လၧ ယခးဒၪယဝ့ၫဆံၭ.- တၭ ဖၫရိၫစံၭအဝ့ၫ,ယိခွါ, နအၪ့ဎၬထဲၩ့လၧနခးဒၪနဝ့ၫအ ကၠီၩ့နီၪ,ဆၧလၧနန့ဘၪအလး အီၪလၧနလန့ဒံၭဘၪ,မွဲ အအီၪဒံၭဆၧနီၪလမံၩ့လဲၪ. တၭအဝ့ၫစံၭဆၧၫ့ဝ့ၫဒၪ, အီၪနးမံၩ့အ့ၬး မွဲလါနၫ့ဘိၩဖျါခွံၬယၧၩနးထံၪဘီၪ.",
			"23": "<sup>23</sup> တၭယွၩထိၪဂဲၩဆၧအဒုၪအဒၩ, စအလဲအဒၫအဖိၪ ခွၫစရံဇၧၫ့ လၧအစဲၪ့ထၪ့ခွံၬ လၧအကဆါဇိၫဘၫအ စဎွၩဟၫဒၭဒံဇၧၫအအီၪလီၫ.",
			"24": "<sup>24</sup> တၭထီးစဒၫဝံၭမၩၥံၫၦၡၩလဖၪတၭ, အဝ့ၫဒုၭအီၪ ကီၪ့ၦၡၩလၧအအီၪတၭ, ကဲၪထၪ့ၦလဒီၪ့အခိၪတၭ, အီၪဝ့ၫထီးနီၪ, ဒဲကဲၪစဎွၩလၧဒမၭစကၧၭအဖၧၩ့လီၫ.",
			"25": "<sup>25</sup> တၭမွဲအံၫစရ့လၭအဒုၪအဒၩ လၧကယဲစစီလမၧၫ့အမု နံၩထီးအလူၬ လၧစဟၫဒၭမၩအၧၩ့ဆၧအဖၫ့ခိၪ,အ ဝ့ၫဒၪမ့ၬလဲၩအံၫစရ့လၭတၭ, ကဲၪစဎွၩလၧစံရအၫအ ဖၫ့ခိၪလီၫ.",
			"26": "<sup>26</sup> တၭစနံဘၭအဖိၪခွၫစယ့ၫရဘိအၫ့, ၦအ့ဖၭၥၭဖိၪ ဘၪဆဲၫ့လၧဇ့ရံဒၫ, စစီလမၧၫ့အဎီးအၡၩလဂၩ, အမိ အမံၩ့မွဲနးဇရုအၫၦမုၪမဲၫလဂၩ, ယၩ့ထၪ့အစူၪထၫ့",
			"27": "<sup>27</sup> ဒုၪဒၩစဎွၩလီၫ.- တၭယၩ့ထၪ့အစူၪထၫ့ဒုၪဒၩစဎွၩ အဂဲးနီၪ,မွဲအယီၩ, စစီလမၧၫ့မၩထၪ့မံလိၫတၭ, မၩ ဂ့ၩထၪ့ထဲၩ့ဆၧဘုၪ့ဖိး လၧအဖါ စဒၫဝံၭအဒိၩ့ဖၧၩ့,",
			"28": "<sup>28</sup> တၭၦၡၩစယ့ၫရဘိအၫ့လဂၩနီၪ, မွဲၦအဆီၪ့, ၦအဂဲး ဆီၪ့အဘၭဆီၪ့တၭ, စစီလမၧၫ့ဒၪဘၪဖိၪၥၪခွၫလဂၩ နီၪ,မွဲၦလၧအဎၬတၭ, စစီလမၧၫ့အီၪက့ၪဝ့ၫလၧကယဲ စယိၥၭအၡၩဂံၪ့ဖိၪအအွံၪဆၧယိၭဆၧအဖၫ့ခိၪလီၫ.",
			"29": "<sup>29</sup> တၭအထီထီးနီၪဆၧမၩအၥၭလၧ စယ့ၫရဘိအၫ့ စဲၪ့ထၪ့ခွံၬလၧယရုစလံၫ့တၭ, ၦၡံလိၫဖိၪ မီၪစအဟဲ ယၫနီၪဒၪန့ဝ့ၫလၧဖၧၩ့ၥၭတၭ, ကီၩ့ဝ့ၫလၧဖၬဘဲၩ့အၥၫ့ လဘံၪ့တၭ,အဝ့ၫၥံၪအီၪဝ့ၫ လၧဆၧပျၩ့ဖၧၩ့န့ၫ နံၫဂၩ",
			"30": "<sup>30</sup> လီၫ.- စအဟဲယၫနီၪဖီၪ့ထၬဖၬဘဲၩ့အၥၫ့လဘံၪ့လၧအ",
			"31": "<sup>31</sup> အီၪဝ့ၫလၧအလီၩ့တၭ, ၡၫ့ဝ့ၫလဆံၫနံၫကဲၩ့တၭ,- စံၭ စယ့ၫရဘိအၫ့, မၩန့ဆံၫကဲၩ့ယီၩဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဝ့ၫဘဲၫယီၩ, ယိခွါ,ယ မိထုၭထၪ့ခွံၬဘၩ့မုးလၧစစီလမၧၫ့ အစူၪဖၧၩ့တၭ,ယမိ",
			"32": "<sup>32</sup> ဖ့ၪလၫ့ၦဆံၫဒီၪ့လၧနၧၩလီၫ.- အ့ၪမွဲအဝ့ၫဒၪနီၪမိအီၪ လၧၦလဒီၪ့လၧယခ့ၫယၡၩစဒၫဝံၭအကၠီၩ့, ဒဲလၧယ ရုစလံၫ့အကၠီၩ့, ဒိၩ့လၧယရွံန့ဝ့ၫလၧကယဲအံၫစရ့လၭ",
			"33": "<sup>33</sup> လဒီၪ့အကျၩနီၪလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလ့ၩဒၪ ယူၭယၧၩယူၭတၭ, ဘိၪ့ထၪ့ဘၩထၪ့ၦဇဲဒၧၫ့ဖိၪအက ဆါမုၪအၭၡတြီၭ, ၦမိအၭဖိၪအယွၩခ့ၫမီၭ, ၦအၫမၧၫ့ ဖိၪအယွၩမိလ့ၭတၭ, ဖိၬယဖၧၩ့ၥၭၥံၪဘဲၫၥိၭအမိမၩ ဆၧတီၩလၧယမ့ၬၥၪဖၧၩ့, ဒဲထီးန့ယဆၧၥီၪ့ဆၧၥၫ့,ဒဲ",
			"34": "<sup>34</sup> ယဆၧစ့ၩရၫ့, ဘဲၫအဖါစဒၫဝံၭအၥိၭနီၪအ့ၬ.- မွဲလါနၫ့ ဘိၩယမိမၩန့ခွံၬဘၩ့မုးထၧၫ့ဘံၪ့ယၫ လၧအစူၪဖၧၩ့ အ့ၬ.တၭယမိအီၪက့ၪအဝ့ၫ လၧအခိၪ လဆိၩဒၪဝ့ၫ လၧယခ့ၫယၡၩစဒၫဝံၭအကၠီၩ့ လၧယရွံန့အဝ့ၫလၧ အထီးန့ယဆၧမၪလူၬလဖၪ, ဒဲယၥနိၫလဖၪအကၠီၩ့နီၪ",
			"35": "<sup>35</sup> လီၫ.- အ့ၪမွဲယမိမၩန့ခွံၬဘၩ့မုးနီၪ လၧအဖိၪခွၫအစူၪ ဖၧၩ့တၭ, ယမိဖ့ၪလၫ့အဝ့ၫလၧနၧၩ, ၦဆံၫဒီၪ့လီၫ.",
			"36": "<sup>36</sup> တၭယမိဖ့ၪလၫ့အဖိၪခွၫ လၧၦလဒီၪ့ဘဲၫၥိၭယခ့ၫယ ၡၩစဒၫဝံၭမိအီၪလၧအဆၧဖၩ့လဖျိၪ့ လၧယမ့ၬယၫလ ထံၪဎးလၧယရုစလံၫ့အဖၧၩ့, ဒိၩ့လဖျိၪ့လၧယရွံန့ဝ့ၫ ဘဲၫၥိၭယမိအီၪက့ၪယမံၩ့ထီးနီၪလီၫ.",
			"37": "<sup>37</sup> တၭယမိမၩန့နၧၩတၭ, နမိကဲၪစဎွၩဘဲၫကယဲဆၧ လၧနၥၭဆိၫ့ဆၧအၥိၭတၭ, နမိကဲၪထၪ့စဎွၩလၧအံၫ",
			"38": "<sup>38</sup> စရ့လၭအဖၫ့ခိၪလီၫ.- နအ့ၪခိၭနၪကယဲဆၧလၧယမၪ လူၬနၧၩတၭ, ဖိၬယဖၧၩ့ၥၭလဖၪတၭ, မၩဆၧလၧအ လီၩ့လၧယမ့ၬယၫ, ဘဲၫၥိၭနမိထီးန့ယၥနိၫလဖၪဒဲယ ဆၧမၪလူၬလဖၪ, ဘဲၫယခ့ၫယၡၩစဒၫဝံၭမၩဝ့ၫအၥိၭ နီၪတၭ,ဆၧမိမၩအၥၭ လၧယမိအီၪလၧနၥိၭတၭ,ယ မိမၩထၪ့န့နၧၩ လၧဂံၪ့ခၧၫ့နးဖျိၪ့, ဘဲၫယမၩထၪ့လၧ စဒၫဝံၭအဂးအၥိၭတၭ, ယမိဖ့ၪလၫ့အံၫစရ့လၭလၧ",
			"39": "<sup>39</sup> နၧၩလီၫ.- တၭလၧဆၧလမံၩ့နီၪအကၠီၩ့ ယမိမၩၡၪ့မၩ နၭစဒၫဝံၭအချံၫအၥၪ, မွဲလါနၫ့အဆိၩအကၠၪနီၪမွဲအ့ၬ.",
			"40": "<sup>40</sup> စစီလမၧၫ့အၪ့ဎူၫအၪ့ဎၬ မၩၥံၫစယ့ၫရဘိအၫ့တၭ, စယ့ၫရဘိအၫ့ဂဲထုၪ့တၭ, စဲၪ့ဖျိၭဝ့ၫလ့ၩလၧအံဇံၭအ စဎွၩစၡံၡၭအအီၪတၭ, အီၪလၧအံဇံၭအဖၧၩ့ထီးစစီ လမၧၫ့ၥံၫဝ့ၫလီၫ.",
			"41": "<sup>41</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စစီလမၧၫ့,ဒဲကယဲ ဆၧလၧအမၩဝ့ၫထီးအလူၬ, ဒဲအဆၧကိၪ့ၥ့ၪနီၪကွ့ၭအ ၥၭလၧလံၬ စစီလမၧၫ့အဆၧမၩအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.",
			"42": "<sup>42</sup> တၭမုနံၩလဖၪလၧစစီလမၧၫ့ကဲၪစဎွၩ လၧယရု စလံၫ့အဖၧၩ့လၧအံၫစရ့လၭထီးအလူၬ အဖၫ့ခိၪနီၪ, မွဲအနံၪ့လံဆံၫလီၫ.",
			"43": "<sup>43</sup> တၭစစီလမၧၫ့မံၫဝ့ၫလၧအဖါလဖၪ အၥိၭတၭ,ၦ ခုၪ့လၩ့ဘၧၩ့ဝ့ၫလၧအဖါစဒၫဝံၭအဒိၩ့ဖၧၩ့တၭ, အဖိၪခွၫ စရံၫဟဘိအၫ့ကဲၪစဎွၩလၧအလးနီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭစရံၫဟဘိအၫ့လ့ၩထီၩ့လၧၡံခံၫ့လီၫ. အဂဲးဘဲၫ ယီၩအံၫစရ့လၭထီးအလူၬ မိဘၪဂဲၫလၧၡံခံၫ့ ဘဲၫၥိၭ",
			"2": "<sup>2</sup> အမိအီၪက့ၪထၪ့အဝ့ၫလၧစဎွၩလီၫ.- တၭထီးစနံဘၭ အဖိၪခွၫစယ့ၫရဘိအၫ့လၧအအီၪဝ့ၫ လၧအံဇံၭအဖၧၩ့ နီၪနါဂၧၫ့ဆၧတၭ, (အဂဲးဘဲၫယီၩ စဲၪ့ဖျိၭယူၭ လၧ စဎွၩစီလမၧၫ့အမ့ၬယၫတၭ, စယ့ၫရဘိအၫ့အီၪဝ့ၫလၧ",
			"3": "<sup>3</sup> အံဇံၭအဖၧၩ့လီၫ.)- ဆၧမၩအၥၭလၧၦအၪ့မၧၫ့လၩ့ ဆၧတၭကိၭထဲၩ့အဝ့ၫတၭ, စယ့ၫရဘိအၫ့, ဒဲအံၫစရ့ လၭအဆၧအီၪကီၪ့ထီးအလူၬ ဂဲၫဝ့ၫတၭ, ချဲၩ့ဆၧလၧ",
			"4": "<sup>4</sup> စရံၫဟဘိအၫ့တၭ, စံၭဝ့ၫဒၪ,- နဖါမၩကၪပနိၪယိၭ ဘီၩ့တၭ,နဝ့ၫဒၪဘိၩ့နဲၪ့ယီၩ နဖါအဆၧမၩကၪ, ဒဲအ နိၪယိၭဘီၩ့ဎၧၫ့ လၧအအီၪက့ၪလၧပလီၩ့ယီၩ, မၩဎွံၫ",
			"5": "<sup>5</sup> နဲၪ့အနီၪဒံၭတၭ, ပမိမၩနဆၧလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫ ၥံၪစဲၪ့ထၪ့ၥၧၫ့နံၩတၭ, ဂဲၫထဲၩ့ထဲၩ့ လၧယအီၪဆံၭ. တၭၦခမျၧးစဲၪ့ထၪ့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> တၭစဎွၩရံၫဟဘိအၫ့ ကိၪ့လိၬအၥၭ လၧၦၥၭၡါ လဖၪလၧအဆၧၫ့ထုၪ့လၧအဖါ စစီလမၧၫ့အမ့ၬယၫ လၧအမၧၫ့ဒံၭဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဘဲၫၥိၭယမိစံၭဆၧၫ့ ၦခမျၧးယီၩ, မွဲနၥံၪမိဒုၭကိၪ့ယၧၩဘဲၫၥ့ၪလဲၪ.",
			"7": "<sup>7</sup> အဝ့ၫၥံၪချဲၩ့ထၪ့ဆၧတၭ, စံၭဝ့ၫဒၪ,နအ့ၪကဲၪထၪ့ ၦခမျၧးအခ့ၫအၡၩ လၧမုဆၫလနံၩယီၩ, ဒဲမၩအဆၧ တၭ,စံၭဆၧၫ့အဝ့ၫၥံၪ, ဒဲချဲၩ့ဆၧချဲၩ့ဂ့ၩလၧအဝ့ၫၥံၪ တၭ,ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪ မိကဲၪထၪ့နခ့ၫနၡၩကိၭမု နံၩမုနၩဒ့ၭလီၫ.",
			"8": "<sup>8</sup> မွဲလါနၫ့အဝ့ၫခွံၬၡိၭခွံၬ ၦၥုၪ့က့ၭၥၭၡါအဆၧကိၪ့ လၧအဝ့ၫၥံၪဒုၭကိၪ့ယူၭအဝ့ၫတၭ, ကိၪ့လိၬအၥၭလၧ ၦအၥၭဘၪ့လၧအဒိၪထၪ့ဎုၬလၧအဝ့ၫ, လၧအဆၧၫ့",
			"9": "<sup>9</sup> ထုၪ့လၧအမ့ၬယၫလီၫ.- စံၭအဝ့ၫၥံၪ, ၦခမျၧးယီၩလၧ အချဲၩ့ဆၧလၧယၧၩတၭ စံၭ, မၩဎွံၫထၪ့နိၪယိၭဘီၩ့ လၧနဖါအီၪက့ၪလၧပလီၩ့ဆံၭနီၪ, ဘဲၫၥိၭပမိလီၩဆၧၫ့",
			"10": "<sup>10</sup> အဝ့ၫၥံၪတၭ, မွဲနၥံၪမိဖ့ၪလၫ့ဆၧဘဲၫၥ့ၪလဲၪ.- ၦအၥၭ ဘၪ့လၧအဒိၪထၪ့ဎုၬလၧအဝ့ၫ, ချဲၩ့ဆၧလၧအဝ့ၫဒၪ တၭ,စံၭဝ့ၫ, နဘၪစံၭၦခမျၧးလၧအချဲၩ့ဆၧလၧနၧၩ, နဖါမၩအနိၪယိၭဘီၩ့ဎၧၫ့, အ့ၪမွဲနဝ့ၫဒၪမၩဎွံၫထၪ့လၧ ပဂးဆံၭနီၪ, နမိဘၪစံၭအဝ့ၫၥံၪဘဲၫယီၩ, ယစူၪဒ့ၭမိ",
			"11": "<sup>11</sup> တၪ့နဲၪ့ဒံၭယဖါအယးဒံၩ့ဒံၭလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ယဖါအီၪက့ၪနိၪယိၭဘီၩ့အဎၧၫ့ လၧနၥံၪအလီၩ့တၭ, ယဝ့ၫဒၪယီၩ, ယမိအီၪက့ၪအၪထၪ့လၧနၥံၪအနိၪယိၭ ဘီၩ့အဖၫ့ခိၪလီၫ. ယဖါအၪ့ၥီၪ့နၥံၪ လၧနိၪဖျ့ၪတၭ, ယဝ့ၫဒၪယီၩယမိအၪ့ၥီၪ့နၥံၪလၧဆၧကဲၪ့မ့လီၫ.",
			"12": "<sup>12</sup> တၭစယ့ၫရဘိအၫ့ ဒဲအၡၩခမျၧးထီးအလူၬဂဲၫဝ့ၫ လၧစရံၫဟဘိအၫ့အအီၪ ၥၧၫ့နံၩလနံၩနီၪ, ဘဲၫစဎွၩ စံၭယူၭအၥိၭတၭ, စံၭဝ့ၫဒၪ, ဂဲၫထဲၩ့လၧယအီၪထီး",
			"13": "<sup>13</sup> အဘၪၥၧၫ့နံၩလနံၩဆံၭ.- စဎွၩစံၭဆၧၫ့ၦခမျၧးကၪ ကၪလ့ၬတၭ,ခွံၬၡိၭခွံၬ ၦၥုၪ့က့ၭၥၭၡါ အဆၧကိၪ့လၧ",
			"14": "<sup>14</sup> အဝ့ၫၥံၪဒုၭကိၪ့ဝ့ၫတၭး- ချဲၩ့ဆၧလၧအဝ့ၫၥံၪ ဘဲၫၦ အၥၭဘၪ့အဆၧကိၪ့အၥိၭနီၪ, စံၭဝ့ၫဒၪ, ယဖါမၩဎၧၫ့ နၥံၪအနိၪယိၭဘီၩ့တၭ, ယဝ့ၫဒၪယီၩယမိအီၪက့ၪအၪ ထၪ့ဆၧလၧနၥံၪအနိၪယိၭဘီၩ့အလီၩ့လီၫ. ယဖါအၪ့ ၥီၪ့နၥံၪလၧနိၪဖျ့ၪ, အ့ၪမွဲယဝ့ၫဒၪယီၩယမိအၪ့ၥီၪ့နၥံၪ လၧဆၧကဲၪ့မ့လီၫ.",
			"15": "<sup>15</sup> တၭစဎွၩခိၭနၪ ၦခမျၧးအလူအ့ၬး မွဲအဂဲးဘဲၫၥ့ၪ လဲၪး ဆၧဂဲၫဝ့ၫလၧယဟိဝၩ, ဘဲၫၥိၭအမိမၩလၧၫ့ထၪ့ ဎွ့ၩထၪ့အဆၧချဲၩ့ လၧယဟိဝၩ ချဲၩ့ဝ့ၫလၧစနံဘၭအ ဖိၪခွၫစယ့ၫရဘိအၫ့လၧၦၡံလိၫဖိၪ စအဟဲယၫအစူၪ ဖၧၩ့နီၪလီၫ.",
			"16": "<sup>16</sup> အံၫစရ့လၭထီးအလူၬ ဒၪဘၪဝ့ၫလၧစဎွၩလခိၭနၪ ဘၪၦခမျၧးအလူတၭ, ၦခမျၧးစံၭဆၧၫ့စဎွၩတၭ,စံၭ ဝ့ၫဒၪ,ပဂးအီၪလၧစဒၫဝံၭအဖၧၩ့နီၪ, မွဲဆၧနီၪလမံၩ့ လဲၪ.တၭပန့ၥၫဆၧလၧ စယ့ၭစံၫအဖိၪခွၫအဖၧၩ့အ့ၬ. ထဲၩ့ထဲၩ့လၧနၥံၪၥုၪ့တဲၩအလးဖၧၩ့ဆံၭၬ အံၫစရ့လၭ ဧ့,ဘိၩ့နဲၪ့ယီၩ, ယိနဂံၪ့ဒၪနဝ့ၫဆံၭ, စဒၫဝံၭဧ့း တၭ",
			"17": "<sup>17</sup> အံၫစရ့လၭထဲၩ့ထဲၩ့ဝ့ၫ လၧတဲၩဖၧၩ့လီၫ.- မွဲလါနၫ့ ဘိၩၦအံၫစရ့လၭဖိၪလၧအအီၪဝ့ၫ လၧယုဒၫအဒိၩ့လ ဖၪအဖၧၩ့နီၪစရံၫဟဘိအၫ့ ကဲၪစဎွၩလၧအဖၫ့ခိၪလီၫ.",
			"18": "<sup>18</sup> တၭစဎွၩရံၫဟဘိအၫ့အၪ့မၧၫ့လၩ့ စအဒိရၫ့လၧအ ပၧၩ့ဘၪအခီၫ့တၭ, အံၫစရ့လၭထီးအလူၬခွံၬအဝ့ၫ လၧလိးၥံၪတၭ,ၥံၫဝ့ၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, စရံၫ ဟဘိအၫ့ လ့ၩဝ့ၫချဲၫ့ချဲၫ့ဘဲၫၥိၭ အမိလ့ၩနုၬထၪ့လၧ အလဲၪ့ၥုၭအဖၧၩ့ ဘဲၫၥိၭအမိထဲၩ့စဲၪ့ဝ့ၫလၧယရုစလံၫ့",
			"19": "<sup>19</sup> လီၫ.- တၭအံၫစရ့လၭပိၩ့ထၪ့စဒၫဝံၭ အၡၩဂံၪ့ဖိၪထီး မုဆၫလနံၩယီၩလီၫ.",
			"20": "<sup>20</sup> ဆၧမၩအၥၭ ထီးအံၫစရ့လၭထီးအလူၬနါဂၧၫ့ဝ့ၫ လၧစယ့ၫရဘိအၫ့ ဂဲၫထဲၩ့ဒီၭတၭ, အဝ့ၫၥံၪအၪ့မၧၫ့ လၩ့ဆၧတၭ, ကိၭန့ဝ့ၫလၧဆၧအီၪကီၪ့ အအီၪတၭ, အီၪက့ၪဝ့ၫလၧစဎွၩ လၧအံၫစရ့လၭ ထီးအလူၬအဖၫ့ ခိၪလီၫ. ၦလၧအလီၩ့ စဒၫဝံၭအၡၩဂံၪ့ဖိၪ အီၪဝ့ၫန့ၫ ယုဒၫလဒီၪ့နီၪလီၫ.",
			"21": "<sup>21</sup> စရံၫဟဘိအၫ့ဂဲၫထီၩ့ဝ့ၫလၧ ယရုစလံၫ့အဖၧၩ့တၭ, ဒုၭအီၪကိၩ့အီၪကီၪ့ ယုဒၫအၡၩဂံၪ့ဖိၪ ထီးအလူၬ,ဒဲ ဘံၪ့ယမံၫ့လဒီၪ့, ၦၥုၭဖိၪလၧအရွံန့ဝ့ၫ, လကုၬဎိၭလၬ ဘဲၫၥိၭအမိဒုၭဆၧထၫ့ဒၩ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ, ဘဲၫၥိၭအမိဒုၭထဲၩ့ ဘၩ့မုးနီၪ လၧစစီလမၧၫ့ အဖိၪခွၫ",
			"22": "<sup>22</sup> စရံၫဟဘိအၫ့အအီၪလီၫ.- တၭယွၩအလူနီၪလၩ့ဘၪ",
			"23": "<sup>23</sup> ယွၩအၡၩစရှ့ၫမအဲအၫတၭ, စံၭဝ့ၫဒၪ,- လီၩဘၪယုဒၫ အစဎွၩ, စစီလမၧၫ့အဖိၪခွၫ စရံၫဟဘိအၫ့, ဒဲယုဒၫ ဒဲဘံၪ့ယမံၫ့အဂံၪ့ဖိၪထီးအလူၬ, ဒဲၦခမျၧးလၧအအီၪ",
			"24": "<sup>24</sup> လၩ့ထးတၭ, စံၭ,- ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, နၥံၪထီး လ့ၩထၪ့ဒုၭၥုၭလၧနၥံၪအထၧၫ့ဖုဝဲ, ၦအံၫစရ့လၭဖိၪ လဂ့ၩ. ထဲၩ့ထဲၩ့လဂၩလၧအဂံၪ့ဒၪဝ့ၫ, လဂၩလၧအ ဂံၪ့ဒၪဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩ ဆၧလမံၩ့ယီၩ ကဲၪထၪ့ လၧယၧၩလီၫ. တၭအဝ့ၫၥံၪခိၭနၪယဟိဝၩအလူတၭ, ထဲၩ့ထဲၩ့ဝ့ၫဘဲၫၥိၭ အမိစဲၪ့ထၪ့ခွံၬ ဘဲၫယဟိဝၩအလူ အၥိၭနီၪလီၫ.",
			"25": "<sup>25</sup> စယ့ၫရဘိအၫ့မၩထၪ့ၡံကံၫ့ လၧခိၪလီၩ့အံဖြံၫ့အ လီၩ့တၭ,အီၪဝ့ၫထီးနီၪတၭး စဲၪ့ထၪ့ထီးနီၪတၭ,မၩထၪ့",
			"26": "<sup>26</sup> ပနုအ့ၫလၭလီၫ.- တၭစယ့ၫရဘိအၫ့စံၭလၧအၥၭခံ ဖၧၩ့,ဘိၩ့နဲၪ့ယီၩ, ဘၩ့မုးယီၩမိထဲၩ့ထဲၩ့ လၧစဒၫဝံၭ",
			"27": "<sup>27</sup> အၡၩဂံၪ့ဖိၪအအီၪလီၫ.- တၭၦခမျၧးယီၩအ့ၪလ့ၩထၪ့ ဘဲၫၥိၭအမိလုထၪ့ဆၧလၧယဟိဝၩ အဂံၪ့ဖၧၩ့လၧယ ရုစလံၫ့အဖၧၩ့တၭ, ထီးနီၪလဖၧၫ့ၦခမျၧးယီၩအၥၭမိ ထဲၩ့ထဲၩ့လၧအကဆါအအီၪ, လၧယုဒၫအစဎွၩရံၫဟ ဘိအၫ့အအီၪတၭ မိမၩၥံၫယၧၩတၭ, မိထဲၩ့ထဲၩ့လၧ",
			"28": "<sup>28</sup> ယုဒၫအစဎွၩရံၫဟဘိအၫ့အအီၪလီၫ.- စဎွၩကိၪ့လိၬ ဆၧတၭ,တဲၩ့ချီဖိၪလၧထီၫ့နံၫဒုၩတၭ, စံၭအဝ့ၫၥံၪ,န ၥံၪလ့ၩထၪ့လၧယရုစလံၫ့မွဲဆၧအၪလၨၪ လၧနၥံၪအ ဂးလီၫ. အံၫစရ့လၭဧ့, နယွၩလဖၪ လၧအဂဲၫဆိၬထၪ့",
			"29": "<sup>29</sup> နၧၩလၧအံဇံၭအဖၧၩ့နီၪ,ယိခွါဘီၪ.- အီၪက့ၪလၩ့ဝ့ၫ လဒုၩလၧဘ့ၫၥလၭအဖၧၩ့, ဒဲအဝ့ၫလဒုၩ လၧဒၫ့အ ဖၧၩ့လီၫ. တၭဆၧလမံၩ့နီၪ ကဲၪထၪ့ဆၧဒဲၩဘၭလီၫ.",
			"30": "<sup>30</sup> အဂဲးဘဲၫယီၩ ၦခမျၧးလ့ၩထၪ့လၧလဒုၩ အမ့ၬယၫ",
			"31": "<sup>31</sup> ထီၩ့လၧဒၫ့လီၫ.- အဝ့ၫမၩဂံၪ့လၧဆၧအလးထၪ့ထီၫ လဖၪတၭ, အီၪက့ၪၦလုဆၧလဖၪလၧၦအၡၪ့ထုၬလၧ ၦခမျၧးအကျၩ လၧအလမွဲဘၪ ၦလံဝဲၫအဖိၪခွၫၥံၪ လီၫ.",
			"32": "<sup>32</sup> တၭစယ့ၫရဘိအၫ့မၩကဲၪထၪ့ဆၧမၩဘိၪ့လၧ လၩဎိၭဘံၪ့လဘံၪ့အဖၧၩ့, လၩထၪ့လဆံၫယဲနံၩလနံၩ နီၪမၩအၥၭဘဲၫဆၧမၩဘိၪ့ လၧယုဒၫအဖၧၩ့အၥိၭနီၪ တၭ,လုထၪ့ဆၧလၧဆၧလုလး အဖၫ့ခိၪလီၫ. မၩဝ့ၫ ဘဲၫနီၪၥိၭဆ့လၧဘ့ၫၥလၭအဖၧၩ့, ချီဖိၪလၧအတဲၩ့ဝ့ၫ နီၪလုထၪ့အဝ့ၫၥံၪး ဒဲဆၧအလးထၪ့ထီၫအၡၩလုဆၧ လဖၪလၧအဒုၭကဲၪထၪ့ဝ့ၫနီၪ အီၪက့ၪလၩ့ဝ့ၫလၧဘ့ၫ",
			"33": "<sup>33</sup> ၥလၭအဖၧၩ့လီၫ.- တၭလုထၪ့ဆၧလၧဆၧလုလးအ ဖၫ့ခိၪလၧအမၩဝ့ၫလၧဘ့ၫၥလၭအဖၧၩ့ လၩဎိၭဘံၪ့ လဘံၪ့လၩထၪ့ လဆံၫယဲနံၩလနံၩအဖၧၩ့, လၧလၩ လၧအကိၪ့ဝဲၩဝ့ၫလၧအၥၭခံဖၧၩ့နီၪတၭ, အီၪက့ၪဆၧ မၩဘိၪ့လၧအံၫစရ့လၭဖိၪအဂးတၭ, လုထၪ့ဆၧလၧ ဆၧလုလးအဖၫ့ခိၪနီၪတၭ, ဆူၭခဲၩဆၧနၧၫ့မၧၫ့လီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ယိခွါ, ယွၩအၡၩလဂၩလၧယဟိဝၩအလူအ ကၠီၩ့ဂဲၫထၪ့ခွံၬ လၧယုဒၫထီၩ့လၧဘ့ၫၥလၭအဖၧၩ့တၭ, စယ့ၫရဘိအၫ့ ဆၧၫ့ထုၪ့ဝ့ၫလၧဆၧလုလး အနဲၩ့ထံၭ",
			"2": "<sup>2</sup> ဘဲၫၥိၭအမိဆူၭခဲၩဆၧနၧၫ့မၧၫ့လီၫ.- ၦၡၩနီၪကိၭထၪ့ ဝ့ၫထၫ့ဒၩဆၧလုအလးလၧယဟိဝၩ အလူအကၠီၩ့တၭ, စံၭဝ့ၫဒၪ,ဆၧလုအလးဧ့, ဆၧလုအလးဧ့, ယဟိဝၩ စံၭဘဲၫယီၩ, ယိခွါ,ဖိၪၥၪလဂၩ မိအီၪဖျဲၪဝ့ၫလၧစဒၫ ဝံၭအဂံၪ့အဂး, အမံၩ့စယိၫစဲအၫတၭး ဆၧအလးထၪ့ ထီၫအၡၩလုဆၧ, ၦလၧအဆူၭခဲၩ ဆၧနၧၫ့မၧၫ့လၧ နလီၩ့လဖၪနီၪ, အဝ့ၫဒၪမိလုထၪ့ အဝ့ၫၥံၪလၧနလီၩ့",
			"3": "<sup>3</sup> တၭး မ့ၪမိအၪ့ၦၡၩအဎွံၪအနၧၩ့လၧနလီၩ့လီၫ.- လၧ မုလနံၩနီၪ အဝ့ၫဒၪဖ့ၪလၫ့ဆၧနဲၪ့တၭ, စံၭဝ့ၫဒၪ,အ ယီၩမွဲဆၧနဲၪ့လၧယဟိဝၩချဲၩ့ယူၭဆၧ, ယိခွါ,ဆၧလု အလးမိထ့ဖၭ, ဒဲဖံၫ့ချၪလၧအအီၪလၧအလီၩ့နီၪမိဘၪ ဆၧဂါလၩ့ခွံၬဝ့ၫလီၫ.",
			"4": "<sup>4</sup> ထီးစဎွၩယ့ၫရဘိအၫ့နါဂၧၫ့ယွၩအၡၩ အဆၧချဲၩ့ လၧအကိၭထၪ့ထၫ့ဒၩ ဆၧလုအလးလၧဘ့ၫၥလၭအ ဖၧၩ့နီၪတၭ, ဆၧမၩအၥၭလၧအယူၬစိၩအစူၪလၧဆၧ လုလးအနဲၩ့ထံၭတၭ, စံၭဝ့ၫဒၪ, ဖီၪ့ထၬအဝ့ၫဘီၪး တၭအစူၪလၧအယူၬစိၩထၫ့ဒုၩဒၩအဝ့ၫနီၪ, ဎဲၫ့ထၪ့ခွံၬ",
			"5": "<sup>5</sup> တၭ,ထုၭလၩ့ထဲၩ့ဝ့ၫလၧအအီၪၥ့ၪလၧၩ့အ့ၬ. ဆၧလု အလးနီၪအ့ၪထ့ဖၭဆ့တၭ, ဖံၫ့ချၪဘၪဆၧလၩ့ခုၬခွံၬ ဝ့ၫလၧဆၧလုအလး, ဘဲၫဆၧနဲၪ့လၧယွၩအၡၩဖ့ၪလၫ့",
			"6": "<sup>6</sup> ဝ့ၫလၧယဟိဝၩအလူအၥိၭနီၪလီၫ.- စဎွၩစံၭဆၧၫ့ယွၩ အၡၩတၭ, စံၭဝ့ၫဒၪ, အၪ့ယၫဆၧလၧယဟိဝၩနယွၩ အမ့ၬယၫတၭ, ဘၩဆိၪဖၪန့ယဂး, ဘဲၫၥိၭယမိန့ထဲၩ့ ယစူၪဆံၭ. တၭယွၩအၡၩအၪ့ကံၩ့အၪ့ယၫ ယဟိ ဝၩတၭ,စဎွၩန့ထဲၩ့အစူၪတၭ, ကဲၪထဲၩ့ဝ့ၫဘဲၫအလး",
			"7": "<sup>7</sup> လီၫ.- တၭစဎွၩစံၭယွၩအၡၩ, ဂဲၫလၧယၥိၭလၧယ ဂံၪ့တၭ, ဒုၭဆီၪ့ထၪ့နၥၭဆံၭ. တၭယမိ ဖ့ၪလၫ့နၧၩ",
			"8": "<sup>8</sup> လၧဆၧလမံၩ့လီၫ.- ယွၩအၡၩနီၪစံၭစဎွၩ, နအ့ၪဖ့ၪ လၫ့ယၧၩလၧနဂံၪ့ထၧၫ့ခီၫယၫနီၪ, ယလ့ၩနုၬလၧနၥိၭ အ့ၬး ယအၪ့ကိၪ, ဒဲယအီၩထံၫ လၧဆၧအလးယီၩ",
			"9": "<sup>9</sup> အ့ၬ.- အဂဲးဘဲၫယီၩ ယဟိဝၩအလူနီၪမၪလူၬယၧၩ ဘဲၫနီၪအၥိၭ, စံၭဝ့ၫဒၪ, အၪ့ကိၪလဂ့ၩ, ဒဲအီၩထံၫလ",
			"10": "<sup>10</sup> ဂ့ၩ,ဒဲထဲၩ့ထဲၩ့လၧဖၧၩ့ၥၭလၧနဂဲၫနီၪလဂ့ၩ.- အခိး မွဲထဲၩ့ထဲၩ့ဝ့ၫလၧဖၧၩ့ၥၭလဘီၩ့ဒၪတၭ, မွဲဖၧၩ့ၥၭလၧ အဂဲၫလၧဘ့ၫၥလၭနီၪအ့ၬ.",
			"11": "<sup>11</sup> မီၪၥၭၡါလဂၩအီၪဝ့ၫလၧ ဘ့ၫၥလၭအဖၧၩ့တၭ,အ ဖိၪခွၫလဖၪဂဲၫတၭ, လီၩဘၪဝ့ၫလၧကယဲဆၧမၩလၧ ယွၩအၡၩမၩဝ့ၫ လၧမုလနံၩနီၪ လၧဘ့ၫၥလၭအဖၧၩ့ လီၫ.ဆၧချဲၩ့လၧအစံၭ စဎွၩနီၪအဝ့ၫၥံၪလီၩဘၪအ ဖါဆ့လီၫ. တၭအဖါစံၭအဝ့ၫၥံၪ, မွဲအလ့ၩဝ့ၫလၧဖၧၩ့",
			"12": "<sup>12</sup> ၥၭလဘီၩ့ဘီၩ့လဲၪ.- အဂဲးဘဲၫယီၩ အဖိၪခွၫလဖၪဒၪ ဘၪဖၧၩ့ၥၭလၧယွၩအၡၩလၧအဂဲၫဝ့ၫ လၧယုဒၫလဂၩ",
			"13": "<sup>13</sup> လ့ၩဝ့ၫနီၪလီၫ.- အဝ့ၫဒၪစံၭအဖိၪခွၫလဖၪနီၪမၩထၪ့",
			"14": "<sup>14</sup> ယၧၩကၥ့ၪယီၩ့အပီၩ့ဆံၭ.- အဝ့ၫၥံၪ မၩထၪ့ကၥ့ၪ ယီၩ့အပီၩ့လၧအဂးတၭ, အဝ့ၫဒၪထူၬဝ့ၫတၭ, လီၩ့ ဆီးယွၩအၡၩတၭ, ဒၪန့ဝ့ၫဆၧၫ့နၩ့ လၧၥံၪ့ထိၭဖၫအ ဖၫ့လၬတၭ,စံၭအဝ့ၫဒၪ, နမွဲယွၩအၡၩလၧအဂဲၫထၪ့ လၧယုဒၫနီၪဆ့ဧၪ. တၭအဝ့ၫဒၪစံၭ, မွဲယၧၩလီၫ.",
			"15": "<sup>15</sup> ထီးနီၪလၧဖၧၫ့ ၦလဂၩနီၪစံၭဝ့ၫ, ဂဲၫလၧယၥိၭလၧယ",
			"16": "<sup>16</sup> ဂံၪ့တၭ,အၪ့ကိၪဆံၭ.- အဝ့ၫဒၪစံၭဝ့ၫ, ယထဲၩ့ထဲၩ့လၧ နၥိၭ,လ့ၩနုၬဒဲနၧၩ, ၥ့ၪအ့ၬ.တၭယအၪ့ကိၪ, ဒဲယအီၩ",
			"17": "<sup>17</sup> ထံၫလၧအလးယီၩအ့ၬ.- အဂဲးဘဲၫယီၩဆၧစံၭယၧၩ လၧယဟိဝၩအလူ, နအၪ့ဘၪကိၪ,ဒဲနအီၩဘၪထံၫလၧ အလးထီးနီၪအ့ၬ. တၭနကၠၪထဲၩ့နၥၭလၧနမိဖိၬဖၧၩ့",
			"18": "<sup>18</sup> ၥၭလၧနဂဲၫနီၪဆ့အ့ၬ.- အဝ့ၫဒၪစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩ ယမွဲမီၪဘဲၫနၧၩ အၥိၭတၭ, ဆၧအၥီၫ့လဂၩလီၩဘၪ ယၧၩလၧယဟိဝၩအလူတၭ, စံၭဝ့ၫဒၪ, ဂဲၫဆိၬအဝ့ၫ လၧနဂံၪ့ဘဲၫၥိၭအမိအၪ့ကိၪဒဲအီၩထံၫဆံၭ. တၭချဲၩ့",
			"19": "<sup>19</sup> ဘျံၭချဲၩ့ဘျၪဆၧလၧအဝ့ၫလီၫ.- အခိးမွဲဘဲၫနီၪတၭအ ဝ့ၫဒၪထဲၩ့ထဲၩ့လၧအၥိၭတၭ, အၪ့ကိၪလၧအဂံၪ့ဖၧၩ့ ဒဲအီၩထံၫလီၫ.",
			"20": "<sup>20</sup> တၭၦလဖၪနီၪ ဆၧၫ့နၩ့လၧစပွဲထံၭအဘိၩ့ဘၭနီၪ ဆၧမၩအၥၭလၧယဟိဝၩ အလူလၩ့ဘၪမီၪလၧအဂဲၫ",
			"21": "<sup>21</sup> ထဲၩ့ဆိၬအဝ့ၫလီၫ.- အဝ့ၫဒၪကိၭထၪ့လၧယွၩအၡၩ လၧအဂဲၫလၧယုဒၫတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩစံၭဘဲၫ ယီၩ,မွဲနပိၩ့ထၪ့ယဟိဝၩအနိၭတၭ, လထီးန့ဘၪဆၧ",
			"22": "<sup>22</sup> မၪလူၬလၧယဟိဝၩ နယွၩမၪလူၬနၧၩး- အ့ၪမွဲနဂဲၫ ထဲၩ့ကဒၩထဲၩ့တၭ, အၪ့ကိၪဒဲအီၩထံၫအလးထီးယ ဟိဝၩစံၭနၧၩ, အၪ့ကိၪလဂ့ၩ, အီၩထံၫလဂ့ၩနီၪ,တၭ",
			"23": "<sup>23</sup> နစွၪဂဲၫထဲၩ့ဘၪလၧနဖါအၥွၪခိၪအဖၧၩ့အ့ၬ.- လၧအ အၪ့ကိၪအလးခဲၫ့, ဒဲလၧအအီၩထံၫအလးခဲၫ့နီၪ,ဆၧ မၩအၥၭလၧၦလဂၩနီၪ မၩထၪ့ကၥ့ၪယီၩ့အပီၩ့လၧ",
			"24": "<sup>24</sup> မီၪလၧအဂဲၫထဲၩ့ဆိၬဝ့ၫလဂၩအဂးလီၫ.- ထီးအဝ့ၫ လ့ၩဆၧတၭ, ဆၬလၥၧၫ့ဘၪခီၩ့ဝ့ၫ လၧဖၧၩ့ၥၭနီၪ, မၩၥံၫဝ့ၫတၭ, အစွၪအီၪခွံၬၡိၭထးအၥၭ လၧဖၧၩ့ၥၭ တၭ,ကၥ့ၪယီၩ့ဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭတၭ, ဆၬလ",
			"25": "<sup>25</sup> ၥၧၫ့နီၪဆၧၫ့ထုၪ့ဝ့ၫလၧအစွၪအနဲၩ့ထံၭဆ့လီၫ.- ယိ ခွါ,ၦၡၩၥံၪလ့ၩဖီၩ့ခွံၬတၭ, ဒၪဘၪအစွၪအီၪခွံၬၡိၭအ ၥၭထီးနီၪလၧဖၧၩ့ၥၭနီၪ ဆၬလၥၧၫ့ဆၧၫ့ထုၪ့လၧအ နဲၩ့ထံၭတၭ, အဝ့ၫၥံၪဂဲၫလီၩဘၪဝ့ၫလၧဒိၩ့ဖၧၩ့, ထီး",
			"26": "<sup>26</sup> မီၪၥၭၡါအီၪဝ့ၫလီၫ.- မီၪလၧအဂဲၫထဲၩ့ဆိၬဝ့ၫလၧဖၧၩ့ ၥၭနီၪနါဂၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, မွဲဝ့ၫယွၫအၡၩလၧအ ပိၩ့ထၪ့ယဟိဝၩအလူတၭ, ယဟိဝၩဖ့ၪလၫ့ခွံၬဝ့ၫလၧ ဆၬလၥၧၫ့လၧအအဲၪ့ၡၫ့ယၬခွံၬဝ့ၫတၭ, မၩၥံၫဝ့ၫ, ဘဲၫ ယဟိဝၩအလူလၧအချဲၩ့ဆၧလၧ အဝ့ၫအၥိၭနီၪလီၫ.",
			"27": "<sup>27</sup> အလဂၩနီၪချဲၩ့ဆၧလၧ အဖိၪခွၫလဖၪ စံၭဝ့ၫဒၪ,မၩ ထၪ့ယၧၩကၥ့ၪယီၩ့အပီၩ့နီၪဆံၭ. တၭအဝ့ၫၥံၪမၩ",
			"28": "<sup>28</sup> ထၪ့ဝ့ၫအပီၩ့နီၪဆ့လီၫ.- လ့ၩဝ့ၫတၭဒၪန့အစွၪအီၪခွံၬ ၡိၭခွံၬအၥၭလၧဖၧၩ့ၥၭအဖၧၩ့, ဒဲကၥ့ၪယီၩ့, ဒဲဆၬလ ၥၧၫ့ဆၧၫ့ထုၪ့ဝ့ၫလၧအစွၪအနဲၩ့ထံၭတၭ, ဆၬလၥၧၫ့ လအၪ့ဘၪအစွၪ, ဒဲလအဲၪ့ၡၫ့ဘၪကၥ့ၪယီၩ့နီၪလီၫ.",
			"29": "<sup>29</sup> မီၪလဂၩနီၪ မၩန့ယွၩအၡၩအစွၪတၭ, အီၪက့ၪဝ့ၫ လၧကၥ့ၪယီၩ့အလီၩ့ ဂဲၫထဲၩ့ဆိၬဝ့ၫတၭ, မီၪၥၭၡါဂဲၫ လၧဒိၩ့ဖၧၩ့, ဘဲၫၥိၭအမိဂၪ့ဝ့ၫတၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬ",
			"30": "<sup>30</sup> ဝ့ၫလီၫ.- အဝ့ၫဒၪအီၪက့ၪအစွၪလၧအၥွၪခိၪဒၪဝ့ၫအ ဖၧၩ့တၭ, ဒဲၩလၩ့အၥၭနၫၡါဂၪ့ကိၭၡၭထၪ့တၭ, စံၭ",
			"31": "<sup>31</sup> ဝ့ၫဒၪ,အၩလါ, ယထၧၫ့ဖုဝဲဧ့,- တၭလၧအခုၪ့လၩ့ဘၧၩ့ ခွံၬဝ့ၫအလးခဲၫ့နီၪဆၧမၩအၥၭ လၧအချဲၩ့ဆၧလၧအ ဖိၪခွၫလဖၪတၭ,စံၭဝ့ၫ, ထီးယအ့ၪၥံၫခိၬတၭ, ခုၪ့လၩ့ ဘၧၩ့ခွံၬယၧၩလၧဆၧၥွၪခိၪအဖၧၩ့ထီးယွၩအၡၩအီၪ ခုၪ့လၩ့ဘၧၩ့အၥၭလၧအဖၧၩ့နီၪဆံၭ. အီၪက့ၪယဎွံၪ",
			"32": "<sup>32</sup> လၧအဝ့ၫအဎွံၪအနဲၩ့ထံၭနီၪဆံၭ.- အဂဲးဘဲၫယီၩဆၧ ချဲၩ့လၧအကိၭထၪ့ယဟိဝၩ အလူထၫ့ဒၩဆၧလုအလး လၧဘ့ၫၥလၭအဖၧၩ့ဒဲထၫ့ဒၩ ဂံၪ့လဖၪလၧဆၧအလး ထၪ့ထီၫထီးအလူၬ လၧအအီၪဝ့ၫလၧစမ့ရအၫအဒိၩ့ ၥံၪအဖၧၩ့နီၪ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့တၡါလီၫ.",
			"33": "<sup>33</sup> ဆၧလမံၩ့ယီၩအလးခဲၫ့ စယ့ၫရဘိအၫ့ ဂဲၫထဲၩ့ ကဒၩထဲၩ့လၧအဖၧၩ့ၥၭအၧၩ့အ့ၬး အ့ၪမွဲအီၪက့ၪထဲၩ့ ဒီၭၦၡၪ့ထုၬလၧၦခမျၧးအကျၩ လၧအလးထၪ့ထီၫအ ၡၩလုဆၧလဖၪလီၫ. တၭထီးဒၪ ၦလၧအဘၪအၥၭ နီၪ,အီၪက့ၪလၩ့မဲၩဒၪဆၧဘဲၫၥိၭ အမိကဲၪထၪ့ဆၧအ လးထၪ့ထီၫအၡၩလုဆၧနီၪလီၫ.",
			"34": "<sup>34</sup> တၭဆၧလမံၩ့ယီၩ ကဲၪထၪ့ဆၧဒဲၩဘၭလၧစယ့ၫရ ဘိအၫ့အဂံၪ့အဂး, ထီးဆၧဒၪ့ထ့ၬ, ဒဲမၩဂၭဂီၩ့ခွံၬဝ့ၫ လၧဂၪ့ခိၪချိၫ့လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> အထီထီးနီၪ စယ့ၫရဘိအၫ့အဖိၪခွၫစအဘဲယၫဆၫ",
			"2": "<sup>2</sup> ထၪ့ဝ့ၫလီၫ.- တၭစယ့ၫရဘိအၫ့စံၭအမၫ, ဂဲထုၪ့လါ ဆံၭ. တၭမၩလၩ့မဲၩနၥၭဘဲၫၥိၭ ၦၡၩထီးၥ့ၪယၫလၧ နမွဲစယ့ၫရဘိအၫ့အမၫလဂ့ၩး တၭလ့ၩလၧၡဲလိၫဆံၭ. တၭယိခွါ, မီၪစအဟဲယၫ, လၧအစံၭယၧၩ လၧယမိ ကဲၪထၪ့စဎွၩလၧၦခမျၧးယီၩအဖၫ့ခိၪနီၪ, အီၪထီးနီၪ",
			"3": "<sup>3</sup> လီၫ.- မၩန့ကိၪဆံၫလီၪ့, ဒဲကိၪပၪပဲၪလဖၪဒဲန့ၫစၩ့လ ပလၫ့လၧနစူၪဖၧၩ့တၭ, လ့ၩလၧအအီၪတၭ, ဖိၪၥၪမိ မၩအၥၭဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ မိလီၩဘၪနၧၩလီၫ.",
			"4": "<sup>4</sup> စယ့ၫရဘိအၫ့အမၫမၩဝ့ၫဘဲၫနီၪတၭ, ဂဲထုၪ့တၭ,လ့ၩ ဝ့ၫလၧၡဲလိၫတၭ, ဂဲၫဝ့ၫလၧစအဟဲယၫ အဂံၪ့လီၫ. တၭစအဟဲယၫလၧအၥၭၡါအကၠီၩ့ အမ့ၬၥၪဒၪဝါဆၧ",
			"5": "<sup>5</sup> အ့ၬ.- တၭယဟိဝၩစံၭစအဟဲယၫ, ယိခွါ,စယ့ၫရဘိ အၫ့အမၫဂဲၫအၪ့ကံၩ့ဆၧလၧနၧၩ လၧအဖိၪခွၫအဂး လီၫ.အဂဲးဘဲၫယီၩ ဘၪဆၧဆၫလီၫ. တၭနမိဘၪစံၭ အဝ့ၫဘဲၫအံၩဘဲၫအိၩလီၫ. အဂဲးဘဲၫယီၩ, ဆၧမၩအ ၥၭထီးအဂဲၫနုၬတၭ, မိကျဲၩ့မၩအၥၭ ဘဲၫၦမုၪအဂူၫ ဂၩလဂၩအၥိၭလီၫ.",
			"6": "<sup>6</sup> ထီးစအဟဲယၫနါဂၧၫ့အခၪ့ၥီၫ လၧအဂဲၫနုၬလၧတ ရၫ့အဖၧၩ့တၭ, ဆၧမၩအၥၭလၧအစံၭဝ့ၫဒၪ, စယ့ၫရ ဘိအၫ့အမၫဧ့, ဂဲၫနုၬဘီၪ. နကျဲၩ့မၩနၥၭဘဲၫၦဂူၫဂၩ အၥိၭ,မွဲဘၪလဲၪ. ဆၧအၪ့မၧၫ့လၩ့ယၧၩ လၧနအီၪ",
			"7": "<sup>7</sup> လၧဆၧအဎၧၫ့လီၫ.- လ့ၩလီၩဘၪစယ့ၫရဘိအၫ့,ယ ဟိဝၩအံၫစရ့လၭအယွၩစံၭဝ့ၫဘဲၫယီၩ, မွဲယထုၭထၪ့ ခွံၬနၧၩလၧၦၡၩခမျၧးအကျၩ အီၪက့ၪထၪ့ထီၫနၧၩ, ဒဲအီၪက့ၪနၧၩလၧယၡၩခမျၧး အံၫစရ့လၭအဖၫ့ခိၪ,",
			"8": "<sup>8</sup> ဒဲထုၭန့ဘၩ့မုး လၧစဒၫဝံၭအၡၩဂံၪ့ဖိၪတၭ, ဖ့ၪလၫ့ လၧနၧၩတၭး မွဲလါနၫ့ဘိၩ ဘဲၫနမိမၩန့ၫဆၧအဘၪလၧ ယမ့ၬယၫနမီၪ့ဎီၩ့ယခ့ၫယၡၩ စဒၫဝံၭ လၧအထီးန့ ယဆၧၥီၪ့ဆၧၥၫ့တၭ, လီၩ့ယၧၩ လၧအၥၭထၧၫ့ဖျိၪ့",
			"9": "<sup>9</sup> ယၫအၥိၭနီၪအ့ၬ.- အ့ၪမွဲနမၩဆၧအၧၩ့နၭနဲၪ့ကယဲၦ လၧအအီၪဝ့ၫလၧနမ့ၬယၫနီၪ, အဂဲးဘဲၫယီၩနလ့ၩတဲၩ့ နယွၩအဂူၫဂၩလဖၪ, ဒဲဆၧဂၩ့ၥိၫ့အၥၭ, ဒဲမၩၥၭထၪ့",
			"10": "<sup>10</sup> ယၧၩတၭ,ခွံၬၡိၭထးယၧၩလၧနချိၫ့နီၪလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ,ယိခွါ, ယမိဒုၭဂဲၫဘၪဆၧအၧၩ့လၧစယ့ၫ ရဘိအၫ့အၡၩဂံၪ့ဖိၪတၭ, လၧၦဘၪဆဲၫ့လၧစယ့ၫရ ဘိအၫ့နီၪ ယမိဒၪ့ထ့ၬခွံၬကယဲၦခွၫလဖၪ, ဒဲၦလၧအ ဘၪဆၧဒုၭထၬဝ့ၫ ဒဲအီၪလၩ့ထး လၧအံၫစရ့လၭအ ဖၧၩ့တၭ,ယမိမၩန့ထၪ့ခွံၬ စယ့ၫရဘိအၫ့ အဆၧအီၪ လၩ့ထး, ဘဲၫၦမၩန့ထၪ့ခွံၬဆၧအ့ၪ ထီးအလူၬအၥိၭ",
			"11": "<sup>11</sup> နီၪလီၫ.- တၭၦဘၪဆဲၫ့လၧစယ့ၫရဘိအၫ့, လၧအၥံၫ ဝ့ၫလၧဒိၩ့ဖၧၩ့နီၪ, ထွံၪမိအၪ့ခွံၬဝ့ၫတၭ, ၦလၧအၥံၫဝ့ၫ လၧမံၩ့လၬကျၩနီၪ, ထိၪၥံၪလံၪၥံၪလၧဆၧဖိၭဖၫ့မိအၪ့ ခွံၬဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩချဲၩ့ယူၭဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ဂဲထုၪ့နဝ့ၫတၭ, ထဲၩ့ထဲၩ့လၧနဂံၪ့ဒၪနဝ့ၫဆံၭ. ထီးနခၪ့",
			"13": "<sup>13</sup> နုၬဘၪလၧဒိၩ့ဖၧၩ့တၭ, ဖိၪၥၪမိၥံၫဝ့ၫလီၫ.- အံၫစရ့ လၭမိဒဲၩလၩ့အၥၭနၫၡါဂၪ့ဝ့ၫလၧအကၠီၩ့တၭ, မိခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ လၧၦဘၪဆဲၫ့လၧ စယ့ၫရဘိအၫ့အကျၩနီၪ ၦမိဂဲၫထီၩ့လၧၥွၪခိၪဖၧၩ့နီၪ မွဲန့ၫအဝ့ၫဒၪလဂၩလီၫ. အဂဲးဘဲၫယီၩ ဆၧဒၪန့ဆၧ ဂ့ၩလၧယဟိဝၩအံၫစရ့လၭ အယွၩအဂးလၧအဝ့ၫဒၪ အဖၧၩ့လၧစယ့ၫရဘိအၫ့ အၡၩဂံၪ့ဖိၪအကျၩလီၫ.",
			"14": "<sup>14</sup> တၭယဟိဝၩမိဒုၭဂဲထုၪ့စဎွၩ လၧအံၫစရ့လၭအဖၫ့ခိၪ လၧအမိဒၪ့ထ့ၬခွံၬစယ့ၫရဘိအၫ့ အၡၩဂံၪ့ဖိၪလၧမုလ နံၩနီၪလီၫ. တၭနီၫလဲၪၬ ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬဆ့လီၫ.",
			"15": "<sup>15</sup> တၭယဟိဝၩမိကျီၪ့ခွံၬ အံၫစရ့လၭဘဲၫဖီးလၧအဂဲၩဝၭ ဝ့ၫလၧထံၫကျၩအၥိၭနီၪ, မိထ့ၬခွံၬအံၫစရ့လၭလၧခး ဂ့ၩလဘံၪ့ယီၩအဖၧၩ့လၧအဖ့ၪလၫ့အဖါလဖၪနီၪ, မိ မၩလၩ့ပြံၩလၩ့ပၩဝ့ၫလၧထံၫမိၡါဝါလခီၫ, အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪတဲၩ့န့အၡ့ရိၫ လၧအဂးတၭ, မၩၥၭထၪ့",
			"16": "<sup>16</sup> ယဟိဝၩလီၫ.- တၭအဝ့ၫဒၪမိဖ့ၪလၫ့ခွံၬ အံၫစရ့လၭ လၧစယ့ၫရဘိအၫ့ အဆၧဒဲၩဘၭအကၠီၩ့, အဝ့ၫလဂၩ မၩဒဲၩဘၭဆၧတၭ, ဒုၭမၩဒဲၩဘၭ အံၫစရ့လၭနီၪဆ့ လီၫ.",
			"17": "<sup>17</sup> စယ့ၫရဘိအၫ့အမၫဂဲထုၪ့, စဲၪ့ထၪ့ခွံၬတၭ,ဂဲၫလၧ တၧဇၫလီၫ. ထီးအထီၩ့လၧတရၫ့အခၧၫ့တၭ, ဖိၪၥၪ",
			"18": "<sup>18</sup> ၥံၫဝ့ၫလီၫ.- အဝ့ၫၥံၪခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫတၭ, အံၫစရ့ လၭထီးအလူၬဒဲၩလၩ့အၥၭနၫၡါတၭး ဂၪ့ဝ့ၫလၧအ ကၠီၩ့,ဘဲၫယဟိဝၩ အလူအထၫလၧအချဲၩ့ဆၧလၧအ ခ့ၫအၡၩမီၪစအဟဲယၫ အစူၪဖၧၩ့အၥိၭနီၪလီၫ.",
			"19": "<sup>19</sup> တၭဆၧအီၪလၩ့ထး ဘၪဆဲၫ့လၧစယ့ၫရဘိအၫ့,လၧ အဒုၭၥုၭအဂဲးအကၠီၪ့, လၧအမၩစဎွၩအဆၧအဂဲးအ ကၠီၪ့,ယိခွါ, ကွ့ၭအၥၭလၧအံၫစရ့လၭအစဎွၩအလံၬ",
			"20": "<sup>20</sup> ကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪလီၫ.- မုနံၩလဖၪလၧစယ့ၫရဘိ အၫ့ကဲၪစဎွၩနီၪမွဲနံၫဆံၫနံၫနံၪ့တၭ, မံၫဝ့ၫလၧအဖါလ ဖၪတၭး အဖိၪခွၫ စနၫဒၭနီၪကဲၪထၪ့စဎွၩ လၧအလး လီၫ.",
			"21": "<sup>21</sup> စစီလမၧၫ့အဖိၪခွၫ စရံၫဟဘိအၫ့နီၪ ကဲၪစဎွၩလၧ ယုဒၫအဖၧၩ့လီၫ. စရံၫဟဘိအၫ့ကဲၪၥၫ့စဎွၩနီၪအၥၭ ၡါလံဆံၫလနံၪ့တၭ, ကဲၪစဎွၩလဆံၫနွ့ၫနံၪ့လၧယရု စလံၫ့အဖၧၩ့နီၪ, ဒိၩ့လၧယဟိဝၩရွံန့လၧအံၫစရ့လၭ အဒီၪ့ထီးအလူၬအကျၩ, ဘဲၫၥိၭအမိအီၪက့ၪအမံၩ့ ထီးနီၪလီၫ. တၭအမိအမံၩ့မွဲနးနၫအမၫ, ၦအၫမၧၫ့အ",
			"22": "<sup>22</sup> မုၪလီၫ.- ယုဒၫနီၪမၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫ တၭ,ထိၪဂဲၩထၪ့အၥၭကဲၪ့လၧ အဝ့ၫၥံၪအဆၧဒဲၩဘၭ လၧအမၩယူၭဝ့ၫ, လၧအဖါလဖၪမၩဝ့ၫထီးအလူၬအ",
			"23": "<sup>23</sup> ဖၫ့ခိၪဒံၭလီၫ.- အဝ့ၫၥံၪနီၪမၩဆ့ လၧအလးထၪ့ထီၫ လဖၪ,ဒဲဆၧဂၩ့အၡ့ရိၫလၧဆၧစီၩ့ခိၪထီၫ ထီးအလူၬ",
			"24": "<sup>24</sup> အလီၩ့, ဒဲလၧၥံၪ့ၥံၫ့ဆ့ၬ ထီးအလူၬအဖၫ့လၬလီၫ.-ၦ အဲၪပခၧၩ့ဖိၪ အီၪလၧခးဖၧၩ့နီၪတၭး အဝ့ၫၥံၪမၩက ယဲဆၧဘၪၥၭလိၪလဖၪ ဘၪဆဲၫ့လၧၦဆၨၩလဖၪလၧ ယဟိဝၩနၫ့ထၪ့ခွံၬဝ့ၫ လၧအံၫစရ့လၭဖိၪ အမ့ၬယၫ အၥိၭနီၪလီၫ.",
			"25": "<sup>25</sup> တၭဆၧမၩအၥၭ လၧစဎွၩရံၫဟဘိအၫ့ အနံၪ့ဎွ့ၩ ထၪ့ယဲနံၪ့လနံၪ့နီၪ အံဇံၭအစဎွၩၡဲၡၭဂဲၫထၫ့ဒၩယရု",
			"26": "<sup>26</sup> စလံၫ့လီၫ.- အဝ့ၫဒၪမၩန့ထၪ့ခွံၬ ယဟိဝၩအဂံၪ့အဆၧ လူဒိၪဎွ့ၩဒိၪ, ဒဲစဎွၩအဂံၪ့ အဆၧလူဒိၪဎွ့ၩဒိၪတၭ, ဆိၬခွံၬဝ့ၫထီးအလူၬတၭ, ဆိၬထၪ့ခွံၬကယဲထၩ့ဖံၭထီၫ့",
			"27": "<sup>27</sup> လၧစစီလမၧၫ့မၩဝ့ၫထီးအလူၬလီၫ.- တၭစဎွၩရံၫဟ ဘိအၫ့တဲၩ့ထၩ့ဖံၭထီးဘၩ့လၧအလးတၭ, ဖ့ၪလၫ့ဝ့ၫ လၧၦပၧၩ့ဆၧၥံၪအခိၪအစူၪဖၧၩ့, လၧအပၧၩ့စဎွၩအ",
			"28": "<sup>28</sup> ဂံၪ့အတရၫ့လီၫ.- ထီးစဎွၩလ့ၩနုၬလၧယဟိဝၩအဂံၪ့ ဖၧၩ့တၭ, ဆၧမၩအၥၭလၧၦပၧၩ့ဆၧၥံၪဆိၬဝ့ၫတၭ, ဂဲၫထဲၩ့န့ဝ့ၫလၧၦပၧၩ့ဆၧၥံၪ အဒူၭဖၧၩ့လီၫ.",
			"29": "<sup>29</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစရံၫဟဘိအၫ့,ဒဲ ကယဲဆၧလၧအမၩဝ့ၫနီၪ, ကွ့ၭအၥၭလၧယုဒၫအစဎွၩ",
			"30": "<sup>30</sup> ၥံၪအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့မွဲအ့ၬဧၪ.- တၭဆၧဒုၭၥုၭ အီၪဝ့ၫလၧစရံၫဟဘိအၫ့, ဒဲစယ့ၫရဘိအၫ့လဆိၩဒၪ",
			"31": "<sup>31</sup> ဝ့ၫလီၫ.- တၭစရံၫဟဘိအၫ့မံၫဝ့ၫလၧအဖါၥံၪအၥိၭ တၭ,ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ အဖါၥံၪအၥိၭလၧစဒၫ ဝံၭအဒိၩ့ဖၧၩ့လီၫ. အမိအမံၩ့မွဲ နးနၫအမၫ ၦအၫမၧၫ့ အမုၪလီၫ. အဖိၪခွၫစအဘဲယၫ့ ကဲၪစဎွၩလၧအလး နီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> လၧစနံဘၭ အဖိၪခွၫစဎွၩ ယ့ၫရဘိအၫ့အနံၪ့ဎွ့ၩ ထၪ့လဆံၫဎိၭနံၪ့လနံၪ့နီၪ, စအဘဲယၫကဲၪစဎွၩလၧ",
			"2": "<sup>2</sup> ယုဒၫအဖၫ့ခိၪနီၪလီၫ.- ကဲၪစဎွၩၥၧၫ့နံၪ့လၧယရုစလံၫ့ အဖၧၩ့တၭ, အမိအမံၩ့မွဲနးမၫအခၫ, စအဘံၭစလိၫ့",
			"3": "<sup>3</sup> အဖိၪမုၪလီၫ.- အဝ့ၫဒၪလ့ၩဝ့ၫလၧအဖါ အဆၧဒဲၩဘၭ လၧအမၩဝ့ၫ လၧအမ့ၬယၫထီးအလူၬ အဖၧၩ့တၭ, အၥၭလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧယဟိဝၩအဝ့ၫဒၪ အယွၩ",
			"4": "<sup>4</sup> ဘဲၫအဖါစဒၫဝံၭအၥၭအၥိၭအ့ၬ.- လါနၫ့တၭ,လၧစဒၫ ဝံၭအကၠီၩ့နီၪ ယဟိဝၩအဝ့ၫဒၪအယွၩ ဖ့ၪလၫ့ဝ့ၫလၧ မ့ၪဒိၩ့လဖျိၪ့လၧယရုစလံၫ့အဖၧၩ့ ဘဲၫၥိၭအမိအီၪက့ၪ လၩ့အဖိၪခွၫလၧအလးခဲၫ့နီၪတၭ, မၩဂုးမၩခၧၫ့ယရု",
			"5": "<sup>5</sup> စလံၫ့နီၪလီၫ.- အဂဲးဘဲၫယီၩ စဒၫဝံၭမၩအတီၩအလီၩ့ လၧယဟိဝၩအမ့ၬယၫတၭ, လဘိၭကၠၪခွံၬဘၪအၥၭ လၧဆၧလၧယဟိဝၩ မၪလူၬလဖၪ လဆိၩဒၪဝ့ၫလီၫ. အဝ့ၫဒၪကၠၪခွံၬအၥၭ န့ၫဆၧဘၪဆဲၫ့ လၧၦဟံၥၭဖိၪ",
			"6": "<sup>6</sup> စယုၫရဲၫအၫလမံၩ့နီၪလီၫ.- တၭဆၧဒုၭၥုၭအီၪဝ့ၫလၧ စရံၫဟဘိအၫ့ဒဲစယ့ၫရဘိအၫ့ လဆိၩဒၪဝ့ၫလီၫ.",
			"7": "<sup>7</sup> ဆၧအီၪလၩ့ထး ဘၪဆဲၫ့လၧစအဘဲယၫ, ဒဲက ယဲဆၧလၧအမၩဝ့ၫနီၪ, ကွ့ၭအၥၭလၧယုဒၫအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့မွဲအ့ၬဧၪ. တၭဆၧဒုၭလိၬအ",
			"8": "<sup>8</sup> ၥၭလၧစအဘဲယၫ့, ဒဲစယ့ၫရဘိအၫ့နီၪလီၫ.- စအဘဲ ယၫ့မံၫဝ့ၫလၧအဖါၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့တၭ, အဖိၪခွၫစအၫစၫ ကဲၪထၪ့ စဎွၩလၧအလးလီၫ.",
			"9": "<sup>9</sup> တၭအံၫစရ့လၭအစဎွၩ စယ့ၫရဘိအၫ့အနံၪ့ဎွ့ၩ ထၪ့နံၫဆံၫနီၪစအၫစၫကဲၪထၪ့စဎွၩ လၧယုဒၫအဖၫ့ခိၪ",
			"10": "<sup>10</sup> လီၫ.- ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့ လံဆံၫလနံၪ့ တၭ,အမိအမံၩ့မွဲနးမၫအခၫစအဘံၭၡလိၫ့ အဖိၪမုၪ",
			"11": "<sup>11</sup> လီၫ.- စအၫစၫမၩဆၧအတီၩအလီၩ့လၧယဟိဝၩအ",
			"12": "<sup>12</sup> မ့ၬၥၪဖၧၩ့ဘဲၫအဖါစဒၫဝံၭအၥိၭနီၪလီၫ.- မၩဂၭဂီၩ့ ခွံၬၦအဲၪပခၧၩ့ဖိၪလၧခးနီၪတၭ, ၥုၭခွံၬဆၧဂၩ့ၥံၪလၧ",
			"13": "<sup>13</sup> အဖါတဲၩ့ဝ့ၫထီးအလူၬလီၫ.- တၭၥုၭခွံၬအမိနးမၫအ ခၫဒၪလ့ၬ လၧနးဎွၩမုၪအလးလၧ အတဲၩ့အၡ့ရိၫအဂၩ့ အကၠီၩ့နီၪလီၫ. တၭစအၫစၫမၩဂၭဂီၩ့ခွံၬ အဆၧဂၩ့",
			"14": "<sup>14</sup> တၭ,ဆူၭထၪ့ခွံၬဝ့ၫလၧထံၫချိၬ ကံဒၧၫ့အနဲၩ့လီၫ.- တၭ ဆၧအလးထၪ့ထီၫလဖၪနီၪ, ဘၪဆၧၥုၭခွံၬဝ့ၫအ့ၬ. လါနၫ့တၭ စအၫစၫအၥၭအီၪဝ့ၫထၧၫ့ဖျိၪ့ယၫ လၧယ",
			"15": "<sup>15</sup> ဟိဝၩလဆိၩဒၪဝ့ၫလီၫ.- အဝ့ၫဂဲၫဆိၬဆၧလၧအဖါ အီၪက့ၪဆံၫ့ဎံၪဝ့ၫ လၧအနၫ့ဆါဒၪဝ့ၫ အီၪက့ၪဆံၫ့ဎံၪ လဖၪလၧယဟိဝၩအဂံၪ့ဖၧၩ့, ကယဲစ့ၩ, ဒဲထီၫ့,ဒဲဆၧ အဎၧၩ့အဎီၥံၪလီၫ.",
			"16": "<sup>16</sup> တၭဆၧဒုၭၥုၭအီၪဝ့ၫလၧ စအၫစၫဒဲအံၫစရ့လၭအ",
			"17": "<sup>17</sup> စဎွၩဘၫအၡၫ လဆိၩဒၪအဝ့ၫၥံၪလီၫ.- တၭအံၫစရ့ လၭအစဎွၩဘၫအၡၫနီၪ လ့ၩထၪ့ထၫ့ဒၩယုဒၫ, ဒဲမၩ ထၪ့ရၫမၫဘဲၫၥိၭ အမိပဒၩ့ၦလ့ၩထၪ့, ဒဲဂဲၫနုၬလၧယု ဒၫအစဎွၩအၫစၫအအီၪလီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ စအၫစၫမၩန့ ကယဲကျိၪၥံၪစ့ၩၥံၪ,ဒဲ ထီၫ့ၥံၪလွ့ၫၥံၪ, လၧအအီၪလၩ့ထးလၧဆၧအီၪက့ၪကီၪ့ အလးလၧယဟိဝၩအဂံၪ့ဖၧၩ့, ဒဲလၧအအီၪက့ၪကီၪ့အ လးလၧစဎွၩအဂံၪ့ဖၧၩ့တၭ, ဖ့ၪလၫ့ဝ့ၫလၧအခ့ၫအၡၩ အစူၪဖၧၩ့တၭ, စဎွၩအၫစၫဖ့ၪယုဝ့ၫ လၧစံရအၫအ စဎွၩဘံၫ့ဟၫဒၭ, စတၫဘြံမိၫ့အဖိၪခွၫ, စဟံဇိၫ့အဖိၪ ခွၫ,လၧအအီၪဝ့ၫ လၧဒမၭစကၧၭအဖၧၩ့ စံၭဝ့ၫဒၪ,",
			"19": "<sup>19</sup> ဆၧအုၩ့လၩ့အီၪဝ့ၫလၧနၧၩ ဒဲယၧၩ, ဒဲယဖါ ဒဲနဖါ လီၫ. ယိခွါ,ယဖ့ၪယုနၧၩ လၧလၬဆီၪ့, ကျိၪၥံၪစ့ၩၥံၪ, ဒဲထီၫ့ၥံၪလွ့ၫၥံၪလီၫ. ဂဲၫမၩဂၭဂီၩ့နဆၧအုၩ့လၩ့ လၧ အံၫစရ့လၭအစဎွၩ ဘၫအၡၫ ဘဲၫၥိၭအမိစဲၪ့ထၪ့ခွံၬ",
			"20": "<sup>20</sup> လၧယအီၪဆံၭ.- စဘံၫ့ဟၫဒၭခိၭနၪစဎွၩ အၫစၫအလူ တၭ,အၪ့မၧၫ့လၩ့ ၦၥုၭအခိၪလဖၪ လၧအအီၪဝ့ၫလၧ အစူၪဖၧၩ့ ထၫ့ဒၩအံၫစရ့လၭ အဒိၩ့လဖၪ, ဒဲကျီၪ့ခွံၬ အဲယၧၫ့,ဒဲဒၫ့, ဒဲအၫတလၭဘ့ၭၥမၫအခၫ ဒဲခံၫ့န့ၫရ့ၭ",
			"21": "<sup>21</sup> ထၧၫ့ဘံၪ့ယၫ, ဒဲခးနၭၥလဲၫထၧၫ့ဘံၪ့ယၫလီၫ.- ထီး စဘၫအၡၫနါဂၧၫ့ဝ့ၫတၭ, ဆၧမၩအၥၭလၧအမၩထၪ့ ရၫမၫနီၪ, အီၪပထုၬဝ့ၫတၭအီၪဝ့ၫလၧတၧဇၫအဖၧၩ့",
			"22": "<sup>22</sup> လီၫ.- တၭစဎွၩအၫစၫဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ဆၧလၧယု ဒၫထၧၫ့ဘံၪ့ယၫဖီၩ့ဖျ့ၭနးဂၩအ့ၬ. တၭၦၡၩဆိၬထၪ့ ခွံၬရၫမၫအလိးလဖၪ, ဒဲအၥံၪ့လဖၪလၧစဘၫအၡၫမၩ ထၪ့ဝ့ၫလၧအဖၧၩ့လီၫ. တၭလၧဆၧလဖၪနီၪစဎွၩအၫ စၫမၩထၪ့ဂံဘၫဘၪဆဲၫ့လၧဘံၪ့ယမံၫ့ ဒဲမံဇဒၫဆ့လီၫ.",
			"23": "<sup>23</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစအၫစၫ, ဒဲအစီၩ့အမၩ့ ထီးအလူၬ, ဒဲကယဲဆၧလၧအမၩဝ့ၫ ဒဲဒိၩ့လဖၪလၧ အမၩထၪ့ဝ့ၫနီၪ ကွ့ၭအၥၭလၧယုဒၫအစဎွၩအလံၬကွ့ၭ နဲၪ့ဆၧအဖၧၩ့,မွဲအ့ၬဧၪ, မွဲလါနၫ့ဘိၩလၧအၥၭၡါအ",
			"24": "<sup>24</sup> ဆၧၫ့အထီနီၪအခၪ့ဆၫလီၫ.- စအၫစၫမံၫဝ့ၫလၧအဖါ ၥံၪအၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ အဖါစဒၫဝံၭ အဒိၩ့ဖၧၩ့တၭ, အဖိၪခွၫစယဟီၡဖၭ ကဲၪထၪ့စဎွၩလၧ အလးလီၫ.",
			"25": "<sup>25</sup> ယုဒၫအစဎွၩ အၫစၫအနံၪ့နံၫနံၪ့လနံၪ့နီၪ,စယ့ၫရ ဘိအၫ့အဖိၪခွၫစနၫဒၭကဲၪစဎွၩ လၧအံၫစရ့လၭအဖၫ့ ခိၪတၭ, ကဲၪစဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪနံၫနံၪ့လီၫ.",
			"26": "<sup>26</sup> မၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫတၭ, လ့ၩဆၧလၧ အဖါအဖၧၩ့ၥၭ, ဒဲလၧအဆၧဒဲၩဘၭအဖၧၩ့, လၧအဒုၭ မၩအံၫစရ့လၭလၧဆၧဒဲၩဘၭလီၫ.",
			"27": "<sup>27</sup> စအံစခၫအၡၩဂံၪ့ဖိၪ စအဟဲယၫအဖိၪခွၫစဘၫ အၡၫကိၪ့ထၪ့ဆၧထၫ့ဒၩဝ့ၫတၭ, စဘၫအၡၫကျီၪ့ခွံၬဝ့ၫ လၧဂံဘၥိၫ့အဖၧၩ့ လၧအဘၪဆဲၫ့ လၧၦဖလံၡၫဖိၪ, အဂဲးဘဲၫယီၩစနၫဒၭ, ဒဲအံၫစရ့လၭထီးအလူၬဝၩ့ထၬ",
			"28": "<sup>28</sup> ဂံဘၥိၫ့တၭး- လၧယုဒၫအစဎွၩ အၫစၫအနံၪ့ၥၧၫ့နံၪ့ လနံၪ့နီၪ, စဘၫအၡၫမၩၥံၫဝ့ၫတၭ, ကဲၪစဎွၩလၧအ",
			"29": "<sup>29</sup> လးလီၫ.- ထီးအကဲၪစဎွၩတၭ, ဆၧမၩအၥၭလၧအ ကျီၪ့ခွံၬစယ့ၫရဘိအၫ့အၡၩဂံၪ့ဖိၪ ထီးအလူၬလီၫ.အီၪ က့ၪလၩ့ထးၦလၧအၥၪထၪ့ဝ့ၫ လၧစယ့ၫရဘိအၫ့ထီး အလမၩဂၭဂီၩ့ဘၪနီၪနးဂၩအ့ၬ. ဘဲၫယဟိဝၩအလူ ချဲၩ့ဝ့ၫလၧအခ့ၫအၡၩ, ၦၡဲလိၫဖိၪစအဟဲယၫ အစူၪ",
			"30": "<sup>30</sup> ဖၧၩ့အၥိၭနီၪလီၫ.- မွဲလၧစယ့ၫရဘိအၫ့အဆၧဒဲၩဘၭ လၧအမၩဝ့ၫ, ဒဲလၧအဒုၭမၩအံၫစရ့လၭ လၧဆၧဒဲၩ ဘၭ,လၧအထိၪဂဲၩ ယဟိဝၩအံၫစရ့လၭ အယွၩအ",
			"31": "<sup>31</sup> ဆၧၥၭထၪ့နီၪအဂဲးလီၫ.- တၭဆၧအီၪလၩ့ထးဘၪ ဆဲၫ့လၧစနၫဒၭ, ဒဲကယဲဆၧလၧအမၩဝ့ၫထီးအလူၬနီၪ ကွ့ၭအၥၭလၧအံၫစရ့လၭအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧ",
			"32": "<sup>32</sup> အဖၧၩ့,မွဲအ့ၬဧၪ.- တၭဆၧဒုၭလိၬအၥၭ အီၪဝ့ၫလၧ စအၫစၫဒဲအံၫစရ့လၭအစဎွၩ ဘၫအၡၫလဆိၩဒၪအ ဝ့ၫၥံၪလီၫ.",
			"33": "<sup>33</sup> လၧယုဒၫအစဎွၩအၫစၫအနံၪ့ၥၧၫ့နံၪ့လနံၪ့နီၪ, စအ ဟဲယၫအဖိၪခွၫ စဘၫအၡၫ ကဲၪၥၫ့စဎွၩ လၧအံၫစရ့ လၭအဖၫ့ခိၪ လၧတၧဇၫအဖၧၩ့ နံၫဆံၫလံနံၪ့လီၫ.",
			"34": "<sup>34</sup> အဝ့ၫမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬယၫတၭ, လ့ၩ ဆၧလၧစယ့ၫရဘိအၫ့အဖၧၩ့ၥၭ, ဒဲလၧအဆၧဒဲၩဘၭ အဖၧၩ့ လၧအဒုၭမၩအံၫစရ့လၭလၧဆၧဒဲၩဘၭလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> တၭယဟိဝၩအလူလၩ့ဘၪ စဟၫနနဲၫအဖိၪခွၫစ",
			"2": "<sup>2</sup> ယံဟုၫထၫ့ဒၩစဘၫအၡၫစံၭဝ့ၫဒၪ,- မွဲယထုၭထၪ့ခွံၬ နၧၩလၧဂၪ့ခိၪမုၬအကျၩနီၪ အီၪက့ၪထၪ့ထီၫနၧၩ, ဒဲအီၪ က့ၪနၧၩလၧဆၧအခိၪလၧ ယၡၩခမျၧးအံၫစရ့လၭအ ဖၫ့ခိၪတၭ, နလ့ၩဆၧလၧစယ့ၫရဘိအၫ့အဖၧၩ့ၥၭဖၧၩ့, ဒဲဒုၭမၩယၡၩခမျၧး အံၫစရ့လၭလၧဆၧဒဲၩဘၭ ဘဲၫ ၥိၭနမိဒုၭထၪ့ယၥၭ လၧအဆၧဒဲၩဘၭ အကၠီၩ့တၭ,",
			"3": "<sup>3</sup> ယိခွါ,ယမိမၩန့ခွံၬ စဘၫအၡၫအဖိၪအလံၩ, ဒဲအၡၩ ဂံၪ့ဖိၪအဖိၪအလံၩတၭး ယမိအီၪက့ၪနဂံၪ့ဘဲၫစနံဘၭ",
			"4": "<sup>4</sup> အဖိၪခွၫစယ့ၫရဘိအၫ့အဂံၪ့အၥိၭနီၪလီၫ.- တၭၦဘၪ ဆဲၫ့လၧစဘၫအၡၫလၧအၥံၫဝ့ၫလၧ ဒိၩ့ဖၧၩ့နီၪထွံၪမိ အၪ့ခွံၬဝ့ၫတၭ, ၦဘၪဆဲၫ့လၧအဝ့ၫ, လၧအၥံၫဝ့ၫလၧ မံၩ့လၬကျၩနီၪ ထိၪၥံၪလံၪၥံၪလၧဆၧဖိၭဖၫ့ မိအၪ့ခွံၬ ဝ့ၫလီၫ.",
			"5": "<sup>5</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစဘၫအၡၫ, ဒဲဆၧ လၧအမၩဝ့ၫ, ဒဲအစီၩ့အမၩ့နီၪ ကွ့ၭအၥၭလၧအံၫစရ့ လၭအစဎွၩအလံၬ ကွ့ၭနဲၪ့ဆၧအဖၧၩ့, မွဲအ့ၬဧၪ.",
			"6": "<sup>6</sup> စဘၫအၡၫမံၫဝ့ၫလၧအဖါၥံၪ အၥိၭတၭ, ၦခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧတၧဇၫအဖၧၩ့တၭ, အဖိၪခွၫစအံလၫ ကဲၪထၪ့စဎွၩလၧအလးလီၫ.",
			"7": "<sup>7</sup> လၧစဟၫနနဲၫအဖိၪခွၫ, မီၪစယံဟုၫအစူၪဖၧၩ့နီၪ, ယဟိဝၩအလူအီၪထၪ့ထၫ့ဒၩ စဘၫအၡၫ,ဒဲထၫ့ဒၩ အၡၩဂံၪ့ဖိၪလၧကယဲဆၧအၧၩ့ လၧအမၩဝ့ၫလၧယဟိ ဝၩအမ့ၬယၫ လၧအထိၪဂဲၩ အဆၧၥၭထၪ့လၧအမၩ ဆၧလၧအစူၪ, လၧအလၩ့ဂၬစယ့ၫရဘိအၫ့အၡၩဂံၪ့ ဖိၪအၥိၭနီၪအကၠီၩ့ ဒဲလၧအမၩၥံၫဝ့ၫအကၠီၩ့ဆ့လီၫ.",
			"8": "<sup>8</sup> တၭလၧယုဒၫအစဎွၩအၫစၫ အနံၪ့နံၫဆံၫဎူၫနံၪ့လ နံၪ့နီၪ, စဘၫအၡၫအဖိၪခွၫစအံလၫကဲၪၥၫ့စဎွၩလၧ",
			"9": "<sup>9</sup> အံၫစရ့လၭအဖၫ့ခိၪ လၧတၧဇၫအဖၧၩ့နံၫနံၪ့လီၫ.- တၭ အခ့ၫအၡၩအလဲၪ့ကၥ့ၪဖိၭဖၫ့အခိၪ စဇံမရဲၫကိၪ့လိၬ ဆၧထၫ့ဒၩအဝ့ၫ ဘိၩ့အအီၪလၧတၧဇၫအဖၧၩ့, အီၩ မၧၩ့အၥၭလၧအၡၩယိအဂံၪ့ လၧတၧဇၫအဖၧၩ့စအါ",
			"10": "<sup>10</sup> ဇၫအဂံၪ့ဖၧၩ့နီၪလီၫ.- စဇံမရဲၫလ့ၩနုၬဝ့ၫတၭ, ကျီၪ့ ခွံၬဒဲမၩၥံၫအဝ့ၫနီၪ ကဲၪထၪ့စဎွၩလၧအလးတၭ,မွဲဝ့ၫ လၧယုဒၫအစဎွၩ အၫစၫအနံၪ့နံၫဆံၫနွ့ၫနံၪ့လနံၪ့နီၪ လီၫ.",
			"11": "<sup>11</sup> ထီးအကဲၪၥၫ့စဎွၩ, ဆၧၫ့နၩ့လၧအလးဆီၩ့ဆီနီၪ တၭ,ဆၧမၩအၥၭလၧအမၩၥံၫ စဘၫအၡၫအၡၩဂံၪ့ ဖိၪထီးအလူၬလီၫ. အဘူၭအထံးမွဲဂ့ၩ, အထံၩအၥိၭ မွဲဂ့ၩ, အီၪက့ၪလၩ့ထးၦၡၩအခွၫ လၧအဘၪဆဲၫ့လၧ",
			"12": "<sup>12</sup> အဝ့ၫနးဂၩအ့ၬ.- တၭစဇံမရဲၫမၩဂၭဂီၩ့ခွံၬ စဘၫအ ၡၫအၡၩဂံၪ့ဖိၪထီးအလူၬ, ဘဲၫယဟိဝၩအလူလၧအ ချဲၩ့ဆၧထၫ့ဒၩ စဘၫအၡၫလၧမီၪစယံဟုၫအစူၪဖၧၩ့",
			"13": "<sup>13</sup> အၥိၭနီၪလီၫ.- မွဲစဘၫအၡၫအဆၧဒဲၩဘၭ, ဒဲအဖိၪခွၫ စအံလၫအဆၧဒဲၩဘၭ ထီးအလူၬ လၧအမၩဆၧဒဲၩ ဘၭ,ဒဲဒုၭမၩအံၫစရ့လၭ လၧဆၧဒဲၩဘၭ လၧအဒုၭ ထၪ့ယဟိဝၩ အံၫစရ့လၭအယွၩ အၥၭလၧအဝ့ၫၥံၪ အဆၧပျီၩပျီၩနီၪအကၠီၩ့လီၫ.",
			"14": "<sup>14</sup> တၭဆၧအီၪလၩ့ထးဘၪဆဲၫ့ လၧစအံလၫအဆၧမၩ လဖၪ,ဒဲကယဲဆၧလၧအမၩဝ့ၫ ထီးအလူၬနီၪကွ့ၭအၥၭ လၧအံၫစရ့လၭအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲအ့ၬဧၪ.",
			"15": "<sup>15</sup> လၧယုဒၫအစဎွၩအၫစၫ အနံၪ့နံၫဆံၫနွ့ၫနံၪ့လနံၪ့ နီၪ,စဇံမရဲၫကဲၪစဎွၩ လၧတၧဇၫအဖၧၩ့နွ့ၫနံၩလီၫ. တၭၦခမျၧးၥုၪ့တဲၩထၫ့ဒၩ ဂံဘၥိၫ့လၧအဘၪဆဲၫ့လၧ",
			"16": "<sup>16</sup> ၦဖလံၡၫဖိၪလီၫ.- တၭၦခမျၧးလၧအၥုၪ့တဲၩလဖၪနီၪ နါဂၧၫ့လၧစဇံမရဲၫကိၪ့လိၬဆၧအၧၩ့, ဒဲမၩၥံၫစဎွၩနီၪ လီၫ.တၭအံၫစရ့လၭ ထီးအလူၬအီၪက့ၪ ၦၥုၭမုအခိၪ စအီမြဲၫလၧစဎွၩလၧအံၫစရ့လၭ အဖၫ့ခိၪလၧၦၥုၪ့တဲၩ",
			"17": "<sup>17</sup> အကျၩလၧမုလနံၩနီၪလီၫ.- စအီမြဲၫလ့ၩထၪ့လၧဂံဘ ၥိၫ့,ဒဲအံၫစရ့လၭ ထီးအလူၬအီၪလၧအၥိၭတၭ,",
			"18": "<sup>18</sup> ဝၩ့ထၬတၧဇၫလီၫ.- တၭထီးစဇံမရဲၫဒၪဘၪဝ့ၫလၧၦမၩ န့ဒိၩ့တၭ, ဆၧမၩအၥၭလၧအလ့ၩနုၬဝ့ၫလၧစဎွၩအ ဂံၪ့အနီးဖၧၩ့တၭ, ဆူၭထၪ့ခွံၬစဎွၩ အဂံၪ့လၧအဖၫ့ခိၪ",
			"19": "<sup>19</sup> လၧမ့ၪတၭ,ၥံၫဝ့ၫလီၫ.- မွဲလၧအဆၧဒဲၩဘၭလၧအမၩ ဝ့ၫလၧယဟိဝၩအမ့ၬယၫ လၧအလ့ၩဆၧလၧစယ့ၫ ရဘိအၫ့အဖၧၩ့ၥၭဒဲလၧ အဆၧဒဲၩဘၭအဖၧၩ့လၧအ မၩဝ့ၫလၧအဒုၭမၩအံၫစရ့လၭ အဆၧဒဲၩဘၭအကၠီၩ့ လီၫ.",
			"20": "<sup>20</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစဇံမရဲၫ, ဒဲအဆၧပိၩ့ ထၪ့လၧအမၩဝ့ၫနီၪကွ့ၭအၥၭ လၧအံၫစရ့လၭအစဎွၩ အလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪမွဲအ့ၬဧၪ.",
			"21": "<sup>21</sup> ထီးနီၪလဖၧၫ့ ၦအံၫစရ့လၭအၡၩခမျၧးလၩ့ဖၭနံၫ ဒီၪ့လီၫ. ၦခမျၧးဖိၭဖၫ့လီၩ့ စဂံနၭအဖိၪခွၫ စတံဘနဲၫ ဘဲၫၥိၭအမိအီၪက့ၪဝ့ၫလၧစဎွၩတၭ, အဖိၭဖၫ့လဒီၪ့နီၪ",
			"22": "<sup>22</sup> လီၩ့စအီမြဲၫလီၫ.- တၭၦခမျၧးလၧအလီၩ့စအီမြဲၫနီၪ, ဆီၪ့နဲၪ့ၦခမျၧး လၧအလီၩ့စဂံနၭအဖိၪခွၫ စတံဘနဲၫ နီၪဒံၭလီၫ. စတံဘနဲၫၥံၫဝ့ၫတၭ, စအီမြဲၫ ကဲၪစဎွၩ လီၫ.",
			"23": "<sup>23</sup> လၧယုဒၫအစဎွၩအၫစၫ အနံၪ့ၥၧၫ့ဆံၫလနံၪ့နီၪစ အီမြဲၫကဲၪၥၫ့စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪ, လဆံၫနံၫနံၪ့",
			"24": "<sup>24</sup> လီၫ. ကဲၪစဎွၩလၧတၧဇၫအဖၧၩ့ဎူၫနံၪ့လီၫ.- အဝ့ၫ ဒၪဎွ့ၩန့ခိၪလီၩ့စမ့ရအၫ လၧစၡံမၧၫအစူၪဖၧၩ့လၧစ့ၩ နံၫကံကၫတၭ, မၩကဲၪထၪ့ဒိၩ့လၧခိၪလီၩ့အလီၩ့တၭ, ဖျိၬဒိၩ့လၧအမၩထၪ့ဝ့ၫနီၪ အမံၩ့ဘဲၫခိၪလီၩ့စမ့ရအၫ",
			"25": "<sup>25</sup> အကဆါစၡံမၧၫအမံၩ့ အၥိၭနီၪလီၫ.- တၭစအီမြဲၫ မၩဆၧအၧၩ့လၧယဟိဝၩအမ့ၬၥၪဖၧၩ့, ဒဲမၩဆၧအၧၩ့ နီၪအၪနဲၪ့ကယဲၦလၧအအီၪထးဝ့ၫ လၧအမ့ၬယၫနီၪ",
			"26": "<sup>26</sup> လီၫ.- တၭလ့ၩဝ့ၫလၧစနံဘၭအဖိၪခွၫ စယ့ၫရဘိအၫ့ အဖၧၩ့ၥၭထၧၫ့ဘီၩ့ယၫ, ဒဲလၧအဆၧဒဲၩဘၭအဖၧၩ့ လၧအဒုၭမၩအံၫစရ့လၭ လၧဆၧဒဲၩဘၭလၧအဒုၭထၪ့ ယဟိဝၩအံၫစရ့လၭ အယွၩအၥၭလၧအဝ့ၫၥံၪအဆၧ ပျီၩပျီၩနီၪလီၫ.",
			"27": "<sup>27</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစအီမြဲၫ လၧအမၩဝ့ၫ, ဒဲအစီၩ့အမၩ့ လၧအမၩဖျီၪဝ့ၫနီၪ ကွ့ၭအၥၭလၧအံၫစရ့ လၭအစဎွၩအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့ မွဲအ့ၬဧၪ.",
			"28": "<sup>28</sup> စအီမြဲၫမံၫဝ့ၫလၧအဖါအၥိၭတၭ, ၦခုၪ့လၩ့ဘၧၩ့ ခွံၬဝ့ၫလၧစမ့ရအၫအဖၧၩ့တၭ, အဖိၪခွၫစအၫဟၭကဲၪ ထၪ့စဎွၩလၧအလးလီၫ.",
			"29": "<sup>29</sup> လၧယုဒၫအစဎွၩအၫစၫအနံၪ့ၥၧၫ့ ဆံၫဎိၭနံၪ့လနံၪ့ နီၪစအီမြဲၫအဖိၪခွၫ စအၫဟၭကဲၪၥၫ့စဎွၩလၧအံၫစရ့ လၭအဖၫ့ခိၪတၭ, စအီမြဲၫအဖိၪခွၫစအၫဟၭကဲၪစဎွၩ လၧအံၫစရ့လၭအဖၫ့ခိၪ လၧစမ့ရအၫအဖၧၩ့ နံၫဆံၫ",
			"30": "<sup>30</sup> နံၫနံၪ့လီၫ.- တၭစအီမြဲၫအဖိၪခွၫ စအၫဟၭမၩဆၧ အၧၩ့လၧယဟိဝၩအမ့ၬယၫ နၭနဲၪ့ကယဲၦလၧအအီၪ",
			"31": "<sup>31</sup> ဝ့ၫလၧအမ့ၬယၫထီးအလူၬဒံၭလီၫ.- တၭဆၧမၩအၥၭ လၧအအီၪက့ၪအလ့ၩဆၧလၧ စနံဘၭအဖိၪခွၫစယ့ၫရ ဘိအၫ့အဆၧဒဲၩဘၭ အဖၧၩ့နီၪဘဲၫအမွဲဆၧဆံၭခိၬ တၭ,မၩန့အမၫလၧဇဲဒၧၫ့ဖိၪအစဎွၩ အ့ၫၥဘ့လၭအ ဖိၪမုၪနးယ့ၭဇဘ့လၭတၭ, လ့ၩမၩဘၫအလၭအဆၧ",
			"32": "<sup>32</sup> တၭ,ဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလီၫ.- တၭမၩဆၧလုလးလၧ ဘၫအလၭအဂးလၧဘၫ အလၭအဂံၪ့ဖၧၩ့လၧအမၩ",
			"33": "<sup>33</sup> ဝ့ၫလၧစမ့ရအၫအဖၧၩ့လီၫ.- စအၫဟၭတဲၩ့အၡ့ရိၫ အဂၩ့း ဒဲစအၫဟၭဒုၭထၪ့ ယဟိဝၩအံၫစရ့လၭအ ယွၩအၥၭနီၪအၪနဲၪ့ ကယဲအံၫစရ့လၭအစဎွၩလၧအ အီၪဝ့ၫလၧအမ့ၬယၫထီးအလူၬလီၫ.",
			"34": "<sup>34</sup> လၧအမုနံၩလဖၪနီၪ ၦဘ့ၫၥလၭဖိၪစဟဲအလၭမၩ ကဲၪထၪ့ယ့ၫရခိၫလီၫ. အီၪက့ၪဝ့ၫအခၪ့ထံၭလၧအဖိၪ ဝဲၡါအဘဲရၫ့အဖၧၩ့တၭ, ဘိၭဆၧၫ့ထုၪ့အတရၫ့လၧအ ဖိၪဒၪဘၨၩစစံဂၧၭအဖၧၩ့နီၪ, ဘဲၫယဟိဝၩအလူလၧ အချဲၩ့ဝ့ၫလၧစနိၫ့အဖိၪခွၫ စယီရှုၫအ့ၫအစူၪဖၧၩ့နီၪ လီၫ."
		},
		"17": {
			"1": "<sup>1</sup> တၭၦတံၡဘၭဖိၪစအံၫလဲယၫ လၧအအီၪဝ့ၫလၧ ၦဂံလအၭဖိၪအကျၩနီၪစံၭစအၫဟၭ, ယဟိဝၩအံၫစ ရ့လၭအယွၩမၧၫ့ဝ့ၫ, လၧယဆၧၫ့ထုၪ့လၧအမ့ၬယၫ နီၪ,ဆၧလၧနံၪ့လဖၪယီၩ ဆၩ့ထံၫမွဲဂ့ၩ, ဆၧဆၧၩ့မွဲ ဂ့ၩ,အ့ၪလမွဲဘၪလၧယလူအကၠီၩ့တၭ မိအီၪဘၪအ့ၬ. ယဟိဝၩအလူလၩ့ဘၪဝ့ၫ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,စဲၪ့ထၪ့ထီး ယီၩတၭ, ကၠၪနၥၭလၧမုထၪ့လခီၫတၭ, အီၪက့ၪၥူၪန ၥၭလၧထံၫချိၬခ့ၫရံၭအနဲၩ့ အီၪလၧယီၫဒၫ့ အမ့ၬယၫ",
			"4": "<sup>4</sup> ဆံၭ.- ဆၧမိမၩအၥၭလၧနမိဘၪအီၩ ဆၧလၧထံၫချိၬ နီၪတၭ,ယမၪလူၬယူၭ ကျၭၥံၪဘဲၫၥိၭအမိဘုၪအၪ့နၧၩ",
			"5": "<sup>5</sup> ထီးနီၪလီၫ.- အဝ့ၫဒၪလ့ၩဝ့ၫဒဲမၩဝ့ၫဘဲၫယဟိဝၩအ လူအၥိၭနီၪတၭ, လ့ၩအီၪလၧထံၫခ့ၫရံၭအနဲၩ့လၧအ",
			"6": "<sup>6</sup> အီၪလၧယီၫဒၫ့အမ့ၬယၫလီၫ.- တၭကျၭၥံၪဂဲၫဆိၬန့ ဝ့ၫလၧကိၪဒဲဆၧယၪလၧဂီၩလခီၫ, ဒဲကိၪဒဲဆၧယၪလၧ မုဂၪလၩ့လခီၫဆ့တၭ, အီၩထံၫလၧထံၫချိၬနီၪလီၫ.",
			"7": "<sup>7</sup> တၭလၧမုနံၩလဖၪနီၪအလးခဲၫ့, ဆၧမၩအၥၭလၧထံၫ လၩ့ၥံၭခွံၬလၧထံၫချိၬဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩဆၧဂဲၫ ဆၧၩ့လၧခးဖၧၩ့အ့ၬ.",
			"8": "<sup>8</sup> ယဟိဝၩအလူလၩ့ဘၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ဂဲထုၪ့ လ့ၩလၧဇၫရဖၭ လၧအဘၪဆဲၫ့လၧဇဲဒၧၫ့တၭ, အီၪ ထီးနီၪဆံၭ,ယိခွါ, ယမၪလူၬၦမုၪမဲၫလဂၩ ထီးနီၪဘဲၫ",
			"10": "<sup>10</sup> ၥိၭအမိလုအၪ့နၧၩလီၫ.- ဂဲထုၪ့တၭလ့ၩဝ့ၫ လၧဇၫရ ဖၭ,လ့ၩထီၩ့လၧဒိၩ့အတရၫ့နီၪ, ယိခွါ, ၦမုၪမဲၫလဂၩ အီၪထီးနီၪအၪ့ထုၫ့ထၪ့ၥံၪ့မုအထဲၩ့တၭ, ကိၭန့အဝ့ၫ, စံၭ,ဂဲၫဆိၬန့လါယၧၩ လၧထံၫလၧလိၫ့ဖၧၩ့ လဆံၭဘဲၫ",
			"11": "<sup>11</sup> ၥိၭယမိအီၩဘီၪ.- လၧၦမုၪနီၪလ့ၩဘဲၫၥိၭအမိဂဲၫထဲၩ့ ဆိၬဝ့ၫတၭ, အဝ့ၫဒၪကိၭထၪ့ဝ့ၫ,စံၭ, ဂဲၫဆိၬန့လါယၧၩ",
			"12": "<sup>12</sup> လၧကိၪနးဆံၭလၧနစူၪဖၧၩ့ဘီၪ.- ၦမုၪနီၪစံၭဝ့ၫ,ယဟိ ဝၩနယွၩမၧၫ့ဝ့ၫနီၪ, ယကိၪပၪပဲၪအီၪအ့ၬ. အီၪန့ၫကိၪ မုၬလစူၪလၧမီၫ့အဖၧၩ့, ဒဲၥိၪလဆံၭ လၧပလၫ့ဖၧၩ့ တၭ,ယိခွါ, ယအၪ့ထုၫ့ထၪ့ၥံၪ့မုထဲၩ့နံၫထဲၩ့, ဘဲၫၥိၭ ယမိလ့ၩနုၬဒဲတဲၩ့ဝဲၩလၧယဂး, ဒဲလၧယဖိၪခွၫအဂး,",
			"13": "<sup>13</sup> ဘဲၫၥိၭပမိအၪ့ဆၧတၭၥံၫဝ့ၫလီၫ.- စအံၫလဲယၫစံၭဝ့ၫ, အၪ့ယိၪလဂ့ၩ, မၩဘဲၫနစံၭဆၧအၥိၭနီၪဆံၭ. မွဲလါ နၫ့တၭ, မၩဆိၫဒၪခလူၬကိၪပၪပဲၪဖိၪလဘံၪ့ လၧယဂး တၭ,ဂဲၫဆိၬလၧယအီၪတၭ, မၩထဲၩ့လၧနဂးဒဲလၧန",
			"14": "<sup>14</sup> ဖိၪခွၫအဂးလၧခဲၫ့ဆံၭ.- အဂဲးဘဲၫယီၩ ယဟိဝၩအံၫ စရ့လၭအယွၩစံၭဘဲၫယီၩ, မီၫ့အကိၪမုၬလမိလူၬဘၪ, ဒဲပလၫ့အၥိၪလမိလၩ့ၡၩဘၪ ထီၩ့လၩ့မုနံၩလၧယဟိ ဝၩအၪ့မၧၫ့ဆၧဂဲၫဆၧၩ့လၩ့ လၧဂၪ့ခိၪချိၫ့လီၫ.",
			"15": "<sup>15</sup> ၦမုၪလ့ၩဝ့ၫတၭ, မၩဆၧဘဲၫစအံၫလဲယၫအလူအ ၥိၭနီၪတၭ,အဝ့ၫဒၪ, ဒဲၦမုၪ,ဒဲအၡၩဂံၪ့ဖိၪအၪ့ဆၧအမု",
			"16": "<sup>16</sup> နံၩလဖၪလီၫ.- မီၫ့အကိၪမုၬလလူၬဘၪ, ပလၫ့အၥိၪ လလၩ့ၡၩဘၪ, ဘဲၫယဟိဝၩအလူ လၧအချဲၩ့ဝ့ၫလၧ စအံၫလဲယၫအစူၪဖၧၩ့အၥိၭနီၪလီၫ.",
			"17": "<sup>17</sup> လၧဆၧနီၪလဖၪအလးခဲၫ့ ဆၧမၩအၥၭ လၧဂံၪ့အ ကဆါမုၪနီၪအဖိၪခွၫဆၫထၪ့ဝ့ၫတၭ, ဆၫဝ့ၫနၭနၭလ့ၬ",
			"18": "<sup>18</sup> ထီးအၥၭအီၪလၧၩ့လၧအဖၧၩ့အ့ၬ.- တၭၦမုၪနီၪစံၭ စအံၫလဲယၫ, ဆၧဘၪဆဲၫ့လၧနၧၩဒဲယၧၩမွဲဆၧနီၪလ မံၩ့လဲၪ,ယွၩအၡၩဧ့, နဂဲၫဒုၭနၪ့ထၪ့ထဲၩ့ ယဆၧဒဲၩ",
			"19": "<sup>19</sup> ဘၭ,ဒဲမၩၥံၫယဖိၪခွၫဆ့ဧၪ.- အဝ့ၫဒၪစံၭ,နဖိၪခွၫနီၪ, ဖ့ၪလၫ့ယၧၩဘီၪ. အဝ့ၫဒၪမၩန့ထၪ့လၧအၥၭနၫၡါအ ဖၧၩ့တၭ, ဆိၬထၪ့ဝ့ၫလၧဒူၭလၧထၭလဆၫ့ထီးအအီၪ အလးတၭအီၪက့ၪလၩ့ဝ့ၫလၧ အလးမံၫဒၪဝ့ၫနီၪလီၫ.",
			"20": "<sup>20</sup> အဝ့ၫဒၪကိၭထၪ့ယဟိဝၩတၭ, စံၭဝ့ၫဒၪ,ယဟိဝၩယ ယွၩဧ့,နဒုၭဂဲၫဆ့ဆၧအၧၩ့ လၧၦမုၪမဲၫအလီၩ့လၧယ",
			"21": "<sup>21</sup> အီၪယါလၧအၥိၭ, ဒဲမၩၥံၫအဖိၪခွၫဆ့ဧၪ.- တၭစီၪ့ထၪ့ အၥၭလၧဖိၪၥၪအဖၫ့ခိၪၥၧၫ့ဖၧၫ့တၭ, ကိၭထၪ့ယဟိ ဝၩတၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩယယွၩဧ့, မွဲဖိၪၥၪအၥၭဂဲၫ",
			"22": "<sup>22</sup> ထဲၩ့လါလၧအဖၧၩ့ဆံၭ.- ယဟိဝၩခိၭနၪစအံၫလဲယၫ အလူတၭ, ဖိၪၥၪအၥၭဂဲၫထဲၩ့ထဲၩ့ လၧအဖၧၩ့တၭ,",
			"23": "<sup>23</sup> မၧၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.- စအံၫလဲယၫမၩန့ဖိၪၥၪဆိၬလၩ့ ခွံၬဝ့ၫလၧဒူၭဖၧၩ့လၧထၭနီၪ, နုၬလၧဂံၪ့ဖၧၩ့ဖ့ၪလၫ့ဝ့ၫ လၧအမိတၭ, စအံၫလဲယၫစံၭဝ့ၫဒၪ, ယိခွါ,နဖိၪခွၫမၧၫ့",
			"24": "<sup>24</sup> ဝ့ၫလီၫ.- တၭၦမုၪစံၭစအံၫလဲယၫ, ဘိၩ့နဲၪ့ယီၩ လၧ ဆၧယီၩအကၠီၩ့ယၥ့ၪယၫလၧနမွဲယွၩအၡၩ, ဒဲယဟိ ဝၩအလူလၧနနိၭမွဲ ဆၧအမွဲအတီၩလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> တၭလၧအၪနံၩအၪၥၫ့နီၪ ဆၧမၩအၥၭလၧယဟိဝၩ အလူလၩ့ဘၪစအံၫလဲယၫ, လၧၥၧၫ့နံၪ့လနံၪ့အဖၧၩ့ နီၪ,စံၭဝ့ၫဒၪ, လ့ၩဒုၭနဲၪနၥၭ လၧစအၫဟၭအမ့ၬယၫ တၭ,ယမိဒုၭဆၧၩ့လၩ့ဆၧလၧ ဂၪ့ခိၪချိၫ့လီၫ.",
			"2": "<sup>2</sup> စအံၫလဲယၫလ့ၩဝ့ၫဒၪ ဘဲၫၥိၭအမိဒုၭနဲၪအၥၭလၧ စအၫဟၭအမ့ၬယၫတၭ, ဆၧၥၭဝံလၩ့ဒိၩအီၪဝ့ၫလၧ",
			"3": "<sup>3</sup> စမ့ရအၫအဖၧၩ့နၭမၬလီၫ.- တၭစအၫဟၭကိၭန့စအိၫ ဘဒဲအၫလၧအပၧၩ့အဂံၪ့လီၫ. (တၭစအိၫဘဒဲအၫၥၭ",
			"4": "<sup>4</sup> မဲၪယဟိဝၩဒိၪမၬလီၫ.- တၭလၧနးယ့ၭဇဘ့လၭဒၪ့ ထ့ၬခွံၬယဟိဝၩအမီၪလဖၪနီၪ ဆၧမၩအၥၭလၧစအိၫ ဘဒဲအၫမၩန့မီၪလယၩတၭ, အီၪက့ၪၥူၪဝ့ၫလၧဆၧ ဖၧၩ့ယဲဆံၫလစီၪ့, ယဲဆံၫလစီၪ့တၭ လုအၪ့လုအီၩဝ့ၫ",
			"5": "<sup>5</sup> လၧကိၪဒဲထံၫလီၫ.)- တၭစအၫဟၭစံၭစအိၫဘဒဲအၫ လ့ၩဆၧလၧခးဖၧၩ့ထၧၫ့ဘံၪ့ယၫ, ကယဲထံၫထၪ့ဖျိၭ လစီၪ့လါလါး ဒဲလၧထံၫချိၬလချိၬလါလါ, ဘၪလဘၪ ပမိဒၪန့နၪ့ၥံၪမံၩ့ၥံၪတၭ ဒုၭမၧၫ့ဒံၭကၥ့ၪ, ဒဲကၥ့ၪလၫ, ဘဲၫၥိၭပဆၧဖိၪဆၧဎါအဒိၩ့ ထီးလၩ့မါဘၪလူၬလ",
			"6": "<sup>6</sup> ဂ့ၩ.- အဝ့ၫၥံၪအၪ့နၩ့ဖၭခးနံၫခီၫ ဘဲၫၥိၭအမိလ့ၩခၫ့ဂၬ ဝ့ၫတၭ, စအၫဟၭအနၫ့ဆါဒၪဝ့ၫလဂၩ လ့ၩလၧဖၧၩ့ ၥၭလဘီၩ့း ဒဲစအိၫဘဒဲအၫအနၫ့ဆါလဂၩ လ့ၩဝ့ၫ လၧဖၧၩ့ၥၭလဘီၩ့ဒၪလီၫ.",
			"7": "<sup>7</sup> စအိၫဘဒဲအၫအီၪလၧဖၧၩ့ၥၭတၭ, ယိခွါ,စအံၫလဲ ယၫဘၪခီၩ့ဝ့ၫတၭ, မွဲအၥ့ၪယၫအဝ့ၫနီၪၡီၫ့လၩ့အၥၭ လၧအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ,နမွဲယကဆါစအံၫလဲယၫ",
			"8": "<sup>8</sup> ဆ့ဧၪ.- တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ,ယၧၩလီၫ. တၭလ့ၩ",
			"9": "<sup>9</sup> လီၩဘၪနကဆါ,ယိခွါ, စအံၫလဲယၫနီၪဆံၭ.- တၭအ ဝ့ၫနီၪစံၭ, ဘဲၫၥိၭနမိဖ့ၪလၫ့ခွံၬနခ့ၫနၡၩ လၧစအၫဟၭ အစူၪဖၧၩ့, ဘဲၫၥိၭအမိမၩၥံၫယၧၩနီၪ, မွဲယမၩမၪဆၧ",
			"10": "<sup>10</sup> နီၪလမံၩ့လဲၪ.- ယဟိဝၩနယွၩမၧၫ့ဝ့ၫနီၪ, ၦၡၩလဆၨၩ မွဲဂ့ၩ,ဘၩ့မုးမွဲဂ့ၩ, လၧယကဆါလအၪ့မၧၫ့ဘၪဆၧ လ့ၩအၪ့ဎၬနၧၩလၧအဖၧၩ့အီၪနးစီၪ့အ့ၬ. တၭထီးၦ ၡၩစံၭလအီၪဘၪတၭ, ဘၩ့မုးမွဲဂ့ၩ, ၦဆၨၩမွဲဂ့ၩ,ဒုၭ",
			"11": "<sup>11</sup> ဆိၪလၩ့ဝ့ၫလၧအဒၪန့နၧၩထီးနီၪအ့ၬ.- တၭဘိၩ့နဲၪ့ ယီၩနစံၭ,လ့ၩလီၩဘၪနကဆါ, ယိခွါ,စအံၫလဲယၫနီၪ",
			"12": "<sup>12</sup> ဆံၭ.- ထီးယစဲၪ့ထၪ့လၧနအီၪတၭ, ဆၧမိမၩအၥၭလၧ ယဟိဝၩအၥၭမုမိဆိၬခွံၬနၧၩ ထီးယလၥ့ၪယၫဘၪအ လးတၭး ထီးယလ့ၩလီၩဘၪစအၫဟၭတၭ, လဒၪန့ ဘၪနၧၩနီၪ, မိမၩၥံၫယၧၩလီၫ. တၭလၧယဖိၪၥၪခွၫ",
			"13": "<sup>13</sup> ထၪ့လံၩလံၩနီၪ, နခ့ၫနၡၩၥၭမဲၪယဟိဝၩလီၫ.- လၧနး ယ့ၭဇဘ့လၭမၩၥံၫယဟိဝၩ အမီၪလဖၪနီၪ ဆၧလၧ ယမၩလၧယအီၪက့ၪၥူၪၦၡၩလယၩ လၧယဟိဝၩအ မီၪလဖၪအကျၩလၧဆၧအိၩဖၧၩ့ ယဲဆံၫလစီၪ့,ယဲဆံၫ လစီၪ့တၭ, ယလုအၪ့လုအီၩလၧကိၪ ဒဲထံၫနီၪ,မွဲဆၧ",
			"14": "<sup>14</sup> လီၩဘၪယကဆါအ့ၬဧၪ.- တၭဘိၩ့နဲၪ့ယီၩနစံၭ,လ့ၩ လီၩဘၪနကဆါ,ယိခွါ, စအံၫလဲယၫနီၪဆံၭ. တၭအ",
			"15": "<sup>15</sup> ဝ့ၫမိမၩၥံၫယၧၩလီၫ.- တၭစအံၫလဲယၫစံၭဝ့ၫဒၪ,ဆၧ ၥုၭမုခမျၧးအယဟိဝၩ လၧယဆၧၫ့ထုၪ့လၧအမ့ၬယၫ မၧၫ့ဝ့ၫနီၪယမိဒုၭနဲၪတၡါယၥၭ လၧအမ့ၬယၫလၧမု ဆၫလနံၩယီၩလီၫ.",
			"16": "<sup>16</sup> စအိၫဘဒဲအၫလ့ၩထၪ့အၪ့ဂၬ စအၫဟၭတၭ,လီၩ ဘၪအဝ့ၫတၭ, စအၫဟၭလ့ၩထၪ့အၪ့ဂၬစအံၫလဲယၫ",
			"17": "<sup>17</sup> လီၫ.- ထီးစအၫဟၭဒၪဘၪစအံၫလဲယၫတၭ, ဆၧမၩ အၥၭလၧစအၫဟၭ စံၭဝ့ၫ, နမွဲၦလၧအမၩထံၬထၬ",
			"18": "<sup>18</sup> အံၫစရ့လၭဆ့ဧၪ.- တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယမၩ ထံၬထၬအံၫစရ့လၭအ့ၬ. အ့ၪမွဲနဝ့ၫဒၪဒဲနဖါအၡၩဂံၪ့ ဖိၪလဖၪမၩထံၬထၬဝ့ၫ လၧနၥံၪစဲၪ့ဒၪယဟိဝၩအဆၧ မၪလူၬလဖၪ, ဒဲဖိၬဘၫအလၭလဖၪ အခဲၫ့နီၪအကၠီၩ့",
			"19": "<sup>19</sup> လီၫ.- ဘိၩ့နဲၪ့ယီၩအၪ့မၧၫ့လၩ့ဆၧ, ဒုၭအီၪကီၪ့အံၫစ ရ့လၭထီးအလူၬ, ဒဲဘၫအလၭအမီၪၥံၪလံယၩယဲဆံၫ, ဒဲအၡ့ရိၫအမီၪလံယၩ, လၧအအၪ့ဆၧလၧနးယ့ၭဇ ဘ့လၭအစပွဲထံၭလဖၪ လၧယအီၪလၧခိၪလီၩ့ ကၫမ",
			"20": "<sup>20</sup> လၭအလီၩ့ဆံၭ.- စအၫဟၭအၪ့မၧၫ့လၩ့ဆၧလၧၦအံၫ စရ့လၭဖိၪထီးအလူၬတၭ, ဒုၭအီၪကီၪ့မီၪလဖၪလၧခိၪ လီၩ့ကၫမလၭအလီၩ့လီၫ.",
			"21": "<sup>21</sup> စအံၫလဲယၫဂဲၫ လၧၦခမျၧးထီးအလူၬအအီၪတၭ, စံၭဝ့ၫဒၪ, မွဲနၥံၪအၥၭမိဂံၩ့ဂၩ့ လၧဆၧနံၫမံၩ့အဘိၩ့ ဆၧၩ့ဆံၭယံၬလဲၪ. ယဟိဝၩအ့ၪမွဲယွၩတၭ, လီၩ့အ ဝ့ၫဆံၭ. ဘၫအလၭအ့ၪမွဲယွၩတၭ, လီၩ့အဝ့ၫဒၪဆံၭ.",
			"22": "<sup>22</sup> တၭၦခမျၧးစံၭဆၧၫ့ဆၧနးထံၪအ့ၬ.- တၭစအံၫလဲယၫ စံၭၦခမျၧး, ယဝ့ၫဒၪယဟိဝၩအမီၪယီၩ, ယအီၪလၩ့ ထးယၧၩလဂၩဎးလီၫ. အ့ၪမွဲဘၫအလၭအမီၪနီၪ,မွဲ",
			"23": "<sup>23</sup> ၦၡၩလံယၩယဲဆံၫလီၫ.- မွဲအဝ့ၫၥံၪဖ့ၪလၫ့ပၧၩလၧချီ ဖၫနံၫဒုၩတၭ, ရွံန့ဝ့ၫချီနးဒုၩလၧအဝ့ၫၥံၪအဂးဒၪဝ့ၫ တၭ,ဒၪ့ထ့ၬလကုၬလကုၬတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧၥံၪ့ မုအဖၫ့ခိၪဆံၭ. ထီးအီၪက့ၪမ့ၪလၧအဖၫ့လၬနီၪလဂ့ၩး တၭယဝ့ၫဒၪယမိတဲၩ့ဝဲၩချီဖၫလဒုၩဒၪ ဒဲအီၪက့ၪလၩ့ လၧၥံၪ့မုအဖၫ့ခိၪတၭ, ယအီၪက့ၪမ့ၪ လၧအဖၫ့လၬ",
			"24": "<sup>24</sup> ဆ့အ့ၬ.- နၥံၪဝ့ၫနီၪကိၭထၪ့ နၥံၪအယွၩလဖၪအမံၩ့ တၭ,ယဝ့ၫဒၪယီၩ ယမိကိၭထၪ့လၧယဟိဝၩအမံၩ့ တၭ,ယွၩလၧအစံၭဆၧၫ့ဆၧလၧမ့ၪလဂၩ, မွဲအအီၪ ဒၪဝ့ၫယွၩနီၪဆံၭ. တၭၦခမျၧးထီးအလူၬ စံၭဆၧၫ့ ဆၧတၭ,စံၭဝ့ၫဒၪ, နချဲၩ့ဆၧနီၪဂ့ၩယူၭ.",
			"25": "<sup>25</sup> စအံၫလဲယၫစံၭ ဘၫအလၭအမီၪလဖၪ အၪ့ဎၬရွံ န့ချီဖၫနးဒုၩ လၧနၥံၪအဂးဒၪနၥံၪဝ့ၫတၭ, တဲၩ့ဝဲၩဆိၫဝ့ၫ ဆံၭ.အဂဲးဘဲၫယီၩ နၥံၪမွဲၦအၪဂၩလီၫ. တၭကိၭထၪ့ နၥံၪအယွၩလဖၪအမံၩ့ဆံၭ. ထီးအီၪက့ၪလၩ့မ့ၪလ",
			"26": "<sup>26</sup> ဂ့ၩ.- အဝ့ၫၥံၪမၩန့ချီဖၫလဒုၩလၧဆၧဖ့ၪလၫ့ဝ့ၫတၭ, တဲၩ့ဝဲၩဝ့ၫတၭ, ကိၭထၪ့ဘၫအလၭအမံၩ့လၧဂီၩထီး လၧမုထုၪ့တၭ,စံၭဝ့ၫ, ဘၫအလၭဧ့, ခိၭနၪပလူဆံၭ. တၭဆၧအလူအီၪအ့ၬ. တၭဆၧစံၭဆၧၫ့ဝ့ၫနးမံၩ့အ့ၬ. တၭအဝ့ၫၥံၪဂဲထုၪ့လံဝၬဖီၩ့ လၧဆၧလုအလးလၧအ",
			"27": "<sup>27</sup> မၩယူၭဝ့ၫလီၫ.- တၭလၧမုထုၪ့နီၪ ဆၧမၩအၥၭလၧ စအံၫလဲယၫဒုၪဒွ့ၪအဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ,ကိၭၡၭထၪ့ ဘီၪ,အဂဲးဘဲၫယီၩမွဲယွၩတၭ, မွဲအဆီၫ့မီၪ့ဆၧဧၪ, အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, မွဲအလီၩ့ဆီးဆၧဧၪး အ့ၪလ မွဲဘၪဘဲၫနီၪတၭ, မွဲအလ့ၩဆၧဧၪး ဘၪလဘၪမံၫမၪ",
			"28": "<sup>28</sup> ဝ့ၫတၭ, ဆၧမိဘၪထိၪဂဲထုၪ့ဝ့ၫလီၫ.- ၦၡၩကိၭၡၭထၪ့ ဝ့ၫတၭ,ဂ့ၬလၩ့အၥၭလၧဎ့ၬ ဒဲဒီၩၥံၪဘဲၫအထူၫအရူၫ",
			"29": "<sup>29</sup> အၥိၭနီၪထီးအၥွံၪဂဲၫထၪ့လၧအလီၩ့လီၫ.- ထီးမုထုၪ့ ဖီၩ့ခွံၬတၭ, ဆၧမၩအၥၭလၧအဝ့ၫၥံၪနီၪ ချဲၩ့ဆၧလၧ မီၪအချိၬထီးလၧလုထၪ့ဆၧအထီတၭ, ဆၧအလူလ အီၪဘၪတၭ, ဆၧစံၭဆၧၫ့ဆၧနးမံၩ့အ့ၬ, ဒဲယူၭယၪ့ဆၧ နီၪအီၪဝ့ၫနးဂၩဆ့အ့ၬ.",
			"30": "<sup>30</sup> စအံၫလဲယၫစံၭၦခမျၧးထီးအလူၬ, ဂဲၫဘူၭလၧ ယၧၩဆံၭ. တၭၦခမျၧးထီးအလူၬဂဲၫဘူၭလၧအဝ့ၫလီၫ. တၭအဝ့ၫမၩထၪ့ထဲၩ့ ယဟိဝၩအဆၧလုလး လၧအ",
			"31": "<sup>31</sup> လၩ့ဎီးနီၪလီၫ.- တၭစအံၫလဲယၫမၩန့လိးလဆံၫနံၫ ဖျိၪ့ဘဲၫဆၧအဒီၪ့လဖၪ ဘၪဆဲၫ့လၧစယၫကူၭအဖိၪခွၫ အဆၧဝံထၪ့နၬထၪ့အၥိၭနီၪ, ၦလၧယဟိဝၩအလူဘၪ",
			"32": "<sup>32</sup> ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, အံၫစရ့လၭမွဲနမံၩ့လီၫ.- တၭအဝ့ၫ မၩထၪ့ဆၧလုအလး လၧလိးလဖၪလၧယဟိဝၩအမံၩ့ တၭ,မၩဆၧကၠီၪ့ဝၬဖီၩ့ဆၧလုအလး လၧအမိထီဆၧ",
			"33": "<sup>33</sup> ချံၫနံၫနၬလီၫ.- တဲၩ့ဝဲၩၥံၪ့မုတၭ, ဒၪ့ထ့ၬချီဖၫလကုၬလ ကုၬတၭ, အီၪက့ၪဝ့ၫလၧၥံၪ့မုအဖၫ့ခိၪတၭစံၭဝ့ၫ, မၩ ဎွ့ၩထံၫဆဲၩလံဖျိၪ့လၧထံၫတၭ, လူၫလၩ့လၧဆၧလုမ့ၪ",
			"34": "<sup>34</sup> အဖၫ့ခိၪဒဲလၧၥံၪ့မုအဖၫ့ခိၪနီၪဆံၭ.- တၭစံၭဝ့ၫဒၪ,မၩ နံၫဘျၩ့လဘျၩ့ဆံၭ. အဝ့ၫၥံၪမၩဝ့ၫနံၫဘျၩ့လဘျၩ့လီၫ. တၭစံၭဝ့ၫဒၪ, မၩၥၧၫ့ဘျၩ့လဘျၩ့ဆံၭ. တၭအဝ့ၫၥံၪ",
			"35": "<sup>35</sup> မၩဝ့ၫၥၧၫ့ဘျၩ့လဘျၩ့လီၫ.- ထံၫလၩ့ယွၩဝၬဖီၩ့ဆၧလု လးတၭအဝ့ၫဒၪမၩဎွ့ၩဆၧအကၠီၪ့နီၪ လၧထံၫဆ့လီၫ.",
			"36": "<sup>36</sup> ဆၧမၩအၥၭလၧလုထၪ့ဆၧအထီနီၪ, မီၪစအံၫလဲ ယၫဂဲၫဘူၭတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩ, စအၫဘြဟၫ့, စအံစၭ,ဒဲအံၫစရ့လၭအယွၩဧ့, လၧမုဆၫလနံၩယီၩ, နဲၪဖျီၪထၪ့လၧနမွဲယွၩလၧအံၫစရ့လၭအကျၩ, ဒဲလၧ ယမွဲနခ့ၫနၡၩ ဒဲလၧယမၩဆၧလဖၪယီၩ ထီးအလူၬ",
			"37": "<sup>37</sup> လၧနလူနီၪဆံၭ.- ခိၭနၪယလူယဟိဝၩဧ့, ဘဲၫၥိၭၦခ မျၧးယီၩမိၥ့ၪယၫလၧနမွဲယဟိဝၩယွၩ, ဒဲလၧနဘိၭကၠၪ",
			"38": "<sup>38</sup> ကဒၩထဲၩ့အဝ့ၫၥံၪအၥၭနီၪဆံၭ.- တၭယဟိဝၩအမ့ၪ လၩ့ထ့ၬဝ့ၫတၭ အၪ့ခွံၬဆၧလုမ့ၪ, ဒဲၥံၪ့မု,ဒဲလိးလဖၪ, ဒဲဂၪ့ခိၪအမုၬတၭ, အၪ့လဲၪ့ထၪ့ခွံၬထံၫလၧအအီၪဝ့ၫ လၧဆၧအကၠီၪ့ဖၧၩ့နီၪလီၫ.",
			"39": "<sup>39</sup> ထီးၦခမျၧးထီးအလူၬဒၪဘၪဝ့ၫတၭ, ၡီၫ့လၩ့အၥၭ ချႃၬလၩ့အမ့ၬတၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩ,အဝ့ၫဒၪမွဲယွၩ",
			"40": "<sup>40</sup> တၭ,ယဟိဝၩ,အဝ့ၫဒၪမွဲယွၩလီၫ.- တၭစအံၫလဲယၫ စံၭအဝ့ၫၥံၪ,ဖီၪ့ထၬဘၫအလၭ အမီၪလဖၪနီၪဆံၭ.ဒုၭ ဖီၩ့ဖျ့ၭဝ့ၫနးဂၩလဂ့ၩ. တၭအဝ့ၫၥံၪ ဖီၪ့ထၬဝ့ၫတၭ စအံၫလဲယၫၥိၫ့လၩ့ဝ့ၫ လၧထံၫချိၬကံၡၧၫ့တၭမၩၥံၫ အဝ့ၫၥံၪထီးနီၪလီၫ.",
			"41": "<sup>41</sup> တၭစအံၫလဲယၫစံၭစအၫဟၭ, လ့ၩထၪ့အၪ့ဆၧအီၩ ဆၧဆံၭ. အဂဲးဘဲၫယီၩ ဆၧဂဲၫဆၧၩ့အၪအၪလ့ၬအ",
			"42": "<sup>42</sup> ၥီၫအီၪထၪ့ဝ့ၫလီၫ.- တၭစအၫဟၭလ့ၩထၪ့ဝ့ၫဘဲၫၥိၭ အမိအၪ့ဆၧဒဲအီၩဆၧလီၫ. တၭစအံၫလဲယၫလ့ၩထၪ့ လၧကၫမလၭအခိၪလီၩ့အဒၩ့ခိၪတၭ, ၡီၫ့လၩ့အၥၭ လၧဂၪ့ခိၪတၭ အီၪက့ၪအမ့ၬ လၧအခၪ့လုးခိၪအဆူၭ",
			"43": "<sup>43</sup> ဖၧၩ့လီၫ.- တၭစံၭအခ့ၫအၡၩလ့ၩထၪ့ဘီၪ, ယိစိၩလၧ မၫဆမံၭနီၪဆံၭ. တၭအဝ့ၫလ့ၩထၪ့ ယိဝ့ၫတၭ,စံၭ ဝ့ၫဒၪ,ဆၧအီၪနးမံၩ့အ့ၬ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, လ့ၩဒီၭ",
			"44": "<sup>44</sup> နွ့ၫဘျၩ့ဆံၭ.- တၭလၧအလ့ၩထၪ့နွ့ၫဘျၩ့လဘျၩ့နီၪ ဆၧမၩအၥၭလၧအစံၭဝ့ၫဒၪ, ယိခွါ, ဆၧအုၪ့ဖိၪထၪ့ လၧမၫဆမံၭဖၧၩ့ ဘဲၫၦၡၩအစူၪယၫၥၭအၥိၭနီၪလီၫ. တၭအဝ့ၫဒၪစံၭ, လ့ၩထၪ့လီၩဘၪစအၫဟၭ, ဘဲၫၥိၭ ဆၧဂဲၫဆၧၩ့ထီးပဒၩ့နၧၩလဂ့ၩ, တဲၩ့ဝဲၩဆၧတၭ,လ့ၩ",
			"45": "<sup>45</sup> လၩ့ဆံၭ.- တၭလၧအဆၧၫ့အထီ ဎွ့ၩအံၩဎွ့ၩအိၩဆၧ မၩအၥၭလၧမူၭခိၪထၪ့ၥၧၫ့ လၧဆၧအုၪ့ၥၧၫ့, ဒဲလံၩ တၭ,ဆၧဂဲၫဆၧၩ့ဖၭဒိၪလီၫ. တၭစအၫဟၭထူၬဆၧ",
			"46": "<sup>46</sup> တၭ,လ့ၩဝ့ၫလၧယံၭစရ့လၭလီၫ.- ယဟိဝၩအစူၪအီၪ ဝ့ၫလၧစအံၫလဲယၫအလီၩ့တၭ, အဝ့ၫဒၪခဲးထူၬထၪ့အ ယးဒံၩ့တၭ, စဲၪ့ဝ့ၫလၧစအၫဟၭ အမ့ၬယၫထီၩ့လၧ ဆၧလ့ၩနုၬလၧယံၭစရ့လၭလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> တၭစအၫဟၭလီၩဘၪ နးယ့ၭဇဘ့လၭလၧကယဲ ဆၧလၧစအံၫလဲယၫမၩဝ့ၫ, ဒဲကယဲဆၧလၧအဘၪဆဲၫ့",
			"2": "<sup>2</sup> လၧအမၩၥံၫမီၪလဖၪလၧနၭလီၫ.- ထီးနီၪလဖၧၫ့နး ယ့ၭဇဘ့လၭ အၪ့မၧၫ့အၥီၫ့လဂၩ လၧစအံၫလဲယၫအ အီၪတၭ,စံၭဝ့ၫဒၪ, ထီးကဲဂီၩခိၬဆၧၫ့ထဲၩ့အလးဘဲၫ ယီၩ,ယအ့ၪလအီၪက့ၪဘၪနၥၭမၧၫ့ ဘဲၫၦလဂၩလၧ အဝ့ၫၥံၪအကျၩအၥိၭနီၪတၭ, မွဲယွၩလဖၪမၩယၧၩ",
			"3": "<sup>3</sup> ဘဲၫနီၪၥိၭ, ဒဲနၭနဲၪ့အနီၪဆံၭ.- ထီးအဒၪဘၪဝ့ၫတၭ, ဂဲထုၪ့လ့ၩဆၧလၧအၥၭမၧၫ့အဂးတၭ, ထီၩ့လၧဘံအၧၫ ၡံၫဘၫလၧအဘၪဆဲၫ့လၧယုဒၫတၭ, အီၪက့ၪလၩ့ထး",
			"4": "<sup>4</sup> အခ့ၫအၡၩထီးနီၪလီၫ.- တၭလ့ၩဝ့ၫအနၫ့ဆါဒၪဝ့ၫ,လ နံၩလ့ၩဆၧ,လၧၡါမုနၧၫ့ဖၫတၭ, ဂဲၫဆၧၫ့နၩ့လၧၥံၪ့ရီ ၥံၫ့အဖၫ့လၬတၭ, အၪ့ကံၩ့ဆၧလၧအၥၭ ဘဲၫၥိၭအမိၥံၫ လီၫ. တၭစံၭဝ့ၫဒၪ, အၪယူၭဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩဧ့, မၩန့ထၪ့ယၥၭဆံၭ. အဂဲးဘဲၫယီၩ ယဂ့ၩနဲၪ့ယဖါ",
			"5": "<sup>5</sup> လဖၪအ့ၬ.- မံၫနၩ့မံၫမၪ လၧၥံၪ့ရီၥံၫ့အဖၫ့လၬတၭ, ယိခွါ,အၥီၫ့လဂၩ, ထိၭအဝ့ၫတၭစံၭဝ့ၫဒၪ, ဂဲထုၪ့အၪ့",
			"6": "<sup>6</sup> ဆၧဘီၪ.- အဝ့ၫဒၪယိဝ့ၫတၭ, ယိခွါ,ကိၪပၪပဲၪလဘံၪ့ ဘၪဆၧအၪ့ဎူဝ့ၫလၧလိးၥွံၫအဖၫ့ခိၪ, ဒဲထံၫတခီးအီၪ လၧအခိၪဎွံၪအနဲၩ့လီၫ. တၭအၪ့ဆၧဒဲအီၩဆၧမံၫနၩ့",
			"7": "<sup>7</sup> ဒီၭလီၫ.- ယဟိဝၩအၥီၫ့ဂဲၫထဲၩ့နံၫဘျၩ့လဘျၩ့တၭ, ထိၭဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ဂဲထုၪ့အၪ့ဆၧဘီၪး အဂဲးဘဲၫ",
			"8": "<sup>8</sup> ယီၩဖၧၩ့ၥၭယဲၩ့ကဲၪကၩလၧနဂးလီၫ.- အဝ့ၫဂဲထုၪ့ အၪ့ဆၧဒဲအီၩဆၧတၭ, လ့ၩဝ့ၫလၧဆၧအၪ့နီၪအဂဲးအ ဘၭအနံၩလံဆံၫ အနၩလံဆံၫ ထီၩ့လၧကဆါအခိၪ လီၩ့ဟိရ့ၭနီၪလီၫ.",
			"9": "<sup>9</sup> ဂဲၫဝ့ၫထီးနီၪလၧဆၧအိၩဖၧၩ့တၭ, အီၪဝ့ၫထီးနီၪ ၥၫ့နၩချီၩ့တၭ,ယိခွါ, ယဟိဝၩအလူလၩ့ဘၪဝ့ၫတၭ, စံၭအဝ့ၫ, စအံၫလဲယၫဧ့, နမၩဆၧနီၪလၫထီးယီၩလဲၪ.",
			"10": "<sup>10</sup> တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယၥၭဆီၪ့လၧယဟိဝၩဆၧၥုၭမု ခမျၧးအယွၩဆီၪ့ဆီၪ့လ့ၬလီၫ. အဂဲးဘဲၫယီၩ ၦအံၫ စရ့လၭဖိၪခွံၬၡိၭနဆၧအုၩ့လၩ့, မၩလၩ့ဎီးခွံၬနဆၧ လုအလးလဖၪ, ဒဲမၩၥံၫနမီၪလဖၪလၧနၭတၭ, အီၪလၩ့ ထးန့ၫယၧၩလဂၩလီၫ. တၭအဝ့ၫၥံၪ အၪ့ဎၬယၥၭ",
			"11": "<sup>11</sup> မၧၫ့ဘဲၫၥိၭအမိမၩန့ထၪ့ခွံၬဝ့ၫလီၫ.- အဆၧစံၭဝ့ၫ, စဲၪ့ ထၪ့တၭ,ဆၧၫ့ထုၪ့လၧခိၪလီၩ့ လၧယဟိဝၩအမ့ၬယၫ ဆံၭ.တၭယိခွါ, ယဟိဝၩလ့ၩဖီၩ့ခွံၬတၭ, လံၩမုဆီၪ့ မၩထ့ဖၭခိၪလီၩ့လဖၪတၭ, မၩလၩ့ဘျ့ၭလိးလဖၪလၧ ယဟိဝၩအမ့ၬယၫလီၫ. ယဟိဝၩအီၪဝ့ၫလၧလံၩနီၪ အဖၧၩ့အ့ၬ. တၭလၧလံၩနီၪအလးခဲၫ့ဂၪ့ခိၪဝၭဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩအီၪဝ့ၫလၧဂၪ့ခိၪဝၭအဖၧၩ့နီၪဆ့အ့ၬ.- တၭ လၧဂၪ့ခိၪဝၭအလးခဲၫ့နီၪ မ့ၪခဲၩထၪ့လီၫ. တၭယဟိ ဝၩအီၪဝ့ၫလၧမ့ၪနီၪအဖၧၩ့ဆ့အ့ၬ. တၭလၧမ့ၪနီၪအ",
			"13": "<sup>13</sup> လးခဲၫ့ဆၧအၥီၫဆံၭခိၬ ဒဲဖူၬလူၭအီၪထၪ့လီၫ.- ထီး စအံၫလဲယၫနါဂၧၫ့တၭ, ဆၧမၩအၥၭလၧအချႃၬဘံၭ အမ့ၬလၧအဖၬဘဲၩ့ဖၧၩ့တၭ, လ့ၩထၪ့ဆၧၫ့ထုၪ့လၧ ဆၧအိၩဖၧၩ့အခိၪထိၭလီၫ. တၭယိခွါ, ဆၧအလူလၩ့ ဘၪအဝ့ၫတၭ,စံၭဝ့ၫဒၪ, စအံၫလဲယၫဧ့, နမၩဆၧနီၪ",
			"14": "<sup>14</sup> လၫထီးယီၩလဲၪ.- တၭအဝ့ၫဒၪစံၭ, ယၥၭဆီၪ့လၧယ ဟိဝၩဆၧၥုၭမုခမျၧးအယွၩအဂး ဆီၪ့ဆီၪ့လ့ၬလီၫ. အဂဲးဘဲၫယီၩ ၦအံၫစရ့လၭဖိၪခွံၬၡိၭနဆၧအုၩ့လၩ့, မၩလၩ့ဎီးခွံၬနဆၧလုအလးလဖၪ, ဒဲမၩၥံၫနမီၪလဖၪ လၧနၭတၭ, အီၪလၩ့ထးန့ၫယၧၩလဂၩလီၫ. အဝ့ၫၥံၪ နီၪအၪ့ဎၬယၥၭမၧၫ့ ဘဲၫၥိၭအမိမၩန့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"15": "<sup>15</sup> တၭယဟိဝၩစံၭဝ့ၫ, လ့ၩထၪ့ဘီၪ, ထဲၩ့ဖိၬနဖၧၩ့ၥၭ လၧဒမၭစကၧၭအၡါမုနၧၫ့ဖၫ, ထီးနအ့ၪလ့ၩထီၩ့တၭ, ဂုၪစဟၭဇအ့လၭ လၧစဎွၩ လၧစံရအၫအဖၫ့ခိၪနီၪ",
			"16": "<sup>16</sup> ဆံၭ.- တၭစနံၫ့ၡဲၫအဖိၪခွၫ စယံဟုၫနီၪနမိဘၪဂုၪဝ့ၫ လၧစဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪတၭ, စၡၫဖၭအဖိၪ ခွၫစအံၫလဲၡၫဘၪဆဲၫ့လၧအၫဘလၭ မဟိလၫလဂၩ",
			"17": "<sup>17</sup> နီၪနမိဘၪဂုၪဝ့ၫလၧမီၪလၧနလးလီၫ.- ဆၧမၩအၥၭ လၧၦလၧအဖီၩ့ဖျ့ၭစဟၭဇအ့လၭအနၭနီၪ စယံဟုၫ မိမၩၥံၫဝ့ၫတၭ, ၦလၧအဖီၩ့ဖျ့ၭစယံဟုၫအနၭနီၪစအံၫ",
			"18": "<sup>18</sup> လဲၡၫမိမၩၥံၫဝ့ၫလီၫ.- မွဲလါနၫ့တၭ, ယအီၪက့ၪလၩ့ ထးယူၭၦၡၩနွ့ၫထီၫ့လၧအံၫစရ့လၭအကျၩ, ကယဲခၪ့ လုးခိၪထီးအလူၬ လၧအလချံၭလၩ့ဘၪအၥၭ လၧဘၫ အလၭအမ့ၬယၫ, ဒဲကယဲနိၭထီးအလူၬလၧအလအဲၪ ဂါဘၪအဝ့ၫဒၪလီၫ.",
			"19": "<sup>19</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ထီးနီၪတၭ, ဒၪန့စၡၫဖၭအဖိၪခွၫ စအံၫလဲၡၫလၧအထဲၫဆၧလၧချီဖၫ လဆံၫနံၫခိၪလၧ အမ့ၬယၫတၭး အဝ့ၫဒၪအီၪလၧအဆၧ လဆံၫနံၫခိၪ လခိၪအၥိၭတၭး စအံၫလဲယၫလ့ၩဖီၩ့ခွံၬဝ့ၫတၭ,ခွံၬ",
			"20": "<sup>20</sup> စိၩအဖၬဘဲၩ့လၧအလီၩ့လီၫ.- အဝ့ၫဒၪစဲၪ့ဒၪချီလဖၪ တၭ,စဲၪ့ဖိၬစအံၫလဲယၫအခဲၫ့စံၭဝ့ၫဒၪ, ဒုၭအဲၪဂါလါ ယၧၩလၧယမိဒဲယဖါဆံၭ, တၭယမိဖိၬနခဲၫ့လီၫ.တၭ အဆၧစံၭဝ့ၫ, ထဲၩ့ကဒၩထဲၩ့ဆံၭ. အဂဲးဘဲၫယီၩယမၩ နၧၩလၧဆၧနီၪလမံၩ့လဲၪ.",
			"21": "<sup>21</sup> အဝ့ၫနီၪထဲၩ့ကဒၩထဲၩ့ဝ့ၫတၭ, မၩန့ချီဖၫလခိၪတၭ, မၩၥံၫဝ့ၫနီၪ, အၪ့ဎွံဝ့ၫအယၪလၧချီဖၫအဎၧၩ့အဎီ,ဖ့ၪ လၫ့ၦခမျၧးတၭ, အဝ့ၫၥံၪအၪ့ဝ့ၫလီၫ. ထီးနီၪလဖၧၫ့ အဝ့ၫဂဲထုၪ့လ့ၩဖိၬ စအံၫလဲယၫအခဲၫ့, ဒဲမၩအခ့ၫအ ၡၩအဆၧမၩလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> စံရအၫအစဎွၩဘံၫ့ဟၫဒၭ ဒုၭအီၪကီၪ့အၥုၭမုခမျၧး ထီးအလူၬတၭ, စဎွၩၥၧၫ့ဆံၫနံၫဂၩ အီၪလၧအၥိၭ, ဒဲ ကၥ့ၪလဖၪ, ဒဲလဲၪ့ၥုၭလဖၪနီၪလီၫ. တၭအဝ့ၫလ့ၩထၪ့",
			"2": "<sup>2</sup> ဒဲဝၩ့ထၬစမ့ရအၫတၭဒုၭထၫ့ဒၩဝ့ၫလီၫ.- အၪ့မၧၫ့လၩ့ အၥီၫ့လဖၪ လၧအံၫစရ့လၭအစဎွၩ အၫဟၭအအီၪ လၧဒိၩ့ဖၧၩ့တၭ, စံၭအဝ့ၫ, စဘံၫ့ဟၫဒၭစံၭဘဲၫယီၩ,",
			"3": "<sup>3</sup> နစ့ၩ,ဒဲနထီၫ့မွဲယဝ့ၫး နမၫၥံၪဆ့ဒဲနဖိၪနလံၩအဂ့ၩထုၬ",
			"4": "<sup>4</sup> လဖၪမွဲယဝ့ၫလီၫ.- အံၫစရ့လၭအစဎွၩစံၭဆၧၫ့ဝ့ၫဒၪ တၭ,ယကဆါစဎွၩဧ့, ဘဲၫနလူအၥိၭနီၪယဝ့ၫဒၪယီၩ ယမွဲနဆၧ, ဒဲကယဲဆၧအီၪလၧယစူၪဖၧၩ့ ထီးအလူၬ လီၫ.",
			"5": "<sup>5</sup> အၥီၫ့လဖၪနီၪဂဲၫထဲၩ့ထဲၩ့ဒီၭတၭ, စံၭဝ့ၫဒၪ,စဘံၫ့ ဟၫဒၭချဲၩ့ဆၧဘဲၫယီၩ, စံၭဝ့ၫဒၪ,ယအၪ့မၧၫ့လၩ့ဆၧ လၧနအီၪတၭ, စံၭလၧနမိဘၪဖ့ၪလၫ့ယၧၩလၧစ့ၩ, ဒဲန",
			"6": "<sup>6</sup> ထီၫ့,ဒဲနမၫၥံၪ, ဒဲနဖိၪနလံၩၥံၪ,- မွဲလါနၫ့ဘိၩကဲဂီၩခိၬ အခၫယီၩ, ယမိအၪ့မၧၫ့လၩ့ယခ့ၫယၡၩတၭ, အဝ့ၫ ၥံၪမိအၪ့ဎၬ ဆၧလၧနဂံၪ့ဖၧၩ့, ဒဲလၧနခ့ၫနၡၩအဂံၪ့ ဖၧၩ့တၭ,ဆၧမိမၩအၥၭ လၧကယဲဆၧလၧနယိဂ့ၩလ မံၩ့လါလါနီၪ, အဝ့ၫၥံၪမိအီၪက့ၪဝ့ၫ လၧအစူၪဖၧၩ့",
			"7": "<sup>7</sup> တၭ,မၩန့ခွံၬဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့အံၫစရ့လၭအ စဎွၩကိၭန့ထံၫၥံၪခးၥံၪအၥုၪ့က့ၭၥၭၡါ ထီးအလူၬတၭ, စံၭဝ့ၫဒၪ,ယိခွါဘီၪ, ယိလၧအဝ့ၫလဂၩယီၩအၪ့ဎၬ ဆၧအၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫအၪ့မၧၫ့လၩ့ဆၧ လၧယအီၪဘဲၫၥိၭအမိန့ဘၪယမၫၥံၪ, ဒဲယဖိၪယလံၩ ၥံၪ,ဒဲယကျိၪၥံၪစ့ၩၥံၪ ထီၫ့ၥံၪလွ့ၫၥံၪတၭး ယပဒၩ့အ",
			"8": "<sup>8</sup> ဝ့ၫအ့ၬ- တၭၦၥုၪ့က့ၭၥၭၡါထီးအလူၬ, ဒဲၦခမျၧးထီး အလူၬစံၭအဝ့ၫ, ခိၭနၪအလူလဂ့ၩ. ဒဲအုၩ့လၩ့လဂ့ၩ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭအဝ့ၫစံၭ စဘံၫ့ဟၫဒၭ အၥီၫ့လ ဖၪ,လီၩဘၪယကဆါစဎွၩနီၪ, ကယဲဆၧလၧနအၪ့မၧၫ့ လၩ့လၧနခ့ၫနၡၩအအီၪလၧနဂး လၧအခၪ့ထံၭလဖၪ ထီးအလူၬနီၪယမိမၩလီၫ. အ့ၪမွဲဆၧလမံၩ့ယီၩယမၩ ၥ့ၪအ့ၬ. တၭအၥီၫ့လဖၪနီၪစဲၪ့ထၪ့ခွံၬ, ဂဲၫန့ဒီၭဝ့ၫလၧ ဆၧချဲၩ့လီၫ.",
			"10": "<sup>10</sup> စဘံၫ့ဟၫဒၭအၪ့မၧၫ့လၩ့ဆၧ လၧအအီၪတၭ,စံၭဝ့ၫ ဒၪ,လၧကယဲၦခမျၧးလၧအဖိၬ ယခဲၫ့မိမၩန့ဝ့ၫဎွ့ၩဎွ့ၩ အစူၪၥံၪနီၪ စမ့ရအၫအဂၪ့ခိၪအမုၬ အ့ၪလၧၫ့လၧအ ဂးတၭ, မွဲယွၩလဖၪ မၩယၧၩဘဲၫနီၪ ဒဲအၪနဲၪ့အနီၪ ဆံၭ.",
			"11": "<sup>11</sup> အံၫစရ့လၭစဎွၩစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ,ၦလၧ အခဲးထူၬအၥၭနီၪ, မွဲအထီးအီၪက့ၪဖိၫလိၫအၥၭဘဲၫ",
			"12": "<sup>12</sup> ၦလၧအဘဲၪ့လၩ့ခွံၬအၥိၭနီၪလဂ့ၩ.- ထီးအနါဂၧၫ့ဆၧ ချဲၩ့နီၪတၭ, ဆၧမၩအၥၭလၧအဝ့ၫဒၪအီၩဆၧ, အဝ့ၫ ဒၪဒဲအစဎွၩလဖၪလၧအတဲၩဖၧၩ့တၭ, စံၭအခ့ၫအၡၩ တဲၩ့ဝဲၩနၥံၪအၥၭဆံၭ. တၭအဝ့ၫၥံၪတဲၩ့ဝဲၩအၥၭထၫ့ ဒုၪဒၩဒိၩ့နီၪလီၫ.",
			"13": "<sup>13</sup> ယိခွါ,မီၪဂဲၫလၧအံၫစရ့လၭ အစဎွၩအၫဟၭအ အီၪလဂၩတၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩစံၭဘဲၫယီၩ, ၦခမျၧး ထီးအလူၬယီၩနဒၪဘၪယူၭဧၪ. ယိခွါ,ယမိဖ့ၪလၫ့ ခွံၬဝ့ၫလၧနစူၪဖၧၩ့လၧမုဆၫလနံၩယီၩတၭ, နမိၥ့ၪယၫ",
			"14": "<sup>14</sup> လၧယမွဲယဟိဝၩလီၫ.- တၭစအၫဟၭစံၭဝ့ၫဒၪ,လၧ ပလၫလဂၩလဲၪ. တၭအဝ့ၫဒၪစံၭ, ယဟိဝၩစံၭဝ့ၫဘဲၫ ယီၩ,လၧထံၫၥံၪခးၥံၪအၦဒိၪဖၭဒိၪ လဖၪအၡၩဖိၪၥၪ ခွၫၥံၪလီၫ. တၭအဝ့ၫဒၪစံၭ, မွဲပလၫမိဘၪတဲၩ့ဝဲၩဆၧ",
			"15": "<sup>15</sup> ဒုၭၥုၭလဂၩလဲၪ. တၭစံၭဆၧၫ့ဝ့ၫဒၪ, မွဲနၧၩလီၫ.- ထီး နီၪလဖၧၫ့အဝ့ၫဒၪဝံထၪ့နၬထၪ့ ထံၫၥံၪခးၥံၪအၦဒိၪလ ဖၪအၡၩဖိၪၥၪခွၫၥံၪတၭ, အီၪဝ့ၫနံၫယၩ ၥၧၫ့ဆံၫနံၫ ဂၩတၭ,လၧခဲၫ့ထဲၩ့, ဝံထၪ့နၬထၪ့ၦခမျၧးထီးအလူၬ,",
			"16": "<sup>16</sup> ကယဲၦအံၫစရ့လၭဖိၪတၭ, အီၪၦၡၩနွ့ၫထီၫ့လီၫ.- မု ထုၪ့နီၪအဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫလီၫ. အ့ၪမွဲစဘံၫ့ဟၫဒၭအီၩ မၧၩ့အၥၭ လၧတဲၩဖၧၩ့တၭ, အဝ့ၫဒၪဒဲစဎွၩလဖၪ ဒဲစဎွၩၥၧၫ့ဆံၫနံၫဂၩ လၧအမၩဆၧၩ့အဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ခးအၦဒိၪဖၭဒိၪလဖၪ အၡၩဖိၪၥၪခွၫၥံၪစဲၪ့ထၪ့ဆိၫ ဝ့ၫတၭ, စဘံၫ့ဟၫဒၭအၪ့မၧၫ့လၩ့ဆၧတၭ, ၦလဖၪဒုၭ နဲၪဝ့ၫတၭ, စံၭဝ့ၫဒၪၦၡၩလဖၪဂဲၫထၪ့လၧစမ့ရအၫအ",
			"18": "<sup>18</sup> ဖၧၩ့လီၫ.- အဝ့ၫဒၪစံၭ, အ့ၪဂဲၫလၧဆၧဎူၫဆၧဎၩ့အဂး မွဲဂ့ၩ, ဖီၪ့န့မၧၫ့ဝ့ၫဆံၭ. အ့ၪမွဲဂဲၫလၧဆၧဒုၭၥုၭအဂး",
			"19": "<sup>19</sup> မွဲဂ့ၩ,ဖီၪ့န့မၧၫ့ဝ့ၫဆံၭ.- ခးအၦဒိၪဖၭဒိၪလဖၪအၡၩ ဖိၪၥၪခွၫဂဲၫထၪ့ လၧဒိၩ့ဖၧၩ့ ဒဲၥုၭမုလၧအဖိၬအခဲၫ့",
			"20": "<sup>20</sup> လီၫ.- အဝ့ၫၥံၪမၩၥံၫဝ့ၫလဂၩအၡၩလဂၩ, လဂၩအ ၡၩလဂၩတၭ ၦစံရအၫဖိၪစဲၪ့ဖျိၭဝ့ၫတၭ, အံၫစရ့လၭ လီၩ့ဆီးဝ့ၫတၭ, စံရအၫအစဎွၩဘံၫ့ဟၫဒၭဖီၩ့ဖျ့ၭဝ့ၫ လၧကၥ့ၪလီၩ့ အီၪလၧၦကၥ့ၪၥုၭဖိၪလဖၪအၥိၭလီၫ.",
			"21": "<sup>21</sup> အံၫစရ့လၭအစဎွၩ လ့ၩထၪ့ဝ့ၫတၭ, ကျီၪ့ခွံၬကၥ့ၪၥံၪ, ဒဲလဲၪ့ၥုၭၥံၪတၭ, ကျီၪ့ခွံၬၦစံရအၫဖိၪလၧဆၧကျီၪ့ခွံၬ ဖၭဒိၪလီၫ.",
			"22": "<sup>22</sup> မီၪလဂၩနီၪဂဲၫဝ့ၫလၧအံၫစရ့လၭ အစဎွၩအအီၪ တၭ,စံၭဝ့ၫ, လ့ၩမၩဆီၪ့ထၪ့နၥၭတၭ, ၥ့ၪယၫယိဆၧ လၧနမၩဆၧလဖၪဆံၭ. အဂဲးဘဲၫယီၩ ထီးနံၪ့ဆၧၫ့ ထဲၩ့အလးတၭ,စံရအၫအစဎွၩ မိဂဲၫထၪ့ထၫ့ဒၩဒီၭနၧၩ လီၫ.",
			"23": "<sup>23</sup> တၭစံရအၫအစဎွၩအခ့ၫအၡၩစံၭဝ့ၫ, အဝ့ၫၥံၪ အယွၩလဖၪနီၪ, မွဲဆၧစီၩ့ခိၪအယွၩၥံၪလီၫ. မၩအၥၭ ဘဲၫနီၪတၭဆီၪ့နဲၪ့ပၧၩဒံၭလီၫ. တၭမွဲပဒုၭၥုၭလၧအ ဝ့ၫၥံၪလၧဆၧပျၩ့ဖၧၩ့ဆံၭ. မွဲမၬပမိဆီၪ့နဲၪ့အဝ့ၫၥံၪ",
			"24": "<sup>24</sup> ဒံၭလီၫ.- တၭမၩဆၧယီၩ, ၥုၭခွံၬစဎွၩၥံၪ,လဂၩလၧအ လးဒၪဝ့ၫ, လဂၩလၧအလးဒၪဝ့ၫတၭ အီၪက့ၪၥုၭခိၪၥံၪ",
			"25": "<sup>25</sup> လၧအလးနီၪဆံၭ.- တၭဝံထၪ့နၬထၪ့ၥုၭမုဎွ့ၩဎီၩ့ၥုၭမု လၧအလၩ့မါခွံၬလၧနစူၪဖၧၩ့နီၪဆံၭ. ကၥ့ၪလဒုၩလၧ ကၥ့ၪလဒုၩအလး, လဲၪ့ၥုၭလခိၪလၧလဲၪ့ၥုၭလခိၪအ လးတၭ, ပမိဒုၭဆၧလၧအဝ့ၫၥံၪ လၧဆၧပျၩ့ဖၧၩ့တၭ, မွဲတၡါပမိဆီၪ့နဲၪ့အဝ့ၫၥံၪလီၫ. တၭအဆၧခိၭနၪအ ဝ့ၫၥံၪအလူတၭ, မၩဝ့ၫဘဲၫနီၪလီၫ.",
			"26": "<sup>26</sup> ထီးနံၪ့ဆၧၫ့ထဲၩ့အလးတၭ, ဆၧမၩအၥၭလၧစဘံၫ့ ဟၫဒၭဝံထၪ့နၬထၪ့ၦစံရအၫဖိၪတၭ, လ့ၩထီၩ့လၧအၫ",
			"27": "<sup>27</sup> ဖ့ၭဘဲၫၥိၭအမိဒုၭဆၧထၫ့ဒၩ အံၫစရ့လၭလီၫ.- တၭ ၦအံၫစရ့လၭဖိၪဘၪဆၧဝံထၪ့ဝ့ၫတၭ, အီၪဝ့ၫထီးအ လူၬတၭ, လ့ၩထၪ့ထၫ့ဒၩအဝ့ၫၥံၪတၭ, ၦအံၫစရ့လၭ ဖိၪၥုၪ့အတဲၩလၧအမ့ၬယၫ, ဘဲၫဘ့ၪဖိၪနံၫဒီၪ့ဆံၭခိၬ အၥိၭ,အ့ၪမွဲၦစံရအၫဖိၪ မၩဎွ့ၩခးဖၧၩ့နီၪလီၫ.",
			"28": "<sup>28</sup> ယွၩအၡၩလဂၩဂဲၫဝ့ၫတၭ, ချဲၩ့ဆၧလၧအံၫစရ့လၭ အစဎွၩတၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩစံၭဘဲၫယီၩ, မွဲၦစံရ အၫဖိၪစံၭယူၭဝ့ၫ လၧယဟိဝၩမွဲစီၩ့ခိၪလဖၪ အယွၩ လမွဲဘၪဆၧပျၩ့ဖၧၩ့ အယွၩအကၠီၩ့နီၪတၭ, ယမိဖ့ၪ လၫ့ၦခမျၧးဖၭဒိၪယီၩ လၧနစူၪဖၧၩ့လီၫ. တၭနၥံၪမိ ၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.",
			"29": "<sup>29</sup> အဝ့ၫၥံၪတဲၩ့ဝဲၩဆၧဆဲၫဎၩ့လိၬအၥၭ နွ့ၫနံၩတၭ နွ့ၫနံၩလနံၩနီၪ ၥုၭဘူၭစိၩအၥၭတၭ, ဒုၭလိၬအၥၭ လီၫ. တၭၦအံၫစရ့လၭဖိၪ မၩၥံၫၦစံရအၫဖိၪ အခၪ့",
			"30": "<sup>30</sup> ၥုၭဖိၪလကုၬ လၧမုလနံၩနီၪ အထးဖၧၩ့လီၫ.- တၭၦ အီၪလၩ့ထးလဖၪနီၪ စဲၪ့ဖျိၭဖိးလၧအၫဖ့ၭ, လၧဒိၩ့ ဖၧၩ့တၭ,ခိၪဒၧၩ့လၩ့ဎီးဝ့ၫလၧ ၦနံၫလၬနွ့ၫထီၫ့လၧအ အီၪလၩ့ထးဝ့ၫနီၪအဖၫ့ခိၪလီၫ. တၭစဘံၫ့ဟၫဒၭစဲၪ့ ဖျိၭခွံၬတၭ,ဂဲၫနုၬလၧဒိၩ့ဖၧၩ့ လၧဒူၭလၧယၫလခီၫလ",
			"31": "<sup>31</sup> ဒူၭအဖၧၩ့လီၫ.- တၭအခ့ၫအၡၩစံၭဝ့ၫ,ယိခွါ, ပနါဂၧၫ့ ယူၭလၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအစဎွၩလဖၪ မွဲစဎွၩ လၧအယၫ့ၥၭဆၧလီၫ. ဒုၭအီၪက့ၪလါပၧၩ လၧရၧၬ အဆၧယၬလၧပယးဒံၩ့, ဒဲဖျံၩလၧပခိၪဎွံၪတၭ, ဒုၭလ့ၩ ထၪ့ပၧၩလၧအံၫစရ့လၭ အစဎွၩအအီၪဆံၭ. ဘၪလ",
			"32": "<sup>32</sup> ဘၪမိဒုၭမၧၫ့ဒံၭနၥၭမၧၫ့လီၫ.- အဝ့ၫၥံၪခဲးထူၬအယး ဒံၩ့လၧရၧၬအဆၧယၬတၭ, အီၪက့ၪဖျံၩလၧအခိၪဎွံၪ တၭဂဲၫဝ့ၫလၧအံၫစရ့လၭ အစဎွၩအအီၪတၭ, စံၭဝ့ၫ ဒၪ,နခ့ၫနၡၩစဘံၫ့ဟၫဒၭစံၭဝ့ၫဒၪ, မွဲနဒုၭမၧၫ့လါဒံၭ ယၧၩဆံၭ. တၭအဝ့ၫဒၪစံၭ, မွဲအမၧၫ့ဒံၭဆ့ဧၪး မွဲဝ့ၫ",
			"33": "<sup>33</sup> လၧယထၧၫ့ဖုဝဲလီၫ.- ၦခမျၧးလဖၪနီၪ ထီးန့ဆၧချဲၩ့ လထံၪချဲၫ့ချဲၫ့တၭ, စံၭဝ့ၫဒၪ, နထၧၫ့ဖုဝဲစဘံၫ့ဟၫဒၭ လီၫ.တၭအဆၧစံၭဝ့ၫဒၪ, လ့ၩဘီၪ, ဂဲၫထဲၩ့ဆိၬအဝ့ၫ ဆံၭ.တၭစဘံၫ့ဟၫဒၭ ဂဲၫထၪ့လၧအအီၪတၭ, အဝ့ၫ",
			"34": "<sup>34</sup> ဒုၭဂဲၫထၪ့ဝ့ၫလၧလဲၪ့ၥုၭအဖၧၩ့လီၫ.- စဘံၫ့ဟၫဒၭ စံၭအဝ့ၫ,ဒိၩ့လဖၪလၧယဖါမၩန့လၧနဖါနီၪ ယမိဖ့ၪ လၫ့ထဲၩ့တၭ, နမိဘၪမၩဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭ လၧဒမၭစကၧၭ အဖၧၩ့ဘဲၫယဖါမၩဝ့ၫ လၧစမ့ရအၫအဖၧၩ့ အၥိၭနီၪ လီၫ.အဝ့ၫဒၪစံၭ, ယမိဖျါခွံၬနၧၩလၧဆၧအုၩ့လၩ့ယီၩ လီၫ.ဆၧအုၩ့လၩ့လိၬအၥၭ လၧအဝ့ၫ,ဖျါခွံၬဝ့ၫလီၫ.",
			"35": "<sup>35</sup> တၭၦလၧမီၪအဖိၪခွၫ အကျၩလဂၩစံၭ ၦလၧအနဲၩ့ ထံၭလဂၩလၧယဟိဝၩအလူနီၪ, ကျီၪ့လါယၧၩဆံၭ.",
			"36": "<sup>36</sup> တၭၦလဂၩနီၪကျီၪ့ဝ့ၫအ့ၬ.- အဝ့ၫဒၪစံၭ,မွဲၦလခိၭနၪ ဘၪယဟိဝၩအလူတၭ, ယိခွါ, ထီးနစဲၪ့ထၪ့ခွံၬလၧယ အီၪတၭ, ဆၬလၥၧၫ့လဒုၩ မိမၩၥံၫနၧၩလီၫ. တၭထီး အစဲၪ့ထၪ့ခွံၬလၧအအီၪနီၪ, ဆၬလၥၧၫ့လဒုၩဒၪန့ဝ့ၫ",
			"37": "<sup>37</sup> တၭ,မၩၥံၫဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ ဆၧဒၪန့ဝ့ၫလၧၦလ ဂၩဒၪတၭ,စံၭဝ့ၫ, ကျီၪ့လါယၧၩဆံၭ. တၭၦလဂၩနီၪ",
			"38": "<sup>38</sup> ကျီၪ့ဝ့ၫတၭ, ကျီၪ့ဝ့ၫနုၬလီၫ.- မီၪလဂၩနီၪစဲၪ့ထၪ့ခွံၬ တၭ,အီၪခိၭစဎွၩလၧဖၧၩ့ၥၭနဲၩ့တၭ, မၩလၩ့မဲၩအ",
			"39": "<sup>39</sup> ၥၭတၭ,အီၪလၧဖံၫ့ချၪ လၧအမ့ၬလီၩ့လီၫ.- ထီးစဎွၩ လ့ၩဖီၩ့အဘိၩ့ဘၭတၭ, အဝ့ၫကိၭထၪ့စဎွၩတၭ, စံၭ ဝ့ၫဒၪ,နခ့ၫနၡၩလ့ၩ လၧဆၧဒုၭၥုၭအကျၩ, ယိခွါ,ၦ လဂၩကၠၪပဲၩအၥၭတၭ, ဂဲၫဆိၬၦလဂၩ လၧယအီၪ တၭ,စံၭဝ့ၫဒၪ, ခိၭထၬၦလဂၩယီၩဆံၭ. အ့ၪလအီၪ ဘၪတၡါတၭ, နၥၭမၧၫ့ဘၪအီၪလၧအၥၭမၧၫ့အဂး လီၫ.အ့ၪလမွဲဘၪဘဲၫနီၪတၭ နမိဘၪလိၭစ့ၩလကံကၫ",
			"40": "<sup>40</sup> လီၫ.- နခ့ၫနၡၩမၩဆၧထီးအံၩထီးအိၩ အဘိၩ့ဘၭ တၭ,အဝ့ၫဒၪ လအီၪဘၪလီၫ. တၭအံၫစရ့လၭအ စဎွၩစံၭအဝ့ၫ, နဆၧစ့ၩရၫ့မိအီၪဘဲၫနီၪလီၫ. နစ့ၩရၫ့",
			"41": "<sup>41</sup> လၩ့နၥၭနနၫ့ဆါဒၪနဝ့ၫလီၫ.- အဝ့ၫဒၪမၩချဲၫ့ချဲၫ့တၭ, ထူၭခွံၬဖံၫ့ချၪ လၧအမ့ၬလီၩ့တၭ, အံၫစရ့လၭအစဎွၩ",
			"42": "<sup>42</sup> ယိနဲၪ့ဝ့ၫလၧအမွဲလၧမီၪလဖၪအကျၩလီၫ.- တၭအဝ့ၫ ဒၪစံၭဝ့ၫ, ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, မွဲနဖျါခွံၬၦလဂၩ လၧယအီၪက့ၪလၩ့ လၧဆၧဂၭဂီၩ့ခွံၬ အဂးအကၠီၩ့ တၭ,နၥၭမၧၫ့ မိအီၪလၧအၥၭမၧၫ့အဂး ဒဲနၡၩခမျၧး လၧအဝ့ၫဒၪအၡၩခမျၧးအဂးနီၪလီၫ.",
			"43": "<sup>43</sup> အံၫစရ့လၭ အစဎွၩ လ့ၩဝ့ၫလၧအဂံၪ့ လၧအၥၭ ဎၧၫ့,ဒဲအၥုၪ့ခိအၥၭဝီၩတၭ, ထီၩ့လၧစမ့ရအၫလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> တၭလၧဆၧနီၪလဖၪအလးခဲၫ့, ဆၧမၩအၥၭလၧၦ ယံၭစရ့လၭဖိၪစနၫဘီၭ အီၪလၧစဘံၭမုအလးလၧယံၭ စရ့လၭအဖၧၩ့အီၪဘူၭ လၧစမ့ရအၫအစဎွၩအၫဟၭ",
			"2": "<sup>2</sup> အနီးနီၪလီၫ.- တၭစအၫဟၭချဲၩ့ဆၧလၧစနၫဘီၭစံၭ ဝ့ၫဒၪ,ဖ့ၪလၫ့ယၧၩလၧစဘံၭမုအလး ဘဲၫၥိၭအမိကဲၪ ထၪ့ဆၧဒိၭဆၧလၪအကျိၭ လၧယဂးဆံၭ. အဂဲးဘဲၫ ယီၩအီၪဘူၭလၧယဂံၪ့လီၫ. တၭယမိဖ့ၪလၫ့နၧၩလၧ စဘံၭမုအလးနးလးဂ့ၩနဲၪ့ အနီၪဒံၭလီၫ. အ့ၪဂ့ၩလၧ နမ့ၬယၫတၭ, ယမိဖ့ၪလၫ့နၧၩ လၧစ့ၩထီးအကြၨၭ",
			"3": "<sup>3</sup> လီၫ.- တၭစနၫဘီၭစံၭစအၫဟၭ မွဲယဟိဝၩထီးဒုၭဖ့ၪ လၫ့ခွံၬယၧၩ လၧယဖါအဆၧဖ့ၪၥၫလၧနၧၩလဂ့ၩ.",
			"4": "<sup>4</sup> တၭစအၫဟၭဂဲၫလၧအဂံၪ့ လၧအၥၭဎၧၫ့ဒဲအၥုၪ့ခိ အၥၭဝီၩလၧဆၧချဲၩ့လၧ ၦယံၭစရ့လၭဖိၪစနၫဘီၭချဲၩ့ ဆၧအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, ယဖ့ၪလၫ့ နၧၩလၧယဖါအဆၧဖ့ၪၥၪနီၪအ့ၬ. မံၫနၩ့ဝ့ၫလၧအလး မံၫအဖၧၩ့တၭ, ကၠၪခွံၬအမ့ၬတၭအၪ့ဆၧနီၪအၥၭအီၪ",
			"5": "<sup>5</sup> အ့ၬ.- အမၫနးယ့ၭဇဘ့လၭ ဂဲၫလၧအအီၪတၭ, စံၭ ဝ့ၫ,နၥၭလမုၬဘၪတၭ, နလအၪ့ဘၪဆၧနီၪမွဲဘၪလဲၪ.",
			"6": "<sup>6</sup> အဝ့ၫဒၪစံၭ, မွဲယချဲၩ့ဆၧလၧၦယံၭစရ့လၭဖိၪစနၫဘီၭ တၭ,ယစံၭ,ဖ့ၪလၫ့ယၧၩ လၧနစဘံၭမုအလး,လၧစ့ၩ အဂးဆံၭ. အ့ၪလမွဲဘၪနီၪတၭ အ့ၪဘၪနၥၭ ယမိဖ့ၪ လၫ့နၧၩလၧစဘံၭမုအလး နးလးလၧအဂးလီၫ. တၭ အဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယဖ့ၪလၫ့နၧၩလၧယစဘံၭမုအလး အ့ၬ.",
			"7": "<sup>7</sup> တၭအမၫနးယ့ၭဇဘ့လၭစံၭဝ့ၫ, ဘိၩ့နဲၪ့ယီၩမွဲနပၧၩ့ အံၫစရ့လၭ အဘၩ့အမုးဆ့ဧၪ. ဂဲထုၪ့အၪ့ဆၧဒဲအီၪ က့ၪနၥၭမုၬမုၬဆံၭ. ယမိဖ့ၪလၫ့နၧၩလၧၦၡၩယံၭစရ့",
			"8": "<sup>8</sup> လၭဖိၪစနၫဘီၭအစဘံၭမုအလးနီၪလီၫ.- ၦမုၪနီၪကွ့ၭ လံၬလၧစအၫဟၭအမံၩ့တၭ, စဲၩနဲၪ့ထၬဝ့ၫလၧဆၧ စဲၩနဲၪ့နီၪတၭ, ဖ့ၪယုလံၬ လၧၦၥုၪ့က့ၭၥၭၡါ ဒဲၦဒိၪ လဖၪလၧအအီၪဝ့ၫလၧဝၩ့ဖၧၩ့ လၧစနၫဘီၭအဒိၩ့လီၫ.",
			"9": "<sup>9</sup> ၦမုၪနီၪကွ့ၭလၧလံၬဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ကိၭထၪ့ဆၧဒုၪ ဆၧအၪ့ဆၧအီၩတၭ, အီၪက့ၪထၪ့ထီၫစနၫဘီၭ လၧၦ",
			"10": "<sup>10</sup> ခမျၧးအကျၩ,- တၭအီၪက့ၪၦဘၫအလၭဖိၪနံၫဂၩလၧ အမ့ၬယၫ ဘဲၫၥိၭအမိထိးအၥၭ ထၫ့ဒၩဝ့ၫတၭ,စံၭ, နဒုၪဒွ့ၪယွၩဒဲစဎွၩနီၪလီၫ. ၦလဖၪနီၪဆိၬထၪ့ခွံၬအ ဝ့ၫတၭ,ခွံၬဝ့ၫလၧလိးထီးအၥံၫလီၫ.",
			"11": "<sup>11</sup> တၭဒိၩ့အၡၩၥံၪ, ၦၥုၪ့က့ၭၥၭၡါ, ဒဲၦဒိၪလဖၪလၧ ၦဒိၩ့ဖိၪလဖၪအကျၩနီၪ မၩဝ့ၫဘဲၫနးယ့ၭဇဘ့လၭအၪ့ မၧၫ့လၩ့ဆၧအၥိၭ, ဘဲၫအကွ့ၭဝ့ၫလၧလံၬဖၧၩ့လၧအ",
			"12": "<sup>12</sup> ဖ့ၪယုဝ့ၫအၥိၭနီၪလီၫ.- တၭကိၭထၪ့ဆၧဒုၪဆၧအၪ့ ဆၧအီၩဒဲအီၪက့ၪထၪ့ထီၫ စနၫဘီၭလၧၦခမျၧးအကျၩ",
			"13": "<sup>13</sup> လီၫ.- ၦဘၫအလၭဖိၪနံၫဂၩ ဂဲၫဆၧၫ့နၩ့လၧအမ့ၬယၫ တၭ,ၦဘၫအလၭဖိၪထိးအၥၭထၫ့ဒၩဝ့ၫ, ထၫ့ဒၩစနၫ ဘီၭဒၪလ့ၬလၧၦခမျၧးအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ,စနၫ ဘီၭဒုၪဒွ့ၪယွၩ, ဒဲစဎွၩလီၫ. ထီးနီၪလဖၧၫ့ၦဆိၬထၪ့ ခွံၬအဝ့ၫလၧဒိၩ့အချိၫ့လၧခီၫ့တၭ, ခွံၬဝ့ၫလၧလိးထီး",
			"14": "<sup>14</sup> အၥံၫလီၫ.- အဝ့ၫၥံၪအၪ့မၧၫ့လၩ့ဆၧလၧနးယ့ၭဇဘ့ လၭအအီၪတၭ, စံၭဝ့ၫဒၪ, စနၫဘီၭဘၪဆၧခွံၬဝ့ၫလၧ",
			"15": "<sup>15</sup> လိးတၭၥံၫဝ့ၫလီၫ.- ထီးနးယ့ၭဇဘ့လၭနါဂၧၫ့ဝ့ၫလၧ စနၫဘီၭဘၪဆၧခွံၬဝ့ၫလၧလိး, ၥံၫယူၭတၭ, ဆၧမၩအ ၥၭလၧနုးယံၭဇဘ့လၭစံၭစအၫဟၭ, ဂဲထုၪ့မၩန့ၦယံၭ စရ့လၭဖိၪစနၫဘီၭ အစဘံၭမုအလး လၧအလအုၩ့ လၩ့ဘၪလၧအမိဖ့ၪလၫ့နၧၩ လၧစ့ၩအဂးနီၪဆံၭ. အ",
			"16": "<sup>16</sup> ဂဲးဘဲၫယီၩ စနၫဘီၭလမၧၫ့ဘၪ, ၥံၫဝ့ၫဒၪယူၭ.- ထီး စအၫဟၭနါဂၧၫ့ လၧစနၫဘီၭၥံၫယူၭတၭ, ဆၧမၩအ ၥၭလၧစအၫဟၭဂဲထုၪ့ဘဲၫၥိၭ အမိလ့ၩလၩ့လၧၦယံၭ စရ့လၭဖိၪစနၫဘီၭ အစဘံၭမုအလး, ဘဲၫၥိၭအမိမၩ န့ဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ယဟိဝၩအလူလၩ့ဘၪ ၦတံၡဘၭဖိၪစအံၫလဲယၫ",
			"18": "<sup>18</sup> တၭ,စံၭဝ့ၫဒၪ,ဂဲထုၪ့,- လ့ၩလၩ့အၪ့ဂၬအံၫစရ့လၭ အစဎွၩအၫဟၭ လၧစမ့ရအၫအဖၧၩ့နီၪဆံၭ. ယိခွါ, အီၪဝ့ၫလၧစနၫဘီၭ အစဘံၭမုအလးဖၧၩ့, ထီးအလး",
			"19": "<sup>19</sup> လၧအလ့ၩလၩ့မၩန့ဝ့ၫလီၫ.- နဘၪချဲၩ့ဆၧလၧအဝ့ၫ တၭ,စံၭ,ယဟိဝၩစံၭဘဲၫယီၩ, နမၩၥံၫဆၧတၭ, မၩ န့ဆၧဆ့ဧၪ. နဘၪချဲၩ့ဆၧလၧအဝ့ၫတၭ, စံၭ, ယဟိ ဝၩစံၭဘဲၫယီၩ, ထီးအလးလၧထွံၪလဖၪအၪ့လဲၪ့စနၫ ဘီၭအၥွံၪနီၪ, ထွံၪလဖၪမိအၪ့လဲၪ့န့နၥွံၪ, နဝ့ၫဒၪလ့ၬ ထီးနီၪဆ့လီၫ.",
			"20": "<sup>20</sup> စအၫဟၭစံၭစအံၫလဲယၫ, မွဲနဒၪန့ယၧၩဧၪ.ယဒုၪ ယဒၩဧ့, တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယဒၪဘၪယူၭ,အဂဲး ဘဲၫယီၩနအၪ့ဆၫခွံၬနနၫ့ဆါ, ဘဲၫၥိၭနမိမၩဆၧအၧၩ့",
			"21": "<sup>21</sup> လၧယဟိဝၩအမ့ၬယၫလီၫ.- ယိခွါ, ယမိဒုၭဂဲၫဘၪ နၧၩလၧဆၧအၧၩ့တၭ, ယမိမၩန့ထၪ့ခွံၬနဆၨၩနဆၬ တၭ,ယမိဒၪ့ထ့ၬခွံၬ ၦခွၫၥံၪဘၪဆဲၫ့ လၧစအၫဟၭ ဒဲၦလၧအဒူၭထၬဝ့ၫ, ဒဲၦလၧအအီၪလၩ့ထး လၧအံၫ",
			"22": "<sup>22</sup> စရ့လၭအဖၧၩ့လီၫ.- တၭယမိအီၪက့ၪနဂံၪ့ ဘဲၫစနံဘၭ အဖိၪခွၫစယ့ၫရဘိအၫ့အဂံၪ့အၥိၭနီၪ, ဒဲဘဲၫစအဟဲ ယၫအဖိၪခွၫစဘၫအၡၫအဂံၪ့အၥိၭ, လၧဆၧၥၭထၪ့အ လးအကၠီၩ့လၧနထိၪဂဲၩ ယဟိဝၩအဆၧၥၭထၪ့တၭ, ဒုၭမၩအံၫစရ့လၭလၧဆၧဒဲၩဘၭနီၪလီၫ.",
			"23": "<sup>23</sup> ယဟိဝၩချဲၩ့ဆၧလၧ နးယ့ၭဇဘ့လၭအဂဲးတၭ,စံၭ ဝ့ၫဒၪ,ထွံၪလဖၪမိအၪ့နးယ့ၭဇဘ့လၭ လၧယံၭစရ့လၭ",
			"24": "<sup>24</sup> အခိၪဒၧၩ့အနဲၩ့နီၪလီၫ.- တၭၦဘၪဆဲၫ့လၧစအၫဟၭ လၧအၥံၫဝ့ၫလၧဒိၩ့ဖၧၩ့နီၪ ထွံၪလဖၪမိအၪ့ခွံၬဝ့ၫတၭ, ၦလၧအၥံၫဝ့ၫ လၧမံၩ့လၬကျၩနီၪ ထိၪၥံၪလံၪၥံၪလၧ မူၭဖိၭဖၫ့လဖၪမိအၪ့ခွံၬဝ့ၫလီၫ.",
			"25": "<sup>25</sup> မွဲမၬၦၡၩဘဲၫစအၫဟၭအၥိၭ လၧအအၪ့ဆၫခွံၬအ နၫ့ဆါဘဲၫၥိၭအမိမၩဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬ ယၫလၧအမၫနးယ့ၭဇဘ့လၭ ထိၪဂဲၩဝ့ၫနီၪအီၪအ့ၬ.",
			"26": "<sup>26</sup> တၭအဝ့ၫမၩဆၧဘၪၥၭလိၪဖၭဒိၪ လၧအဖိၬဆၧဂၩ့ လဖၪအခဲၫ့, ဘဲၫကယဲဆၧအၧၩ့လၧၦအၫမိၫဖိၪမၩဝ့ၫ အၥိၭလၧယဟိဝၩနၫ့ထၪ့ခွံၬဝ့ၫ လၧၦအံၫစရ့လၭဖိၪ အမ့ၬယၫလီၫ.",
			"27": "<sup>27</sup> ထီးစအၫဟၭနါဂၧၫ့ဆၧချဲၩ့နီၪတၭ, ဆၧမၩအၥၭ လၧအၡၫ့အကီၩ့အၥိၭတၭ, အီၪက့ၪရၧၬအဆၧယၬ လၧအလီၩ့တၭ, ဒုၪဆၧအၪ့ဆၧအီၩ, ဒဲမံၫနၩ့ဝ့ၫလၧ",
			"28": "<sup>28</sup> ရၧၬအဆၧယၬအဖၧၩ့တၭ, လ့ၩဝ့ၫစီၩစီၩလီၫ.- ယဟိ ဝၩအလူလၩ့ဘၪ ၦတံၡဘၭဖိၪစအံၫလဲယၫတၭ,စံၭ ဝ့ၫဒၪ,နဒၪဘၪလၧစအၫဟၭ ဆၪ့လၩ့အၥၭလၧယမ့ၬ",
			"29": "<sup>29</sup> ယၫဆ့ဧၪ.- မွဲအဆၪ့လၩ့အၥၭလၧယမ့ၬယၫအကၠီၩ့ တၭ,ယမိဒုၭဂဲၫဆၧအၧၩ့ လၧအဝ့ၫဒၪအမုနံၩလဖၪ အဖၧၩ့အ့ၬ. လၧအဖိၪခွၫအမုနံၩလဖၪနီၪယမိဒုၭဂဲၫ ဘၪဆၧအၧၩ့လၧအဂံၪ့လီၫ."
		},
		"22": {
			"1": "<sup>1</sup> တၭလၧၥၧၫ့နံၪ့အထးဖၧၩ့နီၪ စံရအၫဒဲအံၫစရ့လၭ",
			"2": "<sup>2</sup> အီၪလၧဆၧဒုၭၥုၭအ့ၬ.- တၭၥၧၫ့နံၪ့လနံၪ့နီၪဆၧမၩ အၥၭလၧယုဒၫအစဎွၩ ယဟီၡဖၭဂဲၫလၩ့လၧအံၫစရ့",
			"3": "<sup>3</sup> လၭအစဎွၩအအီၪလီၫ.- အံၫစရ့လၭအစဎွၩစံၭအ ခ့ၫအၡၩ, ရၫမီၭဂံလအၭနီၪမွဲပဆၧတၭ, ပအီၪလၩ့မါ ပံၭ,လမၩန့ဘၪဝ့ၫလၧ စံရအၫအစူၪဖၧၩ့နီၪ,မွဲနၥံၪၥ့ၪ",
			"4": "<sup>4</sup> ယၫအ့ၬဧၪ.- အဝ့ၫဒၪစံၭစယဟီၡဖၭ, မွဲနမိလ့ၩဒုၭ ဆၧလၧယၥိၭ လၧရၫမီၭဂံလအၭနီၪဆ့ဧၪ. တၭစယ ဟီၡဖၭစံၭအံၫစရ့လၭအစဎွၩ, ယဝ့ၫဒၪယီၩယမၩ ယၥၭဘဲၫနၧၩအၥိၭနီၪ, ယၡၩခမျၧးဘဲၫနၡၩခမျၧးအ ၥိၭ,ယကၥ့ၪလဖၪဘဲၫနကၥ့ၪလဖၪ အၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> တၭစယဟီၡဖၭစံၭအံၫစရ့လၭ အစဎွၩအၪ့စၪ့လါ",
			"6": "<sup>6</sup> လၧယဟိဝၩအလူလၧမုဆၫလနံၩယီၩဆံၭ.- ထီးနီၪ လဖၧၫ့အံၫစရ့လၭ အစဎွၩဒုၭအီၪကိၩ့အီၪကီၪ့မီၪ လဖၪၦလံယၩ ကၪယူၭတၭ, စံၭအဝ့ၫၥံၪ,ယမိဘၪ လ့ၩထၪ့လၧရၫမီၭဂံလအၭ ဘဲၫၥိၭယမိဒုၭဆၧနီၪ ဆ့ဧၪ,မွဲယမိဘၪအီၪထးလဲၪ. တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, လ့ၩထၪ့ဘီၪ, အဂဲးဘဲၫယီၩ ယဟိဝၩမိဖ့ၪလၫ့ဝ့ၫလၧ စဎွၩအစူၪဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> တၭစယဟီၡဖၭစံၭဝ့ၫဒၪ, ယဟိဝၩအမီၪလဂၩဘဲၫ ၥိၭပမိအၪ့စၪ့အဝ့ၫဆ့, မွဲအအီၪထီးယီၩနးဂၩအ့ၬဧၪ.",
			"8": "<sup>8</sup> တၭအံၫစရ့လၭအစဎွၩ စံၭစယဟီၡဖၭ,ၦလၧပမိအၪ့ စၪ့ဘၪယဟိဝၩထီးယီၩအီၪဒံၭလဂၩ, စအံမလၫအ ဖိၪခွၫစမံၫခ့ယၫ, မွဲလါနၫ့ဘိၩ,ယၥၭဂဲၫ့အဝ့ၫး အဂဲး ဘဲၫယီၩချဲၩ့ဆၧလၧမီၪအချိၬ လၧဆၧဂ့ၩလၧယဂဲးယ ကၠီၪ့အ့ၬ, အ့ၪမွဲဆၧအၧၩ့လီၫ. တၭစယဟီၡဖၭစံၭဝ့ၫ ဒၪ,မွဲစဎွၩထီးစံၭဘဲၫနီၪလဂ့ၩ.",
			"9": "<sup>9</sup> အံၫစရ့လၭအစဎွၩ ကိၭန့ၦဒိၪလဂၩတၭ,စံၭဝ့ၫဒၪ,",
			"10": "<sup>10</sup> ဒုၭဂဲၫစအံမလၫအဖိၪခွၫ စမံၫခ့ယၫချဲၫ့ချဲၫ့ဆံၭ.- တၭ အံၫစရ့လၭအစဎွၩ ဒဲစယဟီၡဖၭယုဒၫအစဎွၩလုၬ ယူၭအဝိၬလိၫ့ လၧအလးထီးအလ့ၩနုၬ လၧစမ့ရအၫ အတရၫ့ဖၧၩ့တၭ, ဆၧၫ့နၩ့လဂၩလၧအလးဆီၩ့ဆီဒၪ ဝ့ၫ,လဂၩလၧအလးဆီၩ့ဆီဒၪဝ့ၫနီၪတၭ, မီၪထီးအ လူၬ,ချဲၩ့ဆၧလၧမီၪအချိၬလၧအဝ့ၫၥံၪ အမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> စခံၫန့အနၫအဖိၪခွၫစဇ့ၭဒကဲအၫလဂၩ မၩဆၧနိၩ့ထၭ လဖၪလၧအဂးတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩစံၭဘဲၫယီၩ, နမိဘျႃၪ့ၦစံရအၫဖိၪလၧအယီၩ,ထီးနမၩလူၬဝ့ၫလီၫ.",
			"12": "<sup>12</sup> တၭမီၪထီးအလူၬနီၪ ချဲၩ့ဆၧလၧမီၪအချိၬ ဘဲၫနီၪအ ၥိၭ,စံၭဝ့ၫဒၪ, လ့ၩထၪ့လၧရၫမီၭဂံလအၭတၭ, ဘီၪ ထၪ့ယီၫထၪ့ဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩဖ့ၪလၫ့ဝ့ၫ လၧစဎွၩအစူၪဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> အၥီၫ့လဂၩလၧအလ့ၩကိၭန့ စမံၫခ့ယၫချဲၩ့ဆၧ လၧအဝ့ၫတၭ,စံၭဝ့ၫဒၪ, ယိခွါ,မီၪလဖၪအဆၧချဲၩ့မွဲဂ့ၩ လၧစဎွၩအဂဲး လၧအဝ့ၫၥံၪအနိၭလဖၧၫ့ဎးလီၫ. မွဲန ဆၧချဲၩ့မၩအၥၭ ဘဲၫၦလၧအဝ့ၫၥံၪအကျၩလဂၩအ",
			"14": "<sup>14</sup> ဆၧချဲၩ့အၥိၭနီၪတၭ, ချဲၩ့ဆၧဂ့ၩဆံၭ.- တၭစမံၫခ့ယၫ စံၭဝ့ၫဒၪ, ယဟိဝၩမၧၫ့ဝ့ၫနီၪ, ဆၧလၧယဟိဝၩစံၭ ယၧၩယမိချဲၩ့ဆၧနီၪလီၫ.",
			"15": "<sup>15</sup> ဂဲၫဝ့ၫလၧစဎွၩအအီၪတၭ, စဎွၩစံၭအဝ့ၫ,စမံၫခ့ယၫ ဧ့,ပမိဘၪလ့ၩထၪ့ထၫ့ဒၩ ရၫမီၭဂံလအၭ ဘဲၫၥိၭပမိ ဒုၭၥုၭနီၪဆ့ဧၪ, မွဲပဘၪအီၪထးလဲၪ. တၭအဝ့ၫနီၪစံၭ ဆၧၫ့ဝ့ၫ,လ့ၩထၪ့တၭဘီၪထၪ့ယီၫထၪ့ဆံၭ. ယဟိဝၩ",
			"16": "<sup>16</sup> ဖ့ၪလၫ့ဝ့ၫလၧစဎွၩအစူၪဖၧၩ့ဘီၪ.- တၭစဎွၩစံၭဝ့ၫ, ဘဲၫၥိၭနမိစံၭယၧၩ ထီးဆၧမွဲဆၧတီၩလၧယဟိဝၩအ",
			"17": "<sup>17</sup> မံၩ့နီၪ,ယမိဘၪဒုၭဆိၪလၩ့နၥၭဎွ့ဖၧၫ့လဲၪ.- အဝ့ၫဒၪ စံၭ,ယဒၪဘၪအံၫစရ့လၭ ထီးအလူၬလၩ့ပြံၩလၩ့ပၩ လၧခိၪလီၩ့ဘဲၫၥိၪလၧအၡၩယူၬၥိၪ လအီၪဘၪအၥိၭ နီၪတၭ,ယဟိဝၩစံၭဝ့ၫဒၪ, ၦလဖၪယီၩအကဆါအီၪ အ့ၬ.မွဲအဝ့ၫၥံၪထဲၩ့ထဲၩ့လဂၩ လၧအဂံၪ့ဒၪဝ့ၫ,လဂၩ လၧအဂံၪ့ဒၪဝ့ၫမုၬမုၬဆံၭ.",
			"18": "<sup>18</sup> တၭအံၫစရ့လၭအစဎွၩ စံၭစယဟီၡဖၭ,ယစံၭ နၧၩ,လၧအဝ့ၫမိချဲၩ့လၧမီၪအချိၬ, လၧဆၧဂ့ၩလၧယဂဲး အ့ၬး အ့ၪမွဲလၧဆၧအၧၩ့လခီၫနီၪ, မွဲအ့ၬဧၪ.",
			"19": "<sup>19</sup> တၭအဝ့ၫဒၪစံၭ, မၩအၥၭဘဲၫနီၪတၭ, ခိၭနၪယဟိ ဝၩအလူဆံၭ. ယဒၪဘၪယဟိဝၩဆၧၫ့နၩ့ လၧအလး ဆီၩ့ဆီ, ဒဲမူၭခိၪအၥုၭမုခမျၧးထီးအလူၬ ဆၧၫ့ထုၪ့လၧ အနဲၩ့ထံၭလၧအစူၪထွ့ၪလခီၫ, ဒဲလၧအစူၪစ့ၪလခီၫ လီၫ.",
			"20": "<sup>20</sup> တၭယဟိဝၩစံၭဝ့ၫဒၪ, မွဲပလၫမိအၪ့လွ့ၫန့စအၫ ဟၭဘဲၫၥိၭအမိလ့ၩထၪ့ ဒဲလၩ့ထံၩဖါလၧရၫမီၭဂံလ အၭအဖၧၩ့လဂၩလဲၪ. တၭလဂၩစံၭဘဲၫအံၩ, လဂၩ",
			"21": "<sup>21</sup> စံၭဘဲၫအိၩလီၫ.- ၥၭလဂၩဂဲၫထၪ့တၭ, ဆၧၫ့ထုၪ့လၧ ယဟိဝၩအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ယမိအၪ့လွ့ၫန့အဝ့ၫ",
			"22": "<sup>22</sup> လီၫ.- တၭယဟိဝၩစံၭအဝ့ၫ, လၧဆၧနီၪလမံၩ့လဲၪ. တၭအဝ့ၫဒၪစံၭ, ယမိလ့ၩထၪ့တၭ, ယမိကဲၪထၪ့ၥၭ အဘျံၭအဘျၪလၧအမီၪထီးအလူၬ အနိၭဖၧၩ့လီၫ.တၭ အဆၧစံၭဝ့ၫဒၪ, နမိအၪ့လွ့ၫန့ဝ့ၫ, ဒဲမၩနၧၩ့ဆၧဆ့လီၫ.",
			"23": "<sup>23</sup> လ့ၩထၪ့တၭမၩဘဲၫနီၪဆံၭ.- တၭဘိၩ့နဲၪ့ယီၩ,ယိခွါ, ယဟိဝၩအီၪက့ၪၥၭအဘျံၭအဘျၪ လၧနမီၪထီးအလူၬ ယီၩအနိၭဖၧၩ့တၭ, ယဟိဝၩချဲၩ့ဆၧအၧၩ့ လၧနဂဲး နကၠီၪ့လီၫ.",
			"24": "<sup>24</sup> တၭစခံၫန့အနၫအဖိၪခွၫ စဇ့ၭဒကဲအၫၥုၭဘူၭအၥၭ လၧစမံၫခ့ယၫတၭ, ဒဲၩဝ့ၫအနိၭဖၩထံၭတၭ, စံၭဝ့ၫဒၪ, ဘဲၫၥိၭယဟိဝၩအၥၭမိချဲၩ့ဆၧလၧနၧၩတၭ, မွဲအစဲၪ့ ထၪ့ခွံၬလၧယအီၪတၭ, လ့ၩလၧနအီၪဖၧၩ့ၥၭခီၫခီၫ",
			"25": "<sup>25</sup> လဲၪ.- တၭစမံၫခ့ယၫစံၭဝ့ၫဒၪ, ယိခွါ, မုလနံၩလၧနမိ လ့ၩနုၬလၧဒူၭလၧယၫလခီၫ လဒူၭဘဲၫၥိၭနမိအီၪက့ၪ ၥူၪနၥၭနီၪနမိၥ့ၪယၫလီၫ.",
			"26": "<sup>26</sup> အံၫစရ့လၭအစဎွၩစံၭဝ့ၫဒၪ, မၩန့စမံၫခ့ယၫတၭ, ဆိၬန့ထဲၩ့အဝ့ၫလၧဒိၩ့အၦဒိၪ စအၫမိၫ့ဒဲစဎွၩအဖိၪခွၫ",
			"27": "<sup>27</sup> စယိအၭအအီၪ,- တၭစံၭဝ့ၫ, စဎွၩစံၭဘဲၫယီၩ, အီၪ က့ၪၦလဂၩယီၩ လၧထီၫ့ဖၧၩ့တၭ, လုအၪ့လုအီၩအ ဝ့ၫလၧဆၧၡၪ့ဆၧနၭအကိၪ, ဒဲဆၧၡၪ့ဆၧနၭ အထံၫ",
			"28": "<sup>28</sup> ထီးယဂဲၫထဲၩ့မုၬမုၬဆံၭ.- စမံၫခ့ယၫစံၭဝ့ၫဒၪ, နအ့ၪ ဂဲၫထဲၩ့ဘၪမုၬမုၬတၭ, ယဟိဝၩချဲၩ့ဆၧလၧယၧၩအ့ၬ. အဝ့ၫဒၪစံၭ, ၦခမျၧးၥံၪဧ့, ခိၭနၪကိၭဂၩဒ့ၭဆံၭ.",
			"29": "<sup>29</sup> တၭအံၫစရ့လၭအစဎွၩ, ဒဲယုဒၫအစဎွၩစယဟီ",
			"30": "<sup>30</sup> ၡဖၭလ့ၩထၪ့လၧရၫမီၭဂံလအၭလီၫ.- တၭအံၫစရ့လၭ အစဎွၩစံၭစယဟီၡဖၭ, ယမိမၩလၩ့မဲၩယနၫ့ဆါ,ဒဲ လ့ၩနုၬလၧဒုၭၥုၭအဖၧၩ့နီၪး အ့ၪမွဲနဝ့ၫဒၪယီၩ, လုၬနဝိၬ လိၫ့ဆံၭ. အံၫစရ့လၭအစဎွၩ မၩလၩ့မဲၩအၥၭတၭ,",
			"31": "<sup>31</sup> လ့ၩနုၬလၧဆၧဒုၭၥုၭအဖၧၩ့လီၫ.- အ့ၪမွဲစံရအၫအ စဎွၩမၪလူၬ အၥုၭအခိၪၥၧၫ့ဆံၫနံၫဂၩ လၧအပၧၩ့အ လဲၪ့ၥုၭလဖၪစံၭဝ့ၫဒၪ, အဒိၪဂ့ၩအဆံၭဂ့ၩ, ဒုၭဆၧ လၧအဝ့ၫၥံၪလဂ့ၩ, ဒုၭဆၧန့ၫအံၫစရ့လၭ အစဎွၩလ",
			"32": "<sup>32</sup> ဂၩနီၪဆံၭ.- ထီးလဲၪ့ၥုၭအခိၪလဖၪ ဒၪဘၪစယဟီၡ ဖၭတၭ,ဆၧမၩအၥၭ လၧအစံၭဝ့ၫဒၪ, မွဲဝ့ၫလၧအံၫစရ့ လၭအစဎွၩလီၫ. တၭကၠၪအၥၭဘဲၫအမိဒုၭဆၧလၧအ",
			"33": "<sup>33</sup> ဝ့ၫတၭ,စယဟီၡဖၭကိၭထၪ့ဆၧလီၫ.- ထီးလဲၪ့ၥုၭအ ခိၪလဖၪဒၪဘၪဝ့ၫလၧ အလမွဲဘၪအံၫစရ့လၭအစဎွၩ တၭ,ဆၧမၩအၥၭ လၧအထဲၩ့ကဒၩထဲၩ့ လၧအလီၩ့",
			"34": "<sup>34</sup> ဆီးဝ့ၫလီၫ.- ၦလဂၩခၭကြၩ့ဆၧတၭ, ဘၪအံၫစရ့လၭ အစဎွၩလၧဆဲၫ့ၥုၭအဆၧၫ့တၭ, အဆၧစံၭလဲၪ့ၥုၭအ ခိၪလဂၩနီၪ, ကၠၪနစူၪတၭ, ဆိၬထၪ့ခွံၬယၧၩလၧၦၥုၭ မုခမျၧးအကျၩဆံၭ. အဂဲးဘဲၫယီၩ ယဘၪထံၭဆၫ",
			"35": "<sup>35</sup> လီၫ.- ဆၧဒုၭၥုၭအၪထၪ့လၧမုလနံၩနီၪတၭ, ၦဒုၭအီၪ ခၧၫ့ထၪ့စဎွၩ လၧလဲၪ့ၥုၭအဖၧၩ့ထၫ့ဒၩ ၦစံရအၫဖိၪ တၭ,ၥံၫဝ့ၫလၧမုဂၪလၩ့တၭ, အၥွံၪလၩ့ယွၩလၧအ",
			"36": "<sup>36</sup> ဖၧၩ့လးလၧလဲၪ့ၥုၭအဖၧၩ့နီၪလီၫ.- ထီးမုလၩ့နုၬကၪ ယူၭတၭ, ဆၧကိၭထၪ့ဂၧၫ့ထၪ့ၥၩလၩ့ လၧၦၥုၭမုခမျၧး အကျၩ,စံၭဝ့ၫဒၪ, လဂၩလၧအဒိၩ့ဒၪဝ့ၫ, လဂၩလၧအ ဒိၩ့ဒၪဝ့ၫ, လဂၩလၧအခးဒၪဝ့ၫ, လဂၩလၧအခးဒၪဝ့ၫ",
			"37": "<sup>37</sup> နီၪဆံၭ.- ထီးစဎွၩၥံၫဝ့ၫတၭ, ၦလ့ၩဆိၬဝ့ၫလၧစမ့ရအၫ တၭ,ခုၪ့လၩ့ဘၧၩ့ခွံၬစဎွၩ လၧစမ့ရအၫအဖၧၩ့လီၫ.",
			"38": "<sup>38</sup> ၦၥူၫဝၭလဲၪ့ၥုၭလၧစမ့ရအၫ အကမၫဖၧၩ့တၭ,ထွံၪလ ဖၪအၪ့လဲၪ့ခွံၬအၥွံၪ, ဒဲၥူၫဝၭအစူၪဝဲၩ, ဘဲၫယဟိဝၩ အလူလၧအချဲၩ့ဝ့ၫအၥိၭနီၪလီၫ.",
			"39": "<sup>39</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧစအၫဟၭ, ဒဲကယဲဆၧ လၧအမၩဝ့ၫ, ဒဲဂံၪ့ကဆၫ့မဲၪလၧအမၩကဲၪထၪ့ဝ့ၫထီး အလူၬနီၪ, ကွ့ၭအၥၭလၧအံၫစရ့လၭအလံၬ ကွ့ၭနဲၪ့ ဆၧအဖၧၩ့, မွဲအ့ၬဧၪ.",
			"40": "<sup>40</sup> စအၫဟၭမံၫဝ့ၫလၧအဖါလဖၪအၥိၭတၭ, အဖိၪခွၫ စအၫဟဇဲအၫကဲၪစဎွၩ လၧအလးနီၪလီၫ.",
			"41": "<sup>41</sup> တၭလၧအံၫစရ့လၭအစဎွၩအၫဟၭ အနံၪ့လံနံၪ့လ နံၪ့နီၪစအၫစၫအဖိၪခွၫ စယဟီၡဖၭကဲၪၥၫ့စဎွၩလၧယု",
			"42": "<sup>42</sup> ဒၫလီၫ.- စယဟီၡဖၭကဲၪၥၫ့စဎွၩနီၪ အၥၭၡါယူၭၥၧၫ့ ဆံၫယဲနံၪ့တၭ, ကဲၪစဎွၩလၧယရုစလံၫ့အဖၧၩ့နီၪ နံၫ ဆံၫယဲနံၪ့လီၫ. အမိအမံၩ့မွဲနးအဇုဘၫစၡံလဟဲၫအ",
			"43": "<sup>43</sup> ဖိၪမုၪလီၫ.- အဝ့ၫဖိၬအဖါစအၫစၫအဖၧၩ့ ထီးအလူၬ တၭ,ကၠၪပဲၩဘၪအၥၭ လၧအမၩဆၧဂ့ၩလၧယဟိဝၩ အမ့ၬၥၪအဖၧၩ့အ့ၬ. လါနၫ့ဘိၩ, ဆၧမၩဂၭဂီၩ့ဆၧအ လးထၪ့ထီၫၥံၪအ့ၬ. ၦခမျၧး လုထၪ့ဒံၭဆၧဒဲဆူၭခဲၩ",
			"44": "<sup>44</sup> ဆၧနၧၫ့မၧၫ့ လၧဆၧအလးထၪ့ထီၫနီၪလီၫ.- တၭစယ ဟီၡဖၭမၩဆၧဘၪလိၬအိၭလိၬ လၧအံၫစရ့လၭအစ ဎွၩလီၫ.",
			"45": "<sup>45</sup> ဆၧအီၪလၩ့ထးဘၪဆဲၫ့လၧ စယဟီၡဖၭ,ဒဲဆၧ အစီၩ့အမၩ့လၧအဒုၭနဲၪဝ့ၫ, ဒဲအဒုၭၥုၭအဂဲးနီၪကွ့ၭအ ၥၭလၧယုဒၫ အစဎွၩအလံၬကွ့ၭနဲၪ့ဆၧအဖၧၩ့နီၪ, မွဲ",
			"46": "<sup>46</sup> အ့ၬဧၪ.- တၭၦအဲၪပခၧၩ့ဖိၪၥံၪလၧ အအီၪလၩ့ထးလၧ အဖါစအၫစၫအမုနံၩလဖၪနီၪ, အဝ့ၫၥုၭခွံၬအဝ့ၫၥံၪ",
			"47": "<sup>47</sup> လၧအခးဖၧၩ့လီၫ.- တၭအထီနီၪစဎွၩအီၪဝ့ၫလၧအံ ဒၧၫ့အဖၧၩ့နးဂၩအ့ၬ, ၦဒိၪဖၭဒိၪလဂၩ ပၧၩ့ဆၧလီၫ.",
			"48": "<sup>48</sup> တၭစယဟီၡဖၭ တဲၩ့ကဘၩ့တၫၡံၭ ဘဲၫၥိၭအမိ လ့ၩလၧအိဖၧၫလၧထီၫ့အဂးလီၫ. လါနၫ့တၭလ့ၩဝ့ၫ အ့ၬ. အဂဲးဘဲၫယီၩ ကဘၩ့ဂၭဂီၩ့လၧအံဇအၧၫ့ ဂံဘၧၫ လီၫ.",
			"49": "<sup>49</sup> ထီးနီၪလဖၧၫ့ စအၫဟၭ အဖိၪခွၫ စအၫဟဇဲအၫ စံၭစယဟီၡဖၭ, ဒုၭလ့ၩယခ့ၫယၡၩ လၧနခ့ၫနၡၩ အၥိၭလၧကဘၩ့ဖၧၩ့ဆံၭ. တၭစယဟီၡဖၭအုၩ့လၩ့ ဝ့ၫအ့ၬ.",
			"50": "<sup>50</sup> စယဟီၡဖၭမံၫဝ့ၫလၧ အဖါလဖၪအၥိၭတၭ,ၦခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧအဖါၥံၪအၥိၭ လၧအဖါစဒၫဝံၭအ ဒိၩ့ဖၧၩ့တၭ, အဖိၪခွၫစယဟိရၫ့ကဲၪစဎွၩလၧအလး နီၪလီၫ.",
			"51": "<sup>51</sup> တၭလၧယုဒၫအစဎွၩ စယဟီၡဖၭအနံၪ့လံဆံၫနွ့ၫ နံၪ့လနံၪ့နီၪ, စအၫဟၭအဖိၪခွၫ စအၫဟဇဲအၫကဲၪၥၫ့ စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪ လၧစမ့ရအၫအဖၧၩ့တၭ,",
			"52": "<sup>52</sup> ကဲၪစဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪနံၫနံၪ့လီၫ.- အဝ့ၫမၩ ဆၧအၧၩ့လၧယဟိဝၩအမ့ၬယၫတၭ ဖိၬအဖါအဖၧၩ့ ၥၭဒဲအမိအဖၧၩ့ၥၭ, ဒဲစနံဘၭအဖိၪခွၫစယ့ၫရဘိအၫ့ အဖၧၩ့ၥၭ, လၧအဒုၭမၩအံၫစရ့လၭ အဆၧဒဲၩဘၭ",
			"53": "<sup>53</sup> လီၫ.- အဝ့ၫဒၪမၩဘၫအလၭအဆၧတၭ, ဘိၪ့ထၪ့ ဘၩထၪ့ဝ့ၫတၭ, ထိၪဂဲၩယဟိဝၩအံၫစရ့လၭအယွၩ အဆၧၥၭထၪ့နီၪ ဘဲၫကယဲဆၧလၧအဖါမၩယူၭဝ့ၫအ ၥိၭနီၪလီၫ."
		}
	}
};
module.exports = book;